insert  into `report_412`(`uik`,`ocenka`,`author`,`shortDescr`,`fullReport`,`link`) values (1,'','','','',''),(10,'','','','',''),(35,'значительные нарушения','Alexey Kuznetsov','вброс, махинации при подсчете бюллетеней','<p><strong>Отчет по работе в проекте \"Гражданин Наблюдатель\" <br/></strong><strong>Участок N35 (</strong><strong>Москва, Госпитальный вал д.5, кор.19)</strong></p>\n<p><strong>Председатель УИК </strong>Наталья Борисовна Сударикова</p>\n<p><strong>КРАТКАЯ СТАТИСТИКА</strong></p>\n<p>Зарегистрированных избирателей: 2000<br/>Проголосовало</p>\n<p>по нашим подсчётам: ~1000 на участке + 24 по домам == 1024<br/>По подсчётам ИК: 1436 человек.<br/>Вброс: 412</p>\n<p><strong>КАК МЫ СЧИТАЛИ ГОЛОСОВАВШИХ</strong></p>\n<p>Было четыре активных адекватных человека с механическими счётчиками как в аэропортах у секьюрити. Двое считали тех, кто получил бюллетени, двое - тех, кто поместил бюллетень в урну. Получили бюллетени: счётчик_1 - 984; счётчик_2 - 985<br/>Проголосовали: счётчик_3 - 1015; счётчик_4 - 1004<br/>Всего: ~1000 чел.</p>\n<p>(Тех, кто получал бюллетени было труднее учитывать во время максимального наплыва посетителей (~170 чел. в час), так что разница между получившими и голосовавшими может быть связана с этим.)</p>\n<p><strong>РЕЗУЛЬТАТЫ ПО ПАРТИЯМ</strong></p>\n<p>По моей визуальной (см. ниже) оценке граждане проголосовали так:</p>\n<p>ЕР - 22-27%<br/>КПРФ - 20-25%<br/>СР - 20-22%<br/>ЛДПР - 12-15%<br/>Яблоко - 7-10% <br/>Остальные - 6-10%<br/>Испорченных бюллетеней почти не было, \"нахнах\" и ругательных не было ни одного.</p>\n<p><strong>Вот официальные результаты:</strong> </p>\n<p>1. Политическая партия СПРАВЕДЛИВАЯ РОССИЯ 190 (13.01%)<br/>2. Политическая партия \"Либерально-демократическая партия России\" 129 (8.84%)<br/>3. Политическая партия \"ПАТРИОТЫ РОССИИ\" (15 1.03%)<br/>4. Политическая партия \"Коммунистическая партия Российской Федерации\" 244 (16.71%)<br/>5. Политическая партия \"Российская объединенная демократическая партия \"ЯБЛОКО\" 66 (4.52%) <br/>6. Всероссийская политическая партия \"ЕДИНАЯ РОССИЯ\" 792 (54.25%)<br/>7. Всероссийская политическая партия \"ПРАВОЕ ДЕЛО\"  10 (0.68%)<br/><br/>Получается (по моим оценкам) у СР забрали ~35 голосов (я, кстати, увидел, как они шушукаются над пачкой и спросил: \"Что у СР будете изымать голоса?\" - после чего они смутились), у ЛДПР ~10, у  Яблока ~25, у КПРФ ~5.<br/>Забавно, но я так и предполагал, что у ЕР будет 800 голосов, даже на одном из видео слышен мой прогноз, высказанный в начале подсчёта.</p>\n<p><strong>КАК Я ОЦЕНИВАЛ СПРАВЕДЛИВЫЕ РЕЗУЛЬТАТЫ</strong></p>\n<p>Оценивал буквально визуально, по толщине пачек. Считать мне не позволяли и цифры не сообщали. У нас на участке было две урны - условно \"Честная\" и \"Нечестная\". Через Честную прошло примерно 60% избирателей, через Нечестную, соответственно, 40%. В Честную видимо не было вбросов. Соотношение голосов выше приведено по оценке высоты стопок в Честной урне. <br/>После высыпания бюллетений из Нечестной урны на стол, сразу стали заметны вброшенные пачки. По крайней мере один вброс я пометил путем опускания в урну почти сразу после вброса бумажного листа в клеточку большого формата. Так вот, несколько пачек бюллетеней, а не хаотично наваленных листов, легли рядом с моим листом в момент высыпания на стол. Члены ИК мгновенно стали их перемешивать с другими бюллетенями.<br/>У меня не было возможности ни пересчитать бюллетени самому, ни получить информацию от ИК, но была возможность быстро подойти, спрессовать пачки нажатием ладони и измерить их высоту. Стопка ЕР из Нечестной урны (~40% голосов) была выше стопки ЕР из Честной урны (~60% голосов) в три раза - 10.5 мм против 30мм. Это вполне точное измерение. Соотношения между стопками других партий в обеих урнах было одинаковым.<br/>Я не дождался окончательного подсчёта. Вплоть до начала четвёртого утра председатель комиссии не смог свести баланс по заданным показателям - пропорциям по партиям и уровню явки, в связи с чем ИК решила отложить подгонку результатов до утреннего (в пять утра) согласования окончательных цифр, предполагаю, со своим руководством. Причина оказалась вот в чём - перед комиссией встала настоящая техническая проблема - нехватка бюллетеней при подсчёте голосов. Председатель так и сказала, что бюллетеней не хватает. Т.е. наверх они заявили цифру 1436, а реально, даже с вброшенными, казалось меньше. Я думаю, что произошло следующее: после уничтожения 500 бюллетеней, при явке 1024 чел. у них в рукаве осталось 476. По моим оценкам за ЕР проголосовало 270 человек, ну пусть 300. Значит добавили 492 голоса. Это как раз вброшенные 412 и неуничтоженные 64. Получается 776, а надо 792 - не хватает минимум 16-ти бюллетеней. Надо либо где-то брать недостающие, либо занижать число проголосовавших. Судя по офицальным цифрам, где-то нашли пустые бланки, либо ещё как-то смухлевали.</p>\n<p><strong>КАК КОМИССИЯ ОСУЩЕСТВЛЯЕТ ПОДСЧЁТ ПО КНИГАМ ИЗБИРАТЕЛЕЙ</strong></p>\n<p>Итерационно. Сначала всё считают честно с целью понять, сколько не хватает. Председатель выясняет состояние дел и мрачно удаляется в недоступную для наблюдателей комнату. Минут через 10-20 приносит счётчицам скорректированные данные. Дальше происходит переподсчёт, видимо наименее затратным путем переквалификации не явившихся в проголосовавших. Новые цифры предоставляются председателю для анализа и он, после очередного посещения своей комнаты, оглашает результаты. Я сумел подглядеть и записать вторую и третью - последнюю итерацию уточнения количества записей в книге избирателей:<br/>335; 411; 268; 235 == 1249 записей;<br/>390; 411; 367; 268 == 1436 записей (финальная цифра) .</p>\n<p><strong>КАК КОМИССИЯ ПОДСЧИТЫВАЕТ БЮЛЛЕТЕНИ</strong></p>\n<p>Всё содержимое урны вываливают на стол, вокруг которого стоят члены ИК и её председатель. Председатель берёт произвольный бюллетень и, глядя в него и никому не показывая, тихо говорит \"Единая Россия\", например, после чего передаёт его члену комиссии, ответственному за соответствующую партийную стопку. Далее количество бюллетеней в каждой пачке подсчитывается (без публичного оглашения) и негласно принимается решение, в какую пачку чего добавить и откуда чего изъять, чтобы свести \"правильный\" баланс (см. выше \"Результаты по партиям\"). В этот момент обстановка в Комиссии такая, что можно делать с бюллетенями всё, что угодно, включая лицам, случайно  оказавшимся в здании проведения голосования.</p>\n<p><strong>КАК ВБРАСЫВАЮТ БЮЛЛЮТЕНИ</strong></p>\n<p>У нас это точно делали члены комиссии, а обеспечивал успех операции полицейский, отвечающий за общественный порядок на агитпункте. Может он и сам осуществлял вброс. Я задал ему вопрос, почему он участвует в фальсификации, на что он ответил, что никакими незаконными действиями он не занимается и готов мне показать, что у него под курткой и кителем ничего нет. Я попросил это сделать, и он и вправду расстегнул куртку, китель и показал свою белую рубашку. Необычный способ доказательства собственной невиновности.<br/><br/><strong>ВОЗМОЖНО ЛИ ПРОТИВОСТОЯТЬ ВБРОСУ<br/><br/></strong>Возможно, но сложно. Чем мягче председатель ИК и чем бойчее, организованнее и юридически подкованней группа наблюдателей, тем вероятнее свести результат голосования к реальному.</p>\n<p><strong>ЧТО МЫ СДЕЛАЛИ</strong></p>\n<p>Записали все, какие могли нарушения на видео и написали жалобы в Территориальную ИК с целью признать выборы на нашем участке недействительными. Вот и всё.</p>\n<p><strong>ДОПОЛНИТЕЛЬНО</strong></p>\n<p>У меня есть фото и видеоматериалы, подтверждающие часть описанных нарушений. Есть еще три свидетеля - наблюдатель с совещательным голосом от Яблока, наблюдатель от Новой Газеты, наблюдатель от ЛДПР.</p>\n<p>С технической точки зрения, расследовать фальсификации дело нехитрое. Во-первых, телефонные переговоры председателя Комиссии с восьми вечера до шести утра докажут факт подгонки результатов и укажут непосредсвенного руководителя, анализ разговоров которого выведет на следующую ступень. Во-вторых, анализ бюллетеней за ЕР на нашем участке покажет, что около 400 из них заполнено одним или двумя людьми. Я наблюдал за сортировкой бюллетеней, и мне было видно, что значительная часть галочек нарисована одной рукой. Я даже предполагаю какой. Мы приехали знакомиться с председателем комиссии накануне выборов и увидели на столе в их комнате пачку незаполненных бюллетеней, которые они быстро убрали. В тот вечер, кроме председателя, в комиссии была еще только одна дама. Полагаю, что галочки она и ставила, может ей помогал председатель. </p>\n<p>Зачем вообще было заниматься вбросом непосредственно в урны? Можно было цинично при наблюдателях, когда их минимальное количество в помещении для подсчёта голосов, подложить нужную пачку. Членов комиссии больше 10, а наблюдателей в нашем случае в момент подсчёта было двое. Двенадцать свидетелей больше двух, так что, почему они так не делали, мне непонятно.</p>\n<p><strong>ВЫВОДЫ</strong> (верны только при существующей процедуре голосования)</p>\n<p>На выборы надо ходить как можно большему количеству народа - тогда останется меньше пространства для маневрирования неиспользованными бюллетенями. Нужны грамотные, организованные и бойкие команды наблюдателей, и чем больше, тем лучше, обладающие техническими средствами - видеорегистраторами, фонарями, хочется сказать навыками спецназа :)</p>\n<p>Не надо отвлекаться на статистически незначимые нарушения.</p>','otchet-nablyudatelya-duma-uik-35/'),(38,'','','','',''),(54,'','','','',''),(64,'значительные нарушения','','','',''),(78,'значительные нарушения','Щевьев Виктор Алексеевич','Вброс, большое расхождение в числе проголосовавших с результатами наблюдателей','<p>Я, Щевьев Виктор Алексеевич, получил мандат «Пресса» от «Новой газеты» на Покровке, 19. Со мной находился наблюдатель Юрий (очень деятельный молодой человек).</p>\n<p> Я прибыл на участок в 7ч. 30 мин. Небольшая заминка на входе. Рамка, много проверяющих со списком допущенных от прессы (должен приехать Миронов).<br/> Я записал ФИО: Председатель – Ирина Николаевна Заводова, Сергей Альбертович Фаузер –заместитель, Спиридонова Наталья Сергеевна – чл. комиссии.<br/> Наблюдатель от Яблока – Падалко Вадим Олегович. Наблюдатели от КПРФ и «Патриоты России».<br/> На участке я представлялся накануне, поэтому встретили нормально, записали все данные.<br/> Председатель допытывалась, что я буду делать как представитель прессы. Сказал, что у меня задание зафиксировать, в том числе и фотографированием, процесс голосования и процедуру подсчета голосов. С некоторой долей обиды последовали заверения, что у них всегда все бывает в порядке.<br/> В 8 часов просмотрели урны – переносные и стационарные, опечатали. Началось голосование.<br/> Я сразу же начал отмечать получивших бюллетени, ставил палочки в блокноте. Тут нужно быть очень внимательным, избиратели бродят в разные стороны, можно отметить дважды или пропустить. Часа через два Председатель подошла ко мне и сказала: «Мне, конечно, все равно, но Вы очень нехорошо делаете, хотели фотографировать, а сами пишите. Вы будете потом статью писать» Я сказал, что сфотографировал процедуру опечатывания урн и собираюсь сфотографировать членов Комиссии, что и было сделано. Затем продолжил фиксировать избирателей. Наблюдатели меня ободряли. </p>\n<p>Около 11 часов прибыл Миронов, репортеры столпились за урнами, защелкали, кто-то побежал встретить на выходе. Миронов подошел ближе, спросил: «Наблюдатели есть?»  «Есть» - отвечаю. От какой партии? «Новая газета», КПРФ. А «Справедливая Россия» есть? Подбежал высокий молодой человек – есть, Ну тогда все в порядке. Еще раз у выхода сфотографировались у выхода. Потом приходила Бабкина, ее интервьюировали,<br/> Я продолжал свою работу. Отлучался в столовую 2 раза (на первом этаже) и в туалет. Во время отлучек за меня избирателей отмечали наблюдатели – Юра и Вадим Олегович.<br/> Часов в 15, после того, как я перекусил в столовой своей едой, меня попросили подойти к Председателю, она предложила мне пойти пообедать, предлагала талон на бесплатный обед. Я поблагодарил, сказал, что уже поел.<br/> Поставил отметки времени в 12.00, в 14.30 и в 18.00. </p>\n<p>В 18.40 произошел вброс. Вбросили около 15 бюллетеней. Молодого парня задержала полиция. Нам его ФИО не сообщили, отправили в Пресненское УВД. Биже к вечеру сообщали количество проголосовавших. Было намного больше, чем зафиксировано по подсчетам наблюдателей. В 20.00 закрыли участок. После небольших дебатов решили пойти поесть, чтобы можно было отпустить работников столовой. Через полчаса приступили к подсчетам количества неиспользованных бюллетеней, количества проголосовавших и т.д.. Наблюдатель Юра все время делал замечания.<br/> Затем перешли к основной процедуре – вскрытие урн. Сначала переносных, потом стационарных. Когда произошел вброс, я предложил бросать бюллетени в другую урну, тогда можно будет аккуратно открыть урну и извлечь пачку вброшенных. Но опечатать урну может только полиция. А просто запретить использовать одну урну нельзя.<br/> Урны открывали и высыпали содержимое на столы. Члены Комиссии сидели вокруг, нас отставили на метр, за веревочку. Бюллетени быстро выгребали и перемешивали. Когда высыпали из той урны, в которой находился вброс, мы заметили пачку, кто-то предложил ее отложить в сторону. Одна сотрудница переложила пачку поближе к себе, но мужчина (Сергей Альбертович?) дотянулся, начал разгребать пачку и разворачивать бюллетени (они были сложены вчетверо и очень заметны). Позже представители прессы - мужчина с камерой и девушка с микрофоном - рассказали, что видели еще одну пачку.</p>\n<p> Дальше происходила обычная процедура: раскладывали по партиям, считали общее количество и т. д. Тут и обнаружилось, что в урнах находилось 1150 бюллетеней. По моим данным получали бюллетени 740 человек. Мы составили заявление в двух экземплярах в УИК и в ТИК. Когда я подал заявление Председателю (Заводова Ирина Николаевна,она сказала: «Зря я Вас не выгнала». Дальше дело продолжал Юра, т. к. мне было отказано в праве подавать заявление. Пришлось переписать заявление от имени Юры, а я подписал как избиратель.</p>\n<p>Далее было подано заявление о существенной разнице в количестве выданных бюллетеней и количестве людей, проголосовавших по факту.<br/> Была подано заявление о вбросе (ещё до этого).<br/> Было подано заявление о предоставлении актов о проведении выездного голосования.<br/> Было подано заявление о запечатывании урны для голосования.<br/> Все заявления комиссия не рассматривала и оставила без внимания.<br/> В 3:00 я получил копию протокола на руки, заверенную на всех страницах.<br/> Копии заявлений с отметками комиссии и копию протокола передал Шевьёву Виктору Алексеевичу для дальнейшей обработки.<br/> Также хочу отметить провокации от члена ЕР с ПРГ, которая всё время впадала в истерики, когда я оказывался рядом с ней.<br/> В целом, несмотря на нарушения - наш случай был далеко не самый плачевный, и вместе с тем - довольно обидно, что комиссия допускала грубые процессуальные нарушения на довольно приличном участке (там голосовали Миронов, Кудрин, Лавров и ещё несколько высокопоставленных чиновников). Не берусь уточнять размер вброса, однако комиссия содействовала в задержании вбросившего человека и содействовала его передаче полиции (впоследствии его увезли в ОВД Пресненское), так что можно предположить, что комиссия, возможно, не была задействована в этом. Видео задержания сделавшего вброс человека имеется (запись была сделана наблюдателем Юрием Рейнхиммелем) .</p>\n<p> </p>\n<p> </p>','otchet-nablyudatelya-duma-uik-78/'),(103,'','','','',''),(114,'','','','',''),(139,'','Вадим Назаров','Агитация на участке, нарушение при выездном голосовании, подмена протокола','<p>К сожалению, о проекте узнал только за 10 дней до выборов, начал участвовать за неделю, и не смог нормально подготовится к жестокой реальности. Лекцию прослушал, а вот в игре/тренинге поучаствовать уже не успел. Рекомандованные статьи   закона о гарантиях хоть и прочел внимательно, но как это все применять на практике,представление имел очень приблизительное.</p>\n<p>3-го числа получил мандат члена УИК 139  с ПСГ, знакомится с комиссией не поехал - не успевал, да и не видел в этом смысла. 3-го вечером позвонил Андрей, который был определен на этот же участок наблюдателем. 4-го где-то в районе 7-40 приехал в Дворец детского технического творчества, Лавров пер, дом 9, где и проходило голосование. Попросили документы - предьявил направление, без вопросов заверили 2й экземпляр. При просьбе занести в список присутствующих - показали на тетрадку, куда я сам себя и записал, указав номер телефона. Похоже, это была ошибка (и нужно было требовать какую-то утвержденную форму). Смутило, что туда же (вроде бы) записали и дежуривших полицейских. Минуты через две подошли Андрей и незнакомый мне тогда Александр, корреспондент от НГ (тоже из проекта).<br/> <br/> Из нарушений до начала выявили отсутствие УФ протокола - сказали, что ТИК не дал, решили не докапываться, возможно, зря. По той же причине на участке не было сведений о партиях. С книгами избирателей ознакомились без особых проблем - пара членов комиссии пытались возмущаться, но ссылки на закон и доля жесткости от Александра (самого жесткого из нас троих) быстро их успокоили. В книгах все было чисто - отметок не было, нумерация страниц совпадала. По книгам - единственный вопрос, на который у меня до сих пор нет ответа. Они были разделены по домам. Т.е. в одной сброшюрованной книге было, например, так 51-60, далее пустая страница для тех, кто не попал в список, но прописан по этому адресу (как нам объяснили) И далее, допустим, 75-90. Это нарушение или нет?<br/> <br/> Все цифры - количество бюллетеней, ОУ и т.п. нам сообщили. Небольшой конфликт возник из-за фотографирования, но и он разрешился ссылками на закон. Впоследствии мы более менее спокойно снимали все, что хотели. Невыданные ОУ при нас пересчитали и погасили. Урны опечатывали до 8-00,<br/> но в нашем присутствии, они были пустыми, придираться не стали. Из недостатков - переносные урны унесли в комнату, куда у нас не было доступа, но найти ссылку на положение закона, где бы это запрещалось, мы не смогли. Кроме того, как выяснилось уже перед закрытием, в помещении, чуть в стороне от места для голосования, висели флаги Москвы и РФ и портреты их текущих руководителей, но с утра, очевидно от напряжения, мы этого грубого нарушения не заметили.<br/> <br/> Кроме нас троих, на участке присутствовали очень неприятный член УИК с ПСГ от ЕР, по две отбывающих номер женщины от СР и ПР и наблюдатели от КПРФ. Первую половину дня была Галина, очень активная, но слишком сутеливая, а потом ее сменил Тимур, наблюдатель с двадцатилетним стажем. Контакт с КПРФцами установили моментально, в дальнейшем мы помогали друг другу по максимуму.<br/> Специально для \"удобства\" наблюдателей, отведенные им места постоянного пребывания были оборудованы мягкими диванчиками. Правда, находились они в дальнем конце коридора. Но оттуда можно было видеть и столы, и кабинки, и урны, и \"обычных\" наблюдателей все устраивало. Нас - нет. Видно было все, но издалека, под плохим углом, да и помешать при потенциальном вбросе было физически нереально. Поэтому все 12 часов по меньшей мере двое из трех участников проекта были на ногах – один  (а чаще двое) стояли в двух метрах от стационарных урн (по странному стечению обстоятельств там было официально выделенное место для съемки) и считали число опущенных бюллетеней, а другой - то с одной, то с другой стороны от ряда столов – считал число выданных бюллетеней, и пытался контролировать работу членов УИК на выдаче - изъятие ОУ, отсутствие меток и т.п., отсутствие работы со списками без избирателей и т.п. В итоге с очень большой долей вероятности можно сказать, что вбросов (по крайней мере массовых), каруселей, голосований за других людей у нас не было. Было несколько подозрительных личностей, но они шли редко, к разным членам комиссии, и проверять документы мы у них не стали. Вообще в процессе голосования на самом участке все было<br/> очень обнадеживающе.<br/> <br/> Председатель комиссии - Юрий Михайлович Жуковский, равно как и секретарь - Петрова Надежда Олеговна в помещении для голосвания практически не появлялись,  тсиживались в недоступной для нас комнате, куда не пускали очень мутные члены службы безопасности ДДТТ. Наша ошибка, наверное, что мы на них не вызвали патруль из ОВД. Да и вообще общая тактика была - поддавливать с разной степенью настойчивости, но не доводить до кипения, и ради этого мы закрывали глаза на нарушения, казавшиеся не очень важными. По ощущениям, заправлял на участке зам.пред комиссии – Виноградов Сергей Евгеньевич. Есть и пить нам не предлагали, из давления были стандартные \"мешаете работать\", \"вашу энергию да в мирных бы целях\" и т.п. Жуковский Ю.М. регулярно выдавал фразы типа \"вы мне не нравитесь\", но речь об удалении или отстранении не шла. Возможно, они все знали заранее...<br/> <br/> Основной \"экшн\" на участке был связан с голосованием вне помещения. Тут вообще царил полный мрак. Изначально было 120 заявок, реестр не велся (причем, по ощущениям, не с целью что-то сфальсифицировать, а просто по тупому незнанию нормы). Такое большое количество объясняли наличием на территории участка роддома, где по устному сообщению главврача по телефону с утра (проверить не было возможности) было 70 желающих проголосовать. На первый выход зам пред УИКа очень сильно старался меня выпроводить, мотивируя это тем, что идти некому, вы же член УИК и т.п., но по заранее согласованной тактике мы решили идти только на роддом и, возможно, на третий выход. В первом было всего 25 заявок, решили не размениваться. Первая выходная группа собиралась (возможно, из-за моего отказа идти) где-то час - до 11ти, на участке все это время было спокойно. Они взяли с собой больше положенной нормы бюллетеней - 35, не было выписки из несуществующего реестра, но у нас было четкое ощущение, что это отвлекающий маневр, и мырешили на него не обращать особого внимания. Группа ушла в 11-20, вернулась только в 18, при этом проголосовало 28 человек. В 11-15 срочно стали собирать вторую группу - в роддом. Пошли зампред УИК, член УИК с ПСГ от ЕР и я. Тоже без реестра, на что оставшиеся Андрей и Саша стали писать жалобу и вызвали мобильную группу из штаба. Дальше - веселее. Мы дошли до роддома. А там... отдали 75 (\"с запасом\") бюллетеней и переносную урну главврачу. Главврач ушел со всем этим делом вглубь роддома, а все три члена группы остались ждать на входе... Было очевидно, что налицо просто-таки грубейшее нарушение закона, причем на 70 голосов (2,5% от общего числа избирателей, по оценкам 5% от возможной явки).  </p>\n<p>Я написал заявление о признании недействительными всех бюллетеней, вызвонил Андрея, который направил в роддом вызыванную ими мобильную группу. Урну с 70 (посчитали после вскрытия вечером) опущенными (непонятно кем, непонятно как, непонятно когда) бюллетенями, 5 неисползованными бюллетенями и 70 заявлениями о голосовании вне помещения были отданы нам. Как раз в это время приехала мобильная группа проекта, состоявшая из двух корреспондентов, один - из Большого города, второй - не рассмотрел, которые замечательно взяли интервью у всех троих, в том числе добившись от них на диктофон признания, что два часа ящик и бюллетени находились вне зоны досягаемости УИК. По возвращению на участок я вручил Жуковскому жалобу на нарушение при голосовании вне помещения, он, как ни странно, ее принял. Акты по возвращению не составлялись, но мы, честно говоря и не требовали. И так по этому голосванию было подано и принято две разные жалобы.</p>\n<p>С третьим выходом случилась странная история. Его все откладывали и откладывали. Возможно, ожидая возвращения первой группы. А потом наступило 16-00 и Тимур убедил комиссию, что выходить уже незаконно. Поэтому третий выход так и не состоялся. Поскольку не было понятно, что будет с 70 голосами из роддома (даже несмотря на убойные доказательства), решили позвонить в мобильную группу. Они приехали в районе 18-30ти и оказали неоценимую помощью в разрешении ситуации. Алена, Димитрий, Миша - огромное вам спасибо. Димитрий давил грамотным толкованием законов, Миша - просто своим присутствием, Алена - съемкой всего вокруг.<br/> <br/> Участок закрылся вовремя. Мы готовились к борьбе за вторую переносную урну и на этом сосредоточили почти все свое внимание. Данные по книгам считались параллельно, писали карандашом. После этого предварительного подсчета их унесли в ту самую закрытую комнату, где днем пребывали секретарь и председатель. Я с маленьким боем туда прорвался, чтобы пронаблюдать процесс переброшюровки из нескольких книг в одну. К сожалению, до конца процесс посмотреть не удалось, т.к. позвонили ребята из основного помещения и сказали, что УИК собирается нарушить закон и сразу вскрывать урны, не считая неиспользованные бюллетени. Когда я туда вернулся, все рисутствовашие наблюдатели, кроме ЕРовца (баласт от СР и ПР ужеушел домой), дружно объясняли председателю УИК, что он нарушает закон. Не подействовало. Вывалили переносные урны. В \"роддомовской\" на беглый взгляд за ЕР были почти все. В очередной раз отребовали рассмотретьжалобу о признании их недействительными. Не помогло. Звонили члену ТИК от Яблока, пытались дозвониться впрокуратуру (телефон, висевший в распечаткена Покровке, оказался старым и не отвечал), но прогресса видно не было. Бюллетени из обеих переносных урн члены УИК перемешали под наш хор \"Вы нарушаете закон\". Потом вывалили данные из обеих стационарных, пачек не было. Смешения бюллетеней из стационарных и переносных не допустили. В очередной раз потребовали немедленно рассмотреть жалобу о признании теперь уже всех бюллетеней из переносных  урн недействительными. Пригрозили уголовной статьей.<br/> И тут почему-то подействовало! Все руководство комиссии свалило в свою тайную комнату и осталось там минут на 20, а потом вышло и предложило признать результаты по обеим переносным урнам недействительными. Комиссия удивилась, но поддержала. А мы внутри начали праздновать победу. Рано, как оказалось потом. Но тогда мы прикинули, что 70 бюллетеней - это почти 5%, и думали, что это и есть самое большое нарушение, которое мы смогли предотвратить.<br/> Считали голоса за каждую партию не по процедуре, но прозрачно для нас. Четыре наблюдателя (и три зависших на участке члена мобильной группы) стояли за всеми спинами, снимали все (или почти все на видео, фото, писали на диктофон). Где-то в это время с участка пропал член комиссии с ПСГ от ЕР. Посчитали.  182 (СР), 133 (ЛДПР), 30 (ПР), 389 (КПРФ), 227 (Яблоко), 323 (ЕР), 11 (ПД). После вынесли, пересчитали и погасили неиспользованные бюллетени. Контрольные соотношения вроде бы сходились. После этого руководство комиссии опять сбежало в своё убежище, а оставшиеся - и члены УИК и мы - расслабились и стали ждать протокола.<br/> Стопки, разложенные по партиям, при этом не теряли из виду. Ждали, наверное, минут 45, хотя к тому времени уже давала знать усталость, и оценки по времени могут быть необъективными.<br/> В итоге протокол принесли. Копии сделали всем желающим. Всем трем участникам проекта + Тимуру + для себя копии попросили члены УИК с ПРГ от КПРФ и от СР. Копии были подписаны председателем, но на них не было расшифровки подписи и времени и даты заверения. Настояли. НО! Дату, время и расшифровку поставил не опять испарившийся председатель, а его зам. Сейчас очень жалею об этом. Все материалы (ОУ, бюллетени) запаковали в мешки, завязали, опечатали. Мы с Андреем расписались на печатях и стыках. </p>\n<p>Очередное ожидание. Члены комисси с ПРГ по-тихоньку расползаются и отпрашиваются домой. Точно уехала представительница КПРФ (договрившись с наблюдателем от своей партии). По-моему, кто-то еще. Но точно не уверен. Где-то в половину второго часть членов УИК испарилась где-то в дебрях ДДТТ, а Жуковский, Виноградов и Петрова поехали с материалами в ТИК. Нас попросили освободить помещение. И тут мы дали слабину. Имея на руках идеально оформленные копии протокола, поставив подписи на мешках и радуясь победе в ситуации с выносным голсоованием, мы решили поехать<br/> по домам. На будущее урок - нужно было требовать, чтобы взяли с собой в ТИК, ну или по меньшей мере ехать своим ходом туда же.<br/> <br/> Радужное настроение от того, что удалось сделать что-то хорошее, продержалось до появления результатов на сайте. Там пять цифр по партиям из семи совпадают. Но у Яблока 27, а не 227, а у ЕР 573, а не 273. Как, где, когда... на повторный подсчет, естественно, никто не приглашал.</p>\n<p>Скан копии протокола: </p>\n<p>Копии протоколов отдали одну в Яблоко, вторую в проект. Думаю, Тимур свою копию до московского отделения КПРФ донесет.<br/> Хочется верить, что дело дойдет до суда и виновные сядут.</p>','otchet-nablyudatelya-duma-uik-139/'),(144,'некорректная работа УИК','','','',''),(163,'нарушений не выявлено','Андрей Столяров','Чисто','<p><strong> </strong>Как должны проходить выборы.</p>\n<p><br/> На участке: член комиссии с совещательным голосом от КПРФ, наблюдатели от  КПРФ (в 2 смены), СР (вялая апатичная девушка), ЕдРо (из управы), энтузиаст от Яблока и трое от Гражданина Наблюдателя.<br/> Вся комиссия – сотрудники Главного Управления по обслуживанию Дипломатического Корпуса при МИД. Председатель вел себя строго, но в пределах разумного, разрешал вступать в дискуссии, советовать,  я заметил две ошибки, за которые получил благодарность.<br/> <br/> 5 книг со списками избирателей, в ряд, почти парта к парте; две урны, стоящие рядом. Наблюдателям отведен уголок, но можно ходить. Мы ставили зарядки, но получали замечания за съемку (от комиссии и наблюдателя от ЕР). Атмосфера была достаточно спокойная для наблюдателей, хотя сначала все вели себя очень робко –  чтоб не быть выгнанным.<br/> <br/> Постоянно двумя наблюдателями велся подсчет выданных бюллетеней по открепительным и количество опущенных в урны бюллетеней. В первый час насторожил поток полицейских с открепительными, думали, что это такая «карусель», но потом он схлынул – ясно, голосовали перед тем как  заступить на службу.<br/> Периодически, раз в час, выходили на улицу проверить нет ли автобусов с «карусельщиками».<br/> Смотрели, чтоб пока нет избирателей, ничего не писали в книгах.<br/> <br/> Самое страшное «пресечение вброса» было, когда я увидел, что у прилично одетого мужчины в руках над урной два бюллетеня совмещенные – кинулся к нему с вопросом, почему два, закрыл щель – оказалось, что за колонной стояла жена. Все посмеялись :)<br/> <br/> Из известных персон проголосовали: ведущий Андрей Малахов, обольстивший всех девушек в комиссии, Геннадий Селезнев, пообщавшийся с наблюдателями, строгий и быстрый адвокат Кучерена, Юрий Петрович Любимов с женой и Аркадий Дворкович со спутницей. Дворкович провел в кабинке с бюллетенем минуты две, не меньше, чем привлек внимание всех наблюдателей. Потом на правах СМИ спросил у него – почему так долго он принимал решение за кого голосовать? – ответил, что читал знакомые фамилии... Интересно... за кого все-таки...?<br/> <br/> За 15 минут до голосования появилось три парня подозрительного, не-остоженского вида, которые громко говорили и привлекали к себе внимание. Открепительные. То ли Сергиев, то ли Павлов Посад. Двое опустили бюллетени под пристальным взглядом 6-ти наблюдателей, стоящих с включенным видео и напряженными руками, третий стоял минуты три в кабинке щелкая ручкой и периодически что-то делая с сумкой, потом вышел, пообезьянничал на камеры, поржал и положил один бюллетень. Все выдохнули.<br/> <br/> Участок закрыли ровно в 20.00 и начали работать с книгами – долго, но все четко, правда, перешивали книги, чтобы списки тех, кого не было в подготовленных ТИКом списках, сшить в одной книге. На это убили часа 2-3.<br/> Начали раскладывать по стопкам  голоса из урн – сначала из выездной выкинули, потом из двух больших.<br/> <br/> Результаты стали понятны сразу – слышалось что-то подобное: Яблоко-Яблоко-Кпрф-Яблоко-Единая-Яблоко. Все удивлялись. А наблюдатели были в легкой эйфории, изредка омрачаемой думами о том, будет это исправлено в ТИК или нет.<br/> Получилось так:</p>\n<table>\n\n<tr>\n<td>\n<p> </p>\n</td>\n<td>\n<p> </p>\n</td>\n<td>\n<p><strong> Остоженка УИК163</strong></p>\n</td>\n<td>\n<p> </p>\n</td>\n<td>\n<p><strong> Лондон exit-poll</strong></p>\n</td>\n<td>\n<p> </p>\n</td>\n</tr>\n<tr>\n<td>\n<p>№</p>\n</td>\n<td>\n<p>Название</p>\n</td>\n<td>\n<p>Кол-во</p>\n</td>\n<td>\n<p>%</p>\n</td>\n<td>\n<p>Кол-во</p>\n</td>\n<td>\n<p>%</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>5</p>\n</td>\n<td>\n<p>Яблоко</p>\n</td>\n<td>\n<p><strong> 351</strong></p>\n</td>\n<td>\n<p><strong> 31,2%</strong></p>\n</td>\n<td>\n<p><strong> 389</strong></p>\n</td>\n<td>\n<p><strong> 44,9%</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p>4</p>\n</td>\n<td>\n<p>КПРФ</p>\n</td>\n<td>\n<p><strong> 241</strong></p>\n</td>\n<td>\n<p><strong> 21,4%</strong></p>\n</td>\n<td>\n<p><strong> 179</strong></p>\n</td>\n<td>\n<p><strong> 20,6%</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p>1</p>\n</td>\n<td>\n<p>Справедливая Россия</p>\n</td>\n<td>\n<p><strong> 207</strong></p>\n</td>\n<td>\n<p><strong> 18,4%</strong></p>\n</td>\n<td>\n<p><strong> 139</strong></p>\n</td>\n<td>\n<p><strong> 16,0%</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p>6</p>\n</td>\n<td>\n<p>Единая Россия</p>\n</td>\n<td>\n<p><strong> 182</strong></p>\n</td>\n<td>\n<p><strong> 16,2%</strong></p>\n</td>\n<td>\n<p><strong> 81</strong></p>\n</td>\n<td>\n<p><strong> 9,3%</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p>2</p>\n</td>\n<td>\n<p>ЛДПР</p>\n</td>\n<td>\n<p>71</p>\n</td>\n<td>\n<p>6,3%</p>\n</td>\n<td>\n<p>65</p>\n</td>\n<td>\n<p>7,5%</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>7</p>\n</td>\n<td>\n<p>Правое дело</p>\n</td>\n<td>\n<p>29</p>\n</td>\n<td>\n<p>2,6%</p>\n</td>\n<td>\n<p>13</p>\n</td>\n<td>\n<p>1,5%</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>3</p>\n</td>\n<td>\n<p>Патриоты России</p>\n</td>\n<td>\n<p>24</p>\n</td>\n<td>\n<p>2,1%</p>\n</td>\n<td>\n<p>1</p>\n</td>\n<td>\n<p>0,1%</p>\n</td>\n</tr>\n<tr>\n<td>\n<p> </p>\n</td>\n<td>\n<p>недействительные</p>\n</td>\n<td>\n<p>21</p>\n</td>\n<td>\n<p>1,9%</p>\n</td>\n<td>\n<p> </p>\n</td>\n<td>\n<p> </p>\n</td>\n</tr>\n<tr>\n<td>\n<p> </p>\n</td>\n<td>\n<p>ИТОГО</p>\n</td>\n<td>\n<p>1126</p>\n</td>\n<td>\n<p>100,0%</p>\n</td>\n<td>\n<p>867</p>\n</td>\n<td>\n<p>100,0%</p>\n</td>\n</tr>\n\n</table>\n<p><br/> Интересно, что очень близко к тому, как голосовал Лондон по итогам exit-poll.  Привет всем кто там проголосовал – говорят, была двухчасовая очередь и многих отсеивали... ( но...посмотрел официальные результаты ЦИК по зарубежным территориям – у ЕР 61%  :(... )<br/> <br/> Все. Посчитали все бюллетени, 21 недействителен, где-то жирно ПЖИВ, один бюллетень за Яблоко с пометкой «лохи» в 6-ом поле (не квадратике) приняли действительным, кто-то добавил еще листик А4 с надписью вроде – «Верните Честные Выборы, долой ПЖИВ», 2 бюллетеня унесли. Смотреть на бюллетени с галками во всех полях было больно, потому что они могли отнять голоса у ЕдРа, но не отняли.<br/> <br/> Председатель занес все числа в увеличенную копию протокола, но я указал, что контрольное соотношение не сходится. Поругали меня, сказали, что не понимаю ничего, но потом, забив данные в компьютер,  все же пришли и исправили.  :)<br/> До этого мы написали уведомление о том, что нам необходимы копии итоговых протоколов, и на словах председатель подтвердил, что все выдаст, откопировав.<br/> <br/> Но... начали ждать какого-то звонка из ТИК. Комиссия пошла есть фрукты и тортики в другую комнату, все мешки запечатали.  Спросил у коммуниста-члена комиссии, надо ли опечатывать мешки, расписываться и следить за ними, на что он ответил, что теперь судьба цифр в руках ТИК и мы на это повлиять никак уже не можем. Он был уверен, что результат будет изменен.<br/> <br/> Через 40 минут ожидания мы начали звонить в ТИК жаловаться и в штаб, где посоветовали звонить в Московскую ИК, а потом в полицию. В полицию по двум линиям позвонили, и они уже были готовы вызывать наряды - по сообщению о возможной фальсификации – затягивают с выдачей протоколов, но пришел Председатель и сказал, что все сейчас выдаст.<br/> Через 10 минут пришел с секретарем и копиями. Все оформили, расписались и сфоткали мешки с бюллетенями.<br/> <br/> Все наблюдатели уехали, но мне неспокойно было смотреть на брошенные три мешка со всеми результатами, и я решил дождаться, пока их не увезут. Думал даже спрятаться за угол подальше, на случай, если здесь их начнут распаковывать и подмешивать что-то.<br/> Председатель уехал (видимо в ТИК) и минут через 10 позвонил –  сказал везти мешки. Их начали выносить, я добежал до припаркованной рядом машины и сопроводил мешки до входа в ТИК Хамовники. С неспокойной душой за будущее наших результатов поехал спать.<br/> <br/> Утро, на батуте поделился со всеми радостью о 31% за яблоко, еду в машине -  со всех сторон трубят о вбросах, выводах наблюдателей, каруселях, подтасовке в ТИК. <br/> Дима Черный пишет,  что даже у них, где был вброс огромный – все равно потом еще в Тике добавили процентов Партии Жуликов и Воров. Гады.<br/> <br/> Иду проверять свой  УК163 на сайт ЦИК, волнуюсь, но... ЙЕС!!! ЧЕРТ ПОБЕРИ!!! Цифра в Цифру, как было вчера! Олег Борисыч  -  Стальной Председатель!!! Огромный Респект УпДК МИД!!! Так что в  табличке вверху правильные цифры!!! ШОК, Восторг и гнев, почему на других участках не было так как на нашем...<br/> ЯБЛОКО - 31 %, Пария Жуликов и Воров - 16 % !!!</p>','otchet-nablyudatelya-uik-163/'),(188,'нарушений не выявлено','','','',''),(191,'значительные нарушения','Елена Захарова','карусель, фальшивые открепительные, изготовленные на цветном принтере, удаление','<p>1            Число избирателей, внесенных в список избирателей        1146</p>\n<p>2             Число избирательных бюллетеней, полученных участковой избирательной комиссией         900</p>\n<p>3             Число избирательных бюллетеней, выданных избирателям, проголосовавшим досрочно    0</p>\n<p>4             Число избирательных бюллетеней, выданных избирателям в помещении для голосования 786</p>\n<p>5             Число избирательных бюллетеней, выданных избирателям вне помещения для голосования            19</p>\n<p>6             Число погашенных избирательных бюллетеней    95</p>\n<p>7             Число избирательных бюллетеней в переносных ящиках для голосования 19</p>\n<p>8             Число избирательных бюллетеней в стационарных ящиках для голосования             784</p>\n<p>9             Число недействительных избирательных бюллетеней        16</p>\n<p>10           Число действительных избирательных бюллетеней            787</p>\n<p>11           Число открепительных удостоверений, полученных участковой избирательной комиссией 40</p>\n<p>12           Число открепительных удостоверений, выданных избирателям на избирательном участке 18</p>\n<p>13           Число избирателей, проголосовавших по открепительным удостоверениям на избирательном участке          50</p>\n<p>14           Число погашенных неиспользованных открепительных удостоверений      22</p>\n<p>15           Число открепительных удостоверений, выданных избирателям территориальной избирательной комиссией              0</p>\n<p>16           Число утраченных открепительных удостоверений              0</p>\n<p>17           Число утраченных избирательных бюллетеней     0</p>\n<p>18           Число избирательных бюллетеней, не учтенных при получении     0</p>\n<p>       </p>\n<p>Уже в 7,30 мы, наблюдатели от проекта «Гражданин наблюдатель» ГН (два наблюдателя от Яблока и два представителя от СМИ), обнаружили массу нарушений на участке, указали на них председателю и пригрозили жалобой. С этого момента у него испортилось настроение… В 8.00 появились другие наблюдатели, от КПРФ, Справедливой России, Единой России. Про этих людей неохота много рассказывать, они все время выпивали и закусывали по приглашению комиссии, а дама от СправРос без конца жаловалась, что мы ей мешаем наблюдать, и даже настрочила жалобу.</p>\n<p>Председатель и его зам (человек с большим животом и в майке) всячески препятствовали нашим передвижениям в сторону ящиков для голосования, угрожали удалить (комиссия может принять такое решение). А дядястепамилиционер (высокий участковый в парадной форме) вообще от меня не отходил и непрерывно твердил, что я «нарушаю правопорядок». Короче, нам не удалось занять место, откуда было бы видно, как бюллетени опускают в урну.</p>\n<p>После того, как мы не смогли предотвратить голосование «карусельщиков» на двух автобусах с 8.10 до 8.40 (кстати, координировал процесс «наблюдатель» от ЕдРо),  мы (наблюдатели ГН) написали жалобы председателю и в ТИК. А еще мы обнаружили, что в соседней комнате работники ДЭЗАиликактамонназывается копировали на цветном принтере(!!!) открепительные удостоверения (если не приглядываться, то не отличишь). Конечно, подняли шум! Я позвонила во все штабы: реально по всем телефонам, что у меня были – в Яблоко, в ГН, в ТИК, в ЦАО, на какие-то горячие линии и в какие-то газеты, не помню При этом председатель комиссии и его зам, а также вышеуказанный «наблюдатель» орали на меня, что я мешаю работе комиссии и избирателям и пытались меня всячески отстранить.. А еще я слышала, как этот мерзкий едрос-гэбэшник в 9 часов докладывал по телефону, что типа «уже первые вбросили, ждемс…» (я как раз всем названивала).</p>\n<p>Дальше, узнав, что у нас здесь ужосс что происходит, стали стекаться по очереди и одновременно: наблюдатель ОБСЕ (я показала ей ящик, куда вбрасывали карусельщики, он нам совсем был не виден - а им удобен, но через щель видно, что ящик уже наполовину заполнен, в отличие от второго пустого), наблюдатели ПАСЕ (до этих уже меня не допустил председатель), газета «Большой город», кандидаты Яблока, РЕН-ТВ, юристы от ГН, еще какое-то телевидение…</p>\n<p>Короче, этот наш 191 участок стал очень популярным среди наблюдателей и СМИ… ну и меня, по «решению избирательной комиссии большинством голосов» удалили, так как я «мешала работе комиссии и нарушала правопорядок». Выводили культурно, ничего не скажу, в сопровождении дядистепы, правда я по дороге успела  дать интервью РЕН-ТВ J</p>\n<p>Но там остались наши (фу ты, «наши» в хорошем смысле)!!! И они дошли до конца!!! Сюда уже не привозили карусельщиков!</p>\n<p>Дальше я, конечно, поехала в ТИК, написала там заявление. Председатель ТИКа поехал разбираться на участок (заодно и пообедать в буфете Дома на Набережной), но, в конце концов, как ни странно J, приняли сторону председателя. Потом из меня организовали мобильную группу от Яблока (я уже как представитель СМИ, им не нужно направление на конкретный участок), и мы с корреспондентом NewTimes и кандидатом Яблока ездили на участки, в которых происходили всякие ужоссы. Рассказ про это может быть бесконечным. Вот некоторые детали. На участке в районе Цветного бульвара наблюдателем от Яблока оказался муж Председателя комиссии – и у них «голосование проходило хорошо» (а мы оказались там как раз потому, что другой наблюдатель с совещательным голосом от Яблока сообщил о нарушениях и вбросах, и его собирались удалять – стойкий мальчик выдерживал постоянный прессинг от комиссии). На участке на ул. Днепропетровской лысый Председатель в костюме с отливом орал во всю глотку (не преувеличиваю!) на зарегистрированного кандидата от Яблока просто за то, что мы зашли на «его территорию» (к этому времени он уже удалил одного наблюдателя от ГН). На 57 участке, куда мы успели до 20.00, чтобы присутствовать на подсчете голосов, удалили ЧЛЕНА ИЗБИРАТЕЛЬНОЙ КОМИССИИ, по совместительство корреспондента Дождя, за то, что она вела фотосъемку. Там были наблюдатели: от КПРФ (две барышни, читавшие худ. литературу),  от ЕдРо (два бравых молодца) и от Яблока (очень странная женщина, выпивала и закусывала с комиссией). Подсчет голосов начали после 5-тичасового (!!!)  перерыва (конечно, мы написали жалобы обо всем, что там увидели), но, к сожалению, результаты были явно «не чистыми» - комиссии никто не препятствовал выполнить задание как полагается L</p>\n<p>А в это время мои дорогие соратники на 191 участке присутствовали при подсчете голосов (не без приключений). Правда, им не дали копию протокола (а это уже уголовное преступление!), но в систему попали неискаженные цифры (если не считать двух автобусов карусельщиков, которые мы не смогли остановить)!!!</p>\n<p>И вот что я про все это думаю…</p>\n<p>Блогер какой-то написал, я так не умею (но и у него эмоции в рифму не поместились)</p>\n<p>«Тут и там – единоросс, /Ты и я – единоросс, /Дед Мороз – единоросс, /Потому что, БЛЯДЬ, на выборы надо было ходить».</p>\n<p>А в следующий раз – 4 марта! С наступающим…</p>','otchet-nablyudatelya-duma-uik-191/'),(199,'нарушений не выявлено','','','',''),(218,'значительные нарушения','','','',''),(228,'','','','',''),(247,'','','','',''),(265,'','','','',''),(289,'','','','',''),(314,'','','','',''),(315,'некорректная работа УИК','','','',''),(337,'','Западное Дегунино Михаил Щербаков','Массовая карусель, бездействие полиции, давление администрации и депутатов, удаление, потасовки','<p><strong>№338</strong> </p>\n<table>\n\n<tr>\n<td>Партии</td>\n<td>Результат протокола УИК</td>\n<td>Официальный результат</td>\n</tr>\n<tr>\n<td>Справедливая Россия</td>\n<td><strong>17,20</strong></td>\n<td><strong>17,20</strong></td>\n</tr>\n<tr>\n<td>Либерально-демократическая партия России</td>\n<td><strong>13,22</strong></td>\n<td><strong>13,22</strong></td>\n</tr>\n<tr>\n<td>Патриоты России</td>\n<td><strong>1,43</strong></td>\n<td><strong>1,43</strong></td>\n</tr>\n<tr>\n<td>КПРФ</td>\n<td><strong>21,42</strong></td>\n<td><strong>21,42</strong></td>\n</tr>\n<tr>\n<td>Яблоко</td>\n<td><strong>9,55</strong></td>\n<td><strong>9,55</strong></td>\n</tr>\n<tr>\n<td>Единая Россия</td>\n<td><strong>35,83</strong></td>\n<td><strong>35,83</strong></td>\n</tr>\n<tr>\n<td>Правое дело</td>\n<td><strong>0,24</strong></td>\n<td><strong>0,24</strong></td>\n</tr>\n\n</table>\n<p><strong>Группа наблюдателей проекта «Гражданин наблюдатель»:</strong><br/> 1) Щербаков Михаил Сергеевич, член участковой избирательной комиссии с совещательным голосом (член УИК с ПСГ) от РОДП «Яблоко», образование – высшее юридическое (специализация гражданское право);<br/> 2) Кульнев Роман Валерьевич, наблюдатель от РОДП «Яблоко», образование – высшее социологическое;<br/> 3) Поднебесников Евгений Сергеевич, наблюдатель от СМИ «Новая газета», образование – высшее юридическое (специализация гражданское право).<br/> <br/> <strong>03 декабря 2011 года (Суббота)</strong><br/> Получив все необходимые документы в штабе проекта «Гражданин наблюдатель», мы всей командой наблюдателей двинулись на Дегунинскую улицу, знакомится с членами УИК № 337 и № 338. На участке № 337 удалось застать только заместителя председателя участковой избирательной комиссии Данилову Ольгу Николаевну. Сразу обозначу, что Ольга Николаевна, представляет собой вымирающий вид членов избирательных комиссий, которые еще способны испытывать стыд за свои неблаговидные поступки. То есть, она, конечно, нарушает закон, но ей ужасно стыдно, она краснеет, трясутся руки, прыгает давление, ужасно болит голова, но не нарушать закон она не может, ведь и до пенсии немного осталось, да и «Иван Иваныч» все-таки попросил помочь, по-человечески попросил, а не как начальник.<br/> Надо сказать, что костяк УИК № 337 и № 338 сформированы на базе трудового коллектива НИИ Цветметавтоматика (нынешнего ОАО «Союзцветметавтоматика» - http://www.scma.ru/ru/index.html) еще в советские годы, то есть как бы подразумевается, что люди там опытные, порядочные, интеллигентные, из научной среды. Особо больших нарушений на этих участках никогда не было, и все должно было пройти спокойно и без эксцессов.<br/> Мы представили заместителю председателя УИК свои полномочия, выяснили количество избирателей – 2 533 (эта цифра еще несколько раз поменяется), выяснили количество бюллетеней – 2 000 штук. Пошли знакомиться на участок № 338. Тут все оказалось сложнее, разговаривали только со мной, так как у всех остальных наблюдателей был обозначен участок № 337, а  я был как наблюдатель от СМИ мог ходить по любым участкам. Хотя мне тоже ничего не удалось выяснить, фразой – «Мы телевидение и радио не вызывали», председатель УИК № 338 Аникина Л.И. закончила наше общение.<br/> Самое главное, что удалось: наметили пути подхода избирателей, возможности для вброса и карусели, посмотрели обстановку, выяснили, где находится ОВД «Западное Дегунино» и ТИК (территориальная избирательная комиссия) района Западное Дегунино. <br/> <br/> <strong>04 декабря 2011 года (Воскресенье)</strong><br/> <strong>7.20</strong> – в полном составе прибыли на участок № 337. Удивлению комиссии не было предела – «Мы же вам сказали приходить не раньше 7.50». Председатель УИК № 337 Москалёва Нина Зелимхановна сразу решила расставить все точки над i и начала проверять наши документы, приговаривая «Нет, нет, никаких наблюдателей нам не нужно». После стандартных фраз в отношении меня – «А где ваше редакционное задание?!», «А где направление от вашей редакции именно на наш участок?», «А почему меня не предупредили?!», «Мы телевидение на вызывали», «Вы из газеты, тогда можете только писать, а не снимать», звонков в ТИК и т.д., председатель все-таки согласилась оставить нас на участке. Познакомились с другими наблюдателями на нашем участке, их было двое, один от КПРФ (помощи никакой нам не оказывал, только ел в буфете и общался со старыми знакомыми-избирателями), и один очень толковый наблюдатель от «ЛДПР» Илья Чайка (хоть и не был участником нашего проекта, но очень сильно нам помог)<br/> <strong>7.30</strong> – воспользовавшись тем, что пока на участке все спокойно, передали три заявления Председателю УИК №337 на получение копии протокола после завершения голосования и подсчета голосов. Председатель недоуменно взяла заявления и, не поставив отметки о получении, ушла звонить в ТИК, наверное, для получения согласования. Пока ждали ее возвращения, надоумили других наблюдателей написать такие же заявления <br/> <strong>7.40</strong> – так как с мест, отведенных для наблюдателей, одну из урн для голосования нам было не видно, попросили Председателя УИК №337 передвинуть либо урну на видное место, либо сдвинуть кабины для голосования (из-за них, собственно говоря, и не было видно), либо передвинуть места для наблюдения. <br/>  <br/> Получив отказ, стали писать жалобу на имя председателя УИК. Это была наша первая жалоба в УИК, всего их будет 11, еще 7 мы отправим в ТИК, плюс подадим 2 заявления в полицию.<br/> Наша первая жалоба: </p>\n<p><br/> <strong>7.54</strong> – попросили у Председателя УИК № 337 Москалевой Н.З. показать нам списки избирателей для проверки, удостовериться, что там нет никаких пометок, в ответ Председатель заявила, что со списками избирателей мы не имеем права работать, это закрытая информация. Одновременно с отказом председатель предпринимает еще одну попытку удалить камеру с участка, в очередной раз требуя письменное редакционное задание на освещение выборов именно на УИК №337<br/>  <br/> (Прошу прощение за съемку только ног (таких кадров у меня много), еще не выработалась привычка вести профессиональную съемку и тыкать камерой в лицо оппоненту.)<br/> <strong>8.02</strong> – с опозданием наконец-то начали опечатывать стационарные урны. Мы попросили урны дополнительно обвязать скотчем, что и было выполнено членами УИК.<br/>  <br/> <strong>8.03</strong> – пришли первые избиратели, списков избирателей у членов УИК на это время до сих пор нет<br/> <strong>8.04</strong> – Заместителем председателя УИК №337 наконец-то вынесены списки избирателей, которые тут же раздаются членам УИК (наблюдатели так и не получили возможности ознакомиться с ними.<br/>  <br/> <strong>8.15</strong> – начали опечатывать переносные урны. Урны разваливаются на две половинки и держатся исключительно на добром слове и скотче (кстати, скотч принесен одним из наблюдателей)<br/>  <br/> <strong>8.17</strong> – член УИК с правом совещательного голоса Щербаков М.С. путем визуального осмотра устанавливает, что в списках избирателей присутствуют непонятные пометки карандашом. Больше всего пометок выявляется в списках избирателей, расположенных на столах №1 и №2. Именно за эти столы будут садиться все карусельщики, именно за этими столами сидят представителя управы «Западное Дегунино».<br/> Подаем соответствующую жалобу: </p>\n<p> <br/> Заместитель председателя УИК № 337 Данилова О.Н. объясняет пометки необходимостью вручения подарка тем, кто первый раз голосует, а так же тем, что существуюет вероятность нахождения в списках избирателей УЖЕ УМЕРШИХ ЛЮДЕЙ!!! <br/> АУДИОЗАПИСЬ:  <br/> На видео член УИК №337, представитель управы «Западное Дегунино» Чернобровкина Г.Ю. и Председатель УИК №337 Москалева Н.З.<br/>  <br/> Быстрое согласие Председателя УИК №337 убрать пометки из списков избирателей связано не с нашим даром убеждения, а с тем, что никто не собирался их:  они были стерты частично на первых листах книг за всеми столами, кроме столов №1 и №2, где пометки не убирались в принципе. В дальнейшем членам УИК было запрещено демонстрировать нам списки избирателей (со ссылкой на сохранение тайны паспортных данных избирателей) и при появлении в опасной близости от столов наблюдателей закрывать списки избирателей телами.<br/> <strong>8.26</strong> – председатель УИК №337 Москалева Н.З. запретила наблюдателю Кульневу Р.В. сидеть на стуле вблизи урны и забрала у него стул, сославшись на то, что стулья предназначены для престарелых избирателей, которые хотят отдохнуть перед голосованием. Кульневу Р.В. объявлено первое предупреждение<br/> <strong>8.32</strong> – член УИК с ПСГ Щербаков М.С. решил проверить, исполнено ли поручение об устранении пометок в списках избирателей, данное членам УИК председателем. На первых же страницах списка избирателей, расположенного за столом №2 (член УИК Чернобровкина Г.Ю.) были замечены пометки, которые никто и не собирался убирать. В ответ на требование члена УИК с ПСГ Щербакова М.С. об устранении пометок Председатель Москалева Н.З. потребовала от него. занять свое место для наблюдения, больше не приближаться к столам, и попутно объявила первое предупреждение. Всем наблюдателям было объявлено о недопустимости покидать свои места, отведенных для наблюдения, и дан категорический запрет на приближение к столам УИК, кабинам для голосования и урнам для голосования, под угрозой удаления с участка<br/>   Подаем повторную жалобу в УИК:   А после этого, наблюдая, что ничего не происходит, подаем жалобу в ТИК:   <br/><strong>8.52</strong> – после недолгого разговора председателя УИК №337 с одним из избирателей, некой Полуниной И.К., последняя решила написать жалобу на наблюдателя от СМИ Поднебесникова Е.С., якобы Поднебесников Е.С. снимал избирателя без ее согласия.От предложение Поднебесникова Е.С. просмотреть видеоматериал и удостовериться в отсутствии какого-либо из избирателей Полунина И.К. отказалась. Жалоба пишется под диктовку председателя УИК №337 Москалевой Н.З., что отчетливо видно на видео. Пишет долго, начиная несколько раз заново<br/>   В конце видеозаписи видно, как председатель проверяет написанное заявителем, все ли верно услышал избиратель<br/> <strong>8.54</strong> – по требованию члена УИК с ПСГ Щербакова М.С. в сводную таблицу заносятся уже известные данные о количестве избирателей и количестве бюллетеней. Сначала написали карандашом, потом все-таки уступили требованию и написали маркером.<br/> <strong>9.05</strong> – через 7 МИНУТ (!!!) после написания жалобы неизвестным избирателем на участок прибыл «ночной дозор»: председатель ТИК «Западное Дегунино» Каргин Николай Илларионович, вместе с секретарем ТИК Виноградовой Мариной Васильевной. Скорости, с которой члены ТИК отреагировали на жалобу избирателя, можно лишь позавидовать. Естественно, прибыв на участок, члены ТИК Каргин Н.И. и Виноградова М.В. потребовали от наблюдателей немедленно прекратить видеосъемку и не выходить из условно отведенной зоны для наблюдателей. При съемке действий членов ТИК (с 5.30 минуты видео) секретарь ТИК Виноградова М.В. включает «двуликого януса» и требует прекратить съемку, так как она помимо секретаря ТИК – общественного лица, еще является и избирателем, а, значит, может запрещать съемку. Полиция делает попытку убрать камеру, но при упоминании статьи 5 (а нужно было 6) Закона «О полиции», констебль отступает. На 8.15 минуте видео «двуликого януса» включает и председатель ТИК Каргин Н.И. (оказывается, он тоже избиратель, который пришел на УИК №337 не с проверкой, а проголосовать). На заднем фоне этого цирка Михаил Щербаков пытается убедить председателя ТИК Каргина Н.И. убрать пометки в списках избирателей и передвинуть кабины для голосования. Все тщетно!!!<br/>   В конце видеозаписи, председатель ТИК Каргин Н.И. дает несколько советов о том, как нужно обжаловать действия УИК № 337, а именно подать жалобу в ТИК «Западное Дегунино», где комиссия коллегиально рассмотрит эту жалобу немедленно и примет решение. Все бы хорошо, да только все наши 7 жалоб, поданные в ТИК 04 декабря 2011 года так и не были рассмотрены немедленно и даже в этот же день, в связи с тем, что не было кворума, члены ТИК были на избирательных участках по неким заявкам (как сантехники из ЖЭКа) и их прибытие до 20.00 04 декабря 2011 года в ТИК не планировалось. Допустим, что Председатель ТИК «Западное Дегунино» Каргин Н.И. об этом не знал и опрометчиво дал нам такой совет.<br/>   С 1.20 минуты видеозаписи председатель ТИК Каргин Н.И. предлагает председателю УИК №337 Москалевой Н.З. удалить с избирательного участка помимо наблюдателя от СМИ Поднебесникова Е.С. еще и члена УИК с ПСГ Щербакова М.С., что собственно говоря, не предусмотрено законом (возможно только отстранение от работы).<br/> <strong>9.36</strong> – Председатель УИК № 337 Москалева Н.З. предлагает члену УИК с ПСГ Щербакову М.С. ехать с переносной избирательной урной, угрожая, в случае отказа, удалением с участка. Несмотря на угрозы, отказываемся, решив, что на участке мы нужнее<br/> <strong>9.42</strong> – наблюдатель от «ЛДПР» Илья Чайка замечает первых карусельщиков, наблюдатель от СМИ Поднебесников Е.С. тщетно пытается задержать на УИК №338 девушку, которая ранее проголосовала на УИК №337<br/>   <strong>10.30</strong> – наблюдаем массовый приход молодых избирателей за столы №1 и №2 УИК № 337. Доходит до смешного, все столы свободны, кроме столов №1 и №2, туда люди выстраиваются в очередь, растягивающуюся через весь зал избирательного участка. Понимая умом, что здесь что-то не так, не можем ничего предпринять, так как к столам членов УИК наблюдателям приближаться строго настрого запрещено, сверить ФИО в паспорте со списком наблюдателей или регистрацию избирателя – не можем. Пишем жалобы в ТИК и взываем к чувству ответственности полицейского, чтобы он хотя бы проверил регистрацию у проголосовавших избирателей. Параллельно с этим, в кабинете председателя УИК №337 Москалевой Н.З. пишется решение об удалении наблюдателя от СМИ Поднебесникова Е.С. Процесс долгий, сопровождающийся постоянными звонками в ТИК.</p>\n<p>Мы решили поменять стратегия, сначала снимаем, как люди голосуют на УИК №337, а потом идем за ними на УИК №338. Результатом стало следующее:<br/> Вот мы видим, как сначала девушка в белой куртке голосует за столом №1 на УИК № 337 в 10.42<br/>   <br/>А потом, накинув на голову платок, голосует на УИК № 338 в 11.43, за что получает от бригадира «карусельщиков» бонус – пиццу из местного буфета<br/>   <br/><strong>11.00</strong> – поток откровенных «карусельщиков» становится плотным, решаем негласно провожать с видеокамерой всех подозрительных избирателей до выхода из школы. По крайней мере, нарушителям после голосования на УИК №337 приходится выходить на улицу, там ждать несколько минут и снова заходить на голосование в УИК №338. Начинаем периодический выходить на улицу и разгонять камерой ожидающих второго прихода «карусельщиков»<br/>   <br/><strong>11.20</strong> – Председатель УИК №337 Москалева Н.З. вручает наконец-то решение об удалении с избирательного участка наблюдателя от СМИ Поднебесникова Е.С. Обоснованием удаления служит то, что Поднебесников Е.С. снимал избирателей без их разрешения. Полицейский корректно дает собрать вещи и документы. Решаем переместить наблюдателя с УИК №337 на УИК №338, благо, что они рядом, и таким образом вести борьбу с «карусельщиками» на двух участках. Документы наблюдателя от СМИ позволяют находится на любом избирательном участке<br/> Решение УИК №337 об удалении наблюдателя и члена УИК.<br/>По поводу удаления наблюдателя от СМИ Поднебесникова Е.С. подаем соответствующую жалобу в ТИК: </p>\n<p><strong>11.30</strong> – прибыв на УИК №338, наблюдатель от СМИ Поднебесников Е.С. представил все необходимые документы, затребованные членами УИК №338. Председатель УИК №338 Аникина Л.И. объявляет о том, что никаких наблюдателей от СМИ она на участок не пустит. При требовании выдать официальный документ о недопущении наблюдателей от СМИ на участок председатель УИК №338 Аникина Л.И. устраивает голосование комиссии прямо на избирательном участке в присутствии избирателей. Итогом становится вынесение комиссией незаконного и немотивированного решения об удалении наблюдателя от СМИ с избирательного участка<br/>   <br/><strong>11.42</strong> – По распоряжению Председателя УИК №337 Москалевой Н.З. за каждым из оставшихся наблюдателей закреплен член УИК, который следит, чтобы наблюдатели не выходили из зоны, отведенной для наблюдателей, не снимали ничего на видеокамеру и мобильный телефон (одного из таких надзирателей видно на видео). Член УИК с ПСГ Щербаков М.С. на участке №337 пытается выйти за условную черту, члены УИК №337 совместно с полицейским не дают ему это сделать. Прорвав блокаду, Михаил подходит к столу №2 (член УИК Чернобровкина Г.Ю.), за который только что присела избиратель, пытается проверить регистрацию девушки и законность ее голосования на УИК №337. Член УИК Чернобровкина Г.Ю. захлопывает паспорт, данные которого только что записывала в список избирателей, отдает его избирателю и без выдачи бюллетеня для голосования просит избирателя поскорей уйти с избирательного участка. Щербаков М.С. пытается с помощью полицейского задержать девушку (позднее была выяснена ее фамилия – Своровацкая), но полицейский отказывается задерживать нарушителя, девушка скрывается. Одновременно с этим, Председатель УИК №337 Москалева Н.З. не дает наблюдателю от ЛДПР Чайке И. снимать данный инцидент<br/>   <br/>Девушка не успокоится на этой неудаче и придет на избирательный участок после 12-ти, когда на участке уже не будет камеры.<br/> Подаем жалобу в УИК:   <br/><strong>11.49</strong> – наблюдатель от СМИ Поднебесников Е.С. начинает отслеживать группы организованных наблюдателей, подвозимых на автомобилях. Действия одной из такой группы полностью заснято на видео. Вначале на видео отчетливо видно и слышно, как «бригадир группы» дает указания подчиненным – «Не тупим, заходим быстро голосуем, потом на другой…»<br/>   Заметив съемку, группа во главе с бригадиром пытается задержать наблюдателя и отнять у него камеру, но вовремя вызванная по рации помощь в виде других наблюдателей, позволяет спасти камеру. Полиция на все эти действия группы неустановленных лиц смотрит сквозь пальцы, когда нужно, отворачивается или поспешно отходит в другой конец избирательного участка. Одержана первая победа, группа решает не голосовать и уезжает в полном составе <br/> <strong>11.58</strong> – по цепочке с УИК №337 (сообщение по рации от наблюдателя Кульнева Р.В.) отслеживаем группу избирателей, которая проголосовав на УИК №337, сразу же перешла на УИК №338 и пытается проголосовать второй раз. На УИК №338 организованная группа, присев за столы №1 и №2, получает второй раз бюллетени для голосования. Наблюдатель от СМИ Поднебесников Е.С. пытается привлечь внимание других наблюдателей и сотрудника полиции к совершаемому преступлению. Одна из девушек организованной группы «карусельщиков», получив бюллетень для голосования и проголосовав в кабине для голосования, приближается к урне для голосования с целью бросить второй раз свой бюллетень. В это время Председатель УИК №338 Аникина Л.И. заметив, что ведется видеосъемка, подбегает к девушке, выхватывает у нее бюллетень и бросается на наблюдателя от СМИ Поднебесникова Е.С. с целью выхватить у него видеокамеру. Спасает полицейский, прикрепленный к избирательному участку, который прекращает потасовку.<br/>   <br/>Мы вызываем наряд полиции по телефону 02 (который так и не приехал), девушку оставляем на УИК №338 до прибытия полиции, Председатель УИК №338 Аникина Л.И. и секретарь комиссии Белоконная Г.П. удаляется в кабинет для написания решения об удаления с избирательного участка наблюдателя от СМИ<br/> <strong>12.06</strong> – понимая, что подозрительного избирателя ни в коем случае нельзя выпустить с УИК №338 до прибытия полиции, наблюдатель от СМИ Поднебесников Е.С. вместе с камерой и полицейским занимает позицию у выхода с избирательного участка. На участке появляется странная группа молодых людей в составе 4-х человек, которая, не успев зайти на избирательный участок, начинает возмущаться присутствием оператора, пытаются выхватить видеокамеру и вывести наблюдателя с избирательного участка. В это время приходят председатель УИК №338 Аникина Л.И. и секретарь УИК №338 Белоконная Г.П., которые, забалтывая наблюдателя, пытаются его блокировать. Увидев боковым зрением, что задержанная девушка пытается выйти с избирательного участка, наблюдатель поднимает камеру и пытается снять ее уход. И тут случается самое неожиданное: председатель УИК №338 и секретарь бросаются на наблюдателя от СМИ Поднебесникова Е.С. и пытаются отобрать у него камеру. Опять спасает полицейский, который оттесняет членов УИК от наблюдателя. Девушка, воспользовавшись потасовкой, убегает с избирательного участка. Наблюдателя от СМИ Поднебесникова Е.С. удаляют с избирательного участка №338 на основании решения УИК №338<br/>   <br/>В конце видео видны молодые люди, которым очень не хотелось, чтобы их снимали<br/> Решение УИК №338 об удалении наблюдателя от СМИ:<br/>  http://docs.google.com/viewer?a=v&pid=explorer&chrome=true&srcid=0B_QuY0spQbYAYmMwOTI4YWQtMDA4MC00MGYwLThjZDYtZmE0MzM2MDM4Mzdk&hl=en_US<br/> <strong>12.10</strong> – наблюдатель от СМИ Поднебесников Е.С. удален с УИК №337 и УИК №338, выведен сотрудниками полиции на улицу, без возможности взять с собой документы, свою сумку, ключи от автомобиля и самое главное – верхнюю одежду. На улице нулевая температура, идет мокрый снег с дождем. Полицейские не пускают его внутрь помещения школы-лицея №1594. Вещи и верхнюю одежду в итоге выносит другой наблюдатель <br/>   <br/>Начиная с этого времени, расстановка сил примерно такая: наблюдатель от СМИ Поднебесников Е.С., находясь на улице вблизи избирательных участков, с помощью видеокамеры пытается разогнать организованные группы «карусельщиков». Когда это не удается, он по рации сообщает приметы организованной группы избирателей наблюдателям, которые еще остались на УИК №337..Одновременно с этим сообщаем в штаб проекта «Гражданин наблюдатель» номера автомобилей, которые сплошным потоком подвозят избирателей. Голосование уже проходит не в два прихода на избирательный участок, а в три и более. Телефон штаба «Антикарусель», организованный Алексеем Навальным, выключился примерно к часу дня. Чувствуя свою беспомощность, запрашиваем подмогу из штаба «Гражданин наблюдатель», нам обещают прислать нового наблюдателя от СМИ<br/> <strong>12.22</strong> – на УИК №337 вновь появляется девушка по фамилии Своровацкая, которая пытается проголосовать уже в третий раз и опять за столом №2 (член УИК Чернобровкина Г.Ю.). Член УИК с ПСГ Щербаков М.С. второй раз пытается задержать девушку, подойдя к столу и попросив полицейского проверить паспортные данные и регистрацию. Член УИК Чернобровкина Г.Ю. спешно возвращает избирателю паспорт, и нарушитель, несмотря на протесты наблюдателей, покидает избирательный участок.<br/>   <br/>В связи с бездействием сотрудника полиции (присутствует на видео с 0.50 минуты) и членов УИК №337 во главе с председателем Москалевой Н.З. Щербаков М.С. по телефону 02 вызывает наряд полиции и пишет заявление о преступлении в ОВД «Западное Дегунино». Прибывший дознаватель из ОВД «Западное Дегунино» берет показания у члена УИК с ПСГ Щербакова М.С., наблюдателя от «ЛДПР» Чайки И., наблюдателя от СМИ Поднебесникова Е.С., знакомится с видеозаписью, зафиксировавшее нарушение <br/> <strong>12.50</strong> – продолжают прибывать «карусельщики», голосующие сначала на УИК №337, а потом на УИК №338. Между собой наблюдатели начали называть их «Тайными избирателями» (по аналогии с «Тайными покупателями»). Пообщавшись инкогнито с некоторыми участниками этого проекта, мы выяснили некоторые подробности. За голосование на одном участке платят от 800 до 1500 рублей. Для голосования «Тайному избирателю» необходимо получить у бригадира опознавательный знак, либо это специальная обложка паспорта в цвета Российского флага, либо это вложенный в паспорт билет на троллейбус/трамвай, либо вложенный в паспорт особый календарь. На самом избирательном участке необходимо подходить строго к столам №1 и №2, где члены УИК впишут паспортные данные «Тайного избирателя» в список избирателей, в графу избирателя, который обычно на выборы не ходит или по каким-то причинам голосовать не будет. Получив бюллетень, «Тайный избиратель» должен проголосовать за «Единую Россию» с последующим фотографированием результата или без оного (в зависимости от доверия бригадира). После голосования организованные группы избирателей в составе до 40 человек переходят на следующий избирательный участок. Одну из таких групп удалось снять на видео <br/>  </p>\n<p>На самом УИК №337 наблюдателей откровенно игнорируют, никаких действий по их жалобам не принимается. Жалобы в ТИК также не рассматриваются с мотивировкой, что нет кворума, сотрудники ТИК осуществляют проверку на избирательных участках. Телефон «горячей линии» ЦИКа все время занят. Понимая необходимость привлечь внимание к откровенным нарушениям на УИК №337, просим наблюдателей от «ЛДПР» и «КПРФ» срочно позвонить в их штабы и запросить дополнительные силы наблюдателей, либо иную другую помощь<br/> <strong>13.30</strong> – на избирательный участок приезжает помощь из штаба «Гражданин наблюдатель» – новый наблюдатель от СМИ Андрей (фамилию так и не успел узнать). Вручаем ему камеру и запускаем обратно на УИК №337 и УИК №338, процесс разгона «карусельщиков» становится эффективней. Приезжают два новых наблюдателя от «ЛДПР», вызванные наблюдателем Ильей Чайкой. На какой-то период времени устанавливается относительное спокойствие<br/> <strong>13.30</strong> – воспользовавшись численным преимуществом в наблюдателях, член УИК с ПСГ Щербаков М.С. проследил за одним из избирателей (по фамилии Беляков Валерий Александрович), который проголосовал на УИК №338, перешел на УИК №337 и решил проголосовать вновь. Получив избирательный бюллетень второй раз за столом №2 (член УИК Чернобровкина Г.Ю.), Беляков В.А. был задержан вместе с бюллетенем Михаилом Щербаковым. Причем, Михаил, понимая, что никто не будет ему помогать, включая полицейского и членов УИК, схватил Беликова и начал привлекать внимание наблюдателей и других избирателей. Полицейский был вынужден установить личность избирателя, после которой выяснилось, что Беляков В.А. зарегистрирован по другому адресу и голосовать на УИК №337 не имеет права. На каком основании его вписали в список избирателей и выдали бюллетень осталось неизвестным. Полицейский, присутствующий на УИК №337, отказывается составлять протокол и изымать бюллетень. Вызван наряд полиции по телефону 02, сообщено о происшествии Председателю УИК № 337:<br/> <br/> <strong>14.20</strong> – наряда полиции на УИК №337 до сих пор нет. Нарушитель Беляков В.А., все время делающий попытки скрыться, удерживается на участке исключительно силами наблюдателей от «ЛДПР» и Щербакова М.С., полицейский не вмешивается. Вместо полицейского наряда на участок приезжает начальник ОВД «Западное Дегунино» Лясковский Виталий Иванович и пытается убедить члена УИК с ПСГ Щербакова М.С. в том, что ему все показалось и никакого нарушения закона на УИК №337 не было<br/> АУДИОЗАПИСЬ:   <br/>Составляем заявление в полицию и пытаемся вручить его начальнику ОВД: </p>\n<p><br/> <strong>14.35</strong> – спустя 1 час 05 минут после вызова прибывает наряд полиции, который отказывается составлять протокол и изымать бюллетень. Вызывают дознавателя из ОВД «Западное Дегунино», который, оказывается и не уезжал с участка, а все это время находился на улице рядом со зданием школы. Дознаватель берет показания у пятерых свидетелей преступления и Председателя УИК № 337 Москалевой Н.З. На участок срочно прибывает секретарь ТИК района Западное Дегунино Виноградова Марина Васильевна, которая начинает объяснять полиции, что наблюдатели ведут себя отвратительно, а именно, снимают все на камеру.<br/>   <br/>Подаем жалобу председателю УИК №337, с требованием провести проверку голосования Белякова В.А., которые не имел права голосовать: <br/> <br/> <strong>15.15</strong> – на УИК №337 прибывает Заместитель председателя ТИК по району Западное Дегунино Семенова Татьяна Николаевна, которая надиктовывает Белякову В.А. объяснения для дознавателя (дознаватель в это время отсутствует в кабинете).<br/> АУДИОЗАПИСЬ:   <br/>Заместитель председателя ТИК района «Западное Дегунино» Семенова Т.Н. объявляет, что Беляков В.А. может идти домой, и уводит нарушителя с собой. Полицейский не вмешивается, мотивируя свое бездействие тем, что он на обеде<br/>    <br/>На входе на избирательный участок сталкиваемся с начальником ОВД «Западное Дегунино» Лясковским Виталием Ивановичем, требуем задержать нарушителя, на что Лясковский В.И. отвечает, что полицейские свою работу выполнили<br/>   <br/><strong>К 16.00</strong>, воспользовавшись большим числом наблюдателей (к этому времени, уезжает наблюдатель от СМИ Андрей, но помимо двух дополнительных наблюдателей от «ЛДПР» к нам присоединяются два дополнительных наблюдателя от «КПРФ»), полностью останавливаем поток «карусельщиков». Дополнительная помощь приходит оттуда, откуда ее не ждали. На участок с инспекцией приезжает депутат Государственной думы от ЛДПР Максим Станиславович Рохмистров. Депутат известен своим письмом в адрес Прокуратуры с просьбой проверить Ассоциацию «Голос» и проект «Гражданин наблюдатель» (http://www.kommersant.ru/doc/1827101). Тем не менее, мы натравливаем его на избирательную комиссию УИК №337, депутат кричит, угрожает уголовными наказаниями, позором и увольнениями членов УИК… Члены УИК выглядят вконец запуганными и неспособными на дальнейшие фальсификации. Рохмистров М.С. удовлетворенно покидает избирательный участок<br/> <strong>16.30</strong> – следом за Рохмистровым М.С. на УИК №337 прибывает тяжелая кавалерия противника в лице уже известных нам Председателя ТИК по району Западное Дегунино Каргина Николая Илларионовича вместе с секретарем ТИК Виноградовой Мариной Васильевной, на участок прибывает депутат Мосгордумы от «Единой России» Протопопов Игорь Серафимович (http://www.mos-partya.ru/deputies/id/43/), куча других неизвестных нам должностных лиц префектуры и управы. В листе должностных лиц, которые могут находиться на территории участка №337, указанных лиц нет<br/>   <br/>Ругаются на явку избирателей, но их приезд связан явно не с явкой избирателей, а с плохими результатами работы членов УИК №337 и УИК №338. Тот факт, что на участке до сих пор находится член УИК с ПСГ Щербаков М.С. и другие наблюдатели, явно раздражает депутата Протопопова И.С. Депутат звонит кому-то и просит прислать двух крепких полицейских, чтобы убрать с участка наблюдателей<br/>   <br/><strong>16.45</strong> – наблюдатели пытаются объяснить депутату Протопопову И.С. что на кчастках № 337 и № 338 работает группа «карусельщиков», которые голосуют по несколько раз, сначала на одном участке, потом на другом. Все изложенные факты игнорируются депутатом. Председатель ТИК района Западное Дегунино Каргин Н.И. считает, что наблюдатели присутствуют на избирательных участках исключительно для того чтобы устроить скандал, а не для того, чтобы наблюдать за выборами. Председатель ТИК района Западное Дегунино Каргин Н.И. дает незаконное распоряжение убрать члена УИК с ПСГ Щербакова М.С. с избирательного участка<br/> АУДИОЗАПИСЬ:   <br/>Члены УИК №337 под давлением делегации, возглавляемой депутатом Протопоповым И.С. принимают противозаконное решение об удалении члена УИК с ПСГ Щербакова М.С. с избирательного участка. По закону члена УИК с ПСГ могут только отстранить от работы, но не имеют право удалять с участка. Полиция слушается председателя ТИК и депутата, выводит с участка Щербакова М.С.. Подали жалобу в ТИК, естественно никто рассматривать ее не стал, в связи с отсутствием кворума. Депутат удовлетворен решением комиссии и выражает мнение, что наблюдателей и не нужно пускать дальше порога избирательного участка<br/>   <br/><strong>17.00</strong> – депутат Протопопов И.С. покидает избирательный участок, следом за ним уезжают дополнительные наблюдатели от «ЛДПР» и «КПРФ». Спустя какое-то время поток «карусельщиков» возобновляется, хотя уже и не в таких промышленных масштабах. Помешать им уже никто не может, оставшимся на участке наблюдателям, по совету штаба, мы сказали не скандалить и не провоцировать членов УИК на удаление с участка. Нам необходимо получить итоговый протокол голосования на участке, а для этого требуется нахождение наблюдателя на участке в момент подсчета голосов<br/> <strong>20.00</strong> – избирательный участок закрывается. Вскрывают урны, начинают подсчет. При вскрытии избирательных урн стало видно, что наблюдатели не справились с задачей: сразу же обнаружены вброшенные бюллетени – несколько (примерно 6-8) плотно свернутых пачек бюллетеней (в каждой примерно 5-7 бюллетеней). Сложенные вместе пачки бюллетеней шустро потрошат члены УИК. Технология подведения результатов выборов на участке сразу же нарушается. Подсчет голосов не делится на этапы. Нет данных по оставшимся после голосования неиспользованным бюллетеням. Комиссия в составе Председателя, заместителя и секретаря закрываются в отдельном кабинете на 40 минут с оставшимися бюллетенями, что-то химичат, сводили, по всей видимости, цифры. Неиспользованные погашенные бюллетени открыто и гласно не подсчитывались, а были сложены в стопки и помещены в мешки. При подсчете после получения каждого значимого результата полученные результаты не оглашались и не вносились в увеличенные формы Протоколов. Данные по каждой книге списка избирателей не оглашались, равно как и суммарные данные по всему списку. Производился одновременный подсчет избирательных бюллетеней из разных рассортированных пачек. Без пересчета и оглашения исправлялись увеличенные формы Протоколов. Поданные в УИК №337 11 жалоб рассматривать не стали.<br/> <strong>22.30</strong> – подсчет закончен, результат не понятный, вроде как и победу «врагу» не отдали и в тоже время не победили. В принципе можно выдавать протокол, но председатель УИК Москалева Н.З. звонит в ТИК, а там высказывают недовольство полученными после подсчета голосов результатами. Уж слишком сильно отличаются результаты некоторых партий на нашем и соседнем участках от их результатов  в среднем по району. Начинается игра на выживание с 22.30 до 2 часов ночи мы не можем получить итоговый протокол. Сначала Председатель Москалева Н.З. предлагает наблюдателю Кульневу Р.В. получить протокол, заверенный не по форме, потом выдает протокол без времени составления, мотивируя тем, что в окончательной форме протокол будет выдан только после сверки всех данных с Территориальной избирательной комиссией. Настоятельно требуем выдать протокол, в противном случае угрожаем подать жалобу в ТИК. Безрезультатно. Отправляемся в ТИК района Западное Дегунино, где пытаемся подать жалобу на действия председателя УИК № 337. Кворум в ТИКе наконец-то есть, но Секретарь ТИК района Западное Дегунино Виноградова Марина Васильевна в грубой форме просит покинуть помещение ТИК и рассматривать жалобу отказывается<br/>   <br/><strong>00.20</strong> – на УИК № 338 наконец-то выданы протоколы, на УИК № 337 протоколов до сих пор нет. Члены УИК начинают потихонечку собираться домой, бюллетени упаковывают и начинают выносить на первый этаж здания<br/> <strong>02.10</strong> – только после вызова по телефону 02 наряда полиции и написания заявления в полицию по факту сокрытия и невыдачи копии итогового протокола на УИК № 337 Председатель Москалева Н.З. выдала копию протокола наблюдателю Кульневу Р.В.<br/> <br/> <strong>Заключение</strong><br/> Увиденное мною и моими коллегами 04 декабря 2011 года в день голосования на избирательных участках № 337 и № 338 дает мне основания предполагать, что я был свидетелем уголовного преступления, связанного с фальсификацией итогов голосования, совершавшегося с участием нескольких лиц.<br/> По факту грубого нарушения избирательного законодательства в настоящее время в Тимирязевской районной прокуратуре г.Москвы и ОВД «Западное Дегунино» проходит доследственная проверка по двум заявлениям наблюдателей, у наблюдателей изъяты видео и аудио материалы (приобщены к заявлениям), доказывающие факт совершения преступления.<br/> Наблюдателями подготовлен и подан в Тимирязевский районный суд города Москвы совместный иск о признании незаконными действий членов комиссий УИК № 337 и УИК № 338.<br/> <br/> <strong>ЮРИДИЧЕСКАЯ ИНФОРМАЦИЯ</strong><br/> Настоящий отчет является одновременно заявлением в полицию, с изложенными фактами нарушения избирательного законодательства. Любая информация, изложенная в настоящем отчете, может служить основанием для возбуждения дела об административном правонарушении и/или уголовного дела в отношении любых фигурантов, упомянутых в тексте. Я, Поднебесников Евгений Сергеевич, даю свое согласие на использование настоящего материала (текста, аудиоматериалов, видеоматериалов) в качестве доказательной базы при рассмотрении вопроса о возбуждении указанных дел. Изложенные факты, могут быть подтверждены наблюдателями Избирательного участка № 337: Щербаков М.С. (член УИК №337 с ПСГ от партии «Яблоко»), Кульнев Р.В. (наблюдатель от партии «Яблоко»), Чайка И. (наблюдатель от партии «ЛДПР»). При необходимости готов дать дополнительные письменные объяснения.</p>\n<p> </p>','otchet-nablyudatelya-duma-uik-337-i-uik-338/'),(358,'некорректная работа УИК','','','',''),(382,'значительные нарушения','Павел Ярилин','Многочисленные вбросы, попытка подкупа наблюдателей, вмешательство полиции, задержание одного из вбрасывающих, потасовка, наблюдатель покусан представительницей от ЕР, силой выведен с участка неизвестными лицами, удаление представителя СМИ','<p>Ниже отчет от имени жены, работавшей журналисткой.</p>\n<p>7.30. избирательный участок № 382. От «Гражданина наблюдателя» нас трое: наблюдатель от партии «Яблока», член комиссии с совещательным голосом, корреспондент «Новой газеты». На участке с виду все благополучно. Книги прошиты, цветы расставлены, члены комиссии сдержано отвечают на вопросы. Мы знакомимся, стараемся произвести приятное впечатление. С нами на участке находятся два наблюдателя от КПРФ и два от Единой России. Вести фото- и видео съемку открыто очень трудно: это вызывает много возражений и эмоций.<br/> Я нахожусь вместе с камерой между урнами и столами регистрации, веду подсчет голосующих. Председатель комиссии Пуговкин В.Н. пытается выяснить у меня цель нашего наблюдательства. На ответ, что мы хотим получить чистый результат голосования и препятствовать вбросам бюллетеней, не допустить голосования за других лиц, - Пуговкин В.Н. с улыбкой говорит, что это бессмысленно, т.к. Чуров все подправит и дорисует, как надо. На вопрос – считает ли он это справедливым, Владимир Николаевич отвечает, что он вообще хочет уехать из России и здесь нормальные люди жить не могут.</p>\n<p>В этот момент (10.30 утра) происходит первый вброс. Пачку бюллетеней опустила в урну женщина. Наблюдатель от «Яблока» заметил это и, рванув через все помещение, успел только к моменту, когда бюллетени оказались уже внутри. Активистка «Единой России» закатывает истерику по поводу того, что наблюдатель сшиб невинную женщину и обвиняет ее в преступлении. Председатель комиссии разгоняет всю сбежавшуюся толпу, запрещает приближаться к урнам и не дает задержать вбросившую женщину.<br/> В этот момент поднимается всеобщий шум: наблюдателей отправляют в дальнюю часть комнаты, в помещении появляются люди, которые, не представившись, дают указания членам комиссии, наблюдателям.<br/> Проницательный председатель комиссии в это же время находит в кабинке для голосования газету «Яблоко» (которую забыла пожилая женщина незадолго до этого) и громко заявляет, что это незаконная агитация наблюдателя – угадайте от какой партии…  Начинают составлять акт об удалении нас с участка.<br/> Странным образом эта тема затухает, и мы остаемся на участке.<br/> Пока мы занимаемся с наблюдателями жалобой избирателя, касающейся голосования на дому, неизвестный мужчина выполняет второй вброс. На мой крик опять поднимается волна возмущения, мужчина быстро скрывается, нас обвиняют в нарушении порядка. Пока я пишу жалобу, еще один мужчина вбрасывает бюллетени. Я успеваю схватить его за руки, но в этот момент председатель комиссии подлетает, отрывает меня него. Наблюдатель от ЕР устраивает очередную истерику, утверждая, что этот мужчина невиновен. Наш наблюдатель успевает заснять спину уходящего нарушителя и пытается узнать у работников полиции, дежуривших на участке, почему те бездействуют. В ответ – не имеем права задерживать. Написав пачку жалоб и требований опечатать урну, мы заняли более эффективные боевые позиции и приготовились к следующим ударам. Странное дело, но в течение следующих 5 часов ничего не происходило на участке, за исключением постоянного присутствия неизвестных людей, отказывавшихся представляться (вроде бы дружинники, вроде бы полиция, вроде бы прокуратура) – все было спокойно. Некоторые неизвестные люди пытались предложить материальную помощь и верную дружбу наблюдателям, но были огорчены и, видимо, удивлены отказом.<br/> К 19.00 председатель стал говорить о том, что мне как корреспонденту нужно покинуть участок во время подсчета голосов. Открытый на нужной странице закон не производил никакого впечатления. Приехали представители прокуратуры и стали выяснять какие-то факты правонарушения. Наши попытки поговорить с прокурором, он вежливо прекращал и говорил, что сам к нам обратится позже.<br/> Вдруг из бездонных недр коридора, появляются двое из ОВД и предлагают нам проехаться в участок, т.к. в 02 поступила жалоба на хулиганство наблюдателей на 382 участке. Нам предстоит дать объяснения в участке, а после этого мы при большом желании можем вернуться. Во время разговора происходит задержание другими наблюдателями мужчины во время вброса бюллетеней. Количество сотрудников правопорядка на участке, видимо, было критическим, отворачиваться просто было некуда – пришлось нашим полицейским из ОВД вместо нас увезти задержанного.<br/> В коридоре среди полиции и прокуратуры проходили совещания на тему: «нам же было сказано не влезать», «этих бы наблюдателей за слишком внимательное наблюдательство в участок». Но, видимо, начальство имело претензии к младшим чинам за бездействие (вот только не понятно было в отношении чего), поэтому полицейские предложили нам дать объяснение прямо здесь, без заезда в участок, но с условием, что мы напишем об отсутствии претензий к представителям правоохранительных органов.<br/> В момент дачи объяснений, с поличным, с бюллетенями в руках был пойман еще один мужчина. Нашего наблюдателя, крепко схватившего нарушителя, также крепко покусала (!!!) активистка ЕР, пытаясь освободить задержанного мужчину и заявляя, что сейчас за ней приедет скорая. Мы практически силой заставили полицию забрать мужчину. Это все было НА ГЛАЗАХ у прокуратуры! На вопросы «ПОЧЕМУ ТАК?» прокурорский работник ответил, что они тоже хотят все по закону. Дружинники шипели, что мы устраиваем цирк. Полиция шепотом переговаривалась между собой, что нужно камеры везде ставить. Наши объяснения забрали и вместе с задержанным уехали.<br/> Голосование было закончено, наступило 8 часов. После долгих разбирательств и изучения законов, меня, как корреспондента, все-таки выдворили, но удалось оставить камеру нашему наблюдателю. Еще 2 часа после закрытия голосования ждали, когда принесут третью выносную урну, когда приедут члены ТИК.<br/> Все случилось. Но подсчет не начался. Члены комиссии пытались отдохнуть в закрытой комнате с регистрационными книгами, председатель ТИК в это время пытался вести душевно-человеческий разговор с нашим наблюдателем, что нужно бы всем как-то подружиться, у всех дети, внуки, всем противно, но уголовная ответственность очень неприятна и неполезна для здоровья. Давай закроем тебе глазки на пару минут, а за это как-нибудь тебе в жизни поможем. Наблюдатель, цитируя классиков – со щитом или на щите – отказался от сотрудничества и вынудил вынести книги учета из каморки.<br/> В этот момент закрытая дверь участка распахивается, и заходят трое крепких мужчин кавказской внешности во главе с дамой (по слухам, из Управы). Подходят к наблюдателю, уточняют, Павел ли он. Получив утвердительный ответ, втроем хватают его под руки и выносят из помещения на улицу, несмотря на громкие возражения наблюдателя. За ними в холл выскакивают председатель ТИК, вся полиция, дружинники, но остановить ребят не пытаются. На улице эти же неизвестные перегораживают вход в здание и отказываются отвечать на вопросы, помаячив неочевидным удостоверением ФСБ. В это время я вызываю наряд полиции, а высшие чины этой самой полиции стоят рядом и тихо нецензурно удивляются происходящему. Председатель ТИК и лейтенант полиции все-таки вышли на улицу (видимо случилась внезапная судорога совести). Милейший председатель признался в своей трусости и неспособности противостоять этому беспределу и выразил свое удивление по поводу принципиальности наблюдателя. Сказал, что ОБЫЧНО НАБЛЮДАТЕЛИ ПРИХОДЯТ ЗАРАБАТЫВАТЬ ДЕНЬГИ на выборы. Оказывается, в зависимости от момента окончания принципиальности можно заработать на отдых от исполнения гражданского долга в трех- или пятизвездочном отеле.<br/> На улице было холодно, а наблюдатель – мой муж. Поэтому я отправилась в участок за верхней одеждой, где полным ходом происходил подсчет (!!!) голосов всеми членами комиссии сразу с абсолютно блаженными лицами. Когда председатель Пуговкин В.Н. понял, что я разобью дверь, если мне не откроют, он передал пальто и помахал ручкой. К тому моменту как я вышла на улицу, неизвестные стали уходить с крыльца, а вдалеке показалась машина ОВД. Председатель ТИК продолжал извиняться. Приехавшая полиция после небольшого колебания предложила поймать этих ребят и поехать в ОВД писать заявление. Мы ехали за ними на своей машине. К огромному удивлению через двести метров мы действительно увидели, что полицейским удалось задержать двоих, которые непосредственно участвовали в транспортировке наблюдателя. Их посадили в машину полиции и сказали нам следовать за ними в ОВД. И тут выяснилось, что между нами пытается вклиниться темная машина, остановить нас и отбить от полиции. Вот тут уже стало совсем страшно. К счастью, муж у меня машину водит хорошо и вообще способен к агрессивной езде. Поэтому удалось зацепиться за машину полиции и уйти от аварии. Приехав в ОВД Левобережного района, мы дали объяснения начальнику ОВД, следователю. Все сотрудники были озадачены и удивлены происходящим. Большую часть из них мы уже видели на участке. Здесь они разговорились и сказали, что сами голосовать не ходят, что все это бред и неправда. Сами сделать они ничего не могут, права не имеют и вообще. Но, да, конечно, если все будут молчать, то ничего не изменится. Что делать с нашим заявлением, они не очень понимают, состава вроде как не видят, но обязательно передадут дело в прокуратуру, а там «дагеров не любят, так что у вас хорошие шансы на успех». Мальчиков наших тоже измерили и описали, документов не нашли никаких, задержат на 3 часа, потом отпустят. На вопрос про задержанных с бюллетенями ответили, что все в порядке – «завтра дело передается в мировой суд». Нас немножко поторопили – за дверью ждала бабушка, у которой украли собачку. Поэтому мы выдохнули и поехали домой. Нам позвонил наш третий товарищ, который остался на участке. Сказал, что считать вообще ничего не стали, оттеснили наблюдателей в угол, упаковали бюллетени, написали свои данные и все быстро кончилось.<br/> Может быть наш Пуговкин – это Чуров?<br/> <br/> <br/> Небольшая иллюстрация тут.<br/>  http://hifm.livejournal.com/5489.html <br/> <br/> <br/> С уважением,<br/> Павел Ярилин</p>','otchet-nablyudatelya-duma-uik-382/'),(395,'','','','',''),(396,'значительные нарушения','Илья Шатин','Вброс, невыдача копий протоколов','<p><strong> </strong>Началась наша работа с того, что меня и моего коллегу, которые работали по направлению от СМИ, не хотели пускать на участок до начала голосования. Этому попытался воспрепятствовать сотрудник полиции (старший лейтенант), который на протяжении всего дня занимался охраной общественного \"порядка\" на участке. Однако нам с коллегой удалось убедить полицейского и председателя УИК в том, что мы имеем право присутствовать на участке и видеть процесс опечатки урн для голосования, а также заслушать информацию о количестве полученных УИК бюллетеней в ТИКе. В процессе опечатки урн и проверки списков избирателей (которую осуществлял наш коллега) нарушений зафиксировано не было.</p>\n<p>Относительно данных: Количество членов УИК с правом решающего и совещательного голоса: 15<br/>Председатель УИК: Авербух Анатолий Витальевич - зам. главы управы Савеловского р-на г. Москвы<br/>Зам.пред. УИК: Берникова Галина Александровна<br/>Секретарь УИК: Глушкова Наталья Николаевна - заместитель директора по воспитательной работе СОШ №221 г. Москвы (где проводилось голосование и располагалась УИК 396)</p>\n<p>Я имею основания полагать, что данные граждане, способствуя фальсификации результатов голосования и не соблюдая предусмотренный законом порядок проведения голосования, допустили грубые нарушения Закона о выборах, административного и уголовного кодексов РФ.</p>\n<p>Установленное ТИКом кол-во ящиков: 2 стационарных - 3 переносных.<br/>Количество бюллетеней полученных УИК: <strong>2100<br/></strong>Количество избирателей в списке на начало голосования - <strong>2383</strong> человека.<br/>На протяжении всего процесса голосования с 08.00 утра до 20.00 вечера мы вели подсчет выданных гражданам бюллетеней. По нашим подсчетам их количество - <strong>1050-1070 штук</strong>.<br/>По итогам голосования количество неиспользованных бюллетеней по подсчетам УИК составило <strong>214</strong>, а количество выданных и участвовавших в голосовании - <strong>1886</strong>.</p>\n<p>Необходимо отдельно отметить, что на протяжении всего процесса голосования заместитель председателя УИК отсутствовала в помещении для голосования. Она появилась в нем только в 19.20-19.30. А сразу после завершения голосования на основании письменного заявления попросила нас покинуть состав комиссии и избирательный участок. По нашим предположениям она могла находиться в одном из помещений школы, которые должны были быть опечатаны. Мы заметили, что члены УИК голосовали по открепительным удостоверениям именно после того, как покидали его для завтрака, обеда или ужина. Именно поэтому у нас есть основания полагать, что заместитель председателя комиссии выдавала пачки бюллетеней для их последующего вброса членами УИК. Мы предполагаем, что такая схема вполне могла быть реализована.</p>\n<p>Необходимо также отметить, что урны для голосования располагались таким образом, что их невозможно было видеть с позиций, предоставленных для наблюдателей, так как их загораживали кабины для тайного голосования.</p>\n<p>В районе 13 часов в помещении УИК появились 2 молодых человека (вроде бы с открепительными удостоверениями), которые прямиком отправились к секретарю УИК и написали жалобу на присутствие в помещении УИК журналистов, копии жалоб я прилагаю к данному письму. Причем на основании этих жалоб комиссия собиралась принять решение о том, чтобы сделать журналистам предписание, чтобы они не препятствовали свободному волеизъявлению граждан. Воспользовавшись этим инцидентом, отвлекая наше внимание и заставляя переместиться с более удобных точек наблюдения, комиссия создала возможность организовать массовый незаконный вброс бюллетеней.</p>\n<p>Комиссия неоднократно пыталась вывести наблюдателей из помещения для голосования (пользуясь различными предлогами), отвлекала разговорами и пр.</p>\n<p>После окончания голосования. Работа комиссии по подсчету данных по спискам избирателей составила более 2 с половиной часов!!! Сразу после этого этапа книги избирателей были упакованы без возможности для наблюдателей посмотреть данные в них. При наших попытках фиксировать процесс работы по спискам избирателей члены комиссии выказывали активное недовольство, пытались вынести на голосование вопрос о нашем удалении с участка. Ссылались на текст письма, копию которого прилагаю к отчету.</p>\n<p>Процесс выемки бюллетеней из ящиков для голосования также был проведен с грубейшими нарушениями. Председатель вынимал бюллетени руками, разбивая пачки вброшенных бюллетеней. Затем при сортировке бюллетеней происходило то же самое. При наших попытках снимать на камеру сотрудник председатель комиссии также пытался удалить нас с участка.</p>\n<p>В дальнейшем у нас была возможность только писать жалобы, но даже при этом контрольные соотношения по бюллетеням не сходились у УИК. Вброс был больше, чем зафиксированная нами разница в 800 бюллетеней. Поэтому комиссия уехала в ТИК (НЕ ВЫДАВ НАБЛЮДАТЕЛЯМ И ЖУРНАЛИСТАМ КОПИЮ ПРОТОКОЛА С ПОДПИСЯМИ И ПЕЧАТЯМИ!!) и оставалась там более 1.5 часов.</p>\n<p>По возвращении нам выдали бумажку \"ГАС выборы\", цифры которой соответствовали липовым цифрам протокола с сошедшимися контрольными соотношениями. Но члены комиссии отказались подписывать эту бумагу и ставить на нее печать, сославшись на то, что печать у них уже отобрана в ТИКе.</p>\n<p>К сожалению, времени было уже 3:30 минут и мы были слишком измождены, чтобы вызывать наряд полиции. </p>\n<p> </p>','otchet-nablyudatelej-duma-uik-396/'),(411,'','','','',''),(425,'нарушений не выявлено','','','',''),(446,'','','','',''),(467,'','','','',''),(485,'','','','',''),(505,'некорректная работа УИК','','','',''),(519,'','','','',''),(544,'некорректная работа УИК','','','',''),(569,'нарушений не выявлено','','','',''),(587,'нарушений не выявлено','','','',''),(604,'нарушений не выявлено','','','',''),(627,'','','','',''),(649,'','','','',''),(657,'нарушений не выявлено','','','',''),(673,'','','','',''),(689,'','','','',''),(714,'','','','',''),(739,'нарушений не выявлено','','','',''),(750,'нарушений не выявлено','','','',''),(764,'некорректная работа УИК','Северное Медведково Сергей Попов','Чисто?','<p>К открытию участка я малость опоздал - участок находился довольно далеко от метро, в дворах, яндекс карты показывали неверное местоположение (надо сказать, что и интернет в целом работал очень плохо в этот день - отваливался, твиты отправлялись с третьего-пятого раза). В результате прибытие на участок в 7-45, как раз опечатывали урны. Я успел убедиться в том, что они пусты, двойного дна в них нет и т.п.  Хочу отметить, что урны были высокого качества: пластиковые, полупрозрачные, с о-о-очень узкой щелью - порой избиратели стояли возле урны по полминуты, пытаясь засунуть бюллетень внутрь. Вброс пачками был таким образом исключен.</p>\n<p>У меня был косяк с документами - в редакционном удостоверении (я был внештатным корреспондентом газеты \"Троицкий Вариант\", г. Троицк) ошиблись с отчеством: вместо \"Алексеевич\" было \"Николаевич\". Косяк был не редакции \"Трованта\", а ГОЛОСа, ибо по их спискам я тоже числился Николаевичем. Ну да и черт с ним, я аккуратно зачеркнул Николаевича маркером, и вписал Алексеевича ручкой. Никто - ни полиция, ни члены комиссии - вопросов не задавал, и это ободрило меня с самого начала.<br/> <br/> Я зарегистрировался как представитель СМИ, меня внесли во все необходимые списки, взяли контакты. Я расчехлил фотоаппарат, нацепил на него вспышку, чтобы и правда выглядеть как корреспондент, и пошел голосовать по своему открепительному. По пути ознакомился со списками избирателей, нарушений выявлено не было.<br/> <br/> Чеклист (где все было расписано по этапам и шагам) от ГОЛОСа я не стал заполнять сознательно - это мои первые выборы, я хотел разобраться, как это все работает, и сосредоточился на подсчете опускаемых бюллетеней в урны (об этом ниже).<br/> <br/> Осмотрев участок, я выявил несколько незначительных нарушений - отсутствие информации о партиях (кроме скромной 7-страничной книжечки со списками кандидатов от каждой партии под большим логотипом) и отсутствие информации об имуществе кандидатов от партий. Не было видно и сводного плаката с информацией о партиях-кандидатах.<br/> <br/> Также были претензии по тайне голосования. Кабинок было всего 4, они были хорошие, освещенные, с ручками (не карандашами); альтернатива была предложена в виде парт, которые стояли прямо напротив скамеек для наблюдателей - при желании можно было видеть, кто за кого голосует.<br/> <br/> Количество человек, находящихся в списках избирателей на момент голосования - 2887.<br/> <br/> В 8-22 я начал осуществлять подсчет опускаемых в урны бюллетеней с места, отведенного для наблюдателя. По субъективному впечатлению, до этого времени проголосовало не больше 15-20 человек. Через какое-то время поток избирателей усилился, и подсчет опускаемых бюллетеней с места стал невозможен. Я передислоцировался поближе: встал около урн на расстоянии примерно 2 метра, откуда урны были видны без проблем. Через пару часов я устал стоять, взял стул и сел непосредственно перед урнами. Просидев там два часа, получил замечание от председателя комиссии, что, дескать, я нарушаю тайну голосования и, плюс, сижу не в отведенном для наблюдателей месте. Я не согласился в устной форме, но передвинул стул на предыдущее место, дабы не провоцировать конфликт на пустом месте - обзор и там, и там был одинаково хорошим, я видел количество опускаемых каждым человеком бюллетеней очень хорошо. Некоторые люди опускали по два бюллетеня, но, как выяснялось, это были супруги, один из которых ленился опускать бюллетень самостоятельно. От урн я отходил всего один раз - в туалет, просил фиксировать количество избирателей наблюдателя от КПРФ, поэтому погрешность подсчетов должна быть минимальна. Таблица почасового потока избирателей прилагается. </p>\n<p>8-22 = 24<br/> 9-00 = 54<br/> 10-00 = 117<br/> 11-00 = 137<br/> 12-00 = 208<br/> 13-00 = 164<br/> 14-00 = 148<br/> 15-00 = 130<br/> 16-00 = 70<br/> 17-00 = 66<br/> 18-00 = 58<br/> 19-00 = 52<br/> 20-00 = Три человека пытались проголосовать, т.к. участок закрыт не был, но им отказали.<br/></p>\n<p>Итого, по моему субъективному подсчету, 1228 человек проголосовало. Погрешность оцениваю максимум в 40-50 человек вместе с теми, кого я не учел до 8-22. </p>\n<p>Группа выездного голосования выезжала 4 раза (урны было всего три, правда), нарушений по ее работе не выявлено. Заявления принимались до 14-00, попытки подать заявления после этого времени не имели успеха.<br/><br/><strong>Происшествия. </strong><br/><br/>В школе было три участка - один на первом этаже, два других - на втором этаже. Два раза (с 9-00 до 10-00) совсем немощные бабули (одной было 94 года!) и слепой дедуля (с 10-00 до 11-00) физически не могли подняться на второй этаж, и им приносили списки избирателей, вносили туда их данные, выдавали бюллетень, они голосовали (все три раза за Единую Россию, надо сказать - об этом они просто объявляли во всеуслышание), бюллетень забирали и опускали на втором этаже члены комиссии. Все описанные действия проходили в сопровождении наблюдателей от Единой России и КПРФ, и считать эти происшествия серьезными нарушениями вряд ли возможно. <br/><br/>В период с 11-00 до 12-00 ко мне обратилась женщина. Она с семьей прописана в снесенном доме, и им якобы отказывали в голосовании по причине отсутствия дома (при этом в избирательном списке они были). Я предложил ей обратиться к председателю комиссии, но она была на взводе, махала руками и меня вообще не слушала. Она пообещала вернуться с представителями управы и убежала. Через два часа, в период с 13-00 до 14-00, она вернулась одна, я ей все еще раз объяснил, она обратилась к председателю, он внес ее с семьей в дополнительный список, и они проголосовали. <br/><br/>В период с 12-00 до 13-00 поступило сообщение, что к избирательному участку пришла немощная бабуля, не смогла подняться по ступенькам школы и ушла в слезах, ей никто не помог. Впоследствии она вернулась, подняться ей помогли полицейские. <br/><br/>В период с 14-00 до 15-00 одна бабуля пыталась проголосовать без паспорта, ей правомерно отказали и отправили домой за паспортом. <br/><br/>В период с 15-00 до 16-00 мне предложили отойти от урн, сославшись на то, что я нарушаю тайну голосования и сижу в неположенном месте. Я объяснил, что тайну голосования я не нарушаю, т.к. считаю только количество опущенных в урну бюллетеней, а как представитель прессы, могу находиться в любом месте избирательного участка. Но, чтобы не провоцировать конфликт, пересел чуть дальше. <br/><br/>В период с 16-00 до 17-00 председатель заявил, что наблюдатель ему мешает работать - тем, что постоянно спрашивает различные документы и тем самым отвлекает его от работы. Наблюдатель написал жалобу. В этот же период времени поступило сообщение от избирателя, что за него кто-то расписался и проголосовал. Впоследствии выяснилось, что это произошло по ошибке члена комиссии. Был составлен акт. <br/><br/>Под закрытие участка пришел парень из Питера, который вечером 31-го числа писал заявление, комиссия не собралась, в голосовании ему отказали, т.к. в списки его никто не вносил. <br/><br/>Как только он ушел, один из последних избирателей обозвал наблюдателя от Единой России \"жуликом и вором\" и даже хотел его побить, разнимала полиция. <br/><br/>Сразу после этого к наблюдателю от Яблока подошел полицейский и сказал \"Сейчас может какая-нибудь движуха начаться, не отходи от урн\". Я последовал примеру и тоже не отходил от урн. <br/><br/>После закрытия участка зашло еще три человека (участок был закрыт на ключ только около 21-00), в голосовании им было отказано. <br/><br/><strong>Подсчет</strong> <br/><br/>Списки избирателей разброшюрованы и убраны по требованию наблюдателя от Яблока. <br/>Наблюдатели от Единой России уехали сразу после окончания голосования. <br/>Количество проголосовавших вне участка - 37.<br/>Количество неиспользованных бюллетеней - 1034. Погашены, составлен акт. <br/>Количество утерянных бюллетеней - 4. Составлен акт. <br/>Сортировка бюллетеней проходила групповым методом. На предложение наблюдателя делать все по закону секретарь сказала \"ну вы видите, что комиссия чисто работает, до утра так будем сидеть\". Однако надо сказать, что члены комиссии честно пытались не объявлять партии одновременно. Пять наблюдателей (от Справедливой России - 2, от КПРФ - 1, от Яблоко - 1, от СМИ – 1), следили за сортировкой, вброс был невозможен. <br/><br/>Подсчет проводился по закону - один человек перекладывает из одной пачки в другую и считает вслух. Пачки разбивались по 50 штук для удобства. <br/><br/>Недействительные бюллетени - 19<br/>Унесли - 1<br/><br/>Правое Дело - 17<br/>Патриоты России - 27<br/>КПРФ - 333<br/>Яблоко - 147<br/>ЛДПР - 226<br/>Справедливая Россия - 216<br/>ЕР - 380         <br/>Итого - 1365 избирателей пришло на участок по количеству бюллетеней и по спискам. <br/><br/>И вот тут вопрос - куда делось еще 137. Ладно, 37 - погрешность, даже пусть 50 - погрешность. Но остается еще куча... Когда я обсуждал это с наблюдателем от КПРФ, которая тоже вела подсчет и у которой тоже были расхождения, она сказала, что когда проголосовал первый избиратель, и председатель комиссии громко объявил \"Ура товарищи, у нас есть первый избиратель\", секретарь пробормотала \"ага, сто первый\", и наблюдатель это явно услышала. <br/><br/>Итак, каким-то образом все же был произведен вброс, полагаю, путем махинаций со списками. Пачек не было 100%. Однако отследить это нам не удалось, видимо, комиссия была очень осторожна. <br/><br/>Копии протокола я не стал дожидаться, ибо было уже поздно, я не успевал домой. Оставались представители КПРФ и Яблока, я решил, что двух одинаковых копий ГОЛОСу вполне хватит. <br/><br/>В целом могу сказать, что участок был довольно чистый, председатель почти всегда (кроме одного случая, описанного выше) адекватно реагировал на предложения действовать по закону. И хотя количество подсчитанных мной бюллетеней не совпадает с фактическим, судя по увиденному, результаты близки к реальным - за ЕдРо голосовало действительно очень много народу. Если вброс и был (а он, судя по всему, был), то производился он аккуратно и осторожно. В целом результатами по своему участку я доволен. Жаль только, что фальсификации по регионам не позволили ЕдРу набрать свои 30% и успокоиться. Ждем следующих выборов : ))</p>','otchet-nablyudatelya-duma-uik-764/'),(789,'нарушений не выявлено','Мария Хиедори','Чисто','<p><strong>Отчет о ходе голосования на участке  СВАО</strong></p>\n<p>Я получила направление наблюдателя от партии «Яблоко».   </p>\n<p><strong>03.12.2011 </strong></p>\n<p>Избирательный участок был расположен в рекреации второго этажа общеобразовательной школы. Помимо моей  УИК, в здании находились еще 2. Представившись комиссии наблюдателем от партии «Яблоко» и сообщив о своем желании присутствовать на участке во время завтрашнего голосования, я получила ответ о том, что наблюдатель от «Яблока» уже есть, и предложение обратиться в другую УИК. Я объяснила разницу между наблюдателем и членом УИК с ПСГ. Председатель комиссии начала листать справочные брошюрки, затем звонить в ТИК. В ТИКе ей ответили, что она не права. Затем я представила на обозрение свой паспорт и направление и попросила внести меня в списки присутствующих. Мне пообещали это сделать в день голосования. Поинтересовалась количеством избирателей, записала ФИО председателя, зама и секретаря, спросила о времени начала работы УИК. </p>\n<p><strong>04.12.2011</strong> </p>\n<p><strong>7:15-8:00</strong> </p>\n<p>В 7:15 без проблем попала на участок, одновременно со мной пришел Юрий – член УИК с ПСГ, чуть позже (до 7:30) корреспондент Станислав, а также  наблюдатели от «Единой России» и КПРФ. Нас внесли в списки присутствующих, Юрий спросил контрольные цифры у председателя, я у него их переписала. Передавили заявления на получение копии протокола.  Ознакомились с помещением – отсутствовал сводный плакат с данными о партиях (председатель пояснила, что их не напечатали и не выдали, что она ругалась на эту темы с ТИКом) и шторки на кабинах для голосования (председатель пояснила, что им выдал такие ТИК). Далее убедились в том, что урны для голосования, как переносные, так и стационарные, пусты, и следили за их опечатыванием. Члены УИК делали это подчеркнуто демонстративно, отпуская нелицеприятные комментарии в сторону наблюдателей. Потом ознакомились со списками избирателей, в них были карандашные пометки – «умер», «выбыл», «в местах лишения свободы». Обратили внимание на недопустимость пометок, предложили стереть, однако председатель дала указание обвести эти записи ручкой. </p>\n<p><strong>8:00-20:00 </strong></p>\n<p>Наблюдателям предложили занять стулья, находящиеся около стены, однако перемещаться по участку в течение дня не запрещалось (часть времени я простояла у урн, регулярно подходила к увеличенной форме протокола, чтобы подслушать разговоры во время звонков секретаря в ТИК и тд.) Распределили роли – Юрий следил за урнами, я отмечала выданные бюллетени, Стас –  за общей обстановкой. </p>\n<p>Наш участок оказался на удивление «унылым» и правильным. </p>\n<p>- 38 человек проголосовало по открепительным удостоверениям – из них 12 сотрудников школы (члены УИК, уборщицы), 5 наблюдателей. Подавляющее большинство остальных – приходили с семьями, маленькими детьми и с периодичностью раз-два в час. Возможность проведения карусели на моем избирательном участке я исключаю. </p>\n<p>- все 12 часов я считала количество бюллетеней. По моим подсчетам получилось - 991, по данным комиссии – 995, в стационарных ящиках оказалось 993 бюллетени.  Минимальное расхождение цифр я объясняю своей невнимательностью в часы пик и тем, что 2 бюллетени избиратели унесли. Вборсов не было.  Юрий 12 часов внимательно следил за ящиком. </p>\n<p>- члены комиссии регулярно менялись местами за столами со списками избирателей (бегали обедать, пить чай, занимались организацией школьного концерта). Т.е. не было заметно, что есть какой-то «специальный» член комиссии, к которому необходимо подойти предполагаемым «карусельщикам». </p>\n<p>- «подозрительных» избирателей также не было.  В первой половине дня были только пожилые люди, молодежь начала идти во второй половине дня. Многие юноши и девушки – бывшие ученики этой школы, они общались со всей комиссией одновременно, рассказывали, кто куда поступил, родил, женился и т.д. </p>\n<p><strong>Было только 2 небольших конфликта: </strong></p>\n<p>1. Голосование вне помещения проводилось дважды. В первый раз хотели отправиться просто со списком, без выписки из реестра, и взять с собой 50 бюллетеней.  Юрий это пресек. Реестр составили, бюллетеней выдали адекватное количество. Первое голосования вне помещения проводили без наблюдателей. На второе пошел Станислав (председатель долго думала, может ли представитель СМИ сопровождать, но отпустила), т.к. ситуация на участке была спокойной. </p>\n<p>2. Пожилой мужчина устроил скандал с требованием вычеркнуть свою супругу из списка избирателей, объясняя это тем, что в данный момент она находится за границей. Его попытались коллективно успокоить, объясняя, что его требования неправомерны. Его вежливо вывел сотрудник полиции. </p>\n<p><strong>20:00-23:00 </strong></p>\n<p>Составили столы. Подсчитали количество неиспользованных бюллетеней, погасили их. Внесли данные в увеличенную форму протокола. Затем  работали со списками – сначала вносили карандашом, затем обводили ручкой. Юрий начал фотографировать списки, чем разозлил комиссию. Угрожали отстранением, хамили всем наблюдателям. Сшили все книги в одну. Вскрыли поочередно переносные ящики, количество бюллетеней и заявление в каждом сошлись.  Вскрыли стационарные ящики, пачек не было. Собрали в общую стопку, затем каждый член УИК «собирал свою партию»: секретарь оглашал «первая», «вторая», «недействительна» и т.д., формировались стопки. Затем каждую стопку по одной бюллетени считали. Контрольные цифры сошлись. Копию протокола выдали уже 22:45, возмущаясь, зачем нам дата и время заверения. </p>\n<p>Протокол не переделывали. </p>\n<p><strong>На нашем участке:</strong> </p>\n<p>Около 30% у КПРФ, </p>\n<p>24% у Единой России </p>\n<p>16% у Справедливо России </p>\n<p>14% у ЛДПР </p>\n<p>13% у Яблока </p>\n<p>1% у Патриотов </p>\n<p>1% у Правого дела </p>\n<p>1% испорченных.</p>\n<p> </p>\n<p> </p>\n<p> </p>','otchet-nablyudatelya-duma-uik-789/'),(793,'','','','',''),(801,'нарушений не выявлено','','','',''),(821,'','','','',''),(843,'','','','',''),(868,'','','','',''),(870,'','','','',''),(895,'','','','',''),(904,'','','','',''),(924,'','','','',''),(928,'','','','',''),(953,'нарушений не выявлено','','','',''),(970,'','','','',''),(995,'','','','',''),(1004,'','','','',''),(1029,'','','','',''),(1037,'','','','',''),(1051,'','','','',''),(1062,'','','','',''),(1082,'','','','',''),(1109,'некорректная работа УИК','Laszlo Milovanov','Вроде чисто','<p><strong> </strong>Многие избиратели были недовольны.</p>\n<p>Куча бабушек возмущалась по поводу того, что им заранее никто не<br/> сообщил об адресе проведения выборов.<br/> 5 человек пришли на выборы и обнаружили, что за них кто-то взял<br/> открепительные, выданные ТИКом.<br/> Нам попался председатель избирательной комиссии со стажем в 27 лет. Мы<br/> были уже готовы к тому, что на нашем участке произойдет вброс или иное крупное нарушение.. Наблюдатели в количестве 6 человек отмечали на спецлисточках каждый опущенный в<br/> урну бюллетень. Мы насчитали 920 проголосовавших. По данным<br/> избирательной комиссии на участке проголосовало 976 человек. Откуда<br/> взялись эти 56 голосов - не понятно, ведь мы не видели вброса, а эти<br/> левые голоса появлялись во время всей процедуры. Было очень много<br/> мелких нарушений, и несколько более крупных, но все-таки наблюдатели<br/> остались довольны голосованием.<br/> <br/> <br/> (фотография<br/> увеличенной копии протокола. председатель сначала писал туда данные<br/> карандашом, а потом уже их обвел ручкой после того, когда мы ему намекнули на<br/> то, что писать карандашом не по правилам)<br/> <br/> Когда председатель участковой комиссии увидел эти цифры, он начал тянуть  с выдачей нам копий протоколов. По-видимому, рассчитывал  каким-то образом повлиять на результат подсчета голосов. Но мы потребовали немедленного составления протокола и выдачи нам копий. На его возражения мы  отвечали статьями федерального закона о выборах. Он сразу выдал нам копии.</p>\n<p> </p>\n<p> </p>\n<p> </p>\n<p> </p>','otchet-nablyudatelya-duma-uik-1109/'),(1134,'','','','',''),(1146,'значительные нарушения','','Вброс, частично предотвращенный','<p>В итоге своего пребывания на участке в статусе журналиста (о котором я неоднократно пожалела) я поняла, в частности, что данные нам установки \"предотвратить фальсификации\" и \"не вступать в конфликт и дождаться выдачи копии протокола\" друг другу противоречат. Мы старались находить \"золотую середину\", в итоге мы дождались невыдачи копий протокола, но если и предотвратили, то довольно незначительную часть фальсификаций.</p>\n<p>До начала работы комиссии был удален один из двух наблюдателей от \"Яблока\".</p>\n<p>Грубо нарушались права наблюдателей и представителей СМИ: нам было отведено определенное пространство в отдалении от урны (позднее при нарушении этого запрета муж председателя комиссии старался ходить перед моей камерой, чтобы закрыть обзор :)) Не было возможности полноценно ознакомиться с реестром лиц, изъявивших желание проголосовать вне помещения. В сопровождении выносной урны, с которой выехали наблюдатели от \"Единой России\", нам было отказано в категорической форме.</p>\n<p>Из любопытного, моя беседа с человеком, который принес бейджики от ЕР, и представился контролирующим наблюдателем от оной партии. С ним пришла женщина, которая, сев к столу, за которым сидела председатель комиссии и, собравшись \"голосовать\", увидела, что я хожу неподалеку и написала на меня жалобу, что было очень трогательно. Что характерно, голосовать она так и не пошла. Да, еще - на участке у нас присутствовал человек, который честно представился, что он из угрозыска. Он помогал нас утихомиривать, но без навязчивости.</p>\n<p>На самом участке было осуществлено, по-видимому, три вброса, одну из женщин удалось сфотографировать. Судя по всему, еще два удалось предотвратить.</p>\n<p>Подсчет голосов производился не по правилам, представители СМИ не имели возможности вблизи снимать процесс. Наблюдатели подтвердили, что в урнах находились пачки сложенных бюллетеней.</p>\n<p>Расхождения между нашими подсчетами проголосовавших избирателей и количеством бюллетеней, отраженным в окончательной копии протокола, составили примерно 400.</p>\n<p>Наблюдатели и представители СМИ подвергались постоянным оскорблениям и попыткам шантажа со стороны председателя избирательной комиссии и ее членов (\"из-за вас людям вызывают скорую\") и пр.</p>\n<p>\"Подсчет голосов\" отдавал сперва Гоголем, а потом Кафкой - члены комиссии замечательным образом обсуждали, поедут ли они теперь в Тунис или в Египет, а потом и нашу судьбу, будем ли мы со временем \"у руля или у ведра\". Видя меня, снимавшую на видеокамеру, они стали на меня кричаться, бросаться, закрывать камеру и называть политической проституткой.</p>\n<p>Все это зафиксировано на видео.</p>\n<p>Несмотря на поданные заявления, представители СМИ не получили заверенную копию протокола. Копию протокола не получил также и член комиссии с правом решающего голоса - представитель КПРФ, отказавшийся данный протокол подписать.</p>\n<p>Председатель комиссии отказывалась принимать жалобы и заявления от общественных контролеров.</p>\n<p>Наконец, на участке производилось глушение мобильной связи - в период до первого выезда урны в сопровождении ЕР, и после начала подсчета голосов. Интересно, что глушили, видимо, на определенных частотах - некоторые телефоны работали, а некоторые нет, причем это не зависело от того, \"светился\" ли номер в проекте или нет.</p>\n<p>Председатель УИК № 1146 - Бокарева Марина Борисовна.</p>\n<p>Вывод для себя: я никогда не буду слушать никаких советов приятеля, который заставил-таки меня пойти на выборы с этой камерой.</p>\n<p>Еще один вывод, более общего порядка: надо четко знать законы и исходить из того, что рассчитывать можно только на себя, никакие юристы, никакой штаб, никакие мобильные группы и никакие приятели тебе не помогут. Эта установка у нас выработалась, увы, тоже не сразу.</p>\n<p>В целом наша троица, а также примкнувшая к нам девочка-наблюдатель от ЛДПР, получила, конечно, сильный опыт. Девочка из ЛДПР пережила некий мировоззренческий кризис: дело в том, что на участке была член УИК с СГ от ЛДПР, тоже молодая девушка, и она очень активно помогала комиссии, в частности, старалась меня обезвредить. Девочка-наблюдатель пришла к выводу, что она не пойдет больше к человеку из штаба ЛДПР, который прислал сюда их обеих, потом спрашивала у меня, бывало ли в истории России так, чтобы пересмотрели результаты выборов (мне нечем было ее порадовать). Я сказала ей о митинге 5-го числа, она со своими друзьями вышла на Чистые, и их забрали - ее друзья просидели в ОВД \"Коптево\" двое суток. Она, кстати, в отличие от меня, намерена была идти наблюдать на президентские выборы.</p>\n<p>В общем, хотя я и не справилась с заданием, опыт был, несомненно, полезный.</p>','otchet-nablyudatelya-duma-uik-1146/'),(1168,'','','','',''),(1193,'значительные нарушения','','','',''),(1218,'','','','',''),(1235,'','','','',''),(1260,'значительные нарушения','Елена Бондал','Вброс, отстранение','<p><strong>Отчет о ходе голосования на участке 1260, р-н Выхино-Жулебино, Москва</strong></p>\n<p><strong>Елена Бондал, член УИК с ПСГ от партии «Яблоко»</strong></p>\n<p>Я получила мандат от партии «Яблоко» для наблюдения на участке 1260 как член Участковой Избирательной Комиссии с правом совещательного голоса. Со мной от проекта на участке должны были находиться еще два человека, наблюдатель и корреспондент СМИ. Однако оба не явились, хотя с одним из них я встречалась накануне.</p>\n<p>В результате я была на участке одна, не считая двух наблюдателей от Единой России, на которых у меня надежд не было никаких.</p>\n<p><strong>7:30-8:00</strong></p>\n<p>Придя на участок, я познакомилась с Председателем Комиссии, Савостьяновой Ольгой Витальевной, выяснила количество избирателей на участке, количество бюллетеней, полученных из ТИК, количество подавших заявления для голосования на дому. Мне показали все избирательные книги, никаких отметок я в них не обнаружила. При мне опечатали все ящики для голосования, предварительно позволив убедиться, что они пустые. Увеличенная копия протокола висела, как положено, на стене. Ничто не предвещало каких-либо проблем. Председатель была расположена ко мне весьма благодушно. Я верила, что все пройдет гладко.</p>\n<p><strong>8:00-20:00</strong></p>\n<p>Я расположилась за столом, откуда мне были видны все столы с членами комиссии и урны для голосования, однако издалека, так как спортзал школы, в котором находился участок, был достаточно обширен. Я завела листок для подсчета опущенных бюллетеней в урну для голосования и занялась подсчетом. Вскоре ко мне стала подходить Председатель и уговаривать пойти позавтракать, так как у нее был лишний талон. Я отказалась, сославшись на то, что у меня есть с собой еда и питье. Она подходила еще и еще, настойчиво предлагая идти завтракать или хотя бы попить кофе у них в комнате. После моих отказов она взяла с меня обещание пойти потом на обед.<br/>Наблюдатель от ЕДРА, в свою очередь, хвасталась мне теплыми фиолетовыми гольфами, которые она купила для своей мамы этажом ниже (не знаю, почему в школе торгуют подобными вещами в день голосования), и предлагала и мне пойти купить что-нибудь тоже. Я никуда не выходила, кроме как в туалет. И в основном развлекалась тем, что подсчитывала количество бюллетеней, опущенных в урну за каждый час голосования.<br/>Вскоре председатель предложила мне поехать с выездной группой для голосования на дому. Я отказалась. При мне посчитали кол-во поданных заявок для голосования на дому (26) и количество взятых с собой бюллетеней (30). По моей просьбе была составлена выписка из реестра, и выездная группа отправилась с ней.</p>\n<p><strong>Первый конфликт с Председателем.</strong></p>\n<p>Посчитав, что мне недостаточно видно, что происходит за столами, где выдаются бюллетени, а также плохо видны урны, я сообщила Председателю, что хотела бы поставить свой стул так, чтобы видеть, как избиратели опускают бюллетени в урну сбоку, а не со спины, а также хотела бы находиться ближе к столам членов комиссии, чтобы следить за правильностью занесения данных избирателей в книги. На это председатель ответила, что не может удовлетворить мою просьбу. Я попросила ее сослаться на закон, который запрещает мне сделать это, и сказала, что мне придется написать жалобу в случае отказа. Пытаясь избежать конфликта и дав время Председателю подумать, я села на прежнее место. Между тем, Председатель явно стала нервничать: она переменилась в лице и начала куда-то звонить. <br/><br/><strong>Первый факт вброса бюллетеней</strong> </p>\n<p>Около 13:30, отлучившись на несколько минут в туалет, я вернулась в зал и застала следующую картину: какая-то избирательница чем-то громко возмущалась. С ней находилась директор школы. Я подошла к женщине и спросила, что случилось. Она ответила, что при ней какая-то женщина, которая до этого сидела за столом, где обычно сидит Председатель и по описанию похожая на Председателя комиссии, бросила сложенную пополам пачку бюллетеней в урну и предложила бросить и ее бюллетень тоже. Председателя на месте не было. Директор школы кричала, что этого не может быть. Я сказала, что  я независимый наблюдатель, и предложила женщине составить заявление,. Директор школы стала говорить, что я плохо себя веду и что меня следует удалить. Я обратилась к милиционеру, который был всему свидетель. Он бездействовал. Директор школы пыталась увести избирательницу к себе в кабинет. Я просила ее не ходить и написать со мной жалобу. Директор давила. Избирательница все-таки ушла в кабинет к директору, куда меня не пустили. Однако я успела записать ее имя (Зинаида Ивановна Путинцева). Я была сильно взволнована. Тряслись руки, срывался голос. Стала звонить в штаб, но не могла дозвониться. Стала звонить в «Голос». Они направили мое сообщение в твиттер КПРФ. После этого мне стали звонить разные люди из разных организаций и СМИ с советами и со словами поддержки.<br/>Между тем, я вынуждена была покинуть участок, потому что хотела дождаться избирательницу из кабинета директора. Она вышла где-то через 30 минут. Я опять предложила ей написать заявление, она уклонилась, сказав, что должна посоветоваться со своим адвокатом, и ушла.<br/>Я вернулась на участок и стала писать заявление. Заметила, что Председатель переоделась в зеленую водолазку. Это очевидно было связано с вбросом, так как избирательница запомнила, в чем была одета женщина, произведшая вброс.</p>\n<p><strong>Олег, корреспондент СМИ</strong>  </p>\n<p>Приехал, предварительно позвонив, представитель СМИ от проекта Гражданин Наблюдатель, Олег. Меня это сильно взбодрило. Я чувствовала, что уже не одна. Однако вскоре у него возник конфликт с Председателем, так как ему, как и мне, не было позволено находится там, где мы хотели, а кроме того, не позволяли снимать. Председатель написала решение о его удалении, а также вызвала полицию. Олег тоже вызвал полицию. В какой-то момент на участке находились порядка 10 представителей различных подразделений полиции. Около 2-3 часов, пока находилась полиция, ему и мне приходилось отвечать на вопросы и писать объяснительные. Кроме того, была директор школы. Она сильно хамила, назвала меня сумасшедшей. Олег держался прекрасно. Потом его все же удалили, и он уехал в ТИК обжаловать решение.</p>\n<p><strong>Сотрудничество с КПРФ</strong>  </p>\n<p>Звонили различные люди, в том числе и чаще всего от КПРФ. Сообщили, что на моем участке находится представитель КПРФ, который может меня подменять, когда я отлучаюсь. Я познакомилась с ним. Ею оказалась член комиссии с правом решающего голоса Ольга Глинкина. Поначалу она не вызвала моего доверия, поскольку до этого никак не проявляла себя. Однако позже выяснилось, что она на моей стороне, и мы стали союзниками.<br/>Между тем, Председатель включила меня в список 2-ой выездной комиссии для голосования на дому. Я отказалась ехать. Она сказала, чтобы я писала объяснительную. На это я также ответила отказом, сославшись на то, что я имею право не ехать.</p>\n<p><strong>Второй факт вброса бюллетеней</strong> </p>\n<p>По просьбе Ольги Глинкиной приехал представитель из ТИКа от КПРФ, Данил Асоцкий. Она сказала, что с ним можно проконсультироваться по всем возникающим проблемам. Все вместе стали обсуждать ситуацию на участке. Я рассказала о факте вброса. Ольга сказала, что также была свидетельницей вброса, произошедшего еще утром, но никому не сказала об этом, так как была поражена наглостью Председателя и совершенно не знала, что делать. Она рассказала, что около 9:40 утра, воспользовавшись тем, что я вышла, Председатель, с криком «Галя, смотри» (Галя – это зам председателя), побежала в комнату, где находились бюллетени, добежала до урны, вбросила в нее пачку бюллетеней и убежала обратно. Я стала убеждать Ольгу, чтобы она написала жалобу. Она колебалась. Данил предложил написать нам жалобу совместно. Тем временем Председатель написала отказ на мою жалобу о вброс,. Тогда мы решили писать в ТИК совместную жалобу с указанием двух фактов вброса. Данил отвез наше заявление в ТИК.</p>\n<p><strong>20:00 Подсчет голосов</strong></p>\n<p>Начался подсчет неиспользованных бюллетеней. Я настояла, чтобы считали кажый бюллетень по отдельности. Параллельно подсчитывалось кол-во проголосовавших в книгах. Зачитав Председателю закон о необходимости поэтапного подсчета голосов, я вынудила уже изрядно раздраженного Председателя, производить подсчет согласно требованиям закона, пригрозив в противном случае писать жалобы.<br/>Начался подсчет по книгам. Я стала ходить и наблюдать. Председатель нервничала, много раз требовала сесть и не мешать членам комиссии. На мои доводы, что я имею право наблюдать и нисколько не препятствую работе комиссии, она раздражалась еще сильнее. Ей вторили члены комиссии. Стало ясно, что меня хотят удалить. Председатель звонила по телефону.<br/>Начался подсчет бюллетеней в ящиках. Посчитали бюллетени в передвижных ящиках. Никаких нарушений. Вскрыли стационарный ящик. Перед тем, как высыпать бюллетени на стол, зам председателя (Юрлова Галина Александровна) залезла в ящик с головой и помешала бюллетени рукой. Столь комичный жест был сделан явно для того, чтобы скрыть факт вброса бюллетеней. Об этом факте мною и Ольгой Глинкиной была написана еще одна совместная жалоба в ТИК.</p>\n<p><strong>Отстранение</strong> </p>\n<p>Когда поднесли второй ящик, я достала мобильный телефон, чтобы зафиксировать извлечение бюллетеней на камеру. Увидев это, Председатель остановила процесс, стала кричать, говорить, что не имею права снимать. Другие члены тоже очень ругались. Было страшное давление. Пытались взывать к совести, мол, ты же человек, все устали, из-за тебя будем сидеть до ночи. Устроили голосование о моем удалении. Естественно, все за, кроме Ольги Глинкиной. Я сказала, что имею право снимать, и что удалить меня не имеют права. Председатель опять засела за телефон. Около часа советовалась по телефону, что со мной делать. Вынесли решение об отстранении на основании того, что, во-первых, отказалась ехать с выездной комиссией, и, во-вторых, что создаю нервозную атмосферу на участке. Попросили уйти. Я сказала, что меня отстранили, а не удалили, и я имею право присутствовать на участке. Председатель опять повисла не телефоне. Время тянулось. Наконец решили меня больше не трогать и обязали наблюдать издалека.<br/>Все посчитали. Ольга Глинкина, представитель КПРФ, которая тоже принимала участие в подсчете, видела много идущих подряд бюллетеней, где знаки, галочки, крестики, нолики, были проставлены явно одной рукой. Все за ЕДРО. По ее мнению, таких бюллетеней было около 100-150 штук. Она, как член УИК с правом решающего голоса, не подписала протокол о голосовании, написав особое мнение, где указала все факты нарушения в ходе голосования. <br/>В увеличенную копию протокола вносилось все исправно. Я обязала их вставить также и факт о том, что две мои жалобы находились у Председателя. По обеим были вынесены решения, естественно с отказом.<br/>Очень долго, часа два, ждали протокол. Компьютер висел. Наконец все выдали. Я получила свою заверенную копию протокола. Данные в ней, совпадали с данными в увеличенной копии.</p>\n<p>Вернулась домой в 3 часа утра.</p>\n<p><strong>Итоги  </strong></p>\n<p>В ходе голосования написано две жалобы в УИК, подано две совместные жалобы в ТИК, и готовится совместное заявление в прокуратуру по двум фактам вброса бюллетеней.</p>\n<p><strong>Итоги голосования на участке 1260:</strong></p>\n<p>Единая Россия 31.92%</p>\n<p>КПРФ 24.17%</p>\n<p>Справедливая Россия 16.42%</p>\n<p>Либерал-Демократическая партия 13.25%</p>\n<p>«Яблоко» 10.42%</p>\n<p>«Патриоты России» 1.92%</p>\n<p>«Правое дело» 0.67%</p>\n<p><strong>Личное мнение</strong></p>\n<p>Я, несомненно, получила очень ценный опыт. Во время своего нахождения на участке я практически выучила закон об основных гарантиях, поскольку постоянно приходилось апеллировать к нему. Также мне очень помогли консультации как со штабом, также как и с другими людьми, в основном, представителями КПРФ. Однако нужно отметить, что связь со штабом была очень нестабильной.<br/>Находясь на участке, я всегда старалась действовать строго по закону и вести себя максимально корректно. В какой-то момент члены комиссии стали обращаться ко мне, а не к председателю, видя, что я знаю порядок, как и в какой последовательности надо производить подсчет голосов, чем, конечно, очень раздражали и так порядком поистрепавшегося Председателя. В то же время было очевидно, что ни Председатель, ни члены комиссии не знают твердо свои полномочия и уж точно ничего не знают о моих, как наблюдателя. Разговорившись с полицейским, постоянно присутствовавшим на участке, я выяснила, что и он не знает законов. Он сказал, что у него просто нет времени на их изучение, и признался, что не знает, что делать в случае вброса бюллетеней, хотя утверждал, что ничего не видел.<br/>Когда все поуспокоилось и стали ждать протокол, я беседовала с членами комиссии. Мне было очень сложно донести до них, простых учителей, что, когда Председатель галопом бежит к урне и бросает туда пачку бюллетеней, - это преступление, не говоря уже о том, что это просто стыдно.<br/>Ощущение позора от всего происходящего неустанно преследовало меня. Очень жаль, что не удалось предотвратить вброс бюллетеней. Однако есть и чувство удовлетворения, в первую очередь от того, что удалось представительницу от КПРФ убедить написать жалобу по факту вброса бюллетеней.<br/>Я также уверена, что Председатель комиссии получила хороший урок, и на будущее будет знать, что вбрасывать бюллетени – это очень затратное занятие. К концу дня было очевидно, что она очень сильно истощена морально и физически: нелегкое это дело для женщины в летах бегать туда-сюда от урны и обратно, писать ответы на жалобы, кричать, ругаться и постоянно консультироваться с кем-то по телефону. Мне тоже было очень тяжело. Но правда и закон - на моей стороне. Это придавало сил.<br/>В целом, опыт наблюдения очень закалил меня. Теперь я знаю, как действовать в любых ситуациях и готова хоть сейчас идти и наблюдать опять. Огромное спасибо проекту Гражданин Наблюдатель за поддержку. Нас пока немного, но будет больше. Вода камень точит. Мы победим.</p>\n<p> </p>\n<p> </p>','otchet-nablyudatelya-duma-uik-1260/'),(1285,'','','','',''),(1290,'','','','',''),(1297,'значительные нарушения','','','',''),(1322,'','','','',''),(1334,'','','','',''),(1358,'','','','',''),(1383,'','','','',''),(1408,'','','','',''),(1409,'','','','',''),(1434,'значительные нарушения','Кривошеев Андрей','агитация на участке, вброс, предотвращенная попытка вброса, удаление члена комиссии с псг','<p><strong> </strong>У нас на участке 1434 спокойным было только кратковременное знакомство с членами комиссии в субботу. А в воскресенье, прямо с утра, комиссия нам решила показать, кто здесь главный. В списки присутствующих нас внесли, тут все ок. В результате беглого осмотра и оценки ситуации кроме нас, двоих наблюдателей  от  Яблока и КПРФ, а так же члена комиссии с ПСГ на участке мы заметили члена комиссии с ПСГ от КПРФ. На первый взгляд он нам показался странноватым. Сначала он заявил, что он наблюдатель от КПРФ, но позже мы поняли, что это лишь неправильная формулировка, позже он поправился, сказал, что член комиссии с ПСГ.</p>\n<p>Итак, 7:45. Председатель комиссии указывает наблюдателям места в коридоре, откуда обзор урн и членов комиссии просто невозможен, но не препятствует нашим перемещениям по  комнате,  подальше от членов комиссии. Мы просим ознакомиться со списками избирателей. В этом нам отказывают, формулировки такие: «Я не имею права вам их показывать», «Не буду» и т.п. Поднимается небольшая буча, она интересуется, что мы там хотим увидеть, я корректно отвечаю, что мы имеем законное право ознакомиться с их содержимым без каких либо препятствий. Снова отказ. Тут же отмечаем и другие нарушения. Во-первых, урны начинают опечатывать до открытия участка, во-вторых, председатель  отказывается вскрывать их, мотивируя тем, что они развалятся. Нам предложили ознакомиться с их содержимым через щелку сверху –  вроде чисто. Но нарушение налицо. Мы сначала  растерялись, но заявление от нас все же позже поступило, юрист из мобильной группы сказал, что его надо написать.<br/> <br/> Далее самое интересное: списки избирателей не прошиты и не опечатаны. Председатель сказала, что ничего менять не будет, они склеены и этого достаточно. Поднимается ещё более серьезная буча. Оксана проявила настойчивость, ну а я решил, что стоять и тоже спорить мне бессмысленно, и включил камеру. Тут же последовали требования прекратить  съемку, председатель комиссии привлекла сотрудника полиции в звании капитана, позже оказалось, что это участковый. Но я снимал. Начались отзвоны куда-то, приглашение старших и т.п. Ну что же, продолжаем. Подтягивается майор полиции, я делаю вид, что не замечаю его и пишу жалобу по поводу запрета съемки. Майор представляется начальником уголовного розыска УВД Марьино и разъясняет, что я не имею права снимать. Более убедительных аргументов, чем приводил раньше капитан, он не находит. Я решил, что не буду с ними долго общаться, и по привычке, которая у меня уже сформировалась в связи с общением с ДПС, звоню 112 и передаю жалобу на двух сотрудников полиции, препятствующих съемке. Жалобу эту принимают, обещают разобраться. Конец связи. Параллельно вызываю мобильную группу, так как краем уха слышу, что второго нашего наблюдателя, Оксану, уже готовятся удалить. Мобильная группа приехала быстро. В их присутствии председатель и полиция становятся добродушными и приветливыми.Полицейские стесняются, стараются попадать в камеры. Я  снимаю, пользуясь их временной добротой.<br/> <br/> На камеру председатель комиссии почти полностью отказывается от своих слов, пытается нас выставить крайними, а ещё тугодумами и врунами. Ну что же, я не против, флеш карта моей камеры все стерпит. Попутно стягивается полицейское начальство и дополнительные силы полиции, как в виде рядовых сотрудников, так и офицеры. Самый старший из них, судя по погонам, подполковник полиции. Мы с юристом впоследствии прозвали его «вежливый», так как вел он себя на порядок разумнее и сдержаннее своих младших по званию коллег. Под прицелом камер мы повторно задаем вопросы, на которые до этого не получали вменяемых объяснений. Председатель врет и выкручивается, но нарушения-то налицо. </p>\n<p>Все же книги они начали прошивать, даже попытались пронумеровать страницы. Урны решили не вскрывать, но по совету юриста составили по поводу нарушений при опечатывании урн заявление. Кстати, хочу отметить, что до приезда мобильной группы председатель заявления у нас не принимала, хотя в бланках заявлений был указан номер статьи закона, обязывающей ее это сделать. (Эти бланки были немного модифицированной формой тех, что предлагались в рассылках:, я выделил больше места на странице для изложения сути жалобы страниц и разместил каждое заявление на листе А4. Это, как  оказалось, было полезно, так как в предложенные половинные бланки текст просто не поместился бы. Бланков я заготовил много, так что нам хватило с головой.)<br/> <br/> Кстати, на участке постоянно присутствовали разные посторонние лица. Больше всего примелькалась одна дама, если я не ошибаюсь, представитель управы. Своим тоном она как бы говорила: «На этом участке рулю я, сынок». К спискам присутствующих на участке лиц нас не подпускали, но говорили (скорее всего, врали, так как председатель путалась в показаниях), что это член УИК с ПСГ от ЕР. Заявление об этом позднее тоже было направлено председателю, которая после визита юристов и корреспондентов начала ринимать у нас заявления.<br/> <br/> Когда на участке присутствовал юрист, я заметил, как, выдавая бюллетень, члены комиссии откуда-то достают календарик, очень похожий на предвыборный плакат ЕР. Юрист тоже проследил за этим и подтвердил мои подозрения: календарик выдается с бюллетенем.. Мы предложили председателю прекратить их раздавать.Календарики раздавать перестали. Маленькая, но победа! </p>\n<p>Далее представитель управы подняла шумиху, обязав прибывших дополнительно полицейских проверить у всех документы и удалить всех, кто не имеет права находиться в помещении. При этом она забыла, что на участке была куча посторонних лиц, пришедших ее поддержать (например, директор школы).<br/> <br/> Членов мобильной группы очень старались удалить.Полицейские также продолжали придираться ко мне по поводу съемки.по-максимуму. Во время разговоров по этому поводу «вежливый» подполковник несколько раз менял свою позицию. На видеозаписи видно, как  он то разрешает, то запрещает снимать, то просит не снимать, то снимать без лиц, то не снимать вообще и так далее. Сошлись на том, что я буду снимать правонарушения и постараюсь делать это без лиц. Мы понимали, что мобильная группа с минуты на минуту покинет участок и тогда мы останемся наедине с ними, поэтому лучше не конфликтовать, чтобы нас не удалили с участка.</p>\n<p>Удалять Оксану они передумали, вижу в этом заслугу именно мобильной группы.</p>\n<p>Третий наш коллега, Дмитрий, все это время исправно фиксировал количество бюллетеней, опущенных в урны. Нам было просто не до этого.  </p>\n<p>Пока мы пишем заявления, я краем уха слышу, что прибывший по звонку майор, начальник уголовного розыска, не знает, что писать в объяснительной по поводу моего звонка в 112. Подполковник пытается узнать у него, кто позвонил (он не сразу догадался, что это я)</p>\n<p>После того как мы продемонстрировали свою решительность, резкие выпады в мою сторону со стороны майора прекратились.</p>\n<p>Кстати, хочу отметить, что телефон прокуратуры, записанный в штабе, не ответил ни на один из моих многочисленных звонков за весь день, о чем я очень жалею. Судя по сигналам, после 3-го или 4-го звонка на этом номере работал факс. Контакт человека в ТИК, скинутый смс-кой из штаба Яблока, был «временно заблокирован» с самого утра и по поздний вечер, о чем я известил штаб и крайне удивил оператора. Так что минус ещё один из контактов.<br/> <br/> А тем временем работа кипела, участок работал в полную силу. Несмотря на то, что мы с Дмитрием, после того как я разделался с заявлениями, с двух разных мест следили за ящиками, они иногда не были видны ни одному из нас. В эти моменты, не исключено,  были вбросы. </p>\n<p>Хочу отметить, что участок находился в небольшом помещении, от входа до урн, так же как и от урн до любого из члена комиссии всего 2 шага. Вброс было осуществить достаточно просто,  учитывая, что часть кабинок для голосования была развернута в коридор, и мы не всегда могли понять, кто входит в помещение из коридора с бюллетенем – то ли тот, кто ставил там галку, то ли тот кто пришел вбрасывать. Уверен, что в более просторном помещении предотвратить вброс было  бы проще.</p>\n<p> Попутно познакомились с представителем от КПРФ со второго участка, по соседству с нами. Он к нам раза три приходил. Подумали, что там тоже неплохой контроль.<br/> <br/> Дальше начинается самое интересное: выезжают для голосования вне помещение. Все объявляют, список не такой большой, вроде подвоха не ожидается. С ними отправляется член УИК с ПСГ от КПРФ, вроде бы нормально. Нас осталось трое, казалось бы, нормально. Позже оказалось, что это лишь начало. </p>\n<p>Голосование идет своим чередом. Время летит медленно, но все же уже давно перевалило за полдень. Все устали от постоянного стояния на ногах.<br/> Приблизительно в 15 часов ко мне подошла Оксана, рассказала, что председатель дала ей талон на обед и отказываться вроде неудобно. Оксана не хочет им пользоваться, но пообедать надо. Так как мы с Дмитрием наблюдаем за урнами, я предлагаю ей все же пойти пообедать. Дмитрий  тоже изъявил желание пообедать после того как вернется Оксана. Я же уходить с участка не хотел. Меня стали  странные мысли о том, что один член комиссии с ПСГ отправлен на разъезды, наблюдателю вручили талон… </p>\n<p>Когда Оксана вернулась, Дмитрий ушел обедать. Избирателей мало, я наблюдаю в упор за урнами. Обратил внимание на то, что довольно активный молодой человек, как мне показалось, минуя членов комиссии, засовывает бюллетень в урну. Я подумал, что не доглядел, может он и подходил и теперь вернулся из тех кабинок, что обращены в коридор. Но я же вижу, как себя ведут те, кто пришёл голосовать, неуверенно, озираясь, стараясь понять последовательность действий, не спешат никуда, перепроверяют все. А тут такая прыть!  Но как будто у него в руках пачка – небольшая, листов 5, но пачка. Он быстро уходит в коридор. Я делаю пару шагов к урне в замешательстве и замечаю второго в яркой синей куртке – опять же странно, появился из коридора, ближайшего к выходу, опять уверенно идет к ближайшей урне. Тут уже я встал сбоку, чтобы лучше видеть, и точно разглядел , что бюллетень мятый, как из куртки вытащенный, да и не один он там, 5-10 штук сразу. Подбегаю, он уже затолкал их, собирается уходить. Тут я останавливаю его и спрашиваю громко на весь участок: «Ты что сделал только что»? Он ответил что проголосовал. Я говорю: «Я видел, как ты вбросил пачку». Он мне объясняет, что я видимо ошибся. Капитан полиции сидит в двух шагах, все это видит, не реагирует, я повышаю голос, требую немедленно задержать этого человека. И тут начинается цирк: капитан начинает мяться, делает вид, что не понимает, в чем дело. Я поясняю, говорю, что он, капитан, сам все мог видеть, так как сидел в двух шагах. Требую, чтобы капитан выяснил личность подозрительного человека. Дальше ещё больший цирк: капитан отвечает, что ему надо отойти куда-то и что-то взять для того, чтобы проверить у этого человека паспорт. Я был очень сердит, сказал, что если он это не сделает, и молодому человеку удастся покинуть участок, я обзвоню все инстанции и заставлю его пожалеть об этом. </p>\n<p>Я пытался дозвониться раза 4 в штаб, но никто не брал трубку. Тут меня несколько человек пригласили «выйти и поговорить», якобы в моих же интересах. Я довольно грубо ответил, что в их интересах срочно бежать с участка, и я никуда не пойду. Я понял, что это друзья задержанного мною человека, но им ничего предъявить было нельзя.<br/> <br/> Подхожу к этому парню, он стоит рядом с капитаном, весь бледный весь, молчит. Я уже спокойным тоном удава поясняю, что за это предусмотрена очень суровая ответственность, и он попался. Спрашиваю, откуда взял бюллетень свой, пытаясь воспользоваться его шоком и заставить его рассказать как можно больше. Он неуверенно машет рукой в сторону столов, где сидели три члена УИК. Тут ситуация меняется. Подходит якобы удивленная председатель комиссии, выясняет, что происходит. В ответ я сообщаю, что на её участке зафиксировано серьезное правонарушение. Она начинает разводить руками, делая вид, что не понимает, о чем речь. В это время я заглядываю в развернутый паспорт, который держит в руках сотрудник полиции, и отмечаю, что не ошибся – судя по прописке, он не имеет отношения к этому участку. Сообщаю это председателю, она начинает теряться, придумывает, что, может, это его друг проголосовал, а ему дал опустить бюллетень. Говорит, что никакой пачки быть не может, что её коллеги не могли выдать этому человеку бюллетени. Все трое уже ведут себя неуверенно,  мнутся. Я громко объявляю, что требую опечатать урну, в которую произошёл вброс. Требовал я настойчиво, ситуация была очевидна, поэтому ящик был оклеен скотчем и убран с дальний угол. </p>\n<p>Капитан вызывает начальство, я снова вижу нашего «вежливого». Лица у них у всех очень обеспокоенные, и улыбаться уже никому не хочется.<br/> Далее было много писанины, заявление в ОВД, объяснительная, заявление в УИК. Меня пытаются выманить с участка под предлогом того, что я должен поехать с полицией и поставить там подпись, но я отказываюсь, не желая  оставлять. Бумажки, которые мне надо былоподписать, привозят ко мне, я подписываю и получаю корешок о том, что заявления принято.<br/> <br/> Далее я звоню в штаб, там обещают прислать двух РенТВ-шников к 8-ми часам, но, сколько я дальше не звонил, они  так и не приехали. Не прислали и запрошенную мобильную группу. Я боялся, что если никто не приедет, то все просто замнут (что и произошло). Я связался еще с корреспондентами из Новой газеты, они спешили к нам, но ехали на метро и, как я понимаю, не успели. </p>\n<p>Я осознал, что мы остаемся один на один с кучей полицейских и членами УИК. На участке все сидят тихо и смотрят, что же будет дальше, напряжение катастрофическое, обстановка нервозная. Я звонил по всем имеющимся телефонам, в Яблоко, в Голос, в Штаб ЮВАО, в штаб ЦАО, бригадиру, журналистам, но никого не смог вызвать. Приехали только ребята из штаба, которые возили наше заявление в ТИК и просто оказывали моральную поддержку.</p>\n<p>Хочу отметить, что после этого скандала попыток  вброса на участке не было.<br/> <br/> Тут к нам в гости приезжает высокое полицейское руководство. Зная,,что «вежливый», который находится в данный момент на участке,  начальник ОВД Марьино и видя, что он официально рапортует о ситуации на участке тем, кто приехал, я предположил, что прибывший полковник является как минимум начальником по округу. Своим видом он показывал, что опечален всем, что тут происходит, Полиции стало ещё больше. Следом за ними вошли полковники казачьей дружины все с теми же гробовыми лицами. Все общались, советовались, допрашивали начальника уголовного розыска, который по сравнению с  ними казался максимум сержантом на побегушках. Кстати, хочу отметить, что где то внутри этих событий забыл отметить. </p>\n<p>Время приблизительно 19:40. На участке последние избиратели. В приватных беседах с ними отмечаем некоторые нюансы, в частности, что кто-то отсутствует в списках, кто-то просит посодействовать в прекращении агитации на участке в Текстильщиках, кто-то видел некоторые нарушения, про которые мы сообщали председателю. Пришла немного неспокойная избирательница, подняла шум. Оксана выяснила, что на предыдущих выборах она, придя на участок, заметила, что за неё проголосовали, но сейчас вроде все нормально. Если бы мы фиксировали все нарушения заявлениями, у нас бы не хватило всех наших совместных запасов бумаги и не осталось бы времени наблюдать за урнами. Параллельно понимаем, что председатель решила убрать Дмитрия, члена комиссии с правом совещательного голоса. Радуемся про себя (как потом оказалось, напрасно), что не наблюдателей, так как по закону что члена комиссии она удалить не может, только отстранить.</p>\n<p>Итак, 20:00, закрытие участка. Начинается отстранение. Откуда в помещении столько сотрудников полиции, я не понял. Часть из них в гражданской одежде, снимают процесс на камеру, я снимаю на свою, чтобы ничего не упустить. Заявление том, что она не имеет права удалять члена комиссии с ПСГ, ровно как и о том, что решение об отстранении должно быть вручено Дмитрию, не возымел действия. Полицейские почти вынесли его с участка.. В его лице она избавила себя от серьезной головной боли. Я опять звоню куда могу. В штабе Яблока считают, что удалить его можно, а нашем Штабе – что нельзя. Но то, что решение ему не вручено, является нарушением закона –  на этом сошлись оба штаба. Но уже ничего не изменить.<br/> <br/> Время 20:30, начинаются процессы, связанные работой со списками, погашением бюллетеней и т.п.. Все последовательности нарушены, сами процедуры тоже не соблюдаются. Увеличенная копия протокола заполняется карандашом, но я все же прошу обвести ручкой. Как вскрывали ящики и как считали бюллетени, вообще песня, сплошные нарушения. Но я  решаю не конфликтовать, чтобы присутствовать при подсчете и составлении протокола, а то совсем вся работа насмарку. Тем не менее нам с Оксаной все же удавалось частично заставить их делать все так, чтобы хоть немного приблизить к прописанной в законе процедуре.  Несмотря на их протесты, процесс вскрытия урн и сортировки бюллетеней заснят на видео, в том числе и самое интересное:, несколько сложенных пачек бюллетеней. Стол был «отцеплен» полицией, нас близко не подпускали, но иногда я прорывался и указывал им на пачки. Впоследствии об этом было написано заявление. </p>\n<p>Во время подсчета комиссия не записывала результаты, и после того как полностью посчитали голоса за каждую партию, все спохватились, что цифр-то нет. Поэтому для внесения данных в протокол председатель УИК обратилась к нам за помощью, так как все цифры были записаны у меня и у Оксаны.<br/> <br/>Схема вбросов была, похоже, отработана неплохо, так как все контрольные соотношения сошлись сходу. Но к книгам нас так и не подпустили, результаты по каждой из книг отдельно не оглашались, никаких промежуточных результатов по страницам мы, разумеется, не видели. Председатель аж завизжала от восторга, когда все типа сошлось.<br/> <br/> Дальше началась бурная деятельность по упаковке всех бумаг и удалению всей мебели с участка. Председатель куда-то убежала. Посмотрел на часы, 23:00. Забегая вперед, скажу, что покинули участок мы лишь через два с половиной часа, так как председатель сообщила, что подписать копии протоколов не может, пока не согласует все по системе «ГАС», дескать, таково распоряжение сверху. Я отметил, что по закону она должна это сделать сразу после подсчета, но она сказала, что не может нам в этом помочь. С её слов система безбожно висела, вероятно, это правда, так как все три участка остались на местах.</p>\n<p>Нам выдали копии протоколов, вопреки моим опасениям они полностью сошлись с теми результатами, которые мы писали в свои блокноты.</p>\n<p>На улице нас ждала моя группа поддержки в количестве 15 человек, которая приехала отбивать нас от возможной угрозы со стороны лиц с которыми вышел конфликт во время поимки человека, вбросившего бюллетени. Хочу отметить, что данные нашего протокола соответствуют данным ЦИК, что не может не радовать. Даже учитывая вбросы,  ЕР набрала заметно меньше голосов, чем на соседних участках.<br/> <br/> В завершении хотел бы порекомендовать на будущее: необходимо усилить телефонную связь со штабом, так как были огромные интервалы времени, когда трубку никто не брал, в то же время сигнала о том, что я звоню второй линией на телефоне не отображалось. Так же считаю, что необходимо увеличить число мобильных групп, так как в отдельных ситуациях только с их помощью удается повлиять на комиссию наладить связи со СМИ.</p>','otchet-nablyudatelya-duma-uik-1434/'),(1459,'','','','',''),(1474,'значительные нарушения','','','',''),(1481,'значительные нарушения','Катя Владышева','Вборс до запечатывания ящиков, Работой УИК руководит депутат','<p><strong>Выборы как острое приключение</strong><br/><br/>Неприятности начались сразу: в 7.45 постовые полицейские не позволили нам подойти к избирательному участку. «Нам сказали – только после 8». После уговоров и ссылок на закон лишь в 7.52 нам посчастливилось позвонить в запертую дверь. «В 8 начнётся голосование – вас и пустят». Эшелонированная оборона. Войти несколько раньше нужно просто для того, чтобы представиться по форме (документы придирчиво осматривают и неторопливо записывают), убедиться, что нет нарушений, и расположиться для наблюдения. В тот момент нас было только двое: наблюдатель от «Яблока» Катерина и я, спецкор «Новой газеты». Мы ещё накануне познакомились с председателем комиссии Юлией и предупредили её, что прибудем до открытия; возражений тогда не было. Необходимость прорываться оказалась неожиданностью. Мы теряли драгоценные минуты. Вот-вот пробьёт 8 утра, когда все присутствующие, в т.ч. наблюдатели и первые избиратели, узрят священную пустоту стационарных ящиков! Однако ещё в 7.55 обнаружилось, что ящик уже опечатан. И в ответ на предложение согласно закону открыть его, показать и только потом опечатывать <strong>НАЧАЛОСЬ</strong>…</p>\n<p>«Вы должны стоять здесь, а если сдвинетесь со своего места!..», «Если кто-нибудь пожалуется на вас!..», «Вы не имеете права вести видеосъёмку!», «Вы нам очень мешаете и мы не позволим присутствовать до 20, до начала подсчёта», «Если только вы пикнете!..» (это уже при подсчёте). Согласно закону, если председатель сочтёт, что наблюдатели мешают голосованию и работе комиссии – а назвать помехой можно что угодно — их с помощью полиции удаляют с участка. Угроза такого удаления прозвучала практически сразу после «доброго утра» и громко напоминалась в течение всего дня. Едва ли хоть один член УИК не услышал громких слов обо мне: «Он ходит и мешает нам работать, он неадекватный, мы его предупреждали». <br/> <br/> Кто же так активно нам противостоит? Кто этот самый «мы», вернее, «МЫ», которого слушается председательница Юлия? Депутат муниципального собрания Антонов Илья Маркович, 1949 года рождения, место жительства: г. Москва, район Зюзино; генеральный директор ЗАО «Техоснастка».<br/> <br/> Каждого избирателя он приветствовал отеческой улыбкой, широким жестом указывал на кабинки, на прощанье дари шарики деткам («растите, юные избиратели!») и цветы тем, кто голосовал впервые. Моя однокашница-общественница отзывалась о нём благодарно: «Он такой пробивной, так всем помогает, даже на свои деньги. Странно, что он так к вам относится, наверно, нервничает».<br/> <br/> Было от чего нервничать: благодетель Илья Маркович <strong>уже</strong> совершил преступление, подложив в стационарную урну 300 или немногим более бюллетеней — сумеете ли угадать, за какую партию? Впрочем, этот опытный руководитель вряд ли опасался, что его разоблачат: члены комиссии были во всём ему покорны. Скорее, это было расчётливое поведение. Попробуйте-ка не выйти из себя, когда слышите, что видеосъёмки подсчёта голосов не будет? Беру со стола председателя «Федеральный закон о выборах депутатов государственной думы федерального собрания Российской федерации», читаю статью председателю в присутствии депутата Антонова, спрашиваю: «Вы подтверждаете наше законное право снимать?» Председатель вяло кивает и переводит взгляд на Антонова. Тот смотрит на меня в упор: «По закону мы вас удалим». В его глазах ни тени сомнения в своей правоте! Но не может же такой опытный руководитель не знать законов. Значит, врёт в глаза, играет — да как играет! — «Читайте!» — показываю пальцем в нужное место. — «Вы нам очень, ОЧЕНЬ мешаете, но мы, так и быть, всё же позволим вам снимать. Но если только…» — и старые угрозы удалить. Две минуты на повышенных тонах. Председатель безмолвствует, остальные члены УИК тем более, полиция до поры до времени сохраняет нейтралитет. Депутат Антонов раздражается на любое наше движение и не упускает шанса вмешаться. Доходит до абсурда: когда я пошёл со своим открепительным удостоверением за бюллетенем, Антонов очередной раз шумит: «Он всё-таки нарывается!» — но потом и не думает извиняться. Всё очень отвлекает от нашей задачи. Но раздражаем его только мы: по участку свободно бродят социальные работники, представитель МЧС и ещё какого-то ведомства, хотя что им там нужно? <br/> <br/> Психологический прессинг — <strong>провокация</strong>: хочется возмутиться, оспорить, отстоять свою законную позицию. Но если выйдешь из себя, рискуешь услышать роковое «мешает, удалите». Ну а если не отстаивать – как наблюдать? Забиться в уголок и не отсвечивать? <br/> <br/> Впрочем, можно не только в уголок: предлагают подкрепиться завтраком, съездить на бесплатный обед и ужин, взять талоны в рестораны. Полицейский по-свойски подмигивает мне: «Коньячку?» Спасибо, еду взяли с собой. Это не только показная доброта (хотя под должностной кожурой это и вправду могут быть добрые люди) — это ещё один способ отвлечь. Но какой разительный контраст составляет эта забота — и единодушный «одобрямс» при нашем последующем изгнании! <br/> <br/> Мы с Катей сели на стулья примерно в 4-х метрах от стационарной урны, вооружившись листом для подсчёта опущенных бюллетеней и электронным счётчиком. Рядом с урной — караул из двоих дружинников. Фотографировать опускание бюллетеня нельзя, потому что это будет смущать избирателей: вдруг в кадр попадёт и лицо, и отметка в бюллетене? Вот и повод для удаления наблюдателей. Большинство народа складывает свои листочки, так что в узкую щель они проходят не очень легко. Это хорошо: больших вбросов не будет. Тогда мы ещё не подозревали, что они и не нужны, потому что главный вброс уже состоялся. И какой! <br/> <br/> Ящик находился под нашим неусыпным наблюдением все 12 часов, если один ненадолго отлучался, то другой продолжал следить. К закрытию участка в 20.00 мы насчитали 388 опущенных бюллетеней, с погрешностью не больше 10 — нас отвлекали, но не обоих одновременно. «А мы насчитали больше, гораздо больше!» — гордо заявил г-н Антонов. С подтекстом: а вы-то врёте, небось, не всех считали. Сюрприз! Однокашница, которая тоже целый день наблюдала за выборами от другой партии, передала, что тоже удивилась: поток граждан был небольшим.<br/> <br/> Участок закрылся, всех лишних удалили, а нас в очередной раз строго предупредили, что если только двинемся с места или скажем слово… ну, вы поняли. <br/> <br/> Итак: УИК №1481 г. Москвы получил 800 бюллетеней, из них 69 бюллетеней не были использованы, а 32 избирателя проголосовали на дому с помощью переносного ящика. Таким образом, в стационарном оказалось 800-69-32=699. Разница с числом опущенных бюллетеней по нашим подсчетам — примерно 300, т.е. по 2 фальшивых на 3 настоящих! Так что избиратели, особенно пожилые, с трудом переставляющие ноги — могли не особенно напрягаться: за них уже проголосовал депутат Антонов, они оказались всего лишь массовкой для его игры.<br/> <br/> Заметив процедурное нарушение при подсчёте, наблюдатель Катя попросила председателя принять жалобы. Просьба была проигнорирована: «Мы сейчас заняты, потом». Закон требует немедленной регистрации и рассмотрения жалоб, «потом» будет поздно: подведут итоги, опечатают документы, уедут подавать итоговый протокол в УИК — нельзя ждать! «Когда вы примете наши жалобы?» На выручку приходит депутат Антонов, под его нажимом председатель ставит вопрос о нашем удалении с участка (головы участников комиссии склонены, а руки подняты), затем они составляют бумагу, потом Антонов отлучается, чтобы вызывать патруль. В это время подсчёт остановлен, и я сообщаю членам комиссии, что они стали соучастниками грубого нарушения закона. В отсутствие вожака ничего внятного они не отвечают. С одной стороны, величина вброса говорит сама за себя, но есть и другие важные для них цифры: оплата их труда. <br/> <br/> Около 22 полицейские заходят в участок и подгоняют нас угрозами разбить оборудование. Мы заявляем, что на их глазах нарушается закон: мотивированное письменное решение об удалении нам даже не предъявлено для ознакомления и подписания. «Вот оно» — «Покажите» — «Ознакомитесь в отделении, выходите». Председатель на своём участке – царь и бог, и не считает нужным соблюдать процедуру закона.<br/> <br/> Едем на дышле закона в ОВД «Нижегородский» (№97). Там мы проконсультировались по телефону с юристом горячей линией «Яблока» и написали встречное заявление об административном нарушении при удалении с участка, а также объяснительные, завизированные полицейскими — хоть какой-то документ. На выручку пришли муж наблюдательницы и друзья. <br/> <br/> Ближе к полуночи на такси и машинах добрались до управы района, где заседала ТИК, и, после недолгих уговоров, предстали перед комиссией как раз в тот момент, когда по нашему участку был подведён итог: оказывается, за «Единую Россию» отдали голоса 460 избирателей. Представим, что «Единой России» не приписали чужих голосов и прибавка ограничилась только вбросом. Даже в этом случае они получили примерно втрое больше (460 вместо 160), чем за них проголосовали! Услышав нашу историю и приняв жалобу, одни члены комиссии были шокированы, другие выразили сомнения в правдивости истории. Я заявил, что готов подтвердить свои наблюдения в суде. Вообще, подлог можно довольно просто изобличить: надо просмотреть реестр, в котором обнаружатся массовые подделки личных данных и подписей тех избирателей, на чьё имя были выписаны вброшенные бюллетени. <strong>Уголовное дело</strong>, между прочим. Наконец, возник резонный вопрос: а почему мы сразу не сообщили УИК о преждевременно опечатанном ящике? Или не упомянули об этом днём во время визита представителя? И тут надо честно признаться, что мы сами допустили ряд оплошностей. Растерялись от всего, что происходило. В штабе рекомендовали без нужды не обострять отношения, хотя, как выяснилось, как раз в данном случае надо было настаивать до последнего. Следовало не тратить время на спор с Антоновым и другими членами комиссии, а писать жалобы, и если их не принимал председатель — везти их в ТИК. Очень бы помогли ещё друзья-коллеги, но четверо, кого я звал, не захотели, а наблюдатель с совещательным голосом и, главное, опытом работы на выборах, собиралась приехать да не приехала. Её доступ к реестру избирателей очень помог бы установить подделку. Мы с Катей и фотокором от ещё одной газеты Татьяной до сих пор наадреналинены произошедшим. Говорят, что на других участках были похожие и даже более скверные ситуации.<br/> <br/> Каков же вывод? Многие не хотят приходить на выборы: дескать, выбирать не из кого, всё равно напишут нужные цифры. Услышал вчера шутку: «Мы голосуем за вас» — говорят избиратели. — «А мы голосуем за вас» — отвечают в счётных комиссиях. А вот это можно изменить. С какой стати <strong>за</strong> (т.е. вместо) нас решают, на что потратить национальное богатство? Ситуация дикая: на наши деньги работает отлаженная машина нашего же обмана. Да, мы фактически лишены выбора. Но мы не лишены права участвовать в выборах как наблюдатели — и в таком количестве, чтобы фальсификаторы не смогли сбить с толку, помешать видеосъёмке, просто вытолкать. И когда сопротивление народа станет массовым, власть переменится. Помните, Саурон был крутой и большой, а хоббиты - слабые и маленькие, но ... кто кого завалил? :)<br/> <br/> Очень рекомендую рассказ Катя Владышевской, чьим мужеством я восхищаюсь: \"Как я была наблюдателем на выборах 04 декабря 2011, или полный аллес капут\" <br/> Огромная признательность всем, кто нас поддерживал по телефону и личным приездом в полицейский участок.</p>\n<p><strong>А вот и рассказ Кати Владышевской. Те же события ее глазами.</strong></p>\n<p>Как я была наблюдателем на выборах 04 декабря 2011, или полный аллес капут</p>\n<p>Об этих выборах я бы говорила только в грубой матерной форме, если бы мама в детстве не объяснила, что это нехорошо. Итак…<br/> Однажды утром, читая очередной выпуск газеты «Ведомости», в разделе «Комментарии» я наткнулась на словосочетание «независимый наблюдатель на выборах» и стало любопытно. Вот и вся предыстория. Это уже в процессе подготовки любопытство превратилось в подобие гражданской позиции, или как это называют… Кстати, подготовка напоминала то сборы на войну, то приготовления сесть за карточный стол с шулерами. Советы типа «следите за руками» не казались странными. Время от времени кто-то пытался осадить, мол, это не боевые действия, есть закон и он на нашей стороне. Мне иногда тоже казалось, что фонарики, удлинители, диктофоны, фотоаппараты и видеокамеры – это излишне. Ну да, наивные мы. Наверное, всех нас воспитали любящие родители, которые прислушивались к нашему мнению: куда ты хочешь пойти, в кино, или на аттракционы? Давайте обсудим и вместе выберем… <br/> Закон есть. Он напечатан на бумажке. Всё. Точка.<br/> В общем, мы собрались, подготовились, как успели, и пошли работать наблюдателями. И вот скромная картина некоторых наших ошибок.<br/> 04.12.2011 07:40 – нас не пустили на избирательный участок, куда у меня было направление наблюдателем от партии «Яблоко». Переговоры через стеклянную дверь с членом комиссии (при этом полиция была с нашей стороны двери и ее тоже не пускали) привели к тому, что в 07:55 мы все-таки оказались в помещении для голосования. Стационарный ящик был уже опечатан, а нас отвлекали от подачи жалобы требованиями показать документы, редакционные задания и еще чёрта лысого. Тем не менее, перед тем, как первый избиратель опустил бюллетень, мы устно потребовали распечатать ящик или, хотя бы, заглянуть внутрь, чтобы убедиться, что он пуст. Некий депутат Антонов (с ним же велись переговоры через дверь) чуть ли не грудью встал на защиту ящика и, под угрозой удаления нас с участка, запретил приближаться к ящику ближе, чем на два метра.</p>\n<p><strong>Ошибка первая:</strong> испугавшись удаления, мы не стали усугублять ситуацию и отошли.</p>\n<p>Стали уже писать жалобу, но посоветовавшись с юристами, решили повременить и «не раскачивать лодку», пока председатель комиссии к нам благосклонна. Председателем была высокая блондинка с намеком на косоглазие, годами младше меня. Она во всем слушалась х.с.г. Антонова и почти не разговаривала с нами, даже если мы обращались к ней напрямую (прим. х.с.г. – хрен с горы). </p>\n<p>Дальше мы решили быть еще более вежливыми и, несмотря на то, что это право прописано в законе, попросили разрешения комиссии установить камеру с видом на прорезь урны. Кстати, урной она называется в привычном для нас значении – ящик для мусора. В ответ на нашу просьбу х.с.г. Антонов поднял невероятный шум, грозящий перерасти в скандал с рукоприкладством. Его основная мысль заключалась в том, что мы здесь и так милостью его, Антонова, и свои камеры и другие требования можем засунуть себе… ну понятно. В дальнейшем любой наш прыжок на месте расценивался как попытка улететь. На любое наше слово (всегда предельно вежливое, ибо мы пытались избежать удаления) х.с.г. Антонов начинал почти кричать, что мы мешаем избирателям и комиссии, куда-то звонил и жаловался, что мы ведем себя неприлично, устраиваем скандалы и нервируем всех вокруг. Надо заметить, что все наши просьбы не выходили за рамки прав наблюдателей и СМИ, прописанных в ФЗ об основных гарантиях и ФЗ о выборах в госдуму. Вопрос о том, почему присутствие наблюдателя от «Яблока» и представителей СМИ х.с.г. Антонова нервировал, а наблюдатель от ЕР нет, разбирать не будем. <br/><br/><strong>Ошибка вторая</strong>. Мы временно смирились с тем, что нам не дают установить камеру. А надо было поднимать шум, звонить в ТИК и в прокуратуру, чтобы приезжали, вскрывали ящик или хотя бы разобрались с камерой. Пусть бы мы поставили камеру часам к десяти, а они бы потом доказывали, что у них 40% избирателей проголосовали в первые два часа. Но, увы и ах, мы этого не сделали и мирно сели подсчитывать количество людей, опустивших бюллетени в урны, время от времени поглядывая на комиссию, которая в ответ на наши пристальные взгляды начинала коситься друг на друга, нервно озираться и шептаться.<br/><br/>Подсчитывали избирателей в четыре руки. Мой коллега Володя Камский (в статусе представителя СМИ) делал отметки на листе, где была напечатана последовательность цифр от одного до полутора тысяч. После каждого опущенного бюллетеня он зачеркивал следующую цифру. Я подсчитывала на электронном счетчике. Каждый избиратель – нажатие кнопки. Если требовалось отойти, кто-нибудь один оставался рядом с урной и продолжал отмечать за обоих. За весь день расхождения в наших подсчетах составили 2 бюллетеня.</p>\n<p>Этот наш мирный подсчет периодически вызывал вспышки гнева х.с.г. Антонова. Ни один из остальных членов комиссии за целый день ни разу не сказал, что мы мешаем работе. Когда мы заметили, что подсчет не должен занять много времени, так как проголосовавших всего 388 человек, х.с.г. Антонов со странным самодовольством заявил, что мы считали неправильно. Он, мол, за нами наблюдал и видел, что мы отмечали не всех пришедших. Ну, ОК, я готова согласиться, что мы могли пропустить человек 5 максимум. Хотя повторяю, расхождения между моими и Володиными подсчетами составили всего два голоса.<br/> В 20:00 х.с.г. Антонов (не председатель (!), та вообще ходила на задних лапах и во всем слушалась х.с.г.) собрал комиссию и объявил, что перед подсчетом голосов они должны принять решение о том, будут ли представители прессы присутствовать при подсчете голосов, так как по закону они на это права не имеют. То, что в законе о выборах в написано черным по белому, что представители прессы имеют право присутствовать при подсчете голосов, никого не смутило. Ибо законом для этой комиссии был х.с.г Антонов. (N.B. Это было уже не первое наше обращение к закону, пухлое издание которого мы взяли у самой же комиссии. Но, как только мы начинали зачитывать отдельные статьи в подтверждение законности наших требований, комиссия в лице Антонова уходила в глухую оборону, заявляя, что они подчиняются ТИК, и если мы хотим научить их работать, мы должны обращаться туда, а те уже пусть промывают им мозг.)<br/> В итоге комиссия приняла решение оставить представителей СМИ  с условием, что мы все будем сидеть по периметру и не издавать ни единого звука. Любое шевеление, тем более перемещение повлечет за собой удаление всех троих. Нам даже позволили поставить камеру для съемки подсчета голосов (естественно, чего им уже было бояться, все бюллетени были вброшены еще утром). О том, чтобы мы могли подойти так близко, чтобы видеть отметки в бюллетенях при сортировке (как указано в законе) не могло быть и речи.<br/> Мы согласились на эти условия, потому что любые наши протесты могли только ухудшить ситуацию.<br/> Мы сидели спокойно, до тех пор, пока комиссия не подсчитала неиспользованные бюллетени, коих оказалось всего 69. После этого нам стало очевидно, что наша «ошибка» в подсчетах бюллетеней, опущенных в ящик, составила 311 штук!!! У обоих сразу! Мы оба не заметили, как на участок прокрались 311 избирателей сверх подсчитанных нами и проголосовали за…. интересно за кого?... вот интрига-то…<br/> Мы в срочном порядке начали разрабатывать план дальнейших действий. Что мы теперь можем сделать, когда вброс уже совершен? Решили потребовать просмотра списков избирателей, в надежде увидеть там похожие подписи. Заодно написали жалобу о нарушении порядка подсчета голосов, а также решили подстраховаться письменным заявлением на осмотр списков избирателей. Выбрав момент, когда возникла пауза после подсчета голосов и протокол был уже заполнен, я обратилась к председателю комиссии с просьбой принять мои заявления. Как и следовало ожидать, на меня снова налетел х.с.г., не дав говорить с председателем. Заявил, что я вмешиваюсь в подсчет голосов, мешаю работе комиссии, а все мы вместе срываем подведение итогов. И тут же выступил с предложением, а точнее с утверждением, что комиссия должна принять решение о нашем удалении. Вся комиссия потупила глаза и, когда х.с.г. в третий раз повторил: «Они вам мешают! Ведь мешают же! Мы ДОЛЖНЫ их удалить! Голосуем!», подняла руки. Мне показалось, что одна рука осталась не поднятой, но коллеги говорят, мне это только показалось. <br/> Секретарь стала составлять решение о нашем удалении под диктовку х.с.г. Мы с места комментировали, что в нем должны быть указаны пункт закона, нарушение которого послужило причиной удаления, и конкретные действия, которые мы совершали. Здесь, видимо, возникло затруднение, потому что х.с.г. вместе с председателем удалились в чаепитную каморку и стали кому-то звонить. Результатом этих звонков стал приезд наряда полиции, который выдворил нас с участка и повез в Нижегородский ОВД. При этом нам не дали возможности ознакомиться с решением о нашем удалении, несмотря на наши настойчивые просьбы. По-хорошему, нам должны были выдать решение и, если в нем нет клеветы и мы с ним согласны, мы должны были тихо удалиться, не доводя до приезда полиции. Но такой возможности нам не предоставили. Полиция так же не составила никаких бумажек, на основании которых они забрали нас в отделение (тут я не знаю, что должна была делать полиция, может и не должно быть никаких бумажек, хотя предполагаю, что все-таки бумажки должны быть). В участке все прошло вполне мирно. Нам дали написать объяснение и подать заявление на незаконное выдворение с участка на комиссию. Все полицейские были вежливы и милы, хотя и под градусом. Может быть, потому что они просто хорошие люди (J), а может быть, потому что у них под дверью уже дежурили друзья, приехавшие нас поддержать (за что им большое спасибо! полицейские это заметили и сообщили нам). В общем, мы написали все, что хотели, получили копии своих заявлений и мирно вышли из участка. Очень хотелось домой. Все бросить и просто поехать домой. Но решимость Володи ехать в ТИК подавать жалобу на то, что нам не предъявили пустой ящик, восстановила мои силы. Он так и сказал: Я (!) поеду! Подразумевая, что даже если мы все сейчас разъедемся по домам, он в ТИК хоть на оленях, но доберется.<br/> В ТИК нас пускать не хотели. Но благодаря (а может и вопреки) сообщению одного из друзей, что ему в прошлом доводилось работать председателем комиссии, и он порядок знает и нас обязаны пустить, и еще нескольким (провокационным) заявлениям нас милостиво пропустили внутрь и даже устроили срочное заседание по нашей жалобе. На этом заседании мы кратко изложили, как происходило голосование на участке, что мы считали избирателей, что их существенно меньше, чем бюллетеней в ящике, что нас незаконно удалили с участка и увезли в отделение полиции и так далее. По ходу нашего рассказа нас поддерживал представитель «Яблока» в этом самом ТИК Нижегородского района – кажется, единственный человек, который действительно был заинтересован в том, чтобы УСЛЫШАТЬ правду. Выслушав наши объяснения, один из членов комиссии робко произнес: ну вот откуда 460 голосов за ЕР. Этот его робкий выпад быстро заглушили и замяли. Но большинство присутствующих все-таки поцокали языками, покачали головами, высказались на тему «какое безобразие». А потом принялись отечески журить нас за то, что мы не подали жалобу раньше, не позвонили, не сообщили и вообще все сделали неправильно и т.д. и т.п. Конечно же, прошлись по тому, что заявление наше отпечатано на компьютере, что мы заготовили его заранее, а значит пришли в УИК с заготовленной провокацией. На наши объяснения, что все возможные нарушения давно известны, и мы подготовились заранее, чтобы не терять времени на написание заявлений, и если бы не было повода, мы бы их как принесли, так бы и унесли и т.п., у одного из членов комиссии вырвался возглас: «Откуда вам известны возможные нарушения?» Да, действительно, откуда они нам известны? <br/> В итоге заявление наше приняли. Дали нам копию с отметкой о принятии и печатью ТИК (ставить не хотели, если бы я не настояла, так бы и не поставили) и пообещали перезвонить и сообщить, когда можно будет получить письменное решение по ней. С тем мы и вышли из ТИК. На выходе увидели картину, как один из членов ТИК (кажется под изрядным градусом) уже почти с кулаками нападает на того самого представителя Яблока с обвинениями, что он их всех провоцирует и заводит весь день. К месту назревающей драки уже бежал полицейский. Может быть, нам нужно было остаться и в случае чего вмешаться, выступить свидетелями, не знаю что еще… но голова была совершенно пустая. Эти мысли пришли уже когда мы отъехали на приличное расстояние от ТИК. Домой мы вернулись в три часа ночи. Что мы будем делать дальше, я пока не знаю, но что-то делать определенно хочется. <br/> Это только краткое эмоциональное изложение происшедшего и лишь небольшая часть нарушений, сделанных УИКом, и наших ошибок в попытке им противостоять. Мы еще много куда звонили, просили, требовали, консультировались. От тех, кто должен был, по логике вещей, нам помогать, никакой помощи не пришло. А краткие итоги таковы:<br/> 1. Даже если тыкать пальцем в закон, избирательной комиссии на это наплевать, они руководствуются чем-то еще (сложившейся практикой, указаниями ТИКа, отсутствием совести, whatever).<br/> 2. Попытки привлечь полицию к происходящим нарушениям встречались одной заученной фразой: «Нам все равно, мы не можем принимать ни вашу строну, ни их (УИКа)». Про сторону закона умалчивается. Зачем они нужны были на участке, я так и не поняла.<br/> 3. Работа наблюдателем – это не увеселительная прогулка. Это тяжкий и очень нервный труд.<br/> 4. Цифры: Всего бюллетеней, опущенных в стационарный ящик по нашим подсчетам – 388 (+-2)<br/> Количество проголосовавших на дому – 32<br/> Количество бюллетеней, оказавшихся в стационарном ящике – 699<br/> Кол-во бюллетеней с отметками за ЕР - более 450<br/> Итого проголосовавших по нашим подсчетам – 420<br/> Итого проголосовавших по данным УИК – 731<br/> <br/> К сожалению, доказать наши подсчеты нам нечем. Кроме нашей жалобы о том, что нам не предъявили ящик перед голосованием, мы ничего не имеем. И та, по мнению ТИК, подана слишком поздно и вообще неправильно. Но если компетентные люди нам скажут, что с этим можно что-то делать, мы будем делать. А к следующим выборам подготовимся намного лучше.<br/> И как там нужно писать? Все сказанное является моим личным мнением.</p>\n<p> </p>','otchet-nablyudatelya-duma-uik-1481/'),(1493,'значительные нарушения','','','',''),(1516,'','','','',''),(1541,'','','','',''),(1544,'','','','',''),(1569,'некорректная работа УИК','Марина Ступакова','Попытки вброса, попытка удалить наблюдателей, вмешательство замглавы управы','<p>Прочитайте, это важно - не допустить фальсификацию не так уж трудно! Надо только захотеть! Наш пример - тому доказательство. Мы много ошибались, не всегда вели себя наилучшим образом, но все-таки оказались сильнее этой шайки мелких жуликов под названием УИК №1569. </p>\n<p><strong>Состав команды</strong></p>\n<p>На участке №1569 мы вчетвером работали как наблюдатели: мой муж Александр в статусе члена избирательной комиссии с правом решающего голоса от КПРФ, я в статусе члена избирательной комиссии с правом совещательного голоса от КПРФ, мой сын Кирилл (19 лет) в статусе корреспондента газеты «Правда», его друг Лев Суханов (18 лет), в статусе наблюдателя от КПРФ. <br/>КПРФ была только прикрытием. Мы, понятно, беспартийные. Наблюдали потому, что достал весь этот беспредел власти. Немного готовились – мы с мужем прошли обучение в Гражданине Наблюдателе, почитали законы. Все участвовали в процессе наблюдения впервые. <br/>Нам повезло. На участке оказался еще один неангажированный член комиссии с решающим голосом от ЛДПР Август Цыганков. Совсем молодой парень, но очень собранный. Он сразу же примкнул к нашей команде и очень нам помог.</p>\n<p><strong>Место действия</strong></p>\n<p>УИК №1569 основана на базе Строительного Техникума, что определяет ее состав – все ее члены (за исключением двух выше упомянутых членов с решающим голосом и одного с совещательным из нашей команды) преподаватели и сотрудники Техникума во главе с Председателем УИК Соловьевой Еленой Алексеевной. Это достаточно сплоченный коллектив, который в этом составе организует выборы на протяжении 6-7 лет. Поэтому в реализации избирательного процесса они руководствуются не законом, а тем, что «мы всегда так делали». <br/>Также присутствовала наблюдатель от ПЖиВ – 70-летняя женщина, очень говорливая и общительная, которая, по ее признанию, пришла, чтобы «получить добавку к пенсии». Никакой идеологии, как и предполагалось. <br/>Расположение участка позволило УИК активно задействовать административный ресурс – преподавателей, учеников, их родителей и других родственников в приказном порядке заставляли брать отрывные и голосовать на этом участке, чтобы повысить показатели явки и процент проголосовавшим за ПЖиВ.</p>\n<p><strong>Оборудование</strong></p>\n<p>1.Фотоаппараты;<br/>2.Видеокамеры;<br/>3.Нетбуки.;<br/>4.Ручные счетчики;<br/>5.Диктофон;<br/>6.Свистки (если поймаем за руку вбрасывателя);<br/>7.Фонарики (если выключат свет);<br/>8.Ластики (если будут пометки в списках);<br/>Последние три пункта не понадобились.</p>\n<p><strong>Стратегия</strong></p>\n<p>Нашу стратегию можно охарактеризовать как «предупреждать и пресекать». То есть приоритетом было таким образом выстроить отношения с комиссией, чтобы желание фальсифицировать результаты выборов у них отпало полностью. В случае если наши меры по устрашению не будут действовать, было решено пресекать нарушения любой ценой.</p>\n<p><strong>Результаты</strong></p>\n<p>Мы добились поставленной цели – не допустили вброса и других прямых нарушений в выборном процессе. Нам удалось провести честные выборы и получить относительно чистый результат.</p>\n<p>Во всяком случае, он выгодно отличается от среднего по Москве. Мы так запугали все эти УИКи и ТИКи, что они даже не решились протокол в МГИК \"исправить\". </p>\n<p><strong>Хронология избирательного дня</strong></p>\n<p>Накануне выборов муж побывал впервые на участке и заметил, что стационарные ящики установлены почти вплотную к стене так, что в момент голосования наблюдателям и членам комиссии видны только спины голосующих - идеальные условия для вброса.<br/>Поэтому, прибыв 4 декабря в УИК в 7.00, мы первым делом подняли этот вопрос. Сначала попытались договориться с председателем, предложив либо перенести ящики для голосования (категорически нет - уже согласовано с ТИК), либо разрешить нам стоять около стационарных ящиков. Председатель комиссии заявила, что командовать здесь будет она, на что мы ей отвечали, что все будет происходить в рамках закона. <br/><br/>Под угрозой подачи жалобы (которая была заранее подготовлена) мы продавили второй вариант – нам было разрешено стоять около стационарных ящиков. Это было нашей первой победой. С одной стороны, это напрягло отношения с председателем и членами комиссии, с другой стороны, показало наш серьезный настрой и нежелание мириться с каким-либо нарушением нашего права вести наблюдение.<br/>Мы просмотрели книги, в которых оказались пустые страницы и отсутствовали данные паспортов избирателей, получивших открепительные удостоверения. Мы сделали председателю комиссии замечание, но обострять отношения на данном этапе не стали.<br/>Члены комиссии расселись за столы, было три основных и один дополнительный списки. Председатель сама предложила двум членам с решающим голосом нашей команды сесть за основной и дополнительный список, чем мы воспользовались, надежно заблокировав эти участки от возможных махинаций практически на весь день. <br/><br/>На дополнительном списке мы сразу же заметили нарушение. Для выдачи бюллетеней к основному списку прилагался список из 19 ФИО избирателей, не заверенный подписью и печатью. Нас напряг тот факт, что в коридоре образовалась очередь, в которой мы узрели признаки карусели. В списке оказались сотрудники Техникума, которые якобы не могли отлучиться от рабочего процесса и получить открепительное удостоверение по месту жительства, хотя среди них были прописанные на этой же улице. Заявления от избирателей с датой не больше чем за 3 дня присутствовали. Однако, так как мы не помнили наличие в ФЗ-67 упоминания о таком механизме, мы жестко воспротивились его реализации.<br/>Началась очередная эскалация конфликта. Председатель УИК Елена Алексеевна вызвала на помощь тяжелую артиллерию – председателя ТИК Марченко Оксану Викторовну. Приехав в сопровождении человека, который, заметив, что мы фотографируем очередь в коридоре, его подопечную и его лично, потребовал у «корреспондента Правды» удалить последние кадры. Он предъявил удостоверение ФСБ, причем руки при этом у него заметно дрожали. Мы указали ему на этот факт, а также на неправомочность его требований, сославшись на конституционное право «получать и распространять информацию любым законным способом» и Закон о СМИ. ФСБшник ретировался. В течение дня он еще не раз, сопровождая председателя ТИК, появлялся на участке, но оставался в коридоре и к нам не приставал. К сожалению, имя его мы в суматохе не записали. Он останется безымянным героем фронта фальсификаций и подделок.<br/><br/>Марченко Оксана Владимировна сослалась на закон о выборах в Госдуму № 507, где действительно присутствовала расплывчатая формулировка о возможности голосования по таким спискам, а члены УИК разыскали еще пару страниц списка в дополнение к первой (на этот раз с подписью и печатью). На основании этого был составлен документ – решение УИК. После спора с председателем ТИК, в ходе которого мы без предупреждения включили диктофон, что еще больше вывело из равновесия противоположную сторону, нам пришлось согласиться на голосование по списку. Выводы: о включении диктофона стоит громко предупреждать (или спрашивать разрешение), а знакомство с законами стоит расширить за пределы рекомендуемых Гражданином Наблюдателем.<br/>Итак, мы сразу с боем начали день выборов и уже к этому моменту деморализовали не только членов и председателя УИК, но и председателя ТИК. При этом мы говорили, что «мы настроены, чтобы провести эти выборы честно, и сделаем все от нас зависящее, чтобы соблюдать закон», и подтверждали это своим поведением. <br/><br/>Мы, как часовые, заняли позиции вплотную около стационарных ящиков и установили нетбук таким образом, что создавалась видимость трансляции картинки с ящиками в интернет. Мы рассказали об этом всем присутствующим членам комиссии и наблюдателю ПЖиВ. Пошли первые избиратели, и мы начали подсчет с помощью счетчиков. <br/><br/>На участке постоянно появлялись какие-то посторонние, они заходили и уходили. Это были члены ТИК, руководство техникума. Атмосфера была напряженной.<br/>Далее последовали как минимум две попытки вброса. Возможно, их было и больше, но твердо говорить мы можем о следующих инцидентах. <br/><br/>В первом случае женщина получила бюллетень, руки у нее при этом заметно тряслись. Член комиссии, выдавшая бюллетень, сидела пунцового цвета. После выхода из кабинки «избирательница» жалобным взглядом посмотрела на другую представительницу УИК, та отрицательно покачала головой. Все это происходило под нашими пристальными взглядами. Женщина опустила один бюллетень и ушла. В руках у нее был черный полиэтиленовый пакет. <br/><br/>Во втором случае довольно молодая женщина вела себя еще более подозрительно. Еще стоя в конце очереди (это был пиковое время) она начала поверх голов осматривать нас. Взяв бюллетень, она стала обращаться к членам комиссии якобы за рекомендациями по заполнению. Потом она и вовсе спросила, а где наблюдатели. Мы ей сделали ручкой. Тогда она с бюллетенем в руках стала кому-то звонить. Куртка на ней подозрительно топорщилась. После того, как она сделала выбор в кабинке и опустила бюллетень, я последовала за ней. Она явно кого-то дожидалась, так как медлила уходить. Видимо, должна была отдать бюллетени. И действительно одна из членов комиссии последовала за ней. Я продолжала наблюдение. Мы спустились на первый этаж, где традиционно проводилась продажа товаров. «Избирательница» остановилась и выбрала детскую книгу. Член комиссии, видя меня, не могла к ней подойти. «Избирательница» двинулась к выходу и опять встала около входной двери, «читая» купленную книгу. Я подошла к ней и завела беседу типа: «Смотрю, Вы книгу купили. Хорошая? У Вас детки есть?». Оказалась, что она няня. Я еще немного поддержала беседу, душевно с ней распрощалась, и мы направились в разные стороны – она вышла из техникума, я повернула обратно. Через минуту я выглянула – она стояла у выхода. Увидев меня, стала уходить. Я сказала ей что-то типа: «Идите, девушка, идите к детям». Няня побежала... <br/><br/>К чему я так подробно описала этот случай? Надо понимать, что нарушители – это обычные люди, которых корыстный интерес, а не идеологические установки заставляют совершать правонарушение. Они волнуются. Поэтому, во-первых, ведут себя странновато. Во-вторых, чувствительны к нажиму. Этим надо пользоваться. <br/><br/>Часам так к 11.30, видя, что попытки вброса не проходят, председатель УИК занервничала и начала предпринимать попытки удалить нас с участка. Сначала она с большим нажимом пыталась отправить меня вместе с выезжающими для проведения голосования на дому. Но так как желающих проголосовать на дому было всего13 человек, я отказалась. Она настаивала. Начала при мне звонить в ТИК и жаловаться, что я, будучи членом комиссии с совещательным голосом, не выполняю ее поручений. Зная, что я не обязана уезжать, я вежливо послала председателя подальше. <br/><br/>Хочу сказать несколько слов по поводу отношений с комиссией. Бытует мнение, что их надо сохранять корректными. И мы старались это выполнять. Хотя сейчас,  проанализировав свой опыт, считаем, что это лишнее. Председатели УИК и ТИК – это заведомо люди, которые будут нарушать закон. И хотя в присутствии избирателей по возможности надо держать лицо, с ними церемониться – это лишнее. Я не говорю о хамстве и мордобитии, но показать им, что мы знаем, с кем имеем дело, считаю необходимым. На войне как на войне. <br/><br/>Не сумев удалить нас законным способом, председатель УИК опять призвала на помощь председателя ТИК Марченко Оксану Викторовну. Надо отметить, что эта зловредная дамочка внесла определяющую лепту в конфликтную ситуацию на участке. Без ее влияния мы держали бы комиссию под тотальным контролем. <br/><br/>Оксана Викторовна приехала сразу с тремя жалобами на нас – от себя (на то, что мы задержали голосование по списку сотрудников), от наблюдательницы от Едра (на то, что ведем интернет-трансляцию с помощью нетбука) и от якобы избирателя (на то, что мы заглядываем в бюллетени и ведем видеосъемку, а также щелкаем какими-то адскими машинками, которые висят у нас на поясе). Оксана Викторовна призвала на помощь полицейского, который до этого обретался на первом этаже, чтобы убедиться, что эти девайсы безопасны. Полицейский подтвердил, что это так. Кстати, ручные счетчики очень удобны – дают возможность вести подсчет проголосовавших, не отходя от ящиков.<br/>После этого Оксана Викторовна и Еленой Алексеевной удалились, а полицейский остался нас охранять. Запахло жареным. Стало ясно, что дело идет к удалению. Я начала искать поддержку. Телефон Штаба Гражданина Наблюдателя был недоступен. Я попросила помощи у Штаба КПРФ. Я сообщила, что мы пока не допустили вброс, и не допустим, если они нас прикроют. И на всякий случай позвонила в «Голос», сообщив номер участка и описав ситуацию. Помочь они не могли, но обещали распространить информацию. <br/><br/>Я предупредила всех членов команды и начала морально готовиться к удалению. Елена Алексеевна собрала совещание, огласила вопрос по удалению на основе трех жалоб  меня и нашего наблюдателя Льва Суханова. Члена комиссии с решающим голосом и «корреспондента Правды» она удалять пока не решилась. С заявлениями нас не ознакомили. Мы потребовали их копии, но нам отказали. Члены с решающим голосом проголосовали, понятно, большинством голосов (минус два наших голоса).<br/>Елена Алексеевна дала команду полицейскому вывести нас. Мы отказались удалиться без копии решения и сели (для выноса). Полицейский мялся, уговаривая нас выйти. Я продекларировала ему, что он не должен подчиняться председателю без письменного решения, иначе нарушит закон. Он поверил. Кстати, этот представитель закона забыл представиться. Но этот аргумент мы оставили на случай, если бы нас все-таки стали выносить. <br/><br/>Чтобы не терять время, мы стали строчить жалобы сразу в ЦИК Чурову (благо к тому времени уже накопился целый воз нарушений, у меня получился список пунктов в 10). Удаляться не хотелось до жути. Мы понимали, что до этого момента мы не допустили крупных фальсификаций, но если нас удалят, то их вероятность повысится, несмотря на то, что часть команды все-таки останется. <br/><br/>Здесь мне трудно вспомнить порядок событий, так как накал страстей достиг апогея. К нам на помощь подъехала одна за другой две мобильных группы от КПРФ. В каждую из групп входили по депутату (в виде хрупких девушек) и их доверенные лица (решительные женщины). Они тоже подключились к «обсуждению» и написанию жалоб. Спасибо КПРФ за то, что они оперативно среагировали, спасибо этим отважным женщинам, что они отстояли наши и свои интересы!<br/><br/>Со стороны единоросов прибыли члены ТИК - Абаренков Сергей Николаевич (этот хлыщ уже давно вился на участке, видимо, вбросы – его область ответственности) и еще один безымянный, а также Владимир Владимирович Довгань, директор этого богоугодного училища (с ним мы уже тоже конфликтовали с утра по поводу незаверенного списка сотрудников). У Абаренкова дрожали руки, когда он показывал удостоверение, а Довгань орал как оглашенный. Мы тоже втянулись в перепалку, призывали избирателей в свидетели беспредела. Это выглядело ужасно со стороны. Я приношу извинения всем избирателям участка № 1569, но у нас не было другого выхода, мы не могли позволить себе тихо удалиться. Появился также замглавы управы района Текстильщики Александр Николаевич. Очень, как оказалось, приятный человек. Скандала ему не хотелось. И после кулуарных обсуждений нам удалось договориться баш на баш: мы забираем свои жалобы, а они свои, и мы остаемся на участке. Замглавы пообещал, что у нас на участке все будет хорошо. <br/><br/>Этот эпизод показал, кто здесь главный. Несмотря на принятое решение УИК об удалении наблюдателей и истерические выпады так называемого председателя ТИК (Оксаны Викторовны) все было моментально прекращено, как будто ничего не было. Один из полезных выводов состоит в том, что необходимо иметь прямой контакт с руководителем местной управы, который «курирует» выборы. Так, Александр Николаевич оставил нам свой телефон и просил звонить сразу же, как возникнет какая-либо неприятная ситуация. Они очень не хотят шума и огласки своих темных делишек. Это нужно четко понимать и использовать в полной мере. <br/><br/>Подчерку, что в течение дня и в том числе во время этой заварушки мы ни на секунду не оставляли без присмотра стационарные ящики, около них стояли двое из нас. Параллельно подсчитывали голоса и сверяли каждый час с суммой проголосовавших по спискам.<br/><br/>После заключения пакта – а это было уже примерно 16 часов - наступили такой покой и такая тишина, что единственной нашей задачей оставалось только стоять и пялиться на ящики, считать проголосовавших. До 20.00 на участок приходили только мирные жители. Мафия ретировалась. :)<br/>С подведением результатов все прошло гладко. Мы обеспечили если не полное, то достаточное соблюдение закона. Уже к 23 часам подсчет и упаковка закончились. Мы заранее написали и вручили под роспись требования выдать копии протоколов. Но тут опять началась какая-то мутота. Выдать протоколы нам не отказывались, но и не выдавали.<br/><br/>Елена Алексеевна начала тянуть резину. Они якобы вбили данные в какую-то программу и надо подождать, когда цифры сначала пожелтеют, потом посинеют, потом позеленеют. Шли минуты, часы, а мы все еще были без копии протокола.<br/><br/>Мне трудно сказать, что это было. Возможно, они надеялись, что мы уедем домой? Вряд ли. Думаю, они решали в верхах вопрос – фальсифицировать или нет наши результаты. Думаю, испугались.<br/>Получили мы копии только в 3 часа ночи. Написав (под роспись) заявления, что мы требуем оповестить нас о повторном заседании УИК, если таковое состоится, мы поехали домой. Уставшие и счастливые. Мы справились с этой бандой мелких жуликов! Мы не дали им украсть голоса!</p>\n<p><strong>Резюме</strong></p>\n<p>К чему я написала такой длинный отчет о событиях? Чтобы поделиться нашим открытием, которое мы сделали 4 декабря. Проломить эту систему фальсификаций не так уж трудно, потому что:</p>\n<p>1.У нас очень некомпетентные представители властей. Они плохо знают законы, поэтому зная их чуть лучше, можно их перебороть даже на их поле;<br/>2.Они – в данном случае – были на стороне «разбойников», а мы на стороне «казаков», что не добавляло им уверенности; <br/>3.Мы действовали по убеждению, а они по приказу;<br/>4.Мы ничем не рисковали, а они могли потерять многое.</p>\n<p>В такой ситуации победить их не так уж трудно. Доказательство – наш пример. Мы много ошибались, вели себя не всегда лучшим образом, но все равно оказались сильнее.</p>\n<p>И главное!!! Нам под силу остановить в Москве фальсификацию президентских выборов. Нужно только 10 тысяч человек, готовых потратить свое время и силы. Всего 10 тысяч неравнодушных людей, которые прочитают закон и проведут 18-20 часов на участке и ВСЕ! Мы получим ЧЕСТНЫЕ ВЫБОРЫ. Неужели мы не можем организовать такое простое дело, чтобы быть уверенными, что новый президент, кто бы он ни был, легитимен???</p>\n<p>Гарантирую, вы получите массу удовольствия и адреналина. Присоединяйтесь к движению наблюдателей! Есть партийные проекты КПРФ, СР, Яблока, ЛДПР, есть неполитические проекты типа Гражданин Наблюдатель.</p>\n<p> </p>\n<p> </p>\n<p> </p>\n<p> </p>\n<p> </p>','otchet-nablyudatelya-duma-uik-1569/'),(1571,'','','','',''),(1592,'значительные нарушения','','','',''),(1617,'некорректная работа УИК','','','',''),(1632,'некорректная работа УИК','','','',''),(1654,'значительные нарушения','Кирилл Федяев','Удаление, вброс силами членов комиссии, подмена протокола','<p><strong>Вот кто-то с горочки спустился, или как мы напрасно поверили в честность председателя избирательной комиссии</strong></p>\n<p>Пояснение: заголовок придуман не от балды, и это не метафора, это жизнь.</p>\n<p>Ситуацию, когда с самого утра качаешь права, так что днем тебя удаляют и до свидания, я не рассматривал. А общая ситуация конечно абсолютно патовая, и если не менять кардинально состав УИКов и не выводить их из-под местных администраций, то на президентских выборах надежд на реальный успех очень мало.<br/>Под участок 1654 выделена половина спортивного зала. Урны в одном его конце, наблюдатели в другом, между нами и урнами узкая полоска метров 20-30 длиной. Подходить к урнам нельзя, сновать туда-сюда вдоль кабинок не стоит, к спискам лучше не приближаться…</p>\n<p>Наблюдателей фактически двое: я с СПГ от Яблока и Олег корреспондентом от «Новой». Плюс от нашего проекта еще Лариса Ивановна из Солидарности, но ей лет под 80, она много курит (для чего естественно ходит на улицу) и вдобавок считает, что «днем ничего не происходит». Ну и по мелочи: молодой коммунист с решающим голосом, дудящий в одну дуду с комиссией и явно подосланный; от «Справедливой» паренек, этот вообще аполит, ночью он едва не вступил со мной в рукопашную, так как ему очень хотелось домой; и девица от ЕдРа, с ней были проблемы, особенно ночью. Короче, помощь от них ото всех нулевая. К сожалению, и от Ларисы Ивановны в силу ее возраста тоже.</p>\n<p>Председатель комиссии - Гладышева Елена Михайловна, милая, обходительная и дружелюбная женщина. Она нас быстро к себе расположила. Думаю, будь мне лет 12-13,  я б с удовольствием даже у нее в классе поучился. Негласный уговор с нею был такой: «Вы нам не мешаете, а мы вам». Пусть каждый занимается своим делом. И действительно, если нет каруселей, нет отморозков, у которых на лбу все написано, нет проставленных заранее галочек в бюллетенях и возмущенных сим недоразумением граждан, нет приписок в списках избирателей, и когда стул с избирателем пустой, ручкой в списке не водят – ну, какая действительно разница, где стоять наблюдать: в метре от урны или в десяти? Верно?</p>\n<p><strong> И, тем не менее, около 200 голосов вброса.</strong></p>\n<p>То, что 330 потом еще в ТИКе пририсовали ЕдРу за счет остальных – хрен с ними, это даже повеселило, но вот эти вот 200 разозлили и неслабо. Ибо это был исключительно НАШ промах. Это было НАШЕ поражение. И в противовес нашему поражению - ИХ победа, изящная и циничная.</p>\n<p> Я потом еще напрягался и думал, когда все пошло не так. И понял я вот что: пошло не так с самого начала.</p>\n<p> 1)      Что нам мешало не либеральничать с председателем при первом знакомстве, а, нацепив на грудь значки наблюдателей, зачитать ей наш «манифест»?</p>\n<p>2)      Что нам мешало добиваться переноса урн на видное место, а если и не переноса урн, то хотя бы статуса-кво: мы стоим рядом с урнами и занимаемся своим делом? «Мы своим, вы своим, как и договаривались»</p>\n<p>3)      И что нам мешало вести счет голосующих избирателей, чтобы под вечер не зависеть от списков – это раз, и погрешность по проголосовавшим, чтобы была не плюс-минус 70, а плюс-минус 7, - это два?</p>\n<p>4)      Что мешало взять на участок нормальную видеоаппаратуру, а не такую, какую взяли?</p>\n<p>5)      И что нам мешало, в конце концов, относиться к председателю не как к обычному человеку, а как к председателю УИК, которая есть часть ТИК, которая всецело подчиняется управе, которая органично вписана в коррумпированную систему, бездушную и по определению бесчеловечную?</p>\n<p> В этом последнем моменте, кстати, и заключается наш главный просчет. Человечное отношение к функционеру системы. Априори и не сговариваясь, мы с Олегом посчитали председателя достойным и вызывающим доверие человеком. Гонора админресурса в ней не чувствовалось ни малейшего. И довольно естественным выглядело наше желание, как минимум, не идти на конфликт.</p>\n<p>И даже больше. Ее, например, было искренно жаль, когда какой-то кавказец схватил ее за руку и грубо оттолкнул. Она не позволила ему и его жене проголосовать за детей, и он осерчал. Ментов потом парочка подвалила, кавказца с супругой увели, инцидент был исчерпан. И хоть они определенно были противниками ЕдРа, сочувствия они не вызвали. А она вызвала.</p>\n<p> И потом ее было жаль, когда она хмурая в течение часа ходила, подходила к нам, сокрушалась, что отойти никак от такого хамства не может, что напряженная она вся внутри и все такое. Мы верили.</p>\n<p>Короче, не воевать мы туда пришли, а работать. Это на войне ты стреляешь по всему, что движется, а на работе только в случае крайней нужды.</p>\n<p>И это удивительно на самом деле. Ведь знаешь, в какой стране живешь, телевизор не смотришь, читаешь «Новую», усвоил по пунктам катехизис наблюдателя, где на вопрос «кто вбрасывает бюллетени», дается ответ: «карусельщики или комиссия», ну и следи во все глаза за комиссией в отсутствие карусельщиков. Вот твой пост, вон твой враг. Ну а кто он еще, если занимается вбросами? Не будет же Емельяненко, допустим, обращать внимание на синяк на коленке Монсона и от этого, жалеючи соперника, бить слабее? И разве может для черного риэлтора, допустим, служить оправданием тот факт, что он дома старушку-мать кормит с ложечки «Растишкой»? В общем, при хорошо усвоенной теории на практике вышла засада. И это было обескураживающее и больно уязвляющее открытие.</p>\n<p> А когда все было уже позади, и они подогнали количество неиспользованных бюллетеней под количество проголосовавшего народу, и мы их уже часа три продержали в осаде, требуя показать списки, а они не хотели, так что аж сразу двум женщинам поплохело, и одна так вообще с заплаканным носом ходила, а на другую нам указывали пальцем и говорили, «смотрите, мол, гады, до чего человека довели», и уже черт знает сколько постороннего народу перебывало на участке и наобщалось с председателем, после чего удалили Олега как «постороннее на участке лицо», а потом наскоро пролистали мне списки («не хочешь – не смотри»), а потом занялись вываленными на стол бюллетенями, попутно бросая едкие реплики в мой адрес, так как я с камерой наперевес искал вброса и не находил (они маленькими порциями в течение дня кидали, и не один в другом листы были, а рядышком, я эти порции видел, но рефлекс не сработал, увы), так что вышло у ЕдРа в результате 43% – короче, после всего этого беспредела, в 1.45 где-то председатель ушла составлять протокол, а прочие дамы сели за стол. И вот хотите знать, что было дальше?</p>\n<p>Дальше была песнь. Победная. Исполняли ее хором. Одна сказала: «А не спеть ли нам песню?» Другие сказали: «А что, можно». И затянули: «Вот кто-то с гоооооорочки спустился. Наверное, мииииилый мой идет. На нем защиииитна гимнастерка. Она с умаааа меня сведет».</p>\n<p> «Вот это финиш», - подумал я. Картина «Дамы в расслабоне». Или скорее «Охотники на привале». Все равно как фальшивомонетчик всучит кому-то на рынке пачку поддельных тысячерублевок, а потом отойдет в сторонку и затянет: «Виновата ли я? Виновата ли я? Виновата ли я, что люблююююю».</p>\n<p> Только что они внаглую надули общественных контроллеров. В ту же самую ночь по всей стране еще много тысяч комиссий нагло надули общественных контролеров. Судя по масштабам надувательства, эта песнь про «защитну гимнастерку» должна была звучать от Калининграда до Чукотки надо всеми населенными пунктами. Я бы поежился. Это ж какие масштабы! А они ничего. Пели так, будто преодолев трудности и выполнив свой долг, они одержали заслуженную победу. Да, не нокаутом, да, по очкам, но ведь одержали же! Одержали! Как поется еще в одной песенке: «И все-таки, и все-таки, и все-таки мы победили!»</p>\n<p>Кража голосов не считается у них преступлением. Она у них не считается даже хулиганством или баловством. Кража голосов – это и есть та работа, которой занимаются на выборах все УИКи. </p>\n<p>А попутная их обязанность – война с активными наблюдателями. И почему же, спрашивается,  мы с Олегом жалели председателя УИК Гладышеву Елену Михайловну?</p>\n<p> </p>','otchet-nablyudatelya-duma-uik-1654/'),(1679,'','','','',''),(1680,'значительные нарушения','Дмитрий Черный','предполагаемый вброс, выдача избирателю заполненного за ЕР бюллетеня, скандал с потасовкой, удаление наблюдателя, подмена протокола','<p><strong> Отчет о выборах 4 декабря </strong>2011 г<strong>. на УИК 1680 (Даниловский район г. Москвы):</strong></p>\n<p><strong>Итог выборов:</strong></p>\n<p>1) Задание мы провалили. Председателю удалось незаметно для нас обеспечить вброс достаточный, чтобы ЕР получило 43% голосов. Немного радует только то, что на соседнем участке вообще при явке 33% к середине дня закончились  бюллетени - у нас все же такого ужаса не было. =)</p>\n<p>2) Жадность фраера сгубила. 43% им показалось мало, поэтому они уже в ТИКе переписали результат на 55,7% для ЕР. При этом у нас остались копии протокола с 43%. Сейчас готовимся идти в суд.</p>\n<p>3) У нас был достаточно сложный участок как в плане агрессивности окружения (председатель комиссии и директор школы были готовы обеспечить вброс любой ценой и обеспечили, да и персонажи они, судя по всему, совершенно бессовестные), так и в плане конфигурации самого участка, поэтому мы получили неплохой опыт. Все, что написано ниже - это подобие \"работы над ошибками\", чтобы донести опыт до других и попытаться избежать наших ошибок в дальнейшем. </p>\n<p><strong>Подготовка:</strong></p>\n<p>3 декабря (накануне выборов) примерно в 17:40 я пришел в школу 547, чтобы познакомиться с избирательной комиссией. Знакомство прошло нормально, я заметил, что конфигурация участка неудобна для наблюдения (они сослались на схему, утвержденную ТИКом), но не стал заявлять жалоб. Еще я не стал делать нескольких вещей, что было ошибкой. </p>\n<p><strong>\"Работа над ошибками\" на будущее:</strong></p>\n<p>1) Нужно переписать себе весь состав комиссии - когда они понимают, что их знают поименно, то это дисциплинирует.</p>\n<p>2) Нужно внимательно осмотреть помещение для голосования на предмет удобства для наблюдения и, если есть претензии, то сразу заявлять их в виде жалоб. В день голосования делать это будет некогда, поэтому шансы на удовлетворение жалоб равны нулю. Если сделать это заранее, то есть шанс, что что-то изменится. Это важно, так как невозможность видеть одновременно все урны (кроме переносных, так как там все равно много не вбросишь) будет означать, что подсчитать количество реально получивших бюллетени людей может быть очень сложно. В этом случае проверить, был ли вброс, нереально.</p>\n<p>3) Нужно обязательно ознакомиться со списками избирателей и настоять на том, чтобы они были прошиты и правильно оформлены, как положено по закону - не позднее дня, предшествующего дню выборов (без посторонних пометок, стоит выборочно проверить, не дублируются ли записи и т.п.). Ради этого стоит дождаться времени окончания работы комиссии и если что-то не так, то начинать день выборов сразу с жалобы. Это мегаважно, списки избирателей - основной инструмент фальсификаций.</p>\n<p>4) Желательно, чтобы в участок пришли познакомиться все наблюдатели, чтобы комиссия заранее понимала, что наблюдателей будет много. При этом можно не показывать, что наблюдатели чем-то объединены и будут работать в команде - в нашем случае для комиссии это стало неприятным сюрпризом. </p>\n<p>5) Желательно, чтобы в команде наблюдателей был один или два члена УИК с ПСГ - невозможность удалить такого человека - это очень крутое подспорье в работе. Потому что после окончания голосования наблюдателей стараются удалить, а с членом УИК этого сделать нельзя.</p>\n<p>6) Также крайне желательно, чтобы в команде был представитель СМИ, так как представитель СМИ может ссылаться на прямое разрешение закона осуществлять фото- и видеосъемку.</p>\n<p>7) Я получил мандат члена УИК с ПСГ только днем 3 декабря. По итогам выборов понимаю, что нужно было пробовать получить раньше и идти знакомиться с комиссией заранее (хотя бы в субботу утром) и провести с комиссией больше времени  - так было бы больше шансов повлиять на ситуацию в пользу соблюдения законности, возможно, заставить их отказаться от нарушений.</p>\n<p><strong>Голосование</strong>:</p>\n<p>4 декабря (в день выборов) мы пришли в УИК в 7.30 утра, комиссия уже была в сборе и как раз собиралась запечатывать урны. </p>\n<p>Мы увидели несколько нарушений, которые касались размещения комиссии. Поначалу они показались не очень важными, но в итоге повлияли на то, что мы пропустили вброс.</p>\n<p>Дело в том, что участок был расположен в коридоре школы (в спортивном зале, по словам комиссии, было очень холодно), столов для выдачи бюллетеней было 10 штук, и они стояли вдоль коридора длиной метров 30. Чтобы контролировать выдачу бюллетеней, нужно было постоянно перемещаться вдоль коридора. Ходить вдоль коридора нам не особо препятствовали, потому что ругаться одновременно с тремя наблюдателями у них просто не было сил (хотя формально нам указали на место для наблюдателей в конце коридора, где была видна только одна урна). Но две стационарные урны были расположены в двух противоположных концах коридора, а ширмы расположены так, что отгораживали урны друг от друга и от столов со списками избирателей. Увидеть обе урны одновременно было невозможно (в нарушение закона) - как только ты начинаешь идти вдоль коридора, то сразу теряешь из виду одну из урн. Вдобавок в коридор можно было войти с обоих концов, то есть люди заходили и так, и этак. Посчитать реальное количество избирателей, которые получили бюллетени, таким образом, было ОЧЕНЬ сложно (сразу скажу - у нас не получилось).  </p>\n<p>Кроме того, помимо помещения для голосования, на участке было также помещение для подсчета голосов, которое было оборудовано в отдельном кабинете, в который можно было закрыть дверь. Именно в этом кабинете висела увеличенная копия протокола и лежали переносные урны (после требования наблюдателей переносные урны положили в общем зале), а также были сложены бюллетени и иная документация УИК. Такое расположение помещений делало невозможной проверку того, как и в каком количестве членам УИК выдаются бюллетени, не отвлекаясь от наблюдения за голосованием и урнами. У нас банально не хватало людей, чтобы охватить все объекты для наблюдения.</p>\n<p>Представителя СМИ сразу отказались пускать на участок. Для того, чтобы разрешить проблему, пришлось скандалить, разговаривать по мобильному телефону председателя УИК с неизвестным куратором в ТИКе. В итоге представитель СМИ был допущен на участок. Скандал с допуском представителя СМИ разрешился относительно быстро еще и потому, что поджимало время и нужно было открывать участок.</p>\n<p>Затем мы предъявили наши направления Председателю УИК, она проставила на них отметки о принятии.</p>\n<p>Затем мы попросили ознакомиться со списками избирателей, но Председатель УИК заявила, что нам нужно срочно запечатывать урны. Это было сделано корректно (хотя и до наступления 8.00), урны были пустыми.</p>\n<p>Мы подали жалобу на расположение урн, но она не была удовлетворена. К сожалению, когда урны были опечатаны, то наступило 8.00 и на участок пошли избиратели. Поэтому в книгах нам покопаться толком так и не удалось (а в дальнейшем все наши попытки это сделать вызывали отчаянное сопротивление и скандалы).</p>\n<p>Тогда мы распределились по участку так, что один из нас смотрел за одной урной, второй - за другой урной, а третий - за столом с дополнительным списком.</p>\n<p>На момент начала голосования члены комиссии (председатель или секретарь, не помню точно, кто именно) сообщили мне о том, что на участке зарегистрировано 2095 избирателей (сказали, что вычли умерших и выбывших по открепительным). При этом на 3 декабря 2011 г. они мне говорили о 2183 избирателях, и в списке избирателей было именно столько (2179 зарегистрированных + 4 человека в дополнительном списке). Даже если из них вычесть 50 выданных открепительных + 13 открепительных, которые были выданы в ТИКе, то цифры не бьются. На момент начала голосования считать и выяснять подробности времени просто не было, так как нас было всего трое, а сразу после 8.00 на участке стали появляться люди, которые подходили в основном к столу Председателя УИК, за которым сидела сама председатель и секретарь УИК. Люди в очереди на вопросы, откуда они - отмалчивались или бормотали что-то невнятное. У нас есть видеозапись очереди.</p>\n<p>На столе у председателя УИК лежало несколько ничем не скрепленных листов бумаги со списком, по которому эти люди осуществляли голосование. Я попросил посмотреть на список, но мне было отказано со ссылкой на то, что я мешаю голосованию (\"не видите очередь, что ли?\"). Когда я заметил, что список не прошит, то потребовал прошить его, но это было сделано только через час или два. К тому времени по списку проголосовало 42 человека. Всего в списке было 103 человека. Во время голосования одного из людей по списку мне показалось, что он опустил в урну не один бюллетень, а два или три сразу (это было в 9:01, зафиксировать момент на видео не удалось - камера была направлена в другую сторону в этот момент), но я был не уверен в этом, а остальные голосовали вроде нормально. </p>\n<p>После долгих препирательств, подачи мной под отметку заявления об ознакомлении с дополнительным списком, когда я уже написал жалобу в ТИК и собирался ее везти, я показал жалобу одному из членов комиссии с решающим голосом от СР (было уже в районе 5 часов вечера). Он заинтересовался, вместе мы убедили одного из членов комиссии показать нам дополнительный список и узнали, на основании чего он составлен (ранее мне говорили, что он \"спущен\" из ТИКа). Это были заявления граждан о том, что они работают на \"предприятии непрерывного цикла\" и не могут голосовать по месту жительства. В списке были люди не только из разных районов Москвы, но и из других городов (например, один из Омска). Разумеется, никаких подтверждений этого факта в заявлениях не было. Правда, заявления были составлены в разные даты (в период с 21 по 25 ноября 2011 г.) и в основном разным почерком. Так как УИК имеет полное право удовлетворять подобные заявления, то я отказался от подачи жалобы в ТИК ввиду явной бесперспективности и риска не успеть к началу подсчета голосов.</p>\n<p>Еще одна мораль - о своих претензиях лучше спрашивать других членов комиссии - шанс получить поддержку довольно велик, особенно от членов комиссии с решающим голосом от партий.</p>\n<p>В отношении представителя СМИ Председатель в течение дня несколько раз предпринимала попытки его удалить с участка за видеосъемку, при этом ссылалась на (1) то, что он снимает лица, а это якобы персональные данные; (2) то, что у него нет аккредитации, а она якобы нужна. Попытки продолжались с завидной регулярностью, в том числи при помощи откровенных провокаций (председателю комиссии недовольные избиратели подали две или три жалобы на то, что в помещении УИК ведется видеосъемка). К сожалению, примерно в середине дня представитель СМИ был вынужден покинуть нас по причине плохого самочувствия (подскочило давление, начал терять сознание). С этого момента и почти до самого подсчета голосов мы остались вдвоем, примерно в 19:30 на замену приехал Дмитрий Яковлев с направлением от ЛДПР (его ранее удалили с другого участка, он ходил в суд, но без толку - суд отложил заседание; мораль - не надо ждать суда, лучше сразу ехать на другой участок).</p>\n<p>День прошел в попытках совместить подсчет проходящих избирателей, наблюдение за урной, ругань с председателем по поводу списков избирателей и других вопросов (например, она дважды пыталась выпроводить меня и другого наблюдателя на выездное голосование и очень возмущалась, когда выяснилось, что ехать - это наше право, но не обязанность). Оказалось, что сделать хорошо все вместе вдвоем практически невозможно. Вдобавок помещение, где членам комиссии выдавались бюллетени, вообще было вне нашего поля зрения. Пару раз появлялась директор школы и мы с ней ругались.</p>\n<p>Из забавного - на участок через час после открытия пришла женщина с мандатом наблюдателя от партии \"Яблоко\" (мы тоже были от \"Яблока\"). Я думал - это провокация и сейчас будут выдавливать нашего наблюдателя, но оказалось, что это просто ошибка, все обошлось, женщина еще раз приходила вечером узнать, как дела. к председателю подходили люди и спрашивали, почему нет мест для наблюдателей. То есть люди по незнанию хотели, чтобы наблюдателей обеспечили столами, стульями и прочим. Председатель пользовалась этими просьбами, чтобы в очередной раз поднять вопрос о том, что наблюдатели должны сидеть только на своем месте.</p>\n<p>Один раз подошла возмущенная женщина и сказала, что ей выдали бюллетень, который УЖЕ был заполнен за ЕР. Я, по неопытности и в силу общего бардака, просто не сообразил, КАК мне повезло, и что нужно срочно искать, где ей выдали этот бюллетень, искать там другие подобные, вызывать полицию и поднимать скандал. Бюллетень с нашего согласия (сдуру-сдуру, блин!) просто погасили, но контакты женщины я записал (она уже согласилась выступить свидетелем в суде).</p>\n<p>Много раз (человек 7 в общей сложности) подходили люди, которые сообщали о том, что в списках избирателей содержатся фамилии тех, кто уже давно умер или не прописан на участке. Я настаивал в этих случаях, чтобы комиссия ставила соответствующие пометки в книгах. А в конце дня одна такая \"умершая\"  бабушка появилась во плоти и устроила локальный скандал (председатель комиссии опять же это мне поставила в вину). Честно говоря, до сих пор не понимаю, что нужно делать в случаях, когда избиратели говорят про ошибки в списках. =)</p>\n<p>Больше ничего достойного внимания днем не произошло. Вбросов мы не заметили, хотя, судя по всему, они были. При подобной конфигурации участка заметить это было сложно, возможно действовать нужно было более решительно (правда тогда велика вероятность, что наблюдателя просто удалили бы с участка - председатель была настроена откровенно агрессивно). В общем, слажали. </p>\n<p><strong>\"Работа над ошибками\" на будущее:</strong></p>\n<p>1) На участке нужно минимум три (а лучше четыре) человека с четким распределением обязанностей: двое держат урны, один ходит по книгам, один отвечает на постоянные приставания председателя и остальных членов комиссии, подносит еду и подменяет других (в туалет и т.п.) и т.д. </p>\n<p>2) Нужно обязательно иметь телефон человека в ТИКе, что обращаться в сложных ситуациях, это дисциплинирует комиссию необычайно (когда к нам приходили наблюдатели от КПРФ и Яблока из ТИКа, то председатель вытягивалась по струнке прямо).</p>\n<p>3) Помимо телефона штаба \"Гражданина Наблюдателя\" желательно еще иметь телефон штаба партии, от которой ты формально записан наблюдателем. Они тоже иногда могут помочь.</p>\n<p>4) Председатель УИК - главное лицо в УИК и лично несет ответственность за фальсификации (в том смысле, что именно он их должен обеспечить и именно с него кукловоды спрашивают за результат). Это приводит к тому, что чаще всего рядовые члены УИК вообще не хотят ничего решать и делать без указания председателя. Председатель все делает сам. Поэтому если планируется вброс, то он будет вероятнее всего оформляться именно за столом, за которым сидит председатель или зампредседателя УИК.</p>\n<p>5) У членов комиссии небогатая фантазия и закона они не знают. Поэтому список претензий к наблюдателям довольно короткий: \"нельзя снимать видео/фото\", \"нельзя ходить по залу\", \"не дам знакомиться со списком избирателей\", \"вы обязаны мне подчиняться, я же председатель\", может еще кто-то что-то дополнит. На будущее имеет смысл по этому списку сделать короткую памятку (типа FAQ) с цитатами из закона - это облегчает поиск.</p>\n<p>6) Проявление каких-либо эмоций со стороны наблюдателей крайне нежелательно - это изматывает эмоционально и не дает эффекта. Наилучшая стратегия - просто механически цитировать закон снова и снова и настаивать на своем до тех пор, пока требование не будет выполнено. Без эмоций, без попыток убедить - к сожалению, опыт показал, что в работниках комиссии  на выборах просто нет ничего человеческого и убеждать их бесполезно, имеет смысл только требовать.</p>\n<p>7) Наблюдателю важно понимать, что наше наблюдение на самом деле направлено не на соблюдение процедуры до мелочей, а на предотвращение только тех нарушений, которые реально могут повлиять на результат - вбросов, каруселей, голосования по несшитым спискам, голосования за других людей. Все эти нарушения НЕВОЗМОЖНЫ без содействия УИК (просто потому, что бюллетени изготавливаются в самом УИКе, никто, кроме самого УИКа, не может предоставить вбрасывальщикам действительные бюллетени этой комиссии). Поэтому: </p>\n<p>(а) пофиг на мелкие нарушения, важно четко понимать контрольные точки: контролировать урны, следить за списками избирателей, проверять комиссию при подсчете голосов; </p>\n<p>(б) проявление ЛЮБОЙ попытки ограничить ваши права или ущемить вас со стороны членов УИК необходимо воспринимать как признак того, что они ищут возможность вас обмануть или отвлечь, реагировать соответственно - усиливать внимание.</p>\n<p>8) Некоторые вещи означают, что на участке нарушения ТОЧНО будут. Например, избирателю дали бюллетень, в котором уже стоит галочка за ЕР - это значит, что бюллетень подготовлен для вброса. Очередь больше 5 человек к одному из столиков - стопудово подготовка ко вбросу. В подобных случаях надо либо подходить и смотреть во все глаза, либо орать благим матом и звать полицию, останавливать голосование и скандалить.</p>\n<p>9) Не надо стесняться потребовать самим перепроверить бумаги, браться за бюллетени и книги и т.п., вести себя уверенно - как хозяева, а не как гости. Идеально - вообще разрешения ни на что не спрашивать, на претензии отвечать цитатами из закона.</p>\n<p>10) Не нужно бояться спорить с членами УИК при избирателях - например, просить убедиться, что запись об избирателе вносится в строчку с его фамилией, а не с чужой. Члены УИК как раз не любят гласности и если избиратель не свой, то лучше покажут документ, чтобы замять скандал. А если не показывают, значит, вы их поймали и можно требовать милицию - скорее всего, такой избиратель просто убежит. </p>\n<p><strong>Подсчет</strong>:</p>\n<p>Перед началом подсчета член УИК с решающим голосом от СР (единственный, кто нас поддерживал) внезапно сослался на болезнь и свалил с участка - потом я понял, что он, возможно, просто не хотел подписывать заведомо кривой протокол.</p>\n<p>Поначалу все пошло нормально - председатель собиралась сразу вскрывать урны, но мы заставили комиссию сначала погасить неиспользованные бюллетени (их оказалось меньше ожидаемого и мы окончательно поняли, что провалили вброс), потом поработать со списками и только потом приступать к урнам. Правда комиссия несколько напряглась по поводу времени, но несильно.</p>\n<p>На этапе проверки книг я не стал требовать перепроверить на выбор одну из книг - это тоже считаю своей ошибкой (Дима Яковлев предлагал, но я отказался) - лучше нарваться на отказ, чем не попробовать.</p>\n<p>Вся комиссия хором воспротивилась тому, чтобы мы снимали момент открытия урн. Наблюдатель от ЕР (молодой и дерзкий парнишка) заявил: \"вы не будете снимать\" в ультимативной форме. После примерно 15 минут хорового вопля мы все же добились возможности снять, как открываются урны - с условием, что не будем снимать лица комиссии.</p>\n<p>Когда открывали стационарные урны, то мне показалось, что мужчины - члены комиссии с РГ - как-то уж очень активно их трясли - похоже было, будто они хотят перемешать содержимое. Часть бюллетеней даже разлетелась по комнате, ну да хрен с ним - все равно уже провалили. Пачек бюллетеней внутри не оказалось - видимо, технология вброса отработана лучше с прошлых выборов - теперь вбрасываемые бюллетени не складывают пачкой, а складывают по отдельности, а уже затем складывают в пачку - при падении в урну они либо разваливаются, либо после вскрытия урны не выглядят так уж криминально.</p>\n<p>А вот на этапе сортировки бюллетеней и подсчета бюллетеней нам на соблюдении закона настоять не удалось. Комиссия в один голос заявила, что сортировать и считать бюллетени по одному они не намерены.</p>\n<p>К тому же в момент, когда бюллетени были посчитаны и председатель начала оглашать предварительные результаты, то я начал записывать результаты в чеклист, а один из нас начал снимать процесс на камеру и начался безобразнейший скандал. Предмет скандала не стоил выеденного яйца (члены комиссии сочли, что мы не имеем права записывать промежуточные результаты - у нас вырывали чекисты и пытались отнять камеру), но члены комиссии сбрасывали накопившиеся за день эмоции и остановить их не было никакой возможности. Кричали все. Наблюдатель от ЕР и учительница физкультуры (подвыпившая мерзкая баба) пытались силой помешать снимать на камеру все это безобразие, возникла небольшая потасовка даже. В общем, в итоге наблюдателя обвинили в том, что он снимал лица комиссии, и удалили единогласным решением с привлечением полиции. Весь скандал и удаление заняли более часа по времени. Решение на руки дать отказались, сфотографировать его потом тоже не удалось. После этого инцидента комиссия сплотилась против наблюдателей и окончательно отморозилась (нам говорили, что мы ведем себя беспардонно и нагло, что мы считаем, что все должно делаться только по-нашему, что нам идут на встречу, а мы ведем себя неблагодарно и некрасиво и т.п.). В итоге проверить подсчет нам не дали, итоговое заседание комиссии проводить не стали, наши жалобы рассматривать не стали, быстро подбили контрольные соотношения (сначала неправильно посчитали число выданных бюллетеней), нам выдали копии протокола, причем председатель комиссии наотрез отказалась заверять их надлежащим образом - вместо того, чтобы поставить свою подпись под словами \"Копия верна\", она поставила подпись на строке протокола, предназначенной для подписи председателя комиссии. Дальше комиссия отправилась пить чай и водку, председатель отправилась в ТИК, а мы сочли за лучшее удалиться из этого ада. Было около половины второго ночи.</p>\n<p><strong>Утром я обнаружил, что результаты на сайте ЦИК расходятся с имеющейся у меня копией протокола.</strong></p>\n<p><strong> \"Работа над ошибками\":</strong></p>\n<p>1) К вечеру от постоянного напряжения накапливается физическая и моральная усталость. Кажется, что основное уже позади. На самом деле вечером наступает САМЫЙ ВАЖНЫЙ момент - вы остаетесь с комиссией один на один. Нужно, с одной стороны, соблюсти политес, чтобы не быть удаленным и получить заветный протокол, а с другой стороны, не дать комиссии отморозиться и делать все что угодно (иначе все дневные труды могут пойти насмарку).</p>\n<p>2) Необходимо обязательно потребовать проверить на выбор хотя бы одну книгу из списков избирателей. Во время выдачи бюллетеней понять, правильно ли записывают все члены комиссии, нет никакой возможности.</p>\n<p>3) Также необходимо обязательно потребовать пересчитать на выбор самую толстую пачку бюллетеней (за самого популярного кандидата), чтобы понять, что все они действительно за этого кандидата.</p>\n<p>4) Идеальный вариант - это если в течение дня вам удалось ни разу не поскандалить, не скатиться на эмоции и получить у комиссии репутацию спокойного и взвешенного человека, знающего закон. Тогда есть шанс, что к вам будут прислушиваться. При этом психологически противопоставлять себя комиссии (\"если не сделаете по закону, то вы у нас тут все попляшете\") нельзя ни в коем случае - дальше ситуация скорее всего выйдет из-под вашего контроля.</p>\n<p>5) Мы не попробовали, но, наверное, можно попробовать взывать к совести членов комиссии, говорить им, что они учителя, что они учат детей дотошно соблюдать установленную процедуру, чтобы получить нужный результат, проводить аналогии. У нас не получилось.</p>\n<p> </p>','otchet-nablyudatelya-duma-uik-1680/'),(1705,'','','','',''),(1707,'нарушений не выявлено','','','',''),(1724,'','','','',''),(1749,'','','','',''),(1755,'','','','',''),(1775,'значительные нарушения','Дмитрий Тимко','карусель, попытки запретить наблюдателям перемещаться и вести видеосъемку, повторный протокол','<p>Пришел на участок избирательной комиссии (УИК № 1775) примерно в 7:20. Им оказался колледж МЧС по адресу ул. Нагатинская, д.4, корпус 2). Познакомился с председателем избирательной комиссии. Им, как обычно, оказалась климактериального возраста дама с замашками школьного завуча: Евгения Николаевна Дроздова. Остальные члены комиссии, судя по всему, являлись преподавателями и студентами данного колледжа. </p>\n<p> Председатель сразу же стала давить на наблюдателей, которые задавали первые дежурные вопросы про количество бюллетеней, количество избирателей: \"ой, да зачем вам это надо\", \"а вы не имеете права знать\" и т.п. Когда попытались ознакомиться с книгами избирателей - началось давление: \"вы не имеете права\" \"и вообще сядьте вон туда в угол\" - в общем, не было ни одной сферы, где бы председатель не попыталась что-либо нам незаконно запретить. Завучи - они такие завучи... Всего нас было пятеро наблюдателей, плюс еще одна женщина, которая пришла быть наблюдателем из-под палки; выглядела и вела себя она соответственно.<br/> Урны опечатали по правилам, все было чисто.<br/> <br/> <strong>08:00 - 10:00</strong><br/> <br/> К восьми установили камеру - в трех метрах от урны, сбоку. Вернее назвать - видеорегистратор, который принес наш ЧК ПСГ от КПРФ - Владимир Кабанов. Сначала крик подняла председатель - ей мы процитировали закон, а когда это не помогло, начали съемку ее действий на вторую камеру, озвучив номер участка и фамилии. Помогло. Через некоторое время пришел майор полиции по фамилии Гапон (имя и отчество я не записал) и потребовал прекратить съемку. На вопрос, на основании какого  документа он выдвигает такое требование, ответил, что документа у него нет, а есть устное указание от начальства. Был послан.<br/> <br/> После этого председатель попыталась нам запретить перемещаться по помещению - хотела заставить наблюдателей сидеть в одном углу и не подходить ни к столам комиссии, ни к урнам, никуда вообще. Технология повторилась: закон - видеосъемка - победа.<br/> <br/> Тут подъехала представитель ТИКа Семенова (имя и отчество я не записал), она также попыталась запретить нам вести съемку и перемещаться. \"Наблюдатель должен находиться в специально отведенном месте\". В общем, схема стандартная. Врубаю камеру, произношу \"Избирательный участок 1775, Дмитрий Тимко, вы видите представителя ТИКа, которая запрещает...\" ну и далее просто фиксируете все происходящее. Можно даже пытаться взять интервью. Гапон, кстати, тоже в это время появился второй раз и пытался участвовать в запрещении съемки и перемещения - все они были посланы, Гапона и Семенову мы больше не видели. А как смущенно все эти завучи отводили глаза и глотали свои децибелы обратно при виде включенной камеры - это надо было видеть.<br/> <br/> <strong>10:00 - 20:00</strong><br/> <br/> После того, как основные точки над \"i\" были расставлены, голосование пошло относительно скучно. Председатель все время на нас давила, пыталась ограничить перемещения, заставила опустить камеру так, чтобы не было видно лиц и т.д. Принципиальная победа осталась за нами, так что мы не стали накалять ситуацию без нужды. Тем более я сам до конца не уверен - может ли наблюдатель стоять в двух метрах сбоку от урны или нет.<br/> После того, как мы таким вот образом заявили о себе - из комиссии неожиданно пропал некий Куринной - гопообразный пацанчик с ноутбуком - существо в 45 кг веса, с наркоманскими глазами и перегаром. В комиссии его явно все знали (формально он был наблюдателем от ЛДПР) - что именно он хотел замутить на этом участке, так и осталось неизвестным. Председатель ответила, что ему пришлось уйти \"по работе\".<br/> <br/> Наблюдатели считали людей, опускающих бюллетени в урну. Считали в два источника: один человек рисовал ручкой, а пара других, меняясь, жали механический счетчик, обнуляя каждый час.<br/> Сынок председателя мне пообещал набить лицо за то, что я незаконно веду видеосъемку его драгоценной тушки, которая находилась в помещении для голосования. Что, впрочем, оказалось пустым звуком, как и многое другое, из того, что нам пришлось слушать в тот день. Два-три раза к нам приезжали карусели - маршрут одной из них я смог проследить: приехало шесть человек на белой иномарке, проголосовали по открепительным, сели обратно в машину и укатили - видимо, на следующий участок. Выглядели эти люди не намного лучше членов комиссии. Как бороться с каруселями, я так и не придумал. После обеда на избирательном участке постоянно присутствовал, как он сам признался \"сотрудник управы\". Насчет его присутствия к председателю мы не стали подходить, так как берегли силы - децибелы она выдавала качественно.<br/> <br/> <strong>20:00 - 02:30</strong><br/> <br/> Завершился избирательный день. Председатель сделала неожиданное предложение: \"Мы все устали - давайте-ка пойдемте все вместе попьем чаю в другое помещение, на полчасика. Наблюдатели посмеялись и ответили дружное \"нет\". Председатель стала рассказывать про совесть, про то какие мы плохие и все такое. После этого скомандовала считать бюллетени - чай пить ей вдруг резко расхотелось. Две девицы бойко отслюнявили неиспользованные бюллетени, объявили число. После этого Игорь вежливо обратил внимание комиссии на норму закона, где сказано, что бюллетени должны считаться по одному, перекладыванием с места на место. Председатель и челны комиссии поорали, пометались, но потом смирились и выполнили счет по закону. Счет сошелся.<br/> <br/> Подходило время проверять списки избирателей - началось давление. Председатель и члены комиссии подходили по очереди и говорили: \"Ну как вам не стыдно, у вас совесть есть в конце концов? А вот вам бы было приятно, если бы на вас как в зоопарке смотрели?\" и прочий бред. Или просто нагло: \"Немедленно пойдите и станьте в угол, отведенный для наблюдателей! Я, знаете, могу с вами отойти и по-другому поговорить! Вы мешаете работе комиссии!!!» Затем приступили было к подсчету избирателей в книгах - члены ИК бросились считать их все вместе, Игорь напомнил, что считать надо по очереди, в порядке возрастания номера книги. Тут председатель уперлась, и нас решили удалить. Перед подсчетом я пытался пролистать одну из книг избирателей сам, но член комиссии вырвал у меня книгу из рук. Включили видеозапись, на которой я попросил председателя объяснить, почему мне не позволяют прочесть книгу. Она включила режим \"я не я, ничего не знаю, ничего не видела\", после этого попросила Игоря удалить запись, он пошел навстречу. Состряпали акт, каждому выдали по копии, и мы - все пять наблюдателей - покинули помещение.<br/> После того, как этот акт увидели в ТИКе, они позвонили на участок и потребовали вернуть наблюдателей, так что спустя три часа я снова попал на участок, чтобы забрать копию протокола и убедиться, что бюллетеней в урнах они насчитали на 250 штук больше, чем народу пришло.</p>','otchet-nablyudatelya-duma-uik-1775/'),(1798,'','','','',''),(1823,'','','','',''),(1830,'','','','<p><strong>Участок 1830, Москва, Нагорный район.</strong> <strong>Александр Роганов</strong><strong><br/><br/>Оригинал статьи находится здесь </strong></p>\n<p><strong>Предыстория</strong></p>\n<p>На прошлых выборах в Думу меня впервые озадачила мысль (до этого было как-то на**ть) «а что это такое происходит, и почему так». Вызвана она была рядом сигналов от знакомых, поведавших о том, как директор одной из подмосковных школ, собрав учителей, за сутки до выборов заперлась в учительской и усердно ставит галочки в нужный квадратик, а также о том, что в центре столицы нашей Родины председатель комиссии грубо сфальсифицировала протокол, наплевав на всех и все. И еще пара историй схожего характера из серии «а ничего с ними не сделаешь». Тогда, понятное дело, никаким образом поучаствовать в процессе уже не было возможности, но подсознательное желание видимо осталось.<br/><strong><br/>Завязка<br/></strong>Однажды вечером на собрание нашей совсем не политической, а общественной организации пришли активистки проекта «Гражданин Наблюдатель». Они ожидали, что сообщество автомобилистов выделит им скорее водителей для оперативных групп, но мы их немного озадачили своим желанием выступить непосредственно наблюдателями на участках. Пара бесед, тренинг. Не сказать бы, что совсем низкого качества (базовый материал все же был донесен), но, безусловно, есть над чем работать, и обвинения власти в баснословном омериканском финансировании деятельности наблюдателей кроме как чушью и бредом никак назвать не могу. Да, неприятно, когда мегазамысел спалили, но объявлять порядочных граждан шпионами это очень зря.<br/><br/><strong>Действие первое. «Выборы». Безумные сутки<br/></strong>То, что все будет не чисто, стало понятно при знакомстве с председателем в субботу. Она почему-то настаивала на том, что завтра начало в 8-00, а также неудачно попыталась оставить меня без направления. Спалось мне не то, что плохо, скорее вообще никак. И вот наша команда стоит черным московским утром у забора этой школы. Зашли вовремя, сначала даже все выглядело прилично, даже документы показывали. Впрочем, нарушения сразу же обнаружились в документах (карандашные пометки), на требование убрать пометки был игнор и ближе к ночи ответ «все пометки удалены». Ну а к 9-30 вся шайка как с цепи сорвалась — мне, например, одновременно приказывали сесть в угол, предлагали попить чаю, давали талон на завтрак «строжайшей отчетности», угрожали удалением и, как вариант, направлением прогуляться по квартирам с миниурной. Учитывая, что подобные инициативы генерировались всего двумя людьми практически без перерыва, а при этом моего коллегу удаляли с участка, при этом пытаясь завязать драку при помощи непонятного лица ФСБшного вида, стало ясно, что что-то происходит.</p>\n<p>В этот момент произошел первый вброс. Какой-то чмырь закинул пачку, и упала она в почти пустую урну с неповторимым звуком. Так вышло, что его не удалось остановить, зато было получено подтверждение: спускаясь по лестнице чмыря спросил следующий чмырь; «Ну как, не попался?»… К этому моменту один наблюдатель уже был удален, по второму решался вопрос, а меня как члена комиссии с совещательным правом голоса под угрозой удаления отправили по квартирам с миниурной. Фактически в этот момент подсчет явки был серьезно затруднен, а возможность предотвратить вбросы утеряна. Мы приняли решение в подобных обстоятельствах «дожить» каким-либо образом до конца дня. Вариант разойтись по домам был заманчив, но не сочетался с гражданской позицией и желанием узнать правду.</p>\n<p>На протяжении дня молодые люди подходили к столу с открепительными, делали вид что голосуют и закидывали в ближнюю к кабинкам урну небольшие пачки (приблизительно по 7-10 бюллетеней). Председатель летала по помещению с околокосмическими скоростями, не выпуская из рук мобильный телефон. В одном из классов был организован штаб комиссии, в который мне почему-то сначала не давали войти, несмотря на то, что наблюдатели от ЕДРа туда ходили как по расписанию. Надежда на представителей ТИК рухнула вместе с их прибытием. Несмотря на то, что они вели себя гораздо менее топорно, почти сразу стало ясно, что они тоже часть постановки. Повеселило то, что председатель до вечера думала, что мы очень активно защищаем интересы партии «Яблоко», что щас она договорится со мной и ее пронесет. Не стал ее обманывать — не пронесет. Правда интересно, сколько бабла она была готова скинуть или чаем планировала с плюшками откупаться.</p>\n<p>Еще хочу особо отметить за очень крутую работу нашу коллегу журналистку из «Новой газеты», которой чуть-чуть не хватило времени, чтобы поймать вбросчика за руку с пачкой палева. Увы, он смог запихать пакость в урну, но в этот раз хоть полиция не облажалась, и хотя бы его личность осталась где-то фигурировать. Последний вброс сделал сильно нервный паренек в форме МЧС, но до него было не дотянуться, да и нас  опять забавляли попытками удаления и провокациями со стороны наблюдателей ЕДРа, КПРФ и «Патриотов России».</p>\n<p>После закрытия участка стало понятно, что один или несколько параметров запланированной махинации нами были нарушены, т.к. по помещению летали с мобилами уже на пару председатель и представитель ТИК. Процедура подсчета голосов была непоследовательной, непрозрачной и проведена с грубейшими нарушениями. Урну, в которую активно закидывали негодяи, почему то забыли как открывать и поэтому перевернули раза четыре (перемешали как бы). «Яблоку» почему-то насчитали 37 голосов, на чем жестко спалились, т.к. велась видеосъемка подсчета и пачка бумаги размером в 100+ листов визуально отличается от пачки в 37 листов. Забегали еще быстрее, порой пропадая минут на 20 в классах. Кому-то стало нехорошо. Простите, но я считаю, что хорошо от такой х***ни не должно быть никому. Плохо со здоровьем — не лезьте к кормушке по головам!</p>\n<p>В процессе  подгона пачка ЕДРа поредела с 758 до 723 голосов, а в протокол было внесено 667. Вот она сила математики! Даже забитые, лишенные техсредств наблюдатели легко и непринужденно снижают результат ЕДРа на участке на 10% ! Еще час-другой проканифолив мозги себе и другим, нам выдали неправильно оформленные копии протоколов (на всякий случай, мало ли). Я не буду здесь перечислять все то, что было в этот день нарушено, т.к. это достаточно утомительно и в целом неинтересно. Если случится такое чудо и будет суд над этими сволочами — там я постараюсь педантично изложить все. Особо запомнился эпизод, когда представитель ТИК в исступлении орала на полицейских и комиссию «Б**** , ВЫВЕДИТЕ ЕГО ОТСЮДА НЕМЕДЛЕННО!». Сей адский опус предназначался нашему коллеге, прибывшему под вечер на подмогу и тут же попавшему под замес «не снимай тут». С третьего раза председатель нашла правильный шаблон решения, распечатала его и парня наконец-то удалили. Обезумевшая женщина говорила, что «не простит, если мы дадим этому парню копию протокола, которую он отнесет к себе в ЛДПР и получит свои три тыщи». Увы, он тоже был от проекта, а не «отЛДПРзатритыщи». Заехали ночью в офис проекта, сдали улов, пообщались. Оказалось, у нас еще не самый ужасный случай, но в то же время были и те, кто смог противостоять фальсификациям и получить чистый результат. Сутки закончились — разбежались.<br/><br/><strong>Действие второе. «День митинга»<br/></strong>Проснувшись, заглянул в энторнеты. Про митинг прочитал — думаю ну его нах. Ну правда. Первые результаты имитации выборов особо не озадачили. Сильно расстроили отзывы из регионов, где ЕДРО загандошили, из серии «ваша поганая Москва». Блин, и в этот раз вроде даже есть за что. Грустно. Поехал на работу. Все валилось из рук, хотелось спать, но вроде как-то дожил до вечера. Так вышло, что одним из наблюдателей был мой коллега по работе и захотел он поехать на митинг, я понимал, что это авантюра, но в итоге и сам не смог пропустить такой экшн. Опоздали мы к началу, постояли, пообщались. Я зашел в общественный туалет с желтой буквой М. Краем уха послушал, что народ вокруг говорит — реально вокруг одни наблюдатели и политактив. Решили все-таки попробовать попасть на митинг, но на подходах увидели акт силовой погрузки людей в автобус, задержались поснимать и тут же были для комплекта упакованы туда же. Ни слова о том, кто задерживает и за что, сказано не было. Была надежда что рано или поздно отпустят, потому как не было ясно что нарисуют. Авторитетов в нашем автобусе не обнаружилось, все обычные ребята, пара журналистов. Приехали в ОВД, запихали нас в помещение для подготовки состава. За три часа надежда на то, что отстанут сменилась на нехорошее предчувствие вместе со статьей КоАП: начали переходом улицы в неположенном месте, продолжили участием в несанкционированном митинге и закончили неповиновением законному действию сотрудника полиции.<br/><br/><strong>Действие третье. «Добро пожаловать за решетку»<br/></strong>48 часов мы провели в ОВД, из них около 40 в обезьяннике вместе с бомжами, уголовниками и подсадными нашистами. В целом было хреново, но не фатально. Бодрились тем, что гандошили прокурорскую мразь, которая нам состряпала 19.3, ну и чтобы не повадно на вторые сутки объявили голодовку. Пару раз вызывали скорую товарищам по несчастью. Из общения с полицаями стало ясно, что кара нам заказана «от Колокольцева или выше». Потом судья Москаленко в экспресс-режиме осудила меня и еще 4 человек из ОВД Красносельское на 15 суток, отклонив все ходатайства и в целом судом это действо я бы называть не стал. Настолько чувствовала Мария Сергеевна себя неуязвимой, что даже не старалась. Не знаю, что там против нас имели наверху, но, наверно, 15 суток для большинства из нас оказалось слишком почетно. Огребли три наблюдателя, один политактивист и один обычный человек. Так что некий рандом все-таки присутствовал. Можно предположить, что выбор был не случайным и все остальные в обезьяннике святые, но судя по ситуации в изоляторах просто больше не было места. Вот мы уже сидим вчетвером в автомобиле газель, переделанном какими-то алкашами в автозак. Компанию нам составляют трое лимитчиков в милицейской форме и «бывший» нашист, которого для его же безопасности заперли в отдельный одиночный железный ящик, а затем высадили в хорошевском изоляторе. Можете называть меня параноиком сколько угодно, но я никогда не поверю, что человек собираясь покататься на машине пьяный без прав надевает на себя белую куртку-путинку и наглаженную сорочку, а потом, спалившись вещает из своего фсбшного лица, что он ушел из движения «наши» потому, что там стали мало платить. К слову, трясло в транспорте нехило, и уродец наверняка приложился об железку не раз и не два. Когда приехали на Симферопольский, полицаи наши что-то заныли — оказывается у ворот Спецприемника номер один собралась целая очередь из автозаков из других ОВД. Таким образом, 6 часов мы провели в неотапливаемом железном ящике. Дело было так — мегагазель глохла на холостых, электричества в ней хватало при движении либо на освещение, либо на обогрев. На стоянке же полицаи закутались в кабине в свои бушлаты, а нас оставили мерзнуть в кузове при минус двух. Часа через три, обменявшись с нами матюгами и угрозами расправы, изверги, немного растерявшись, решили сделать круг до заправки и обратно, чтобы немного погреть и себя и нас. Толку от 5 минутной поездки на холодной машине практически не было. К 7 утра наши трясущиеся в ознобе тела впустили погреться в изолятор, ну там и оставили. Даже разрешили, пока оформляют, потусить в офицерском сортире, что было весьма кстати. Взяв из вонючего подвала последний грязнущий матрац, я узнал что меня ждет 5-я камера, в которой сидит сам. «Бинго» сказал я, т.к. узнать побольше об этом человеке вполне себе распространенная в моей среде хотелка. Хотел еще Яшину навалять, но он был в 6-й и к моменту нашей встречи меня убедили, что он этого не заслуживает. На момент нашего прихода в камере был сам, несколько политических, пара воров-наркоманов, несколько этнических. В комнате стоял дым и угар. Политическое пополнение изменило баланс сил, распорядок в камере и в итоге всем понравилось. Отдельно хотелось бы поблагодарить всех людей, приносивших передачки несчастным политзекам, правозащитников и всех-всех, кто делал наше пребывание в изоляторе из нормального хорошим. 13 дней и ночей пролетели почти незаметно — много спали, еще много ели, книги там читали, в игры играли, доставали администрацию, а она нас, слушали радио. Я бы очень хотел рассказать о персоналиях и конкретных ситуациях, но считаю, что какие-либо подробности в открытом доступе могут нанести вред этим самым персоналиям. Скажу просто: парни, было очень круто, спасибо вам за увлекательнейшую неделю в моей жизни. Из услышанного мной по радио могу сказать, что Немцов и компания повели себя вообще не правильно (впрочем другого от них никто и не ждал, увы), еще тошнотворный пресс-марафон Путина запомнился. Реально от его тарабарщины голова заболела. Ни о чем. Постановка «Тагильскый Мужыг» разве что развеселила. Болотную слушали, над зданием несколько раз пролетал вертолет, вокруг стояло оцепление. Говорят, митинг был крутой. На мой взгляд, перелом был именно там. Опять люди разошлись с ощущением бесполезности. Но я не вправе решать за людей, что им надо делать. Еще полгода проживем спокойно, если повезет. Были пара обысков, разводы администрации, подсадные мутанты — всего понемногу. В целом все прошло прилично. Ближе к финалу наши гневные жалобы, куда только можно, все-таки сработали, и нас свозили в районный суд. Судья Цветков уже не был так категоричен с ходатайствами, но, тем не менее, по сути ничего не принял и отвод себе дать отказался ну и оставил все в силе. В общем, еще один цепной пес путинского режима.<br/><br/><strong>Заключение заключения<br/></strong>Вот-вот еще немного, какой-то час, а тут отвлекся на секунду и тебя уже выгоняют к дежурному и на свободу. Чем-то благодаря нам в спецприемнике гу мвд №1 закупили немного нового постельного белья, починили часть освещения, попытались починить сортиры, а еще «этнические хулиганы» узнали немного о законодательстве РФ, за что на нас сильно обиделась администрация, так как вчерашние, считай, рабы вдруг начали отказывать в невинных просьбах. Ну все, вот она свобода. Ночь свет фонарей, двое оперов снимают на видео, заграждение, человек 100 встречающих. Впечатлило очень сильно, правда. Чуть ли ни в первый раз в жизни пришлось выбирать, с кем поехать, и извиняться перед остальными. Автомобиль мой за две недели превратился в сугроб со спущенным колесом. Пытка холодом в газели и тюремные сквозняки вылились в продолжительное простудное заболевание непонятного свойства.<br/><br/><strong>Персоналии<br/></strong>Навальный оказался очень интересным и вполне адекватным человеком. Не удалось каким-либо образом подтвердить его связь с американцами (что очень радует). Меня немного удивило, что он ярый антисталинист, впрочем глядя на Кургиняна и Гоблина образца 2011 года стать антисталинистом не так уж и сложно.<br/>Яшина, несмотря на предысторию, я все же был очень рад встретить. Всем от него, как и раньше, сплошное беспокойство, этим он и ценен.<br/>Удальцов выглядел очень плохо, да и вообще я не понимаю, на кой черт над ним издеваются так долго, жестоко и бессмысленно. Он этого не заслуживает. Вот вас бы арестовали 28 раз за год — вы бы что тогда делали?</p>\n<p><strong>Послесловие<br/></strong> Эти и предыдущие выборы — фикция, но, тем не менее, на них критически необходимо приходить. Некие лица правят страной на силовых основаниях. Легко нащупать грань, где видимость исполнения законов легко перевоплощается в абсолютный беспредел. Небольшая встряска подняла со дна все г**но, и оно теперь строит из себя представителей Болотной и Сахарова, ну а кто-то просто тявкает издалека (привет Пучкову с Кургиняном). А что будет дальше - время покажет. Это пока приличные люди без вил митинговали, дай бог, чтобы водки и Дома-2 на всех хватило.</p>','otchet-nablyudatelya-duma-uik-1830/'),(1851,'некорректная работа УИК','','','',''),(1876,'','','','',''),(1882,'','','','',''),(1907,'','','','',''),(1918,'','','','',''),(1943,'значительные нарушения','Татьяна Черникова','Карусель, вброс, вбрасывающего поймали и отпустили, удаление 3 наблюдателей, не принимали и не рассматривали жалобы, ограничивали передвижение наблюдателей, в итоговом протоколе не отражены принятые жалобы','<p> </p>\n<p>Я участвовала в наблюдении на выборах 4 декабря 2011 г. в рамках проекта «Гражданин наблюдатель» на избирательном участке No 1943 района Царицыно. У меня был статус корреспондента СМИ. Со мной в рамках проекта «Гражданин наблюдатель» на участке находилось еще трое человек: один член избирательной комиссии с совещательным голосом от партии «Яблоко», один наблюдатель от партии «Яблоко» и один корреспондент. С нами также активно взаимодействовала представитель «Голоса», присутствовавшая на участке в качестве корреспондента.<br/> <br/> Утром мы пришли на избирательный участок в районе 7.20. Проблем с допуском на участок не возникло, нас сразу внесли в список присутствующих. Члену комиссии с совещательным голосом разрешили ознакомиться со списками избирателей. Он констатировал, что там не было посторонних отметок, кроме отметок напротив граждан, голосовавших в первый раз, которым избирательная комиссия собиралась вручать подарки. Нам показали две пустые стационарные урны и четыре пустые переносные урны. В 8 утра все урны опечатали при нас и разрешили заснять это на видео. Переносные урны находились на участке в пределах нашей видимости в течение всего дня голосования.<br/> <br/> В 8 утра избирательный участок открылся для избирателей. Нам не запрещали передвигаться по участку и вести фото и видео съемку, но периодически призывали ограничивать себя в этом, не пугать избирателей и вернуться на отведенные для наблюдателей места в углу комнаты. На месте для наблюдателей было несколько стульев. С некоторых из них были хорошо видны обе стационарные урны, с некоторых – только одна. В целом, до 15.00 нам удавалось контролировать общую ситуацию на участке и ситуацию вокруг урн.<br/> <br/> Серьезной проблемой было полное отсутствие возможности проконтролировать ситуацию со списками избирателей, к которым нас не подпускали. Это означало, что мы не могли проверить, голосуют ли люди за самих себя или за других, забирают ли у них открепительные и т.д. Ситуация осложнялась тем, что дополнительный список избирателей лежал на одном столе с одним из основных списков, и ими занимался один член избирательной комиссии. Из-за этого невозможно было подсчитать, сколько человек голосовали по открепительным талонам. Я спрашивала разрешения сесть рядом с этим членом комиссии, но мне не разрешили. Когда люди голосовали по открепительным, я пыталась посмотреть с расстояния в несколько метров, забирают ли у людей открепительные, но мне говорили, что я пугаю избирателей, и просили вернуться на место. Мы старались не конфликтовать с членами избирательной комиссии.<br/> <br/> Около 10 часов на участок пришел представитель Территориальной избирательной комиссии (ТИК) района Царицыно от партии «Единая России». Он сказал, что в комиссию поступили устные жалобы от избирателей, что их снимают на камеру. Мы пояснили, что при ведении видеосъемки мы соблюдали предусмотренные законом требования, в частности, не нарушали тайны голосования и не снимали лица людей крупным планом. Мы также сказали, что если на нас были поданы жалобы, они должны быть в письменном виде. Представитель ТИКа сказал, что он не хочет с нами конфликтовать, и что он просто пришел побеседовать и предупредить нас о необходимости соблюдать законодательство. Мы сказали, что намерены соблюдать законодательство. Представитель ТИКа вежливо попрощался и ушел.<br/> <br/> Председатель комиссии вовремя предупреждал присутствующих о том, что будет выезд для голосования на дому. Утром записавшихся для голосования на дому было 24, к 14.00 их стало 31. Мы решили, что это незначительное число и что наш представитель не пойдет наблюдать за голосованием на дому. Председатель комиссии сначала пытался заставить нашего члена комиссии с совещательным голосом пойти наблюдать за голосованием на дому, но после наших ссылок на законодательство признал, что он не  обязан это делать.<br/> <br/> Мы вели подсчет опущенных в урну бюллетеней и каждые два часа сверяли наши сведения со сведениями избирательной комиссии. До 15.00 эти сведения практически совпадали. В 15.00 стали происходить странные вещи с данными избирательной комиссии. Сначала нам назвали число проголосовавших на 200 человек меньшее, чем по нашим подсчетам, через 5 минут сказали, что ошиблись, и назвали число на 70 человек большее, чем наше, а через 15 минут снова изменили цифру, которая стала уже на 140 человек больше, чем наша.<br/> <br/> В 15.30 на участок пришла большая группа людей и встала в очередь перед столом, где лежали дополнительный список избирателей и один из основных списков. У меня возникли подозрения, что это карусель. Я вышла на улицу посмотреть, нет ли там транспортного средства, подвозящего избирателей к участку. Такого транспортного средства я не обнаружила. После этого я вернулась на участок и начала снимать на видео очередь перед списком. Один из людей, стоявших в очереди, подошел ко мне и спросил, на каких основаниях я его снимаю. Я показала ему свое удостоверение СМИ и сказала, что имею право вести съемку, оговорив при этом, что не собираюсь его снимать крупным планом. Он мне ответил, что не хочет, чтобы я его снимала вообще. Не желая идти на обострение ситуации, я отошла в угол участка и продолжила там видеосъемку. Из-за этого моего передвижения в поле моей видимости перестали попадать избирательные урны.</p>\n<p>Через 5 минут молодой человек, просивший меня не снимать, подошел к урне и вбросил в нее пачку бюллетеней. Свидетелями вброса стали представитель «Голоса» и корреспондент от «Гражданина наблюдателя». Зафиксировать вброс на видео не удалось. Корреспонденты стали задерживать убегающего молодого человека, а я – снимать это на видео. Его удалось задержать и сдать сотрудникам полиции. Его разговор с сотрудниками полиции я сняла на видео. Позже сотрудники полиции отдали этого человека председателю избирательной комиссии, который его отпустил.<br/> <br/> Мы начали протестовать против факта вброса. Из-за этого голосование на участке было приостановлено примерно на час, т.к. председатель комиссии удалился из зала для принятия решения. В это время на участке скопилось большое количество избирателей. Атмосфера была напряженной. Часть людей возмущалась тем, что они долго не могут проголосовать, часть людей выражала нам поддержку в связи с борьбой против вброса. Представители избирательной комиссии показывали людям на нас и говорили, что это из-за нас они не могут так долго проголосовать. Но большинство людей относились к нам нейтрально или доброжелательно.<br/> <br/> Вернувшись в зал, председатель комиссии огласил свое решение об удалении троих представителей «Гражданина наблюдателя» (члена с совещательным голосом от «Яблока», наблюдателя от «Яблока» и корреспондента). На участке остались я и представитель «Голоса». Мои коллеги перед уходом с участка хотели подать жалобу председателю комиссии на их удаление, но он их жалобы не принял. Я подала председателю комиссии жалобу на удаление моих коллег и на вброс бюллетеней. Мои жалобы он принял и внес в реестр. Однако в полученном в конце дня протоколе было написано, что поданных жалоб было 0. Мои удаленные коллеги подали жалобы в ТИК.<br/> <br/> После этого голосование на участке было продолжено. В период между 15.00 и 17.00, несмотря на часовую приостановку голосования, было зафиксировано двукратное увеличение явки избирателей.<br/> <br/> Через некоторое время на участок приехал представитель муниципального собрания района Царицыно, который высказал нам сожаление, что до нашего появления у них в районе все было спокойно, а теперь «творится такое». Поинтересовался, являемся ли мы жителями «Царицыно». Через некоторое время он уехал.<br/> <br/> Дальше до завершения голосования в 20.00 на участке все было относительно спокойно. К моменту завершения голосования к нам присоединились еще один наблюдатель от партии из «Гражданина наблюдателя» и корреспондент «Граней-ТВ» Дмитрий Зыков.<br/> <br/> В 20.00 завершилось голосование. В 21.00 начали работать над ведением данных в увеличенную форму протокола. В начале представители комиссии действовали в соответствии с законом, в частности, соблюдали поочередность действий.<br/> <br/> Были вскрыты урны, и этот момент Дмитрий Зыков заснял на видео. Во время вскрытия переносных урн нарушений выявлено не было. Во время вскрытия одной из стационарных урн были обнаружены две сложенные пачки бюллетеней. Одну из пачек быстро размешала представитель избирательной комиссии. Другую пачку удалось заснять на видео. Дмитрий Зыков задал вопрос члену комиссии с совещательным голосом от «Единой России» и наблюдателю от «Единой России», подтверждают ли он факт наличия в урной сложенной пачки бюллетеней. Они ответили на камеру, что да. Мы стали требовать отделить эту пачку от остальных бюллетеней и показать, за кого там были поданы голоса. Председатель комиссии показал, что все бюллетени были за «Единую Россию». Дальше мы стали требовать признать эти голоса недействительными. Председатель отказался это делать, и эти бюллетени были подсчитаны вместе со всеми остальными. Наш наблюдатель подал жалобу на факт обнаружения сложенной пачки бюллетеней в урне.<br/> <br/> При подсчете голосов не соблюдалась поочередность действий. Около 8 членов комиссии считали бюллетени одновременно. Нам чаще всего не разрешали подходить близко к столу, и мы большую часть времени не видели проставленных в бюллетенях знаков. Введению видеосъемки не препятствовали.<br/> <br/> В 2.30 утра 5 декабря я и все присутствующие получили протоколы. С получением протоколов проблем не возникло.<br/> <br/> Явка на участке составила 68%. «Единая Россия» получила 54%.<br/> <br/> </p>\n<p> </p>','otchet-nablyudatelya-duma-uik-1943/'),(1951,'значительные нарушения','Фёдор Грабар','карусель, беспрецедентно огромное количество проголосовавших по открепительным','<p><strong>Участники от проекта:</strong></p>\n<p>Грабар Федор - представитель от СМИ \"Новая газета\", итог - удален во время подсчета голосов;<br/> Наблюдатель номер два, Павел. По ошибке попал на участок 1961 в той же школе, где был наш участок. Принял решение остаться там. Итог - сообщил по телефону примерно в 23.55 о вбросе 300-400 бюллетеней;<br/> Наблюдатель номер три, Софья. Итог - удалось проследить за всем процессом и получить копию протокола.<br/> Кратко о формальном:<br/> - пришел в 07.40, познакомился, представился с документами, с ворчанием, но зарегистрировали.<br/> - список голосования был представлен в закрытом виде, проверить на предмет пометок не удалось.<br/> - пустые урны при нас были опечатаны.<br/> - в течение дня были ограничения для наблюдателей по перемещению по участку, фото- и видео- съемке, но так как помещение маленькое - кабинет физики (мама - привет!) – все было видно. Принял решение жалобы на мелкие нарушения не писать, чтобы \"дожить\" до подсчета и копии протокола.<br/> Ппомимо участников проекта, присутствовали наблюдатели от КПРФ - два участника (муж и жена), наблюдатель от ЕДРО и подставной наблюдатель от КПРФ, последние две - учителя школы, где проходило голосование.<br/> Из 7 членов комиссии во время голосования и подведения итогов присутствовали 6 человек, 5 из которых работают (или работали ранее) в школе, где проходило голосование.<br/> С высокой долей вероятности можно сказать, что на участке не было вброса. Урны нами хорошо контролировались в течение всего времени голосования. Из нас двоих на участке все время кто-то присутствовал.<br/> Несколько раз пытался после голосования уже в фойе школы остановить для предъявления документов подозрительных молодых людей. Милиция в просьбе проверить документы отказала (слово «карусель» они не понимают). Хотя бы напугал вероятных жуликов УКодексом.<br/> Итоги по количеству проголосовавших сошлись с нашими наблюдениями. Неиспользованные бюллетени после окончания голосования были пересчитаны и погашены (правда, только после настоятельной просьбы).<br/> Зафиксировано огромное количество голосовавших по открепительным удостоверениям - 150% (sic) от проголосовавших граждан по месту жительства.<br/> В работе УИК постоянное участие принимала представитель управы, в т.ч. в процессе СОРТИРОВКИ БЮЛЛЕТЕНЕЙ.<br/> Грубые нарушения процедуры начались сразу после закрытия участка. Из основных:<br/>- сразу вскрыли ящики (вываливать на столы не стали после убедительных просьб не нарушать закон),<br/>- подсчет по списку в книге сделали, но после убедительной просьбы, книгу после подсчета не убрали.<br/>-фиксация промежуточных итогов в увеличенной форме (УФ) на стене не производилась,<br/>-сортировку бюллетеней проводили всей комиссией, требования закона бюллетени показывать  по одному не выполнялись.<br/> - после того, как мною были высказаны неоднократные замечания по несоблюдению описанной в законе процедуры подсчета, с предложением ознакомиться с ними и им следовать, примерно в 20.15 был в течение 10-15 секунд (!) составлен протокол о том, что я \"... мешал работе комиссии\". Представителем милиции я был удален с участка. Сопротивления не оказывал. Милиция вела себя корректно. Копию протокола об удалении на руки получил.<br/> Указанные выше нарушения я попытался по горячим следам зафиксировать, прибыв в ТИК и подав заявления.</p>\n<p><strong>Результаты голосования (записал по телефону со слов Софьи)</strong>. </p>\n<p>Проголосовало 257 человек, в т.ч. 100 по спискам (явка 50%), 157 по открепительным.<br/> 6 - испорчено<br/> 1-я партия - 41<br/> 2-я партия - 31<br/> 3-я партия - 1<br/> 4-я партия - 37<br/> 5-я партия - 23<br/> 6-я партия /Единая Россия/ -116 (46%),<br/> 7-я партия - 2.<br/> С данными на сайте избиркома результаты сходятся<br/> <br/> <strong>Мои предложения к размышлению:</strong><br/> - Крайне важно количество надежных наблюдателей. Очень плохо, что нас было только двое. Троим или лучше четверым-пятерым гораздо легче отстаивать как свои права, так и нормы ФЗГ. Приходилось закрывать глаза на многие мелкие нарушения, запрет свободы перемещения и съемки и т.д., ради главной цели - получения копии протокола.<br/> - Интуитивная тактика \"злой\" - \"добрый\" следователь, а в нашем случае \"эмоциональный\" корреспондент - \"спокойный\" наблюдатель, оправдалась. Жаль, я \"не дожил\" до копии протокола, но моя напарница ее все-таки получила. Молодец! Есть еще студенты в русских селениях!<br/> - Две большие технологии \"правки\" результатов выборов - вброс и \"карусель с открепительными\". С первой бороться, как показала практика, удается. Задача состоит в том, чтобы найти лекарство против второй.<br/><br/> <strong>Чуть неформального:<br/></strong>- честными наблюдателями из не проектных участников показались только семейная пара от КПРФ, остальные – овощи;<br/>- опыт бесценный, уверен, поможет в жизни;<br/>- моя страна меня не перестает удивлять;<br/>- несмотря на все препятствия, люди, которые не карусельщики, шли голосовать валом, выстаивали в часы пик очередь;<br/>- жалко, а более стыдно за учителей, повсеместно (по крайней мере в Москве) втянутых в грязную кампанию по подтасовкам;<br/>- вчера сел в поезд, в купе 4 человека, никто не смог назвать ни одного знакомого, который собирался или фактически проголосовал за ЕдРо. А на моем участке таких молчунов оказалось аж 46%! Будем искать!<br/>- весело, если не задумываться насколько грустно.</p>\n<p><br/> Дай бог возможности и удачи в продолжении - март не за горами.</p>','otchet-nablyudatelya-duma-uik-1951/'),(1976,'','','','',''),(2005,'некорректная работа УИК','AnrydeRon','вброс, удаление наблюдателя, предотвращенная попытка нарушений при голосовании вне помещения','<p>Я был наблюдателем от \"Яблока\".</p>\n<p>В целом все прошло неплохо. Большую часть времени комиссия была корректна и выполняла наши просьбы.<br/> <br/> Руководила избирательной комиссией директор школы 879 Ольга Филипповна, при этом не занимая там никакой должности. <br/> Она позволила себе оскорбить партию \"Яблоко\", от которой я был членом комиссии с правом совещательного голоса, лично руководителя партии и проект \"Гражданин наблюдатель\".. После моих устных требований прекратить оскорбления она ушла в другую часть зала. Ольга Филипповна также пыталась убедить нас не приближаться к урнам (в ряде случаев мне (Тюрину Андрею) и моему соратнику Кудашеву Михаилу казалось, что готовится вброс, и мы приближались к урне на метр полтора) - но мы игнорировали ее требования, и мягко настаивали на своем.<br/> <br/> На избирательном участке не было стенда с партиями. На столах были разложены книги избирателей с указателями по домам, но я не стал протестовать против этого, сочтя это нецелесообразным.<br/> <br/> На дому проголосовало 33 человека, я лично проконтролировал. изначально предполагалось около 50 человек. Реестр они составлять поначалу отказывались. Во время работы выездной группы (которую я сопровождал) руководителю группы неоднократно звонили, вносили коррективы в список. Хотели так же вынести еще один ящик для параллельного обхода, ссылаясь на \"затерявшиеся записи\", но я пригрозил результаты по этому параллельному ящику аннулировать, и они отказались от этой идеи.<br/> <br/> Когда я вернулся со второго выездного голосования, мои соратники указали на то, что комиссия нервничала, когда они подходили и пересчитывали открепительные, и предложили мне ознакомиться с ними. Несмотря на устные замечания Ольги Филипповны, что я веду себя безнравственно, заглядывая через плечо сотруднице комиссии, которая  работала с открепительными удостоверениями,  мне их, не сразу, но все же предоставили для ознакомления. Внимательно ознакомившись с ними, я обнаружил где-то 20 избирателей с соседних улиц. Мне показалось это странным, и я попытался дозвониться до бригадира, потом до штаба ГН, потом до штаба Яблока, но все безуспешно. Во время этих моих попыток члены комиссии очень нервничали. На их требование не беспокоить граждан и замечание, что я сам открепленный, я заявил, что не против того, чтоб они обзвонили соседние участки и проверили, не голосовал ли кто по моему паспорту. После этого глава комиссии побежала к Ольге Филипповне, и та придумала отстранить меня от работы в комиссии за попытку разглашения конфиденциальных данных третьим лицам по телефону. Составление бумаги заняло 45 минут (бумага очень грамотная, они нашли закон и статью которую я нарушил, проголосовали единогласно), после чего в 18.20 я покинул участок, сходил домой, зарядил камеру и к закрытию принес соратникам. Они засняли вскрытие урны и подсчет голосов.<br/> <br/>КПРФ - 304 голоса. Едра - 257, СР - 229. ЛДПР и яблоко по 142<br/> <br/> При подсчете оказалось, что бюллетеней на 75 больше,  чем проголосовавших по подсчетам моих соратников, которые отмечали в тетради каждого проголосовавшего.</p>\n<p>Мы подозреваем, что проглядели вброс, хотя мои соратники были у урн все время голосования. Я думаю, что вброс был произведен в момент опечатывания ящиков для выездного голосования (урны опечатали сначала, потом, пока мы осматривали ящики, наверное, и произвели вброс).<br/> <br/> Я также подозреваю т.наз. карусель из 20-30 человек – за попытку передать их паспортные данные на другие участки меня и отстранили от работы на участке в 18.20. Наблюдение закончили мои соратники, они же сообщили мне результаты.<br/> <br/> После того как выяснилось, что едро не победило, большая часть комиссии было крайне подавлена. Когда они сообщали кому-то результаты, их грубо отчитывали часа два.<br/> <br/> Хочу отдельно отметить что сотрудники полиции и школьные охранники, оставаясь со мной наедине, были очень доброжелательны, сочувствовали нам, один даже сказал \" Молодцы. Если б везде работали так, как вы, все было по другому, а так, конечно, несправедливо.\"</p>\n<p> </p>','otchet-nablyudatelya-duma-uik-2005/'),(2010,'','','','',''),(2035,'','','','',''),(2050,'нарушений не выявлено','Хананашвили','чисто','<p><strong>ВЫБОРЫ – 2011. ДЕНЬ ЧУРК</strong></p>\n<p>Факт всплытия не позволяет<br/>дерьму считаться сливками.<br/>Из некоторых электоральных наблюдений</p>\n<p>Похоже, «лёд тронулся». Граждане, молча поглощавшие тонны PR-требухи от «партии власти» и её лидеров в течение более чем 10 последних лет, наконец в массовом порядке вышли на улицу. Уже не сотни и не тысячи людей; пока что – десятки тысяч, но, думаю, это – не предел.</p>\n<p>И у власти «затряслись поджилки». Это пока не очень заметно внешне. Продолжается хорошая PR-мина при плохой игре и задорное участие в инсценированном общении «с народом». Однако заметно движение уровня популярности «пресс-секретаря страны» вниз, вполне возможно, с ускорением, характерным для разочарования «голым королём», точнее «голым тандемом».</p>\n<p>Выборы, прошедшие 4 декабря с невероятным количеством нарушений, продемонстрировали, что ЕР – не только ПЖиВ, но ещё и, как я понимаю, <strong>ПОПСа – партия организованного преступного сообщества</strong>, с некоторым образом отлаженной системой разделения ролей: одни – планируют разнообразные противоправные действия и криминальные технологии по нарушению ими же (и для себя же) разрабатываемого и извращённо реализуемого избирательного законодательства, другие – «за три копейки» или под вертикально административной угрозой бегают между участками или занимаются вбросами бюллетеней «за одну партию» на глазах у «изумлённой публики», а третьи – «на голубом глазу» осуществляют «операцию прикрытия» и уверяют весь белый свет, что десятки и сотни видеозаписей – неубедительны, а съёмки – сомнительны, заявления не имеют под собою фактической почвы, их собственное поведение – безупречно, рекламная предвыборная кампания, проводимая ими с многочисленными нарушениями, является образцом легитимности.</p>\n<p>Помня, как нагло на прошлых выборах (2009 года в Мосгордуму) сговаривались «уполномоченные» лица об итогах выборов у меня на глазах, я сегодня почти любое видео могу принять. Впрочем, никто не мешает провести экспертизу идентичности картинки. Вот только кто бы этим занялся, независимый? Что-то не видно энтузиазма во властных структурах.</p>\n<p>Высказанные утверждения можно назвать жёсткими и нуждающимися в обосновании. Этому и будет посвящён предлагаемый материал.</p>\n<p>Однако, по порядку.</p>\n<p><strong> I. ДЕНЬ ВЫБОРОВ на «ПОЯСЕ ОРИОНА»</strong></p>\n<p>Нынешние выборы 2011 года уже вошли в историю. Вошли скандально, как и должно было быть, судя по сочетанию обычных предвыборных приготовлений «партии власти», связанных с инструктивными заседаниями в бюджетных учреждениях, чьи сотрудники, «по доброй традиции» являются членами участковых избирательных комиссий (УИК). На это обстоятельство (привлечение сотрудников бюджетных учреждений к работе в УИК) обращу внимание особо, поскольку, как представляется, это сегодня – один из самых мощных инструментов, применяемых властью для противоправных действий в процессе выборов. Одновременно, полагаю, что <strong>прекращение практики использования структур, зависимых от власти, должно стать главным требованием граждан, рассчитывающих на обеспечение справедливых и честных выборов</strong>.</p>\n<p>Работа в той или иной роли на выборах стала для автора данной статьи, в течение примерно последних лет 20 с небольшим, чем-то вроде хобби, сочетающегося с выполнением, пусть это и пафосно звучит, гражданского долга. Проведённый в позапрошлом году эксперимент по системному осмыслению происходящего в ходе выборов позволил сделать несколько интересных выводов  [1] . Однако «гражданская работа» в одиночку (точнее, в паре с собственным сыном), хотя и оказалась интересной, насыщенной новым знанием об устройстве выборов при нынешней власти и довольно с этой точки зрения наглядной, конечно же, не может быть достаточно эффективной, если она не включена в систему более широких, спланированных и скоординированных действий. </p>\n<p>Счастье «пришло» с ожидаемой стороны: Д.Орешкин, проделавший очень интересную и системную работу в 2009 году, способствовал соорганизации людей, желающих обеспечить соблюдение законности на предстоящих выборах в Государственную Думу ФС РФ в 2011-м. В течение нескольких последних месяцев сформировалось движение «Гражданин наблюдатель». Надо сказать, что собиравшиеся граждане первоначально были вовсе не уверенны, что им удастся выполнить исходный замысел – обеспечить примерно 5% избирательных участков системным наблюдением, с определённым «шагом» присутствия. Уже сейчас понятно, что выполнить эту задачу движению удалось. Правда, как я понял, распределение участников Движения оказалось не очень равномерным: на том участке, где я выполнял роль члена УИК (№2050), было два члена комиссии с решающим голосом, один – с совещательным, один представитель СМИ и два наблюдателя – от КПРФ и «Яблока». Пожалуй, этого хватило даже с избытком; а где-то присутствовал лишь один наблюдатель, удаление которого практически с неизбежностью приводило к потере гражданского контроля.</p>\n<p>Опишу «кейс» – с тем, чтобы читателю были понятны дальнейшие рассуждения. Кроме того, считаю, что цифровая конкретика оказывается в конечном итоге не менее важной, чем последующие обобщения и системные выводы.</p>\n<p>Участок мне попался, казалось бы, достаточно простой: всего-то избирателей немногим более 850 – досуговый центр «Орион», председатель комиссии (А.Н.Сидоренко) в этой роли выступал впервые, так что – вряд ли мог жёстко следовать инструкциям «вертикали», если таковые для него и существовали. Заглядывая несколько вперёд, могу сказать, что инструкции у него, видимо, были, но применять их г-н Сидоренко поостерёгся. Так что, по факту, могу поблагодарить его и, особенно и отдельно – молодёжный коллектив клуба «Орион», который выполнил свою ответственную функцию без нарушений.</p>\n<p>Наряду с внешней простотой ситуации на небольшом участке, почти сразу стало известно об одном факторе, способном заметно осложнить миссию: помимо «стационарных» избирателей, нашлись ещё и избиратели, пребывающие в Москве временно – студенты одного из соседних общежитий, статус которых оставался довольно долго не прояснённым. Напряжения же в целом были, я бы сказал, незначительные. Лишь первоначально, при определении местоположения урн для голосования, была председателем УИК предпринята попытка поставить их так, чтобы было незаметен сам момент опускания бюллетеней в урну. А когда по окончании голосования начался подсчёт бюллетеней, наблюдатели приблизились к столу, чтобы видеть процесс подсчёта. Это движение привело председателя комиссии в состояние повышенной нервозности, и он было даже предложил проголосовать за удаление наблюдателей, как «мешающих» подсчёту. Однако простая апелляция к разуму вкупе с нормами ФЗ-67 «Об основных гарантиях избирательных прав и права на участие в референдуме граждан Российской Федерации» (что-то вроде: «Артём Николаевич! Зачем проводить голосование, если можем потом оказаться в глупом положении – из-за того, что наше решение противоречит закону? Давайте посмотрим норму!») стала очень действенным шагом для, как говорили в 1970-х годах, «процесса разрядки напряжённости».</p>\n<p>Не утомляя читателя долгим описанием события длиною в 17 часов (от прихода в 7.00 до момента отправки заполненного и подписанного протокола и выдачи его копий всем заинтересованным), приведу цифры <strong>честного голосования</strong> (студенты из общежития были явно не организованными извне и потому голосовали так, как считали нужным). Скажу также о нескольких элементах, которые представляются мне наиболее существенными.</p>\n<p>Итак, результаты голосования таковы (по заверенной копии протокола, данные совпадают с вывешенными на сайте ЦИК) – проголосовавших – 495 (из 862) – 57,42%. Несколько более высокий процент по сравнению со средним <strong>честным</strong> показателем по Москве (примерно 50%) объясняется просто: это те самые студенты, которые голосовали, но вносились в список избирателей только по их собственному заявлению. Если б они изначально были включены в списки избирателей общим списком на основании временной регистрации, явка оказалась бы значительно ниже.</p>\n<p>Итоги же по распределению голосов таковы:</p>\n<p><strong> Справедливая Россия                   – 94 голоса (18,99%);</strong></p>\n<p><strong> ЛДПР                                                – 84 голоса (16,97%);</strong></p>\n<p><strong>Патриоты России                           – 10 голосов (2,02%);</strong></p>\n<p><strong> КПРФ                                               – 120 голосов (24,24%);</strong></p>\n<p><strong>Партия «Яблоко»                           – 85 голосов (17,17%);</strong></p>\n<p><strong>Единая Россия                                – 89 голосов (17,98%);</strong></p>\n<p><strong>Партия «Правое дело»                  – 7 голосов (1,41%).</strong></p>\n<p>Оставшиеся примерно 1,21 % (6 бюллетеней) оказались недействительными.</p>\n<p>Ну что ж, жители района именно так оценили популярность партий, претендовавших на места в Госдуме. <strong>Говорю это ответственно, и утверждаю</strong>, что более 30% (максимум 35%) голосов партия «Единая Россия» <strong>не могла</strong> набрать в Москве. Все результаты, превышающие данные примерные показатели, смело можно считать преступной фальсификацией, ещё точнее – <strong>государственным преступлением</strong>.</p>\n<p>Причём для доказательства я даже не стану приводить такие изящные инструменты, как распределение Гаусса, поскольку бессмысленно бессовестным лгунам доказывать, что дважды два – четыре. Но продемонстрирую результаты соседних честных участков и одного – нечестного, очевидно преступного. Голосуют жители значительной части района «Академический», проживающие рядом.</p>\n<p><strong>II. ПРЕСТУПЛЕНИЯ «ЭЛИТЫ» и «МУЖЕСТВО» РЯДОВЫХ</strong></p>\n<p></p>\n<p>Данная картинка вполне сойдёт вместо эпиграфа к данной части материала; дефицит грамотности вполне компенсируется точностью изобразительного мастерства.</p>\n<p>В качестве наглядной иллюстрации предлагаю взглянуть на несколько любопытных цифр – а именно, на результаты голосования на нескольких соседних участках (№№ 2050-2055). Живу в этом микрорайоне более 10 лет, и стало интересно, что же происходит у нас. Участки располагаются:</p>\n<p>- в досуговом центре «ОРИОН» (где я и был);</p>\n<p>- в одной из самых обычных, рядовых школ (участки 2051 и 2055, школа №102);</p>\n<p>- в тоже не очень «навороченной», школе №625 (участок 2052);</p>\n<p>- в общежитии МГУ «Домом аспиранта и стажёра» (ДАС МГУ) – участок 2053;</p>\n<p>- в школе (гимназии) №45 (участок 2054).</p>\n<p>Школа (гимназия) №45. Это – одна из так называемых элитных школ города («мильграмовская»). Находится она в нескольких минутах ходьбы от других перечисленных участков. А теперь – прошу сравнить.</p>\n<p>Для удобства и наглядности расположим данные в табличке[2].</p>\n<p><strong>Таблица 1</strong></p>\n<table>\n\n<tr>\n<td>\n<p>Наименование партии</p>\n</td>\n<td>\n<p><strong>Номера участков, учреждения – количество % (и голосов)</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong>2050 (клуб «ОРИОН»)</strong></p>\n</td>\n<td>\n<p><strong>2051 </strong></p>\n<p><strong> школа 102</strong></p>\n</td>\n<td>\n<p><strong>2052 школа 625</strong></p>\n</td>\n<td>\n<p><strong>2053 общежитие ДАСМГУ</strong></p>\n</td>\n<td>\n<p><strong>2054 гимназия №45</strong></p>\n</td>\n<td>\n<p><strong>2055 </strong></p>\n<p><strong> школа 102</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> СР</strong></p>\n</td>\n<td>\n<p>18,99% (94 голоса)</p>\n</td>\n<td>\n<p>18,21% (244 голоса)</p>\n</td>\n<td>\n<p>19.24% (238)</p>\n</td>\n<td>\n<p>14.54% (234)</p>\n</td>\n<td>\n<p><strong> 6.17% (111)</strong></p>\n</td>\n<td>\n<p>18,09% (214 голосов)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> ЛДПР</strong></p>\n</td>\n<td>\n<p>16,97% (84 голоса)</p>\n</td>\n<td>\n<p>10,60% (142)</p>\n</td>\n<td>\n<p>12.13% (150)</p>\n</td>\n<td>\n<p>9.94% (160)</p>\n</td>\n<td>\n<p><strong> 2.17% (39)</strong></p>\n</td>\n<td>\n<p>12,51% (148)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> Патриоты России</strong></p>\n</td>\n<td>\n<p>2.02% (10)</p>\n</td>\n<td>\n<p>1,94% (26)</p>\n</td>\n<td>\n<p>1.86% (23)</p>\n</td>\n<td>\n<p>1.99% (32)</p>\n</td>\n<td>\n<p><strong> 1.11% (20)</strong></p>\n</td>\n<td>\n<p>1,44% (17)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> КПРФ</strong></p>\n</td>\n<td>\n<p>24.24% (120)</p>\n</td>\n<td>\n<p>22,24% (298)</p>\n</td>\n<td>\n<p>24.98% (309)</p>\n</td>\n<td>\n<p>26.10% (420)</p>\n</td>\n<td>\n<p><strong> 7.28% (131)</strong></p>\n</td>\n<td>\n<p>26,20% (310)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> «Яблоко»</strong></p>\n</td>\n<td>\n<p>17.17% (85)</p>\n</td>\n<td>\n<p>23,66% (317)</p>\n</td>\n<td>\n<p>19.16% (237)</p>\n</td>\n<td>\n<p>20.32% (327)</p>\n</td>\n<td>\n<p><strong>6.11% (110)</strong></p>\n</td>\n<td>\n<p>17,16% (203)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> Единая Россия</strong></p>\n</td>\n<td>\n<p><strong> 17.98% (89)</strong></p>\n</td>\n<td>\n<p><strong> 19,10% (256)</strong></p>\n</td>\n<td>\n<p><strong> 18.51% (229)</strong></p>\n</td>\n<td>\n<p><strong> 23.56% (379)</strong></p>\n</td>\n<td>\n<p><strong> 75.00% (1350)</strong></p>\n</td>\n<td>\n<p><strong> 20,63% (244)</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> Правое дело</strong></p>\n</td>\n<td>\n<p>1.41% (7)</p>\n</td>\n<td>\n<p>1,72% (23)</p>\n</td>\n<td>\n<p>1.78% (22)</p>\n</td>\n<td>\n<p>1.68% (27)</p>\n</td>\n<td>\n<p><strong> 1.00% (18)</strong></p>\n</td>\n<td>\n<p>1,01% (12)</p>\n</td>\n</tr>\n\n</table>\n<p>В полученной картинке меня, очевидно, изумляет просто-таки бешеная провластная активность избирателей маленькой части квартала, вовсе не отличающегося подобными предпочтениями. А теперь – произведу несложную манипуляцию с цифрами. Перекинем из ячейки «ЕР» в ячейки СР, ЛДПР, КПРФ и «Яблока», «тупо», как принято выражаться в нынешней молодёжной среде, по 250 голосов. Результат – снова отобразим в табличке, сравнивая нынешний вид с результатом нашей манипуляции. Для наглядности в таблицу добавлю данные по участку №2050, за качество (точность и честность) которых я полностью отвечаю:</p>\n<p><strong>Таблица 2</strong></p>\n<table>\n\n<tr>\n<td>\n<p><strong> Наименование партии</strong></p>\n</td>\n<td>\n<p><strong> Участок 2054 (нынешние данные)</strong></p>\n</td>\n<td>\n<p><strong> Участок 2054 (данные с учётом «обратного переброса»)</strong></p>\n</td>\n<td>\n<p><strong> Участок 2050 («ОРИОН»)</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> СР</strong></p>\n</td>\n<td>\n<p><strong> 6,17% (111)</strong></p>\n</td>\n<td>\n<p>20,36% (361)</p>\n</td>\n<td>\n<p>18,99% (94 голоса)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> ЛДПР</strong></p>\n</td>\n<td>\n<p><strong> 2,17% (39)</strong></p>\n</td>\n<td>\n<p>16,30% (289)</p>\n</td>\n<td>\n<p>16,97% (84 голоса)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> Патриоты России</strong></p>\n</td>\n<td>\n<p><strong> 1,11% (20)</strong></p>\n</td>\n<td>\n<p>1,11% (20)</p>\n</td>\n<td>\n<p>2,02% (10)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> КПРФ</strong></p>\n</td>\n<td>\n<p><strong> 7,28% (131)</strong></p>\n</td>\n<td>\n<p>21,49% (381)</p>\n</td>\n<td>\n<p>24,24% (120)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> «Яблоко»</strong></p>\n</td>\n<td>\n<p><strong>6,11% (110)</strong></p>\n</td>\n<td>\n<p>20,30% (360)</p>\n</td>\n<td>\n<p>17,17% (85)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> Единая Россия</strong></p>\n</td>\n<td>\n<p><strong> 75,00% (1350)</strong></p>\n</td>\n<td>\n<p>19,74% (350)</p>\n</td>\n<td>\n<p>17,98% (89)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> Правое дело</strong></p>\n</td>\n<td>\n<p><strong> 1,00% (18)</strong></p>\n</td>\n<td>\n<p>1,00% (18)</p>\n</td>\n<td>\n<p>1,41% (7)</p>\n</td>\n</tr>\n\n</table>\n<p>А результаты-то из столбцов 2 и 3 почти совпадают! Вот вам и ответ на вопрос о том, что же сделали «элитные волшебники».</p>\n<p>Эта, или подобная ей, манипуляция – только в противоположном направлении и не только с цифрами, но и с бюллетенями – была проделана участковой избирательной комиссией на <strong>участке №2054</strong>. В этом и состоит преступление этих «педагогов».</p>\n<p>Для удовлетворения любопытства взглянул на данные по ещё нескольким «элитным» школам и обнаружил занимательную картинку: <strong> гимназия №1535</strong> и <strong>математическая школа №57</strong> явили миру столь же ч<strong>у</strong>дное, сколь и чудн<strong>о</strong>е антинаучное отклонение в политических предпочтениях и. при этом – невероятную сплочённость рядов за ПЖиВ. В связи с чем возникает ещё одно «смутное сомнение»: уж не являются те самые московские гранты, выданные этим школам №1535 и №57 – по 15 млн. рублей, №45 – 5 млн. рублей) в преддверии выборов «за наилучшие показатели» эдаким бонусом – для уверенности в «правильном» голосовании на «школьных участках во время выборов? Отдаю должное при этом и некоторым школам, гимназиям и лицеям, не вошедшим в этот позорный список – либо из-за честности коллективов комиссий УИК, либо же по причине осторожности отказавшихся от такой сомнительной чести – принимать у себя в школах выборы и на своих плечах «из болота тащить бегемота».</p>\n<p>Для показательности продемонстрирую нижеследующую таблицу – «элитных» школ города Москвы. Данные взяты по гимназии №1535 (первая – в рейтинге московских школ), школе №57 (вторая – в этом же рейтинге) и гимназии 45. Оцените результат!</p>\n<p><strong> Таблица 3</strong></p>\n<table>\n\n<tr>\n<td>\n<p><strong> Наименование партии</strong></p>\n</td>\n<td>\n<p><strong> Участок 2054 (гимназия №45)</strong></p>\n</td>\n<td>\n<p><strong> Участок 190 (гимназия №1535)</strong></p>\n</td>\n<td>\n<p><strong> Участок 175 (школа №57, математическая)</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> СР</strong></p>\n</td>\n<td>\n<p>6,17% (111 голосов)</p>\n</td>\n<td>\n<p>2,31% (34 голоса)</p>\n</td>\n<td>\n<p>3,12% (37 голосов)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> ЛДПР</strong></p>\n</td>\n<td>\n<p>2,17% (39)</p>\n</td>\n<td>\n<p>0,81% (12)</p>\n</td>\n<td>\n<p>2,45% (29)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> Патриоты России</strong></p>\n</td>\n<td>\n<p>1,11% (20)</p>\n</td>\n<td>\n<p>0,27% (4)</p>\n</td>\n<td>\n<p>0,84% (10)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> КПРФ</strong></p>\n</td>\n<td>\n<p>7,28% (131)</p>\n</td>\n<td>\n<p>3,87% (57)</p>\n</td>\n<td>\n<p>7,17% (85)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> «Яблоко»</strong></p>\n</td>\n<td>\n<p>6,11% (110)</p>\n</td>\n<td>\n<p>2,78% (41)</p>\n</td>\n<td>\n<p><strong> 0,42% (5)</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> Единая Россия</strong></p>\n</td>\n<td>\n<p><strong> 75,00% (1350)</strong></p>\n</td>\n<td>\n<p><strong> 86,22% (1270)</strong></p>\n</td>\n<td>\n<p><strong> 85,92% (1019)</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong> Правое дело</strong></p>\n</td>\n<td>\n<p>1,00% (18)</p>\n</td>\n<td>\n<p>0,27% (4)</p>\n</td>\n<td>\n<p>0,08% (1)</p>\n</td>\n</tr>\n\n</table>\n<p>Потрясающее единство не только результатов, но и, судя по всему, методов, с помощью которых были обворованы «соседи» по списку – СР, ЛДПР, КПРФ и «Яблоко». В третьем случае, правда, политические противники были ограблены, очевидно, на несколько меньшее количество бюллетеней, полагаю, «всего-то» на 800 штук (например, по 200 с каждой). «С миру по нитке, ЕдРу – большинство в Госдуме».</p>\n<p>Обращу внимание на цифру проголосовавших за партию «Яблоко» на участке №175: уверен, что не составит большого труда найти на этом участке людей, проголосовавших за эту партию. Причём, даже не сомневаюсь, что их наберётся заметно больше, чем это указано в протоколе. Для ловких деятелей из «математической» школы, полагаю, открытый и справедливый судебный процесс мог бы стать неплохим уроком не только математики, но и уголовного права.</p>\n<p>В этом случае, помимо уже высказанного предположения про «бонус», возникает ещё и ряд других, вполне закономерных вопросов:</p>\n<p><strong>Можно ли доверять наших детей таким учителям? </strong></p>\n<p><strong> Насколько правомерно, что данные школы считаются одними из лучших в столице?</strong></p>\n<p><strong> Кого они могут воспитать, если педагогическому коллективу не хватает элементарной совести для обеспечения справедливых, а не преступных выборов?</strong></p>\n<p>Пожалуй, самый главный вопрос, который, впрочем, имеет, скорее всего, банальный ответ: кто координирует подобного рода фокусы в системе государственных учреждений, прямо зависящих от «руки дающего»? Насколько далеко простирается эта вертикаль? Не сомневаюсь, что сходство (если в данном случае – не <strong>единство</strong>) методов позволяет сделать полученный ответ однозначным – система столичного образования. И тогда получается, что школы (и другие бюджетные учреждения), которые, несмотря на прямой и жёсткий диктат и угрозу применения финансовых или административных санкций, не стали заниматься махинациями и нарушением избирательного и уголовного законодательства, являются учреждениями, заслуживающими высокого звания <strong>гражданственных</strong>. Всего-то – не стали нарушать закон, но в наше время и для этого уже необходимо гражданское мужество. Спасибо им!</p>\n<p><strong>III. ПО СЛЕДАМ ПРЕСТУПЛЕНИЙ</strong></p>\n<p></p>\n<p>Знакомясь со многочисленными сообщениями о нарушениях в день выборов, попытался, если не систематизировать применявшиеся уловки и нарушения, то перечислить хотя бы основные их типы. Условно в качестве таковых можно назвать следующие:</p>\n<p>1. «Вброс». В урну для голосования, в тот или иной удобный момент (до начала голосования, во время, после окончания – к остальным выпавшим) вбрасываются имеющиеся бюллетени, заранее заготовленные членами (руководителем) УИК. Наиболее рискованный способ, поскольку факт может быть зафиксирован и неизбежно порождает скандал в самый момент свершения. Сюда же входят и карусельщики, которые, по сути, осуществляют ту же функцию, но завуалированно (об этом чуть подробнее – ниже). Основной вторичный признак наличия – повышенное количество голосовавших. Массовое использование подобной технологии позволяет говорить о необходимости переименования партии, члены которой могут впредь себя называть «единовбросы». Такое название тем более обосновано, поскольку осуществить преступный замысел можно только в сговоре – организаторов, самих исполнителей и членов комиссии, допускающих это преступление.</p>\n<p>2. «Переброс». Во время подсчёта голосов из одной стопки бюллетени перекладываются в другую, в помощь «нужной» партии. Такое действие может быть произведено в том случае, если при подсчёте голосов нет никакого реального контроля или имеет «дружественный контроль», псевдоконтроль от нужной партии. Однако в такой ситуации заметно возрастает вероятность заметить искажения на основе научных методов (та же кривая распределения Гаусса, то бишь, нормального распределения), что делает результат выглядящим смехотворно (но не смешно!) и неправдоподобно.</p>\n<p>3. «Перекос». Название скорее шутливое, поскольку речь – о перекосе в мозгах. Нужно иметь невероятную наглость, чтобы уже подписанные протоколы подменять на другие, содержащие изменённые цифры. Нынешняя «напёрсточная» власть использует при этом псевдоюридические приёмы, либо отказывая под различными предлогами наблюдателям в получении завереных копий, либо предлагая «желающим» вручать наблюдателям от других партий «не очень легитимные» копии протоколов, с «недостающими» отметками. Однако, с точки зрения юриспруденции (а не правонигилистического подхода нынешних ангажированных судов) копией вполне может считаться документ, заверенный просто печатью и подписью: главное, чтобы заверяемые подписи были подлинными. А вот уже их подделка – совсем сложная штука.</p>\n<p>Кстати, на этой махинации власть и попадается, глупо и очень сильно; взгляните на один из Интернет-ресурсов, содержащих сравнительные данные – официальные и реальные:  https://ruelect.com/ru/. Согласно им, воровство голосов на выборах в пользу ЕР составляет более 18%.</p>\n<p>Движение «Гражданин Наблюдатель», созданное оперативно за несколько месяцев до выборов, в настоящее время действует на достаточно приличном уровне, формируя инструменты для научно обоснованного изучения «статистики Чурова» или, как теперь это принято называть, «чуродейства»:  http://www.forbes.ru/sobytiya/vlast/77338-izbiratelnaya-geografiya-moskvy. К выборам Движению, фактически на добровольческих началах удалось не только сорганизоваться и провести целый ряд семинаров для наблюдателей, но и выпустить вполне приличные иллюстративные материалы, например, такой (карточка с оборотом):</p>\n<p> </p>\n<p>Многообразие способов совершения преступлений, конечно, невероятно велико. Но, подчас, среди этого нескончаемого потока мерзостей, возникают и в своём роде перлы – такие, как описанные в статье «Новой газеты» от 09.12.2011г. «<strong>Я участник фальсификации выборов 2011</strong>»:  http://www.novayagazeta.ru/inquests/49943.html. Свидетельства молодых людей, проживающих в России (гражданами я бы побрезговал их назвать) – это свидетельства прямой и непосредственной опасности приближающегося фашизма. Если непонятно, поясню коротко: фашизм наступает тогда, когда у молодёжи исчезает совесть; значит, не просто можно всё, вплоть до преступлений, но ещё у негодяев возникает и «праведный» гнев, если эти преступления заказчик вовремя не оплачивает. Иуда отдыхает!</p>\n<p><strong> IV. НЕКОТОРЫЕ ВЫВОДЫ</strong></p>\n<p>«Тут один выход: или я её веду в ЗАГС,</p>\n<p>или она меня ведёт к прокурору!»</p>\n<p><strong>к/ф «Кавказская пленница».</strong></p>\n<p>Из всего сказанного, что составляет лишь малую часть сегодняшнего информационного пространства, вполне правомерно сделать несколько кардинальных выводов:</p>\n<p>1) Нынешняя власть в России теряет свою сакральность. Это, правда, можно сказать в основном только о «продвинутых» территориях – прежде всего, о больших городах с развитой системой внетелевизионного, Интернет-общения. Теряет настолько, что первые лица становятся либо объектами освистания, либо ёрнических и всё более жёстких насмешек.</p>\n<p>Волна насмешек над главой дуумвирата свидетельствует о том, что народ увидел ещё недавнего кумира в неглиже – тем, кем он и является: неплохим пиарщиком, лихо общающимся по телевизору в режиме вопрос-ответ или пресс-конференции. Ясна теперь, собственно, и причина, по которой этому персонажу не близки хоть какие-то дебаты с оппонентами: любой диалог требует не хлёстких ответов в одну сторону, а развёрнутой аргументации и более длительного диалога, в котором нынешняя система крайне слабого управления тут же окажется в роли оправдывающейся стороны, а значит – точно проигравшей, поскольку не то, что оправдания, но даже просто разумного объяснения, всем неисчислимым безобразиям в России за прошедшие 12 лет попросту нет. Ну, разве что: «Она утонула!».</p>\n<p>2) Эта же продвинутость и позволила в сжатые сроки обеспечить соорганизованность граждан на проведение ответственного наблюдения за выборами, где всё и раскрылось. Кроме того, чем более нынешние правители будут пытаться рулить и по привычке давить на граждан, тем быстро возникающие и крепнущие сообщества граждан («пожарные дружины-2010», «синие ведёрки», теперь – сообщества для обеспечения честных и справедливых выборов и др.) будут успешнее и более консолидированно сопротивляться противоправным действиям узурпаторов – вне зависимости от их уровня и формата. Таковы непреложные исторические законы, о действии которых зарвавшаяся политическая верхушка всегда забывает.</p>\n<p>3) Если нынешняя власть не отменит результаты состоявшихся «выборов», которые попросту невозможно назвать справедливыми*, тем самым она фактически запустит механизм обратного отсчёта даже не собственного пребывания у руля, а целостности страны. При этом жалкие потуги на повышение уровня подконтрольности выборов будущих, например, в виде установки камер видеонаблюдения, предлагать уже поздно: это нужно было делать в момент предложения – до парламентских выборов. Равно как и идеи либерализации самого избирательного законодательства необходимо было претворять в жизнь в начале прошлого избирательного цикла, а не тогда, когда уже «земля горит под ногами».</p>\n<p>Не говоря уж о том, что все дальнейшие не очень хорошие запахи – в виде слухов о «коварных замыслах вашингтонского обкома» или «происках империализма», властная верхушка вполне резонно может вернуть себе «в точку исхода»: нынешняя фальсификация процедур и итогов выборов представляет собою очевидный подрыв национальной безопасности и стабильности силами власти. Именно сегодня их усилиями страна доведена до грани распада, на которой Россия на самом деле не находилась на рубеже XXI века, как о том ни талдычил «лидер партии», благоразумно и заблаговременно отошедший в сторону от смрада «единоотбросов». С этой точки зрения партию, которая организует и осуществляет подобное преступление, следует распустить, проведя при этом комплексное расследование противоправной деятельности.</p>\n<p>Только, опять же, «а судьи кто»? Система уже настолько разложилась, что в ней по существу не осталось институтов, способных стать консолидирующим общество инструментом. Чего-либо более разумного и внятного, чем предлагаемые участниками заседания «круглого стола 12 декабря» Меморандум и Обращение (http://www.novayagazeta.ru/politics/50072.html), пока не просматривается. И главное, времени для принятия ответственного решения тоже почти не остаётся. А вот об ответственности с нынешней властью говорить бесполезно: брать ответственность на себя она никогда не умела, не умеет и, самое печальное – уметь не собирается. Поскольку «вцепившиеся зубами», жадные до природных ресурсов и денег, вряд ли ослабят свою политтехнологическую хватку, то и будущее у нашей страны завидным вряд ли можно назвать.</p>\n<p>И, наконец, замечание итоговое. Сегодня изо всех государственных рупоров и иных властных отверстий до жителей страны те, кому это мило, пытаются донести мысль, что альтернативы нынешней власти у России нет. Звучит, вроде, резонно, а для кого-то – даже пленительно. Однако! Само отсутствие альтернативы, сформированное нынешней властью, искусственная монополия «выжженной политической земли», представляет собою, пожалуй, самое серьёзное политическое преступление: на выжженной земле быстрее всего вырастают сорняки, в данном случае – <strong>фашизм, тот самый, представителям которого всё равно, что делать, лишь бы деньги платили вовремя</strong>.</p>\n<br>  \n\n<p>[1] С материалом «День выборов». Победные будни ЕР» можно познакомиться здесь</p>','otchet-nablyudatelya-duma-uik-2050/'),(2075,'значительные нарушения','','','<p><strong>Провал наблюдателя<br/></strong>На избирательный участок, расположенный в школе номер 199, я пришел за день довыборов, чтобы познакомиться с комиссией. Общаясь с председателем и секретарем, уловил небольшую нервозность в их действиях. В частности, секретарь, посмотрев на аккредитационный документ, произнес: «Так, по 5-е число… Вы будете здесь до 12-ти часов, а потом пойдете… Хотя посмотрим». Я ответил, немного ошарашенный: «Как пойду? Я останусь». Секретарь покачал головой, не выразив ни одобрения, ни недовольства, но общий настрой отношения к комиссии задал. Председатель рассказал о расположении столов; наблюдатели располагались с двух сторон от них и могли визуально контролировать происходящее за ними. Утром, однако, наблюдателям предоставили места только с одной стороны от столов, а стол, за которым голосуют по открепительным и вносят в дополнительный список, располагался от наблюдателей дальше других столов. Урны при этом расположились так, что в случае столпотворения избирателей их не было бы видно вообще. Мы с коллегами по проекту (всего нас было трое) были недовольны, но не решились тут же требовать от председателя УИК смены их расположения. Это было нашим большим недочетом.</p>\n<p>Избирательная комиссия, которая на предыдущих выборах на этом участке состояла из школьных учителей, теперь процентов на 80 состояла из представителей некого ООО «Ска». Председатель общался с членами комиссии как с подчиненными, за исключением, разве что, секретаря, более подкованного в юридических вопросах. Наблюдатели от «ЕР» действовали заодно с комиссией, а наблюдатели от «КПРФ» не препятствовали их действиям на протяжении всех выборов. Впрочем, не со зла, а из-за незнания. Представители же «ГН» с самого утра заметили, что к человеку, обслуживающему голосующих по открепительным удостоверениям, который в дополнение к этому обслуживал еще несколько домов, подходит значительно большее число людей, чем к другим представителям комиссии. Да и урн на самом деле не было видно (это хорошо отражено на вот этом видео). Ходить по участку нам запрещал лично председатель – в том числе, загораживая проход (пространство, впрочем, на самом деле было очень узким). Мы написали жалобу по поводу этого, однако председатель затягивал ее рассмотрение. Вскоре на участок приехали представители ТИКа, и мы изложили свои требования уже им. Представители ТИКа – два мужчины средних лет – вначале сопротивлялись, но в итоге (спустя два часа после прихода ТИК) председатель соблаговолил переставить урны и позволил посадить одного наблюдателя близко к ним.</p>\n<p>Беда в том, что к этому времени грязное дело уже было успешно завершено. К примеру, мы заметили, как к человеку, записывающему голосующих по открепительным удостоверениям (стол номер 4), подошел бомжеватого вида мужичок в кожаной куртке и сказал громко фразу: «Я из «Ска»». А это как раз компания, к которой принадлежат члены комиссии! Затем еще несколько таких, бомжеватых, подходили к столу – однако, издалека их паспорта не было видно, мы не смогли заметить, содержали ли их паспорта вкладыши или что-то подобное. Только здесь мы сообразили, что за столом номер 4 сидел единственный в комиссии мужчина! Тут не надо было никаких цветочков как опознавательных знаков – карусельщикам было ясно, к кому подходить. Затем член УИК от \"ГН\" заявляет о том, что ей удалось заметить вброс бюллетеней, совершенный человеком наркоманского вида. Остановить его она не успела, а другие два представителя «ГН» общались с председателем относительно передвижения урн. Стало ясно, что миссия по предотвращению нарушений провалилась. Теперь наше дело – зафиксировать их и отразить картину происходящего. После обеда никаких эксцессов уже не происходило. На участок приезжали корреспонденты от газеты «Яблока» - предупреждали о молодых «карусельщиках», но в итоге к нам на участок они так и не зашли, а председатель комиссии требовал, чтобы «яблочники» немедленно уходили.</p>\n<p>Член УИК от «ГН» следила за правильностью выполнения процедуры голосования на дому и в целом за действиями комиссий, заставляя их следовать букве закона. Я и наблюдатель от «ГН» терпеливо считали явку, сверяя данные с официальными и фиксируя подозрительных лиц на фото и видео. Параллельно мы случайно узнали от неангажированного (вероятно) члена комиссии о том, что за одним из столов, к которому подходило не так много людей, явка была сопоставимой с той, что была за столом № 4.Мы, естественно ждали, что женщина, сидящая за столом, станет судорожно вписывать дополнительных людей в книги, но этого так и не произошло. И стало понятно почему! После финальной работы со списками нам не огласили результаты по каждой книге, а члену УИК от «ГН» не дали ознакомиться с данными подробно. Но и без этого она заметила несоответствие числа проголосовавших итоговому результату на страницах. Во время извлечения бюллетеней нам удалось заметить пачку и зафиксировать это на видео. При том, что комиссия агрессивно сопротивлялась съемке, отнять пачку не получилось, так как комиссия оккупировала столы, встав единым кругом. Член УИК от «ГН», естественно, написала жалобы и по поводу вброса и по поводу книг, и тут же поехала в ТИК. Подсчет проводился уже в спокойной обстановке. Ручкой протокол начали заполнять ближе к 3.00 чтобы фальшивые цифры сошлись. Копии протокола мы получили до поездки комиссии в ТИК, хотя давать их нам не хотели. В итоге в протоколе стоит число выданных бюллетеней – 1094, хотя по нашим подсчетам на участок явилось 979 человек. Вброс, +115; не будь его, 39% официально отданных за «ЕР» сократилось бы значительно. По моим подсчетам - до 32%. Мне мешал решительно действовать статус представителя СМИ. Как оказалось, по закону им многое не запрещено, но не так много разрешено. Я регулярно звонил в штаб, спрашивая, могу ли я подписывать жалобы и обращался с другими вопросами, но внятных ответов не получал. Комиссия удивлялась моим регулярным замечаниям и постоянно пеняла на мой статус. Постоянно запрещали снимать на видео, но никак не могли меня убедить в том, что этого делать нельзя. Вообще, было видно, что председатель хотел, чтобы все на участке было шито-крыто, и дальше угроз не заходил, скорее всего он не пошел бы на наше удаление. Жаль, что мы поняли это слишком поздно. Командой «ГН» мы сработались хорошо, регулярно консультировали друг друга. Жаль, однако, что получилось лишь понять и зафиксировать злодеяния (и, может быть, сократить их масштабы), но не предотвратить их. Жалобы члена УИК от «ГН» были рассмотрены ТИКом, по ним получен отрицательный ответ.</p>\n<p>Видео с нарушениями</p>\n<p><strong>Отчет от члена УИК № 2075 Академического р-на Москвы с правом совещательного голоса от партии «Яблоко» - Ольшевской Л.Г.<br/></strong>В отличие от всех предыдущих выборов, где членами данной УИК были учителя и администрация школы, в этот раз УИК почти полностью (9 человек из 14) состояла из сотрудников ООО «СКА», связанного со строительством и ремонтом ЖКХ, во главе с директором этого ООО г-ном Киприяновым Петром Эдуардовичем. Перед официальным открытием участка произошли прения по поводу регистрации наблюдателя от СМИ, в итоге – зарегистрировали. Таким образом, нас стало трое – от СМИ, член УИК от «Яблока» с ПСГ и наблюдателя от «Яблока». К сожалению, член УИК от КПРФ на нашем участке с правом решающего голоса (пожилая бабулька) была не на нашей стороне, её всё устраивало, и наши жалобы, и протесты ей не нравились. У неё был блокнот наблюдателя от КПРФ, очень хороший и дельный (у меня он тоже был). На мои предложения по ходу процесса написать жалобы, в соответствии с её блокнотом, она сказала, что не хочет, что её все устраивает и она не видит никаких нарушений. Этой наблюдательнице от КПРФ разрешалось ходить по участку, т.е. вдоль столов членов УИК с книгами и до урн. На мой резонный вопрос о неравном положении наблюдателей от разных партий (представителю КПРФ разрешалось ходить, а мне, представителю «Яблоко» – нет) ответа от Председателя не было.</p>\n<p>Место для наблюдателей было выбрано продуманно, так, чтобы при большом скоплении народа у стола, стоящего рядом с урнами, момент опускания бюллетеней был не виден. Утром, когда явка избирателей была невелика, нам это доказать никак не удавалось (урны были в поле нашего наблюдения). После 11-00, когда явка стала большой, мы неоднократно обращались с жалобами и к Председателю, и к секретарю о невозможности наблюдения за процессом голосования. Написали коллективную жалобу. С трудом, после звонка в ТИК, приняли. Необходимо сказать, что назначение этого стола, стоящего рядом с урнами, было выбрано не случайно: у него постоянно скапливался народ, т.к. за ним было закреплено гораздо больше домов, чем за другими столами, кроме того, за этим столом получали бюллетени голосующие по открепительным удостоверениям и по дополнительному списку. Там была книга № 4, к которой отдельно прикреплялся дополнительный список (у нас он был на 3-х отдельных листах, отдельно от книги, не прошит), и в эту-то книгу вносились окончательные данные по участку.</p>\n<p>Отмечу, что при попытке наблюдателя от СМИ сфотографировать таблички с адресами и номерами домов наш Председатель очень занервничал. И вообще, как только мы делали попытки приблизиться к этой книге – мы получали настоящий отпор. Это было сделано не случайно. Слишком велика была разница между жителями района и людьми, которые целенаправленно подходили к этому столу. Один мужчина подошел и сказал: «Я из СКА». У него взяли паспорт, зарегистрировали и выдали бюллетень. На мои вопросы секретарь ответил, что этот человек писал заявление за 3 дня до голосования, он внесен в дополнительный список, сам этот человек из Тулы, живет в Москве в общежитии. Секретарь всегда подходил к этим людям, которые резко отличались от жителей района.Затем пришли еще двое с паспортами. На мою просьбу показать пальцем в дополнительном списке их фамилии секретарь был вынужден проверить их паспорта и, не найдя их в доп.списке, отправить их с участка.После пресечения данного нарушения у нас повалили люди с открепительными.  </p>\n<p>Вопрос: листы дополнительного списка у нас были отдельные, на скрепочке, не подшитые к последней книге. А как должно быть? Наконец приехали по нашей жалобе люди из ТИК. Глава ТИК не усмотрел нарушения по нашему месту наблюдения Я демонстративно встала на стул и продолжала так наблюдать. Народу прибавлялось. Подъехали еще две женщины из ТИК. Одна из них – от ЛДПР. Пообещали разобраться. <br/><br/>Днем мы стали замечать, что очень активно Председатель носит чистые бюллетени к одному столу (книга № 3), хотя явка у неё была ниже среднего. Наша ошибка – не проверили эти бюллетени «на чистоту», настолько быстро он пробегал с ними мимо нас. Приехали еще раз Председатель ТИК и его зам, зашли в другое помещение, где была орг.комната – опять спорили по поводу мест для наблюдателей. И тут я поняла, что мы оставили наши урны без присмотра. Возвращаюсь – и тут передо мной молодой человек криминальной наружности опустил пачку (!) плюс один бюллетень. Я ору: что вы сделали, я видела вброс, милиция! Тишина. Наркоман делает ноги. Председатель орет, что сейчас же за клевету удаляет меня. Я ору, что это преступление, прошу посмотреть видео, т.к. в школе ведется видеонаблюдение. Участковый разводит руками. Но меня не удаляют!</p>\n<p>После пика посещаемости нам меняют место для наблюдений. Ходить мне так и не позволяется. Теперь мы понимаем, что основные нарушения будут в книгах № 3 и № 4, мы держим их в поле зрения: теперь они ничего лишнего в книгах не пишут! Визуально видим, когда они переворачивают страницы, что на каждом листе – по 3-4 заполненных строчек, ну иногда 5-6 максимум.</p>\n<p>Второй вброс я просто физически не смогла предотвратить. Также в «пиковое» время зашел мужчина лет 55, похожий на работника из «СКА», подмигнул Председателю. Я кинулась к столу, где его будут регистрировать, но Председатель просто встал и заслонил мне проход – см. фото. Я возмущаюсь – в ответ угроза удаления. Все стало понятно, и от этого стало грустно. В таком настроении мы досидели до вскрытия урн.</p>\n<p>Но до этого момента проходила долгая работа сначала карандашами в книгах. Особенно долго «мучилась» книга № 4 (итоговая). Секретарь подходил к нему, долго объяснял что-то, куда что надо вписывать и т.д. Уходил в орг. комнату, звонил, снова подходил к книгам, снова давал указания. Так мы сидели до 24-00. Видимо, ждали указаний. Я попросила этого секретаря, чтобы меня визуально хотя бы ознакомили с содержанием книг перед открытием урн. Он сказал, что передаст мою просьбу Председателю.</p>\n<p>Приблизительно в полпервого собрались вскрывать урны. Я напомнила о своей просьбе посмотреть книги. Подошла с Председателем к книге № 3 – он встал ко мне своей широкой спиной и начал быстро-быстро пролистывать ее. Опытным счетоводским взглядом в итоговых графах я увидела цифры, совершенно отличающиеся от кол-ва заполненных строк: там, где было заполнено 3 строки, в итоге стояло 12, и так по всей книге! Я сказала, что увидела грубые нарушения работы со списком избирателей. Председатель молча закрыл книги и унес их в орг.комнату. Тут уже не выдержала я: предупредив оставшихся 2-х наблюдателей, чтобы вели себя «хорошо» и дождались копий протокола, сказала, что не собираюсь участвовать в подтасовке нечестных выборов и подаю жалобы о книгах и о вбросе. После многочисленных звонков в ТИК у меня приняли жалобы.</p>\n<p>В это же время происходило вскрытие урн. В каждой из урн было обнаружено по 1 пачке вброса. Представитель от СМИ стал снимать их, поднялся скандал, отбивались, я приставала со своими жалобами. Я попросила выпустить меня с участка, на что Председатель сказал, что участок закрыт, и он не будет никого ни впускать, ни выпускать. Я к участковому – тот говорит, что руководит всем Председатель. Я звоню снова в ТИК – Председатель выпускает. Еду в ТИК, подаю жалобу и прошу ТИК посмотреть книгу  № 3. Ну и получаю на следующий день ответ – всё хорошо, прекрасная маркиза.</p>\n<p>Просмотрено, нарушений не выявлено. Я снова жалобу – кто смотрел, где акт, подписи.</p>\n<p>Жду ответа.</p>\n<p><strong>Выводы:</strong></p>\n<p>1. Такой дружной кооперации, как на этих выборах я просто не помню. Среди наблюдателей – молодёжь!!! Это здорово!!! </p>\n<p>2. Власть опешила и озверела одновременно.</p>\n<p>3. Необходимо формировать свои коллективы избирательных комиссий, как на нашем участке было с ООО «СКА». В нашей районной газете, посвященной номерам УИК, было объявление о приглашении в УИКи! Да, мы были с правом совещательного голоса, а нужно занять как можно больше позиций с правом решающего голоса.</p>\n<p>4. Может, нам создавать свои ООО перед выборами? (Шутка)</p>\n<p>5. Да, в этот раз свои люди в ТИК очень помогли, но нужно еще больше людей от всех партий там! Юристам предлагаю продумать все варианты внедрения в УИКи.</p>','otchet-nablyudatelya-duma-uik-2075/'),(2077,'некорректная работа УИК','','','',''),(2099,'значительные нарушения','Москва Анна Воронцова','вброс, удаление','<p><strong>Анна Сергеевна Воронцова, член участковой избирательной комиссии с правом совещательного голоса. Направлена от КПРФ.</strong></p>\n<p>УИК №2099, адрес - Москва, район Зюзино, ул. Болотниковская, дом 52, корпус 3. Школа №1948. Отчёт написан 5 декабря 2011 года.</p>\n<p>На самом деле подготовку к наблюдению я проходила не у коммунистов, а в общественной организации \"Гражданин наблюдатель\". Но так как не все желающие имеют право осуществлять общественный контроль, а только наблюдатели от партий или СМИ, нас случайным образом распределили по партиям. Поработали. 22 часа в избирательной комиссии. Тяжело. Грязно.<br/><br/>Было нас много. \"Гражданин наблюдатель\" по одному никого не направляет, а человека по три. У нас на участке оказалось целых пятеро. Плюс наблюдатель, подготовленный \"Справедливой Россией\" - порядочная, ответственная женщина. Плюс одна барышня из коллектива школы - с простотой Луны Лавгуд не поддерживавшая то, что было явно преступно. С другой стороны баррикады - 13 членов комисии с правом решающего голоса (\"член комиссии с правом решающего голоса\" - это члены коллектива, который собственно и трудится на участке - дежурит до выборов, в день голосования выдаёт бюллетени, считает их после и подписывает итоговый протокол. Все остальные - разные формы общественного контроля).</p>\n<p>На участок зашли без проблем - поздоровались, поулыбались, предъявили свои документы. Встретили нас довольно приветливо и охотно проводили на места для наблюдателей. По случайности наши стулья оказались в самом дальнем от урн углу помещения, и с половины сидений урны были не видны в принципе.</p>\n<p>Кроме мелкой, но неисправимой случайности со стульями, в остальном участок был в порядке. Я обошла все 6 кабинок для голосования и протестировала ручки. Нормальные оказались ручки, надписи до сих пор не исчезли.</p>\n<p>Я посмотрела списки избирателей, познакомилась кое с кем из комиссии, потом пробило 8 часов, нам предъявили и опечатали урны, и голосование началось.</p>\n<p>Потихоньку пошли избиратели. Одним из первых была я - проголосовала по открепительному.</p>\n<p>Председатель комиссии, Смирнова Людмила Георгиевна сама подошла к нам и спросила, есть ли желающие наблюдать за голосованием вне помещения (ходить с переносной урной). Я вызвалась. Познакомилась с девочками, с которыми буду ходить - обе помладше меня, одна учитель ритмики в этой школе, вторая - член УИК с правом решающего голоса, направленный КПРФ - Петрунина Оксана Владимировна. Она ещё будет упомянута.</p>\n<p>Мы решили вести подсчёт - сколько избирателей получили бюллетени, сколько избирателей опустили бюллетени в урны. Для этого по очереди вставали поближе к спискам избирателей и зачёркивали клеточки. В то же время один из наших ребят встал рядом с урнами - на расстоянии вытянутой руки, считал опущенные бюллетени. Кроме того, я каждый час (когда не ходила по квартирам) подходила по очереди к каждому выдававшему бюллетени члену комиссии и спрашивала, сколько избирателей он обслужил. Сравнивали цифры со своими - любопытная была динамика. Каждый час мы \"упускали из виду\" 20-40 избирателей. И если в часы пик я действительно не была уверена за свои цифры, то когда волна схлынула, с 16 до 20 часов, я в наших цифрах уверена железно. И всё равно - я видела, как выдались 60 бюллетеней - а за это время официальное количество избирателей увеличивалось на 90. </p>\n<p>За весь день расхождение составило около 300 человек.</p>\n<p>Миссию подсчёта опущенных бюллетеней мы провалили. Вскоре после того, как один из наших парней взял стул и удобно устроился в углу с урнами (этот пост более боевой, поэтому туда пошли мужчины), председатель комиссии стала нервничать. Попросила его отойти, не мешать избирателям. Сначала тихо и вежливо, потом всё более громко и грубо.</p>\n<p>Я позвонила в ТИК (территориальная избирательная комиссия, ей подчиняется наша) и описала ситуацию. Карпеев Игорь Вячеславович мне ответил - мол, если наблюдатель не мешает опускать бюллетени в щель, то пускай стоит рядом. Я передала этот разговор председателю, но Карпеев И.В. для неё не авторитет. Она тоже звонила в ТИК и ей сказали наблюдателя отодвинуть. </p>\n<p>Подтянулись и другие женщины из комисси, и охранявший нас полицейский (Вирясов Владимир Александрович, местный участковый, капитан полиции отдела МВД России по району Зюзино. Документов его я не видела, а полностью свои фио и звание он нам сообщил после довольно продолжительного и неприятного препирания. Откуда у полицейских такая скрытность?), да и избирателей подошло уже порядочно. В итоге парень сдал позиции и стал присматривать за урнами с расстояния в метра два и через спины избирателей. В какой-то момент он с криком \"вброс! полиция, на помощь!\" бросился на избирателя - тот так же громко стал кричать, прося спасти его от бешеного наблюдателя. Полиция, естественно, подтянулась, и компания отошла от урн вообще далеко. Я в это время одевалась и уходила с переносной урной, и у меня было ощущение, что по возвращении останусь один на один с комиссией. Пока я ходила, история повторилась и со вторым нашим парнем, а женщинам осталось только издалека считать вбрасываемые пачки. Штук двадцать насчитали. Избирательная комиссия оперативно и грамотно оформила два решения - за драки и нарушение общественного спокойствия одного (корреспондента) удалить из помещения, а второго (члена УИК с ПСГ, которого удалить невозможно) - отстранить от работы.</p>\n<p>Я же с барышнями обошла чуть больше половины желавших проголосовать на дому - 14 человек. 3 часа. Довольно утомительно. Зато \"чисто\". Вернулись. Скандал всё тянулся, но наши пока все были в помещении. Я перекусила и приняла эстафету подсчёта избирателей. Считала выдаваемые бюллетени, потихоньку придвигаясь поближе к урнам. Время от времени наши женщины восклицали \"вон, вон пачку кидают, ловите\" и жизнь продолжалась.</p>\n<p>Я решила больше не ходить по домам, а потихоньку задвинулась на то самое роковое место рядом с урнами. Одним глазом считала выдаваемые бюллетени, другим - сколько их падает в щель. Падали по одному, редко по два - если голосовала семья. Меня устало и мягко попросили отойти, чтобы не провоцировать скандалы. Я ответила, когда я ясно вижу что вбросов нет - то это лучшее средство от скандалов, но отошла. Потом подошла обратно, и мы с моей коллегой от СР этот пост держали, сменяя друг друга, до конца голосования. Претензий к нам не возникало - видимо, что должно было произойти, уже произошло. Ну, можно потешить себя мыслью, что просто решили с нами больше не связываться, но я сама в неё не особо верю.</p>\n<p>Удалённый корреспондент и его боевая подруга покинули нас. Избирателей приходило всё меньше и меньше, и в 20-00 участок закрылся. Началось подведение итогов.</p>\n<p>Погасили неиспользованные бюллетени. Как - достали толстую пачку бюллетеней (\"считать?! смотрите, сколько их, мы их до утра считать будем!\"), председатель отрезала углы и кидала в мешок. Неожиданно на неё налетела другая дама из комиссии, крича, что их все надо пересчитать - иначе получается уголовное преступление. Председатель, ворча, стала доставать пачки обратно и раздавать их для пересчёта. Человек пять одновременно, разойдясь по углам, пересчитали их. Я видела 694 штуки. Председатель на свой черновой листочек записала 918 и упаковала мешок. В итоговом протоколе сейчас указано 874.</p>\n<p>Члены комиссии поколдовали над книгами (списки избирателей) - оп-ля-ля! - они уже упакованы. Я говорю - э, книги покажите! - да они же упакованы! </p>\n<p>Короче, данные по списку избирателей нам огласили с того же заветного листочка.</p>\n<p>Извлекли бюллетени из урн. Сначала из переносных - там полный порядок. Потом из стационарных. До бюллетеней я не касалась - не имею права. Одна наша дама, член УИК с ПРГ (направлена СР) два раза доставала из кучи плотно свёрнутые пачки - смотрите, явный вброс! Председатель комиссии отбирала (она из бОльшей весовой категории) и, раскидывая бюллетени ровным слоем приговаривала - мол, не вижу никакой пачки. Хор из 12 голосов подтверждал - действительно, пачек нету, не мешайте нам работать. </p>\n<p>К моему удивлению, в хоре активно звучала, да и сольно выступала иногда Оксана Владимировна Петрунина. Если про учителей ещё можно с натяжкой сказать - ну им деваться некуда, работодатель им велит совершать преступления - то кто велел это делать Оксане? Не понимаю. Мой мозг отторгает этот вопрос.</p>\n<p>Бюллетени быстренько разложили по пачкам и стали сортировать - вот яблоко, куда класть? Единую сюда, сюда передавайте. Это КПРФ, передайте в ту пачку. Я возникла - законная процедура сортировки и подсчёта голосов выглядит совсем иначе. По закону бюллетени сортируются по одному, вот так: один человек берёт бюллетень и всем демонстрирует - смотрите, где галочка - и кладёт в соответствующую пачку. Когда разложат все бюллетени, их так же, по одному, демонстрируя всем, пересчитывают.</p>\n<p>Мне объяснили, что это ну просто физически невозможно. Красиво получилось - сначала мы с Людмилой Григорьевной громко и выразительно разговаривали. Потом принялись друг на друга орать. Потом вступил знакомый нам хор, всё с той же песней - всё у нас нормально, не мешайте работать. </p>\n<p>Я выдохлась, отошла в уголок и написала заявление о нарушении. Председатель с облегчением расписалась в получении и продолжила спокойно, без помех, работать. Правда, её подчинённые иногда высказывались, что фото и видеосъёмки им всё-таки мешают, председатель соглашалась, что это крайне неприятно, и мы продолжали снимать.</p>\n<p>Вот бюллетени разложены по пачкам, на каждой карандашиком написано количество. Теперь на сцену вышла Тамара Гинаятовна Сарина, член УИК с правом решающего голоса, направленная СР. Кроме голоса, она обладает правом трогать бюллетени, поэтому пересчитала все пачки - мешая порядочным членам комиссии их упаковывать. Галочки в бюллетенях оказались на правильных местах, ну и количество более-менее совпало...</p>\n<p>Кстати, следует сказать, что каждое действие комиссии при подсчёте голосов должно отражаться в увеличенной форме протокола, висящей на стене. Для гласности процесса. Стоит ли упоминать, что наша увеличенная форма осталась старой девой, ни одна отметка её так и не нарушила..? (Пожалуй, стоит всё-таки.)</p>\n<p>Бюллетени упаковали, все бумаги утащили в техническую комнатку составлять итоговый протокол. По хорошему, мне следовало тоже туда отправиться, но я сдалась. Ноги мои больше не держали, глаза не смотрели, уши не слушали. Пару раз я только нашла в себе силы сходить всё в ту же комнату - первый раз, чтобы налить воды попить. Председатель комиссии крепко \"висела\" на телефоне, остальные тихо и устало сидели за чайным столом. Второй раз - спросить, есть ли у нас в комиссии текст Федерального закона \"Об основных гарантиях избирательных прав\"? На самом деле, это не полное название закона, но когда я закончила выговаривать этот уменьшительный вариант - услышала в ответ \"знаете, мы даже не поняли что Вы сейчас сказали\". Особо ёрничать, правда, не хочу - дело было уже к полуночи, тяжело соображать было всем. Просто я сама, слегка отдышавшись, начала потихоньку сочинять жалобы в ТИК (вышестоящую комиссию) и хотела для пущей важности сослаться на конкретную статью закона. Но из нормативных документов нашёлся только \"Рабочий блокнот УИК\", и его секретарь комиссии мне довольно любезно дала почитать. </p>\n<p>Наконец Протокол итогового заседания комиссии был составлен. И всем желающим выдали копии этого протокола, заверенные честь по чести - а заверение такой важной бумаги это тоже целая история. </p>\n<p>Хотя не, не всем. Тамара Гинаятовна почему-то её не получила. Тёмная история, я не поняла, как это вышло. Она принялась шуметь, но ответственные лица комиссии скорее сунули ей простую ксерокопию (незаверенную) и бегом отправились в ТИК сдавать протокол.</p>\n<p>Единственной новой для меня строчкой в бюллетене было количество погашенных протоколов. Количество голосов за партии не изменилось.</p>\n<p>Время остановилось. Часов, наверное, пять, мы сидели и ждали звонка о том, что протокол принят. </p>\n<p>Пока его не примут, комиссия не расходится - вдруг ТИК найдёт в нём недопустимые ошибки и придётся всё пересчитывать - а для этого необходим полный состав комиссии.</p>\n<p>Звонок прозвучал около пяти утра. Оделись, выползли на улицу. Всё. Рабочий день закончился.</p>\n<p>Посмотреть наш протокол можно по ссылке. УИК № 2099.  </p>\n<p>Единая Россия и Правое дело получили на нашем участке чуть меньше процент голосов, чем в среднем по Москве, остальные партии - чуть больше.</p>\n<p><strong>Наши маленькие итоги выборов:</strong></p>\n<p>Справедливая Россия = 212 голосов = 17,67%</p>\n<p>ЛДПР = 153 голоса = 12,75%</p>\n<p>Патриоты России = 23 голоса = 1,92%</p>\n<p>КПРФ = 230 голосов = 19,17%</p>\n<p>Яблоко = 147 голосов = 12,25%</p>\n<p>Единая Россия = 404 голоса = 33,67%</p>\n<p>Правое Дело = 9 голосов = 0,75%</p>\n<p>Всего действительных бюллетеней = 1178 штук.</p>\n<p>И ещё 22 испорченных.</p>\n<p><strong>Продолжение. Пересчёт в ТИКе.</strong></p>\n<p>На нашем участке во время голосования и подсчёта голосов было допущенно много нарушений. По этому поводу я написала 6 заявлений в ТИК \"Зюзино\" и одно - во время подсчёта голосов в адрес УИК. Председатель заявление приняла, завизировала, но никакой реакции или ответа не последовало. Итак, темы моих заявлений:</p>\n<p>- о том, что моё заявление в УИК не было рассмотрено;<br/>- о том, что наблюдателю не разрешали находиться рядом с урнами; <br/>- о нарушении порядка заполнения увеличенной формы протокола (УФ вообще не заполнялась);<br/>- о нарушении процедуры подсчёта и погашения неиспользованных избирательных бюллетеней; <br/>- о нарушении порядка подсчёта голосов; <br/>- о нарушении порядка подсчёта количества избирателей.</p>\n<p><strong>Последние три заявления заканчивались требованием произвести повторный подсчёт.  </strong></p>\n<p>В понедельник, 12 декабря, ТИК пригласил меня на пересчёт. Пересчёт назначили на 13 декабря, 17 часов. Кроме меня присутствовали: председатель и зампредседателя УИК №2099 и 6 человек от ТИК Зюзино - зампредседателя, секретарь, и 4 рядовых члена ТИК. Причём  Карпеев Игорь Вячеславович направлен КПРФ и Раскин Илья Анатольевич направлен Яблоком. Присутствие представителей оппозиции придавало мне уверенности и ощущение команды.</p>\n<p>Принесли бюллетени. Неиспользованные были свалены в здоровый пакет из крафт-бумаги. 4 декабря я видела пакет, но запакован он был далеко от меня, поэтому сегодня к виду пакета у меня претензий не было. Вытряхнули бюллетени, стали пересчитывать - председатель УИК их перелистывала, все смотрели. Если я сбивалась со счёта - вежливо просила вернуться назад, и мою просьбу вежливо удовлетворяли. Не сошлось на 1 штуку, но даже мне не хотелось пересчитывать, написали, что порядок.</p>\n<p>Теперь - пересчёт голосов. 4 декабря голоса, отданные за каждую партию, заворачивали в бумагу и подписывались, а потом все упаковали в один большой белый свёрток, на свёртке фломастером написали \"1200\" - кол-во действительных бюллетеней, хотя в этом свёртке 1226 бумажек - вместе с испорченными. Фотографии отдельных свёртков и одного большого у меня были, я их распечатала накануне и сейчас держала в руках. Так вот - общий свёрток с бюллетенями отличался от того, что на фотографии. Тоже плотная белая бумага, перемотанная скотчем и подписанная фломастером - но скотч лежит по-другому и начертание цифр явно отличается. Я остановила председателя УИК, уже начавшей разрезать свёрток, и стала убеждать присутствующих не вскрывать упаковку вовсе. Ответ: \"ну мало ли, что там у Вас за фотография. Может, она при проявке там смазалась.\" А когда представители оппозиции высказались, что \"при переносе пачки надпись не меняется\" и \"главное - это количество голосов, а не что на пачке написано\" - отвечать мне стало нечего. Честно говоря, я не знаю, что делать в таком случае. </p>\n<p>Свёрток вскрыли.</p>\n<p>Пачку голосов за Единую Россию я долго не разглядывала, но похоже на мою фотографию. Остальные пачки разошлись по рукам и были вскрыты без моего контроля.</p>\n<p>Подсчёт голосов осуществлялся путём перекладывания бюллетеней по одному из пачки в пачку - зато одновременно двумя членами УИК. Количество совпало.</p>\n<p>Составили \"Акт повторного просчета итогов голосования...\" - подписали все, я прибавила \"особое мнение\" о внешнем виде упаковки.</p>\n<p> Теперь список избирателей. Пока его не принесли, я изъявила желание увидеть  сейф, убедиться, что список хранится в надёжном месте. Мне было отказано. Принесли свёрток - опять же не могу сказать, отличалась ли упаковка от сделанной 4 декабря, т.к. вблизи не видела.</p>\n<p>Все 6 книг пролистали по очереди, пересчитывая количество выданных бюллетеней - 1226, сошлось один в один. В двух книгах попадались необычные, заполенные почти сплошь, страницы (вообще явка 52%), но я же не графолог... Сошлось.</p>\n<p>Составили \"Акт повторного просчета списков избирателей...\"</p>\n<p><strong>Всё.</strong></p>\n<p> </p>\n<p> </p>','otchet-nablyudatelya-duma-uik-2099/'),(2124,'значительные нарушения','Гриша Колюцкий','вброс, запрет фотосъемки, удаление корреспондента','<p><strong>Провал наблюдателя</strong></p>\n<p>Честно говоря, ни российские политики (демонстрируемые по телевизору), ни допущенные до выборов партии мне не нравятся категорически. Но правда политического момента еще неприятнее — под угрозой оказался сам по себе (демократический) институт выборов. Именно такие размышления и сподвигли меня поучаствовать в общественном внепартийном проекте «Гражданин Наблюдатель».</p>\n<p>Тут надо сделать разъяснение по терминологии. Кроме членов УИКов (участковых избирательных комиссий) с правом решающего голоса на избирательных участках могут находиться члены УИК с ПСГ (правом совещательного голоса), представляемые по одному от каждой из партий, просто наблюдатели (по одному от каждой из партий) и корреспонденты от СМИ. У них немножко разные права, но идея одна — всё это виды общественных наблюдателей.</p>\n<p>Основная цель присутствия общественных наблюдателей на избирательных участках — помешать нарушениям, предотвратить их. Забегая вперед, скажу, что мне этого сделать не удалось...</p>\n<p>Собственно идея «Гражданина Наблюдателя» заключалась в том, чтобы собрать неравнодушных людей, юридически нас подготовить (я посетил три занятия) и, договорившись с разными партиями, получить для нас мандаты наблюдателей. Людей собралось внушительное количество, но не слишком много — хватило примерно на 160 участков в Москве (идея была в том, чтобы покрыть 5%, которые составили выборку).</p>\n<p>Я был членом УИК №2124 (Москва, ЮЗАО, Зюзино) с правом совещательного голоса от «Яблока». Председателем моей УИК была Милена Борисовна Милевская, начальница отдела паспортного стола в управе района «Зюзино». А наблюдателем от «Единой России» был представитель управы по вопросам ЖКХ из той же управы. Он уже сидел на участке накануне дня голосования, когда я приходил знакомиться с комиссией. По большинству вопросов председатель УИК консультировалась с ним. Кроме меня, на участке были ПСГ от «Справедливой России» и от КПРФ, наблюдатель от КПРФ и еще несколько корреспондентов и наблюдателей в рамках «Гражданина Наблюдателя».</p>\n<p>Две фатальные ошибки были совершенны наблюдателями еще до начала голосования: стационарные урны для голосования были поставлены достаточно далеко от зоны видимости наблюдателей, раз, и мы (наблюдатели) не просмотрели книги со списками избирателей, два.</p>\n<p>Так как наблюдателей было достаточно много, нам удалось с хорошей точностью посчитать количество проголосовавших (подсчитывались именно опущенные в урну бюллетени): 1115. Плюс 9 — выездное голосование. Итого 1124.</p>\n<p>После вскрытия стационарных урн там обнаружилось 1757 бюллетеней, т.е. вброшено было примерно 640 бюллетеней. При вскрытии урны №2 (дальней) мы зафиксировали несколько сложенных пачек бюллетеней (на всех стояли отметки за «Единую Россию»). Одну из пачек мне удалось сфотографировать. Корреспондентка Н.С. Ульянова сняла на фотоаппарат процесс разбрасывания вброшенных пачек членами УИК.</p>\n<p>  </p>\n<p>Официальные результаты по нашему участку: ЕР — 820, КПРФ — 286, «Яблоко» — 230, СР — 222, ЛДПР — 147, ПР— 17, ПД — 16, испорченных (недействительных) — 28. Вычитаем вброс: КПРФ — 286, «Яблоко» — 230, СР — 222, ЕР — 180, ЛДПР — 147, ПР — 17, ПД — 16, испорченных (недействительных)— 28. Почувствуйте разницу!</p>\n<p>Особенно грубо избирательное законодательство нарушалось во время подсчета голосов.</p>\n<p>1. Наблюдателям не дали ознакомиться с книгами проголосовавших избирателей и опечатали их.</p>\n<p>2. При открывании урны №2 были зафиксированы вброшенные пачки бюллетеней — члены УИК сразу же стали растаскивать бюллетени по столу и раскладывать их по пачкам, сформированным из урны №1. В ответ на мою просьбу аннулировать результаты голосования по урне №2 члены УИК (прямо в процессе раскладывания бюллетеней) проголосовали против.</p>\n<p>3. Еще до 8 утра 04.12.2011 УИК постановила запретить фотосъемку иначе как со штатива (что противоречит ФЗ 67 и Постановлению ЦИК от 17.08.2011 №26/254-6). На основании этой филькиной грамоты УИК удалила с участка корреспондента, который фотографировал процесс сортировки бюллетеней (к сожалению, сотрудники полиции пошли на поводу у председателя УИК, а мои доводы слушать не стали, хотя и были смущены происходящим — цитированных мною норм законодательства они явно не знали).</p>\n<p>4. Председатель УИК отказалась рассматривать все жалобы, написанные мною и членами УИК с ПСГ от СР и от КПРФ (т.е. просто отказалась даже посмотреть тексты жалоб.)</p>\n<p>5. Никакого финального заседания УИК не было: члены комиссии молча подписали протокол и выдали наблюдателям заверенную копию. Между подсчетом голосов и выдачей копий протокола прошло около получаса; на это время председатель УИК вместе с наблюдателем от ЕР покидали помещение для голосования.</p>\n<p>6. В ответ на мои неоднократные обращения к председателю УИК с требованием соблюдать букву закона (при подсчете голосов) члены УИК (все — женщины) выкрикивали следующее: «Законодательство, бл*дь!», «Молодой человек, один вы, блин, со своей нормой 31» и т.д.</p>\n<p>На всякий случай замечу, что все наблюдатели сошлись в правовой оценке происходящего: члены УИК с ПСГ от КПРФ, СР и «Яблока» (это я) составили совместный акт о нарушениях и жалобу в вышестоящий ТИК.</p>\n<p>Сейчас юристы — волонтеры проекта «Гражданин Наблюдатель» работают над обращением в суд.</p>\n<p>В заключение хочу отметить несколько характерных (для текущего состояния нашего общества) деталей.</p>\n<p>1. К ролевой игре в Демократию мы готовы плохо — после трех лекций и штудирования в свободное от работы время текстов законов я знал детали избирательной процедуры и нормы законов существенно лучше, чем все члены избирательной комиссии и чем сотрудники полиции, дежурившие на участке.</p>\n<p>2. Не известно ни одного прецедента, чтобы работники прокуратуры сами бы (на основании многочисленных записей в блогах, например) занялись расследованием нарушений выборного (и уголовного!) законодательства, — волонтерам «Гражданина Наблюдателя» это оказалось важнее.</p>\n<p>3. Появление достаточного количества наблюдателей (в будущем) позволит разделить избирательные участки на два типа: те, на которых нарушений не будет, и те, результаты по которым из-за нарушений не надо будет учитывать. Так мы сможем посчитать результаты любого голосования, полностью игнорируя иллюзионистов из ЦИК.</p>\n<p><strong>Гриша Колюцкий,</strong><br/> <strong>канд.физ. -мат.наук,</strong> <strong>н.с. ИППИ им. А.А.Харкевича РАН,</strong> <strong>н.с. Чебышевской математической лаборатории при СПбГУ, </strong><strong><strong>лауреат конкурса «Молодой учитель» фонда «Династия»</strong></strong> </p>','otchet-nablyudatelya-duma-uin-2124/'),(2129,'','','','',''),(2154,'значительные нарушения','Ольга Баранникова','предотвращена попытка вброса','<p>Во время голосования нарушений было сравнительно мало. Комиссия пыталась запретить фотосъёмку, но после изучения закона о СМИ их удалось переубедить. После окончания голосования Комиссия пыталась нарушить порядок подсчёта голосов (предлагалось одновременно гасить бюллетени и вскрывать урны), но удалось этому воспрепятствовать, показывая им соответствующие пункты закона. Мы не допустили огромного вброса! При погашении бюллетеней мы обнаружили в пачке неиспользованных бюллетеней часть с галочками \"Единой России\", которые, судя по всему, собирались  подбросить (их было 272 штуки, а в урнах за ЕР - 271, то есть должно было быть в два раза больше). Мы пригласили полицейских, составили акт, отдельно опечатали бюллетени с пометкой в графе «Единая Россия».  Весь процесс запечатлен на видео.</p>\n<p><strong>Результаты такие:</strong></p>\n<p> КПРФ - 26 % (320 бюллетеней), ЕР - 22 % (271), \"Справедливая Россия\" и \"Яблоко\" - по 19 % (231 и 230 соответственно), ЛДПР - 12 % (147). Всего проголосовавших - 1238.<br/> <br/> Кроме того, в урне обнаружили пачку из пяти бюллетеней, заполненных одной ручкой за ЕР - сделать тут уже ничего нельзя, но осталось видео на память.<br/>Результаты совпадают с данными на сайте ЦИК.</p>\n<p><strong>Комментарий моей дочери:</strong> Для сравнения результаты на участке через дорогу, в том же районе Коньково, где я голосовала (буквально в километре от участка 2154) <br/> ЕдРо - 70.48% !!!<br/> КПРФ - 20.89%<br/> Справороссы - 4.75%<br/> Яблоко - 2.17%<br/> \"И действительно, когда я сбежала с участка, где родители наблюдали за ходом голосования, на тот, к которому я приписана, чтобы проголосовать, мне в глаза бросилась разница. У нас наблюдатели не спускали глаз с урн и постоянно считали каждый бюллетень. На том же участке сидели весёлые тётеньки в комиссии и ни одного наблюдателя... Вбрасывай, сколько хочешь\".</p>\n<p> </p>','otchet-nablyudatelya-duma-uik-2154/'),(2172,'','','','',''),(2188,'','','','',''),(2210,'нарушений не выявлено','','','',''),(2229,'некорректная работа УИК','','','',''),(2254,'нарушений не выявлено','','','',''),(2279,'','','','',''),(2288,'','','','',''),(2313,'значительные нарушения','Андрей и Евгения Бирюковы','вброс','<p> 7-15     Пришли на участок. Представились (Андрей и Евгения Бирюковы).</p>\n<p>7-20     Наши данные внесли в список присутствующих на участке (с телефонами). Получили отметки о вручении направлений наблюдателей на копиях.</p>\n<p>7-25     Число избирателей, внесенных в список избирателей – 2094<br/> Число полученных комиссией бюллетеней – 1500</p>\n<p>7-30     Осмотр книг со списками избирателей (председатель разрешила члену комиссии пролистать только одну книгу) – были замечены карандашные пометки. Объяснение председателя – помечены люди, голосующие на дому.</p>\n<p>7-35     Председатель Короткова Е.А. отказалась предоставить список членов УИК с решающим голосом (подана жалоба).</p>\n<p>8-00     Осмотр стационарных и переносных урн для голосования и опечатывание.</p>\n<p>8-00     Начали вести скрытый подсчет опущенных бюллетеней в стационарные ящики и количества поданных открепительных удостоверений с помощью механических счетчиков.</p>\n<p>8-15     Пришел наблюдатель от СМИ – Спанаки Лев Константинович</p>\n<p>9-00     Председатель объявила нам о запрете фотосъемки процесса голосования без штатива (подана жалоба). Установили штатив, который у нас был.</p>\n<p>9-00     Проголосовало 28 человек.</p>\n<p>9-35      Запрет пользоваться телефонами в помещении для голосования (якобы в телефонах – фотокамеры и мы можем заснять лица избирателей и комиссии, а их согласия на фотосъемку мы не имеем).</p>\n<p>10-00    Проголосовало 48 человек.</p>\n<p>11-00   Проголосовало 111 человек.</p>\n<p>11-30    По данным комиссии проголосовал 221 человек.</p>\n<p>11-40    Наблюдателю, который вел подсчет количества опущенных бюллетеней, было запрещено находиться вблизи стационарных ящиков, где он мог увидеть и пресечь вброс бюллетеней. С места, определенного для наблюдателей, не было видно как предъявляются документы, выдаются бюллетени и производится голосование.</p>\n<p>12-00    Проголосовало 248 человек</p>\n<p>13-00    Проголосовало 413 человек</p>\n<p>14-00    Проголосовало 561 человек</p>\n<p>15-00    Проголосовало 694 человека</p>\n<p>16-00    Проголосовало 792 человека</p>\n<p>16-38    Член избирательной комиссии с решающим голосом в отсутствии избирателей работал с книгой по адресу ул. Обручева д. 47, 51, 53, 57 (подана жалоба).</p>\n<p>17-00    Проголосовал 861 человек.</p>\n<p>17-00    Член избирательной комиссии с решающим голосом в отсутствии избирателей работал с книгой по адресу ул. Обручева д. 47, 51, 53, 57 (подана жалоба).</p>\n<p>17-15    Председатель УИК предъявила требование не покидать зону, выделенную для наблюдателей. Якобы на основании постановления ТИК. Предъявить постановление ТИК отказалась (подана жалоба).</p>\n<p>18-00    Проголосовало 920 человек</p>\n<p>19-00    Проголосовало 978 человек.</p>\n<p>19-38    Член избирательной комиссии с решающим голосом в отсутствии избирателей работал с книгой по адресу ул. Херсонская д. 17, 19, 21, 23 (подана жалоба).</p>\n<p>20-00    Проголосовали 1034 человека (точность подсчета +/- 3 человека).</p>\n<p>По данным комиссии проголосовали 1469 человек – разница (вброс) – 435 бюллетеней.</p>\n<p>При вскрытии стационарных ящиков были сложенные пачки бюллетеней (подана жалоба).</p>\n<p>20-05    Дверь помещения для голосования не была закрыта на ключ. Председателем УИК был объявлен перерыв. Комиссия продолжила работу в 20-42 (подана жалоба).</p>\n<p>20-42    Погашение неиспользованных бюллетеней (193).</p>\n<p>20-52    Подсчет по спискам избирателей (до 23.18). Результаты подсчета оглашены не были и увеличенная форма протокола не заполнялась.</p>\n<p>В открытую дверь избирательного участка вбежала председатель соседнего УИК 2314 (рядом, в спортивном зале) с криком: «Вызывайте наряд, меня грозят убить». Впоследствии оказалось, что некий гражданин требовал у председателя УИК подать неверные данные по голосованию, иначе грозил убить. Свидетелями были все члены УИК 2313 и дежурный полицейский.</p>\n<p>23-18    Подсчет бюллетеней в переносных ящиках – 38. Нарушений при голосовании на дому не выявлено.</p>\n<p>23-23    При вскрытии стационарных ящиков в них были обнаружены зафиксированы на фото сложенные пачки бюллетеней (подана жалоба) . Количество пачек – около 20-и, приблизительное количество бюллетеней в каждой из них – 15-20.</p>\n<p>Участковая избирательная комиссия отказалась удовлетворить требование о признании бюллетеней в таких пачках недействительными. Полагаем, что таким отказом избирательная комиссия сделала невозможным достоверное установление результатов волеизъявления избирателей на данном избирательном участке.</p>\n<p>В связи с этим на основании подпункта а) пункта 9 статьи 70 Федерального закона «Об основных гарантиях избирательных прав и права на участие в референдуме граждан Российской Федерации» просим вышестоящую комиссию признать итоги голосования на данном избирательном участке недействительными (подана жалоба в вышестоящую комиссию).</p>\n<p>Сложенные пачки бюллетеней были зафиксированы на фото. Комиссия перемешивала бюллетени, чтобы рассыпать пачки.</p>\n<p>23-50    Председатель УИК нарушила пункт 2.6 Рабочего блокнота УИК (размещение наблюдателей при подсчете голосов) – с места, отведенного для наблюдателей не были видны отметки на бюллетенях (подана жалоба).</p>\n<p>При сортировке бюллетеней была нарушена процедура – они сортировались одновременно десятью членами УИК, без предъявления отметок в бюллетенях наблюдателям (подана жалоба). В ответе на жалобу председатель УИК Короткова Е.А. письменно подтвердила нарушение закона: «все члены УИК участвовали в сортировке для более быстрого распределения по партиям». Имеется видеозапись нарушения.</p>\n<p>При подсчете количества голосов избирателей в рассортированных по пачкам избирательных бюллетенях указанная участковая избирательная комиссия нарушила требования пункта 18 статьи 68 Федерального закона «Об основных гарантиях избирательных прав и права на участие в референдуме граждан Российской Федерации»: бюллетени не подсчитывались «путем перекладывания их по одному из одной части пачки в другую таким образом, чтобы лица, присутствующие при подсчете, могли увидеть отметку избирателя в каждом бюллетене». При этом допускался одновременный подсчет бюллетеней из разных пачек. Имеется видеозапись нарушения.</p>\n<p>Допущенные нарушения не позволили наблюдателям убедиться в правильности подсчета голосов и не позволяют с достоверностью определить результаты волеизъявления избирателей.</p>\n<p>Результаты подсчета голосов не были оглашены наблюдателям, и проверка контрольных соотношений не производилась. Все документы были упакованы до заполнения увеличенной копии протокола.</p>\n<p>По результатам наблюдения были поданы 12 жалоб на нарушения. Копии протокола были выданы наблюдателям в 4.15 5-го декабря.</p>\n<p>По итогам наблюдения за голосованием на участке 2313 делаем следующие выводы:</p>\n<p>1.      Наблюдателям не дали проконтролировать опускание бюллетеней в урны, в результате был осуществлен вброс бюллетеней в количестве 435 штук.</p>\n<p>2.      Сортировка и подсчет результатов голосования были проведены с нарушениями, допущенные нарушения не позволили наблюдателям убедиться в правильности подсчета голосов и не позволяют с достоверностью определить результаты волеизъявления избирателей.</p>\n<p>3.      Результаты голосования и явка избирателей на этом участке кардинально отличаются от результатов голосования на участке 2314 (соседний участок, те же улицы, такой же состав избирателей).</p>\n<p>2313     явка – 69,87%, ЕР – 45,06%</p>\n<p>2314     явка – 50,04%, ЕР – 22,41%</p>\n<p>Если вычесть вброс 435 бюллетеней из количества проголосовавших и голосовавших за ЕР, то результаты голосования на этих участках совпадают до 3-го знака. См. файл «Результат_2313_2314.xls».</p>\n<p>4.      Считаем, что результаты голосования на участке 2313 сфальсифицированы и должны быть аннулированы.</p>\n<p>Наблюдатели:</p>\n<p>Андрей Бирюков, Евгения Бирюкова, Лев Спанаки - члены проекта «Гражданин наблюдатель».</p>\n<p>Готовы выступать свидетелями в суде.</p>','otchet-nablyudatelya-duma-uik-2313/'),(2315,'','Юлия Минеева','Чисто','<h3>Почти идеальный участок                                                         </h3>\n<p><strong>«Команда» от «Гражданина наблюдателя»:</strong></p>\n<p>1. Лямин Сергей – член комиссии с совещательным голосом от партии «Яблоко»<br/> 2. Тарасов Алексей – наблюдатель от партии «Яблоко»<br/> 3. Минеева Юлия – спецкор «Новой газеты»<br/> <br/> <strong>Комиссия на участке № 2315</strong> насчитывала 16 человек (один не явился), учителя школы № 2046.<br/> <br/> 1. Председатель комиссии – Денисова Ирина Павловна<br/> 2. Зам. председателя комиссии – Макина Ирина Петровна<br/> 3. Секретарь – Кошечкин Николай Васильевич<br/> <br/> <strong>3 декабря</strong><br/> <br/> Мы приехали познакомиться с членами УИК 2315 накануне, 3 декабря, около 14:00.  Председатель комиссии, Ирина Павловна Денисова, сказала, что занесет нас в реестр присутствующих и даст данные о количестве избирателей и прочем на следующий день. Она была не уверена, могут ли присутствовать на участке наблюдатели от партии, не утвержденные ТИКом, но обещала узнать у коллег (позднее выяснилось, что она работала в качестве председателя комиссии в первый раз, поэтому, скорее всего, перепутала наблюдателей с членами комиссии с решающим голосом). У меня на руках была только пресс-карта, однако Денисова редакционное задание или какие-то другие документы не потребовала. При осмотре участка и близлежащей территории никаких серьезных нарушений выявлено не было. Места наблюдателей располагались крайне неудачно, оттуда совершенно не было видно ни урн, ни кабинок, но на следующий день никто не заставлял нас там сидеть. Кроме того, нас очень удивили урны с отверстиями по периметру верхней крышки.<br/> <br/> Позднее Алексей Тарасов составил жалобу в ТИК (но не отправил), а также позвонил члену ТИК с правом решающего голоса от партии «Яблоко» Большаковой Надежде Алексеевне, которая обещала решить проблему, если на следующий день отверстия останутся. Однако эти предосторожности также оказались излишними.<br/> <br/> <strong>4 декабря<br/> 7:30-8:00</strong><br/> <br/> Мы с Алексеем Тарасовым приехали на участок в 7:30. Денисова сразу же занесла нас в реестр присутствующих, записала адреса и телефоны. Тарасов осмотрел списки избирателей: с его слов они не имели никаких пометок, были прошиты, но не были опечатаны. После обращения к председателю все книги на наших глазах сразу же опечатали. УФ протокола висела на видном месте, в ней уже были заполнены фломастером строки 2, 3, 11, 12, 14-18 (в дальнейшем эти данные никто не менял, и они были занесены в итоговый протокол).<br/> <br/> Председатель также сообщила все интересующие нас данные:<br/> <br/> • Количество избирателей, внесенных в список для избирателей – 2051.<br/> • Количество переносных ящиков – 2.<br/> • Количество бюллетеней, полученных УИК – 2000.<br/> • Количество открепительных удостоверений получено УИК – 80.<br/> • Количество открепительных удостоверений выдано избирателям – 47.<br/> • Количество избирателей, внесенных в реестр заявлений на голосование вне помещений – 2.<br/> • Количество избирателей, подавших заявление на голосование на основании временной регистрации – 20.<br/> <br/> При нас в 7:50 пересчитали и погасили оставшиеся 33 открепительных удостоверения.<br/> <br/> <strong>8:00-20:00</strong><br/> <br/> В 8:00 председатель объявила о начале голосовании. В присутствии наблюдателей и нескольких избирателей два стационарных и два переносных ящика были осмотрены и запечатаны (есть видео). Верхние крышки стационарных ящиков буквально забили молотком, чтобы никаких отверстий не осталось. Переносные ящики все время голосования находились в помещении для голосования.<br/> Помимо нас присутствовали два наблюдателя – от КПРФ (кажется) и СР, однако они активного участия в наблюдении не принимали, по отношению к нам были настроены дружелюбно. Уже после открытия участка появилась женщина от ЕР, она несколько часов просидела без дела на месте для наблюдателей (откуда ничего не видно), а потом куда-то вышла и так и не вернулась.<br/> В 8:20 я подала председателю заявление с просьбой сразу после составления протокола выдать мне копию документа. Денисова засомневалась, имеет ли представитель СМИ право требовать эту копию. Она вместе со своим заместителем, Ириной Петровной Макиной, попытались найти данные в законе «Об основных гарантиях», однако так как в соответствующих статьях было написано «наблюдатель», а не «представитель СМИ», то Денисова позвонила за разъяснениями в ТИК. Там ей сказали, что давать мне копию протокола не надо. Штаб «Гражданина наблюдателя» посоветовал мне попросить у председателя письменный отказ. Денисова без возражений согласилась его написать. Позднее, когда председатель звонила по каким-то другим вопросам в ТИК, она разговаривала уже с другим человеком. Денисова повторила свой вопрос, и на этот раз ей ответили, что журналисту копию протокола можно дать. В 11:50 мое заявление было принято, а на моей копии была сделана соответствующая отметка.<br/> <br/> Все время голосования мы свободно передвигались по участку, большую часть времени я сидела прямо около урн. Отверстия в урнах были очень узкие, избиратели в половине случаев опускали бюллетени только со второй попытки, поэтому, на мой взгляд, провести вброс там было практически невозможно. Кроме того, я со своего места хорошо видела, если кто-то опускал два бюллетеня, а не один (в данном случае не было никаких нарушений, например, семейная пара получала свои бюллетени, каждый голосовал самостоятельно, но опускал их в урну кто-то один). Весь день мы вели самостоятельный подсчет количества выданных бюллетеней и регулярно сверяли наши данные со сводками комиссии, расхождения были весьма незначительными. По моим расчетам комиссия выдала 998 бюллетеней (по итогам комиссии – 997). Я несколько раз ненадолго отходила с участка и просила моих коллег в это время посчитать за меня, так что все эти цифры носят примерный характер. У моих коллег получилось несколько меньше, однако в пределах допустимой погрешности (один-два десятка).<br/> <br/> Несколько раз возникали небольшие конфликты с членами комиссии о праве вести фото- и видеосъемку. Члены комиссии ссылались на какое-то постановление ЦИК, а также на то, что мы нарушаем их право на частную жизнь. Однако фактически они ни разу не пытались удалить нас с участка, и мы снимали все, что считали нужным.<br/> <br/> В списках избирателей было много ошибок: отсутствовали некоторые квартиры или же по определенному адресу был указан только один человек, хотя прописаны несколько. Все эти избиратели голосовали по дополнительному списку. Один из избирателей не нашел себя в списке (его квартира присутствовала, но там числился только один из членов семьи), написал жалобу в комиссию, однако в заявлении не указал свой адрес, в связи с чем жалоба была признана не имеющей под собой оснований. Кроме того, этот избиратель решил, что в его квартире «прописаны» три неизвестных человека. Проверка списка избирателей показала, что он ошибся – это были фамилии его соседей. Жители нескольких новостроек по улице Захарьина горка также не нашли себя в списке избирателей (по словам членов комиссии и самих избирателей, такая же ситуация была и во время выборов 2009 года), они голосовали по дополнительным спискам. Алексей Тарасов проверил адреса в дополнительном списке, а также попросил кого-то из избирателей показать прописку в паспорте – везде действительно значилась Захарьина горка.<br/> На участке № 2315 признаков «карусели» замечено не было. Однако я случайно услышала разговор небольшой группы женщин (человек десять), стоявших около входа в школу: «Значит, ты по открепительному, ты по заявлению…». При моем появлении они зашикали («Тише-тише!»), вполголоса обсудили, кто с кем едет и ушли. Я пошла за ними и издалека видела, как они сели в две легковые машины (номера записать, к сожалению, не удалось). Не могу с уверенностью сказать, была ли это «карусель» или нет. Но на наш участок никто из них не заходил, возможно, они голосовали на участке № 2316 и/или 2317, расположенных в той же школе. <br/> Фальсификаций с заявлениями лиц с временной регистрацией и открепительными также замечено не было. Все открепительные забирались (всего по ним проголосовало 44 человека), людям с временной регистрацией, не подавшим заранее заявление, в праве голосовать отказывали (некоторые избиратели весьма громко этим возмущались). Списки избирателей ни разу за пределы помещения для голосования не выносились.<br/> На выезд для голосования вне помещения члены комиссии ездили один раз. Председатель комиссии предложила пойти Алексею Тарасову или Сергею Лямину, но после их отказа на своем предложении не настаивала. В итоге с ними ходил наблюдатель от СР. Перед выездом с реестром заявлений на голосовании вне помещения ознакомился Алексей Тарасов. Там значилось восемь заявок. Группа ушла примерно в 13:45. Вскоре после этого один из избирателей спросил, может ли он проголосовать за свою мать, которая не имеет возможность прийти на участок сама. Председатель предложила ему написать заявление на голосование вне помещения, он написал, после чего зам. председателя позвонила уже уехавшей группе с просьбой зайти и к этой избирательнице. Это нарушение носило единичный характер, и на итоги выборов не повлияло, поэтому мы его фиксировать не стали, хотя и обратили на него внимание членов комиссии. В итоге было подано девять заявок, все избиратели написали заявления (и в переносной урне в дальнейшем было обнаружено девять бюллетеней), после возвращения группы был составлен соответствующий акт.<br/> <br/> Последний избиратель покинул участок в 19:55.<br/> <br/> <strong>20:00-20:20</strong><br/> <br/> В 20:00 председатель комиссии громко объявила об окончании голосования и о первых двух этапах предстоящей работы комиссии. Члены комиссии сдали неиспользованные бюллетени (203 штуки), затем из сейфа принесли оставшиеся бюллетени, пересчитали их по десяткам и погасили (есть видео). В это время работа со списками избирателей не велась (есть видео). Всего получилось 984 бюллетеня – эти данные сразу занесли в УФ протокола. По распоряжению председателя бюллетени тогда же упаковали и опечатали (есть видео).<br/> <br/> <strong>20:20-21:50</strong><br/> <br/> После этого члены комиссии начали подсчеты по спискам избирателей (есть видео). Когда члены комиссии заносили в специальный реестр номера открепительных удостоверений, Сергей Лямин обратил внимание на то, что одно из этих удостоверений выглядит иначе – оно было красного цвета. Оказалось, что это открепительное по выборам в Московскую областную думу. Председатель занервничала, обстановка несколько накалилась. Но вскоре выяснилось, что удостоверение принадлежало одному из сотрудников милиции, который дежурил в этот день в школе. Он был заранее занесен в список людей, подавших заявление с временной регистрацией, и свое открепительное, судя по всему, отдал комиссии по ошибке. Фактически нарушения не было, комиссия собиралась вернуть открепительное избирателю, а в списке избирателей было сделано соответствующее исправление.<br/> <br/> После внесения результатов в УФ протокола оказалось, что контрольное соотношение не совпадает: 2000+0=0+1001+9+984+0. В 21:30 упакованные бюллетени вскрыли, заново пересчитали уже поштучно, нашли ошибку – бюллетеней оказалось не 984, а 994, опять упаковали, опечатали и унесли в сейф. Одна ошибка была найдена в списке избирателей (четырех избирателей, проголосовавших на дому, посчитали с теми, кто приходил на участок) – вместо 1001 на самом деле на участке было выдано 997 бюллетеней. Контрольное соотношение (2000+0=0+997+9+994+0) совпало. После этого все подсчеты, сделанные карандашом, обвели ручкой, члены комиссии расписались, и списки были убраны в сейф в соседнем помещении (есть видео). В УФ протокола внесли необходимые поправки.<br/> <br/> <strong>21:55-22:55</strong><br/> <br/> Если первые два этапа производились по отдельности, то в дальнейшем эта очередность была нарушена. Сначала вскрыли переносную урну, в которой оказались девять бюллетеней – столько же, сколько было подано заявлений. Затем вскрыли первую стационарную урну (есть видео). В этот момент перенервничавшая после истории с открепительным председатель опять возмутилась тем, что мы проводим съемку, и попросила отойти наблюдателей на пару метров от стола, заявила, что мы вообще не имеем право видеть отметки на бюллетенях и что это они на нас жалобу подадут (есть видео, частично). Но эту ситуацию, как и предыдущие конфликты, как-то удалось спустить на тормозах, и во время сортировки и подсчетов голосов мы стояли с разных сторон стола вплотную, снимали и видели, что происходит. После вскрытия урны все члены комиссии складывали бюллетени в стопки (есть видео).<br/> Потом стопку отдали одному из членов комиссии и начали сортировку по партиям (есть видео). В моем поле зрения находились стопки Справедливой России, Правого дела и испорченные бюллетени – отметки на них соответствовали тому, что объявлялось. Другие наблюдатели стояли с других сторон и отслеживали другие партии.<br/> Только после сортировки бюллетеней из первого ящика члены комиссии вскрыли второй ящик (есть видео) и также сначала сложили в стопку, а затем рассортировали (есть видео).<br/> Бюллетени пересчитывали все одновременно, не перекладывая из одной стопки в другую (есть видео). Однако мы, во-первых, уже видели отметки, а, во-вторых, у нас не было оснований подозревать комиссию в фальсификациях, поэтому мы не стали фиксировать это нарушение.<br/> <br/> В результате были получены следующие данные:<br/> <br/> Единая Россия - 300<br/> КПРФ - 244<br/> ЛДПР - 198<br/> Справедливая Россия - 144<br/> Яблоко - 66<br/> Патриоты России - 25<br/> Правое дело - 2<br/> «Против всех» (недействительные бюллетени) - 24<br/> <br/> Все данные сразу занесли в УФ протокола (результаты по партиям записаны карандашом, но именно эти данные попали в итоговый протокол без каких-либо изменений).<br/> <br/> <strong>23:10-0:00</strong><br/> <br/> После окончания подсчета голосов члены комиссии упаковали бюллетени (есть видео), составили протокол и сразу же выдали нам копии. Изначально на копиях не были проставлены дата и время заверения копии, но после нашей просьбы члены комиссии эти данные записали.<br/> <br/> <strong>5 декабря<br/> 0:00-4:00</strong><br/> <br/> Мы решили дождаться звонка члена комиссии, который отправился в ТИК сдавать документы. Но не дождались:) Перед отъездом оставили телефон членам комиссии с просьбой позвонить нам, когда они узнают, что протокол в ТИКе принят. Они сообщили нам эту радостную весть, когда мы еще ехали домой.<br/> <br/> <strong>21:00</strong><br/> <br/> На сайте Мосгоризбиркома данные об УИК 2315 соответствуют тем, которые мы получили (на всякий случай я сохранила эту страницу).<br/> <br/> <strong>ИТОГ</strong><br/> Несмотря на ряд нарушений и конфликтных ситуаций, результаты выборов на УИК 2315, на мой взгляд, сфальсифицированы не были.<br/> <br/> Это я все к чему... нарушений по Москве и России, конечно, было море. У меня в рассылку от \"Гражданина наблюдателя\" ежедневно приходит по несколько десятков писем со \"страшными\" историями от моих коллег. Но честные комиссии тоже существуют. Так что, если кто-то из вас собрался идти наблюдать весной, то не советую сразу наносить боевую раскраску и врываться на участок с томагавком наперевес. Не стоит без веских поводов превращаться из наблюдателей в надзирателей с плетью. И романтизировать процесс наблюдения тоже не надо - это тяжелая и в общем-то довольно нудная работа. Dixi.</p>\n<p> </p>','otchet-nablyudatelya-duma-uik-2315/'),(2340,'нарушений не выявлено','','','',''),(2365,'','','','',''),(2370,'значительные нарушения','Андрей Лопухин','карусель, вброс','<p>Я пришел в проект «Гражданин наблюдатель», узнав о нем из «Газета.ру». Прослушал лекцию, распечатал и изучил «краткое руководство для наблюдателя», поискал, но не смог купить официальный ФЗГ. Участвовал в деловой игре; очень понравилось, как в кейсе «вброс» коуч Оксана легко выполнила свою миссию «фальсификатора», отвлекая 5 добровольцев искусственно  организованным скандалом. Получил мандат члена УИК с правом совещательного голоса от партии «Яблоко» для наблюдения на участке 2370.  02.12.2011 со мной связалась куратор по ЮЗАО Нина Ивановна, заочно познакомила меня еще с двумя участниками проекта – «представителями СМИ» от КПРФ. Оба они – гг. Гарник И.Д. и Федоров В.П. – люди очень немолодые, но оказывали потом большую поддержку на выборах. На участке кроме нас были наблюдатели от Справедливой России, от «ЕР» (дама – мелкий начальник в местном ЖКХ), и от КПРФ.</p>\n<p>Согласно полученной на лекции рекомендации, 03.12.2011 примерно в 18.00 я пошел на участок знакомиться с руководством УИК; гг. Гарник и Федоров сделали это ранее. Председатель УИК Плеханова Ирина Сергеевна встретила меня неприветливо: «ходите, мешаете работать», даже звонила в ТИК – могу ли я присутствовать, если до сих пор не был внесен в протокол. Потом, в день выборов, она настолько «достала» ТИК звонками по поводу меня, что к вечеру 04.12.2011 заместитель председателя ТИК Татьяна Ивановна Бобринская во всех спорных вопросах брала мою сторону, а не сторону г-жи Плехановой. </p>\n<p><strong>7:30-8:00</strong> <br/>Утром на участке я выяснил количество избирателей (2114), количество бюллетеней, полученных из ТИК (2100), количество подавших заявления для голосования на дому (17). Мне показали все книги со списками избирателей, отметки стояли напротив 6 или 7 избирателей                </p>\n<p> 92-93 г.рождения. Члены комиссии объяснили, что отмечены голосующие в первый раз, для них подготовлены подарки – сумочки с канцелярскими принадлежностями. В списках избирателей (всего было 6 книг) прошивка была выполнена очень толстым шнуром, из-за чего приклеенная бумажка с печатью УИК позволяла вынуть «хвостики» прошивки; после замечания это было тут же исправлено - «хвостики»  накрепко прижали широкой липкой лентой. Подошли остальные наблюдатели, при них председатель сообщила число членов УИК с правом решающего голоса (12чел.). Стационарные урны опечатали. </p>\n<p><strong>8:00-20:00</strong> <br/>С нашими «представителями прессы» договорились о подсчете голосов. Первый избиратель появился ровно в 8.00 и быстро проголосовал. Член УИК с правом решающего голоса по имени Анатолий Федорович (?)  потребовал перенести одну из урн для голосования из угла помещения в центр, но председатель отказалась это делать, аргументируя тем, что «вы не просили этого вчера, до того, как ТИК по акту принял у меня подготовку участка»; наблюдатели решили не настаивать.</p>\n<p><strong>Распределение числа избирателей по часам было такое (с округлением): </strong></p>\n<p>8.00-9.00        35<br/>9.00-10.00      30<br/>9.00-10.00      60<br/>10.00-11.00    100<br/>11.00-12.00    120<br/>12.00-13.00    130<br/>14.00-15.00    70<br/>15.00-16.00    80<br/>16.00-17.00    75<br/>17.00-18.00    85<br/>18.00-19.00    60<br/>19.00-20.00    45 </p>\n<p>Как видите, общее число проголосовавших на участке – менее 900 чел. Данные примерно совпали по двум подсчетам.. </p>\n<p>В ходе голосования председатель не оглашал число проголосовавших, но нам удалось снимать информацию с листков, которые лежали на столах у ведущих списки; примерно с 11.00 наши данные, и данные этих списков начали различаться примерно на 100 человек, и далее этот отрыв все время увеличивался.</p>\n<p>Наблюдатель от «едра» была на участке не более 30% времени. Из её переговоров с членами УИК с правом решающего голоса я понял, что она отходит на два соседних УИК №№ 2371 и 2372. Не намного больше времени в помещении УИК присутствовал и наблюдатель от КПРФ. </p>\n<p>Первую жалобу подал в 9.05 г-н Гарник И.Д, по поводу отсутствия на УИК плаката с перечнем всех кандидатов. Вторую – я, в 11.00, заметив, что одна из пожилых избирательниц голосовала без паспорта, по «карточке москвича». На 1-ю жалобу председатель не ответил, приняв ее, написал «ознакомлен с возражениями»; на <br/> 2-ю дали ответ: «в прессе была информация о том, что голосовать можно по любому документу с номером и фотографией».</p>\n<p>В выездных голосованиях я не участвовал, ограничился проверкой наличия реестров. Позднее стало понятно, что это было правильно: всего выезжали 3 раза, 49 проголосовавших, что совпало с реестрами. </p>\n<p><strong>Конфликты с Председателем</strong> были постоянно: </p>\n<p>1). Из-за фото- и видеосъемки (якобы запрещено без разрешения). Вызванный вначале (примерно в 10.00) председателем на подмогу полицейский подполковник пытался уверять, что УИК – не общественное место, а «спецобъект». Т.к. такая аргументация была не слишком весомой, принята она не была, и позднее полиция перестала реагировать на эти претензии, но со стороны членов УИК постоянно по этому поводу шли истеричные выкрики «мешаете работать», «я не давала разрешение» и проч.</p>\n<p>2). Из-за того, что подходим близко к столам; к концу дня член УИК, ведущий списки избирателей (книга 6) – молодая учительница – даже имитировала сердечный приступ; секретарь комиссии давала ей таблетки, и все громко возмущались наглостью наблюдателей. </p>\n<p>3). Из-за того, что я на выходе в дверях УИК спросил у двух молодых людей, сколько из них проголосовали (они у урны были вдвоем, стояли к нам спиной, и я хотел уточнить данные для подсчета числа избирателей), секретарь комиссии быстро составила жалобу, что я «веду агитацию». Председатель требовал от полиции меня удалить, я говорил, что у них нет такого права из-за моего статуса, секретарь звонила в ТИК, но там меня поддержали.</p>\n<p>Есть подозрения на <strong>факты вброса бюллетеней</strong> (прямые доказательства отсутствуют). </p>\n<p>Среди наблюдателей существовало подозрение, что мелкие (по 2-3 бюллетеня) вбросы делают сами члены УИК, голосуя по открепительным. Но за руку схватить их не удалось.</p>\n<p>Около 17.25 мы увидели плотную толпу примерно в 30 чел., которая сразу подошла к столу с открепительными. Эти люди были знакомы между собой (обращались друг к другу по именам, в очереди разговаривали, смеялись). На выходе с теми из них, кто проголосовал первыми, курила наблюдатель от «ЕР» - тоже обращалась по имени, спрашивала, «не оставили ли они в кабинете включенным свет». Я с фотоаппаратом обежал территорию вокруг школы, прошел по соседним дворам, но автобуса не увидел. Вернувшись, получил от наблюдателя Горобец А.А. информацию о том, что «она видела, как у одного из этой толпы было 2 или 3 бюллетеня», но сама она ничего не предприняла. Мы составили коллективное заявление о странном поведении этой группы голосующих, председатель на нее не ответила, приняв ее, и снова написав «ознакомлен с возражениями».<br/>Имеется фотография части описанных участников предположительной «карусели».</p>\n<p><strong>Сотрудничество со штабом <br/></strong>Дозвониться было нелегко; после дозвона мы получали лишь самые общие рекомендации из «талисмана наблюдателя». И хотя даже такая поддержка помогала, хотелось бы большего; из штаба, например, на сообщение о возможной «карусели» ответ был такой: «мы отреагировать не успеем, поищите автобус недалеко от участка, а больше ничем  помочь не в состоянии». </p>\n<p><strong>20:00 Подсчет голосов</strong> <br/>В 19.55 повесили увеличенную копию протокола. Подсчитали неиспользованные бюллетени (855). Зам. председателя комиссии тупыми ножницами начала отрезать уголки, делала это ОЧЕНЬ медленно. В это время члены УИК, ведшие списки, активно начали вписывать в пустые графы данные об избирателях, и расписываться за них. Мы не сразу это заметили, подняли шум, поставили 2 наблюдателей у столов. Ведшие списки начали кричать, что они не могут так работать, председатель стала отодвигать наблюдателей «на 3 метра от стола», на помощь ей пришли представители полиции и МЧС (3 чел.). Мы добились того, что нам позволили продолжать наблюдение, и все равно зам.председателя (вела книгу №1) и член комиссии, которая вела книгу №2, продолжали вписывать фальшивых избирателей – если мы начинали протестовать, тут же подходила председатель УИК, вычеркивала фальшивую надпись, писала «запись сделана ошибочно»), и расписывалась рядом; после 3-х таких случаев председатель сказала тем, кто вели списки: «не надо, у нас и так сойдется».</p>\n<p>Подсчет по книгам я производил лично, но наблюдатель Горобец А.А. стала протестовать, «это займет много времени» - в итоге книги унесли, и не было возможности проверить, не продолжил ли кто-то вписывать фальшивых избирателей. </p>\n<p>В увеличенную копию протокола были внесены данные о кол-ве избирателей (2208),  выданных на УИК бюллетенях (1245), вне УИК (49), погашенных бюллетенях (855), выданных ТИКом открепительных (3), полученных (30) и выданных УИКом открепительных (27). </p>\n<p>Начался подсчет бюллетеней в урнах. Посчитали бюллетени в передвижных урнах. Никаких нарушений.</p>\n<p>Вскрыли 1-й стационарный ящик. Сразу за ним -2-й.  Визуально пачек сложенных вместе бюллетеней не было. Я начал снимать процесс сортировки бюллетеней (имеется 4 части видеозаписи, общая продолжительность съемки примерно 40 мин.). </p>\n<p>Очевидно, что председатель в тот момент посчитала, что результат «ЕР» с учетом вброса и карусели будет приличным, т.к. не препятствовала съемке; подсчет велся по правилам: каждый бюллетень поочередно громко оглашался перед раскладыванием их на стопки. </p>\n<p>К середине подсчета стало очевидно, что стопка «едра» растет очень медленно; примерно через 30 мин. стопки были пересчитаны, сверху стопок были положены листы бумаги с написанным названием партии и кол-вом бюллетеней. </p>\n<p>«Справедливая Россия»       208 шт.<br/>«ЛДПР»                                 147 шт.<br/>«Патриоты России»             25 шт.<br/>«КПРФ»                                 320 шт.<br/>«Яблоко»                               134 шт.<br/>«едро»                        365 шт.<br/>«Правое дело»                       11 шт.<br/>недействительные               14 шт. </p>\n<p>Председатель занервничала, побежала куда-то звонить, и в итоге объявила: «Я не смогу вам выдать подписанную копию итогового протокола». </p>\n<p>Примерно через час, после звонка в ТИК ( я разговаривал с председателем Юдиным В.В.) нам выдали протоколы с указанными выше данными, с подписью секретаря и с печатью УИК, но БЕЗ ЕДИНОЙ ПОДПИСИ членов УИК.</p>\n<p>Пока готовился протокол, мы написали коллективное заявление о том, что, по нашим подсчетам, на УИК 2370 с 8.00 по 20.00 даже с учетом выездного голосования, проголосовало не более 950 человек. Важно, что данное заявление подписал член комиссии с правом решающего голоса г-н Анатолий Федорович (?). Данную жалобу председатель принять отказалась, и сразу же уехала в ТИК.</p>\n<p><strong>ТИК</strong> <br/>Нам было важно зарегистрировать последнюю жалобу о недостоверности общего количества проголосовавших на участке, и мы с г-ном Гарником Я.Д. и наблюдателем от «Справедливой России» г-ном Тимофеевым Н.П поехали в ТИК. </p>\n<p>Председатель ТИК наше заявление не принял, сославшись на «ненаучность явления телепортации». Копии заявления передали присутствовавшим на 01.45 в ТИКе представителям «Яблока» (Леониду Александровичу) и «Справедливой России». </p>\n<p>Имеется фотография сводной таблицы голосования в ТИКе на момент 01.30, где приведены итоговые данные по участку 2370, аналогичные тем, что указаны в копии итогового протокола УИК.</p>\n<p><strong>ИТОГИ</strong><br/>05.12.2011 в 19.30 я передал оригиналы итогового протокола и 4-х жалоб в приемную «Яблока» на Пятницкой, 31. </p>\n<p>06.12.2011 на сайте Мосгосизбиркома с удивление увидел, что данные итогового протокола скорректированы: </p>\n<p>- строка 4 (число избирательных бюллетеней, выданных в помещении для голосования) изменена с 1245 на 1196 шт.</p>\n<p>- строка 8 (число избирательных бюллетеней в стационарных ящиках для голосования) изменена с 1224 на 1175 шт. </p>\n<p>Возможно, в увеличенной копии и выданных нам копиях итогового протокола не учли голосование на дому (49 бюллетеней). <br/><br/>Официальные данные ЦИК по нашему участку </p>\n<p><br/></p>\n<p> </p>','otchet-nablyudatelej-duma-uik-2370/'),(2395,'некорректная работа УИК','','','',''),(2420,'','','','',''),(2425,'','','','',''),(2431,'','Илья Бурмистрович','Вброс, Удаление наблюдателя','<p>Избирательный участок № 2431, г.Москва, Бережковская набережная , дом 6.</p>\n<p>Председатель участковой избирательной комиссии Валерий Павлович Красильников</p>\n<p>Секретарь комиссии Рустам Рустамходжаевич Турсункулов</p>\n<p>Представителями СМИ (газеты «Троицкий вариант») на избирательном участке были Бурмистрович Илья Евсеевич, Самодуров Юрий Вадимович, оба не профессионалы-журналисты.</p>\n<p>Первое нарушение, первое столкновение, первые выводы.</p>\n<p>В 11.05-11.10 мы стали свидетелями того, что минимум два человека (молодые парни), подойдя к секретарю избирательной комиссии, получили у него избирательные бюллетени, не оставив на столе у секретаря открепительные удостоверения. Первый из них, получив от секретаря избирательный бюллетень вместе с открепительным талоном,  отошел от стола секретаря комиссии и пошел голосовать, но мы не успели на это среагировать. Второй показал секретарю не открепительное удостоверение, а, как увидел один из нас (Самодуров)  какую-то белую бумагу, которую секретарь избирательной комиссии,  записав в журнал какие-то данные,  вернул этому парню вместе с паспортом и бюллетенем. Это же видела член УИК с решающим голосом г-жа Э.Ш. Набутовская. Заметив это нарушение, мы оба, а также г-жа Набутовская, подойдя к столу секретаря избирательной комиссии,  стали требовать, чтобы секретарь немедленно, пока парень не ушел (мы блокировали парня и не дали ему отойти от стола секретаря) предъявил нам открепительное удостоверение, по которому он выдал избирательный бюллетень. Сделать этого секретарь не смог. Он начал  перебирать  удостоверения в тонкой пачке (причем не те, что лежали сверху) и  тянул время. Свою фамилию, когда мы его об этом спросили,  блокированный нами парень отказался назвать.  При этом бумага, которую ему вернул секретарь, выглядывала  у парня из паспорта, который он держал в руках.</p>\n<p>  Вместе с г-жой Набутовской мы, обращаясь к секретарю,  продолжали настаивать на проверке: “Где открепительное удостоверение, которое Вы у этого парня взяли?”. Вмешался председатель комиссии и потребовал “не мешать работать”. Мы продолжали настаивать на проверке,  тогда председатель комиссии вызвал дежурящего на участке капитана полиции. Мы продолжали настаивать и перед полицейским, чтобы парень назвал свою фамилию, а секретарь предъявил нам его открепительное удостоверение. Председатель неожиданно для нас объявил,  что  временно прекращает работу комиссии и предложил членам комиссии с решающим голосом проголосовать: “Было ли нарушение?”. О каком нарушении идет речь, он членам комиссии не сказал. Все члены избирательной комиссии с решающим голосом, кроме  г-жи Набутовской,  проголосовали за то, что  “нарушения не было”. К сожалению, это голосование не было зафиксировано протоколом, а мы не сообразили настоять на этом, не имея достаточного опыта. Только после голосования  мы дали   парню уйти, и за тем, как он бросил бюллетень в избирательную урну, к сожалению, не проследили.</p>\n<p>Председатель, очень раздраженный происшедшим, сказал, что  делает нам обоим замечание и что в случае второго замечания мы будем удалены с избирательного участка. Самодуров ответил что-то вроде того, что  “Вы сами продавили нарушение и поступили  незаконно и я тоже Вас предупреждаю, чтобы Вы так не делали”.</p>\n<p>После этого случая мы до конца голосования взяли под наблюдение стол секретаря и его работу с  избирателями. Во всех случаях, когда к секретарю подходили молодые парни (“подозрительные”, на наш взгляд)  Илья Бурмистрович становился неподалеку от стола секретаря, чтобы контролировать процедуру выдачи бюллетеня по открепительному удостоверению. Это очень раздражало председателя. После очередного замечания Бурмистрович спросил у председателя: «Где я должен находиться, чтобы не мешать избирателям, но при этом видеть, что происходит?». Такое место (сзади и сбоку от стола секретаря) было найдено. Больше нарушений при выдаче бюллетеней избирателям, которых нет в списке, мы не зафиксировали. Позже председатель комиссии раза два сказал Бурмистровичу: «Присядьте!», но не настаивал.</p>\n<p> За час-полтора  до окончания голосования  на участок друг за другом вошли три пары не очень городских по виду молодых парней, которые прямиком, не смотря по сторонам,  направились к столу секретаря избирательной комиссии. Каждый из них держал наготове паспорт с вложенным туда открепительным удостоверением. Как они голосовали, мы не проследили.</p>\n<p>Второе столкновение с председателем избирательной комиссии произошло во время подсчета голосов. Нарушений установленной законом процедуры подсчета было много (они  описаны отдельно г-жой Набутовской в поданной ею жалобе). В частности, в обоих ящиках для голосования, которые были установлены на участке, после вскрытия нами были замечены   пачечки сложенных вчетверо бюллетеней  по 4 (в одном случае  5) штук. Таких пачечек независимые наблюдатели обнаружили при разборе высыпанных из ящиков бюллетеней не менее восьми, Это число совпадает с числом подозрительных молодых людей, которых мы видели в течение дня на участке. Но это, разумеется, ничего не доказывает. В тех случаях, когда мы сумели выяснить содержание бюллетеней из этих пачечек, оказывалось, что все они были в пользу одной партии (угадайте, какой). Мы предложили председателю разбираться с этими бюллетенями отдельно, поскольку это явно “вброс”. Председатель ответил: «Это ваши домыслы,» –  и продолжал класть бюллетени из пачечек в общую стопку бюллетеней за партию ЕР. Тогда Самодуров  стал фотографировать все пачечки бюллетеней.   Одна молодая дама, член комиссии, попросила Самодурова  не фотографировать со вспышкой, поскольку она  ее ослепляет (ее просьбу Самодуров  выполнил и продолжал фотографировать без вспышки).</p>\n<p> “Сорвались” мы, когда председатель комиссии начал подсчет бюллетеней. В находящейся перед ним, ранее уже отсортированной пачке бюллетеней, поданных за “Единую Россию”,  председатель комиссии стал молча перебирать уголки листов в пачке (как считают деньги), а не брал по листу  и не перекладывал их,   чтобы мы могли контролировать результаты подсчета (перекладывать каждый лист при подсчете – это  требование п.18 ст. 6 ФЗГ).   Поскольку на наши просьбы вести подсчет по закону председатель не реагировал и продолжал считать “по уголкам”,  мы стали буквально кричать: “Валерий Петрович, так считать нельзя! Валерий Петрович, надо брать  лист и перекладывать! Валерий Петрович, Вы нарушаете процедуру!”  </p>\n<p> Реакция председателя была та же, что и при  первом столкновении, но более решительная. Он объявил, что мы весь день мешали работе комиссии, и сказал: «Делаю вам последнее предупреждение. Вам понятно?» Бурмистрович ответил: «Нет». Тогда он объявил, что прерывает подсчет бюллетеней и  поставил на голосование вопрос о нашем удалении, пригласив голосовать всех членов комиссии, как с решающим, так и с совещательным голосом. Против нашего удаления проголосовали двое: г-жа Набутовская  и  представитель КПРФ.</p>\n<p>По нашему требованию было составлено решение об удалении. ОДНО НА ДВОИХ (см. Приложение).  Его копию – в одном экземпляре –  мы получили на руки. Г-жа Набутовская сделала на нем приписку об особом мнении.   Поскольку мы продолжали настаивать, чтобы в решении были приведены конкретные причины нашего удаления и указано, какие именно нормы мы нарушили (решение было составлено в самых общих выражениях), председатель вызвал дежурного капитана полиции, после чего нам пришлось покинуть избирательный участок. К сожалению, один из нас (Самодуров) не удержался и сказал председателю комиссии  во время составления  решения: “Желаю Вам заработать много денег.”  Вот во что это превратилось в тексте решения: «перешли на личности, оскорбили председателя.»</p>\n<p><strong>После нашего удаления</strong> приехавшие на участок по звонку  И.Бурмистровича член ТИКа и кандидат в депутаты от “Яблока” добились того, чтобы  подсчет  велся по предусмотренной законом процедуре, с перекладыванием листов,  а “не по уголкам” в пачках.  </p>\n<p>Итоговый протокол, заверенную копию которого получили Э.Набутовская и другие после весьма длительного ожидания, совпадает с официально опубликованным.</p>','otchet-nablyudatelya-duma-uik-2431/'),(2451,'','','','',''),(2473,'некорректная работа УИК','Елена Букварёва','вроде чисто','<p><strong> На участке кроме членов УИК присутствовали:</strong></p>\n<p>- наблюдатиель от СР - 1 человек<br/>- наблюдатели от ЕР - 2 человека<br/>- наблюдатели от КПРФ - 2 человека<br/>- корреспондент Новой Газеты Харламов С.А.-  - представитель проекта ГН<br/>- корреспондент Троицкого варианта Панкратов Д.В   - представитель проекта ГН</p>\n<p><strong>В составе УИК были:</strong></p>\n<p>- член УИК с ПРГ от СР - Букварева Е.Н.  - представитель проекта ГН<br/>- член УИК  с ПСГ от Яблока - Букварева А.А. - представитель проекта ГН<br/>- член УИК от КПРФ (не наш человек)</p>\n<p>Процесс голосования шел без особых нарушений.</p>\n<p>Нарушения начались после окончания голосования и начала подведения итогов. </p>\n<p>Незаконно был удален с участка  корреспондент Новой Газеты Харламов С.А. , производивший видеосъемку, но съемку после этого продолжал  корреспондент Троицкого варианта Панкратов Д.В.</p>\n<p>Несмотря на сильнейшее сопротивление членов УИК и ее председателя Свечиной Раисы Кузьминичны, оставшимся на тот момент в помещении для голосования представителям проекта ГН удалось добиться соблюдения законного порядка подведения итогов голосования - сортировку бюллетеней и подсчет бюллетеней в пачках партий осуществляла член УИК с ПРГ Букварева Е.Н. поскольку председатель УИК отказалась это делать.</p>\n<p>Протокол подписан всеми членами УИК и председателем, выданы заверенные копии протокола, но председатель УИК отказался внести их в реестр и пронумеровать.</p>\n<p>Весь процесс подведения итогов голосования имеется на видео (около 3 часов съемки).</p>\n<p>Имеются диктофонные записи разговоров представителей проекта ГН с другими участниками процесса.</p>\n<p> </p>','otchet-nablyudatelya-duma-uik-2473/'),(2498,'значительные нарушения','Дмитрий Яковлев','Удаление представителя СМИ за видеосъемку, которая не производилась','<p>Я был представителем СМИ, в 8 утра занял пост возле стационарных ящиков, щелкал счетчиком и не уходил со своего места ни на секунду до 13 часов.</p>\n<p>Рядом был еще один представитель СМИ от проекта, который тоже параллельно считал опущенные бюллетени.</p>\n<p>Наша задача была - ждать и не допустить вброс.</p>\n<p>В руках у меня была камера, но включать ее не было необходимости, т.к. все было чисто и гладко.</p>\n<p>Также от проекта были наблюдатель и член комиссии с ПСГ, которые контролировали прочие процедуры.</p>\n<p>В 12 часов у председателя УИК  Абрамяна Виктора Романовича закончилось терпение, и он сообщил нам, что будет ставить вопрос о нашем (представителей СМИ) удалении в связи с тем, что на нас поступили жалобы от избирателей и членов комиссии на незаконную фото и видеосъемку.</p>\n<p>В 13 часов приехал представитель ТИК, был поставлен вопрос об удалении, комиссия проголосовала единогласно. Эту процедуру я таки снял на видео, т.к. терять уже было нечего. После письменного запроса и звонка в ТИК нам даже выдали решение об удалении.В решении написано, что мы удалены в связи с тем, что производили видеосъемку.</p>\n<p>Решение было обжаловано в тот же день в ТИК и Кунцевском районном суде. ТИК ответила сразу отказом, суд перенес заседание на 6 декабря, когда также и вынес отказ. Решение суда здесь.  </p>\n<p>Там много букв. Если коротко, то \"<strong>избирательная комиссия расценила мое поведение, как нарушение избирательного законодательства</strong>\", поэтому решение правомерно.</p>\n<p>При этом так и не разъяснено, какие мои действия и какую норму избирательного законодательства нарушили.</p>\n<p>Напомню, что для представителей СМИ, в отличие от наблюдателей, в Федеральном Законе №67 «Об основных гарантиях нет даже явного запрета на действия, препятствующие работе комиссии, а фото- и видеосъемка  </p>\n<p>Буду обжаловать в Мосгорсуде. Советы принимаются...</p>\n<p>Параллельно, отправил жалобу в ЦИК в электронном виде сегодня около 16 часов. </p>\n<p>После суда 4 декабря успел еще направиться наблюдателем на участок 1680, куда приехал в 19:50.</p>\n<p>Подробнее об этом участке - в отчете Дмитрия Черного.</p>\n<p> Со второго участка меня тоже удалили за видеосъемку в середине процедуры подсчета.</p>\n<p> </p>','otchet-nablyudatelya-duma-uik-2498/'),(2511,'','','','',''),(2536,'','','','',''),(2547,'','','','',''),(2572,'нарушений не выявлено','','','',''),(2579,'','','','',''),(2604,'','','','',''),(2608,'значительные нарушения','Павел Васильев','Вброс, удаление, фальсификация при подсчете бюллетеней, в протокол внесены цифры с потолка','<p><strong>Как я первый раз наблюдал за «честными» выборами...</strong></p>\n<p>А началось всё с Навального... Читаю его регулярно – чаще соглашаюсь, порой – поражаюсь, иногда – возмущаюсь.  Но как-то пассивно – да, каждый день заглядываю на его страничку, да, перевёл деньги для поддержки его безусловно честной борьбы, но было ощущение – нужно что-то ещё!  И это «что-то» появилось в тот день, когда Навальный разместил у себя на страничке ссылки на проекты, запущенные для контроля за выборами депутатов Госдумы.  Сходил.  Прочитал.  Перечитал на следующий день...  И тут – кольнуло!  Ведь это – то, что я действительно могу сделать.  Как совпадение на следующий день коллега по работе сказала «А ты слышал про «Гражданин Наблюдатель?»...  Ну, раз все звёзды совпали, то НАДО!  Забегая вперёд, скажу, что в ночь с 4 на 5 декабря больше всего мы перезванивались именно с Машей, моей коллегой, упомянувшей о проекте «Гражданин Наблюдатель», рассказывая друг другу «ужастики», поражаясь «Да ты что! Так вообще не бывает!», поддерживая друг друга!..  Я благодарен ей за это!</p>\n<p>Итак, я сходил на первую (установочную) встречу, затем – подробную лекцию, сказал, что готов участвовать в мобильной группе, сам – юрист (непрактикующий), а вообще – готов к любой работе с целью провести Честные Выборы...  Да, тогда мне казалось, что всё – возможно, стоит лишь захотеть! <br/> Меня назначили членом комиссии с правом совещательного голоса, чему я немедленно возгордился и за что позднее и поплатился.. Но это я забегаю вперед.  А пока неумолимо приближались Выборы.<br/>  <br/> Накануне...<br/> Первую половину субботы, 3 декабря, я провёл в попытках получить открепительный талон на «родном» участке (179, 2я Фрунзенская).  Председатель лишь разводил руками, говорил, что «в ТИК мы уже давно сообщили», но ничего сделать не мог... Открепительных – не было! Выдали, мол, все... Ну, что же – это первая проверка боем.  Жалоба раз - в УИК, жалоба два - в ТИК... В обоих местах заверяли, что «непременно изыщут скрытые ресурсы», но... не открепительное удостоверение мне получить так и не удалось!<br/> Встретившись с одним из ребят из проекта ГН рядом с нашим участком (2608, на Лобачевского), мы пошли «знакомиться с комиссией».  «Тётя председатель» сразу встретила нас настороженно, начала требовать документы, но мы были непокобелилебимы – «Всё – завтра! Но нас – ждите обязательно!»<br/>Начало...<br/> Город ещё спит, а наблюдатель – уже разбужен, взбудоражен и готов к превратностям судьбы.  Проснувшись в 6:30, к 7:20 прибываю к дверям участка!  Ребята подходят вскоре, полицейские открывают двери, мы предъявляем документы – и вот мы внутри!<br/> Сразу заявляем о своём желании ознакомиться со списками избирателей, на что получаем первое возражение: «Почему раньше не приходили?».  Парируем: «Не обязаны, и имеем право сейчас!».  Нехотя, но дают.  В книгах находим карандашные пометки (в основном, «Убыл»), заставляем стереть.  Осматриваемся... Урны стоят в месте, где за ними удобно смотреть, столы – все перед глазами, кабинки – чуть в отдалении.  Вроде всё нормально!  Гасим невыданные открепительные. <br/> Председатель предлагает опечатывать урны.  Не очень настойчиво требуем, чтобы сделали это с приходом первых избирателей, после 8 утра, но убедившись, что в них – «мышь повесилась», соглашаемся!  Первые избиратели, пришедшие к 8 утра, застают нас за этими действиями, один выражает неудовольствие тем, что его заставили ждать. Это немедленно ставится комиссией нам в упрек.<br/> Вместе с нами на участке – наблюдатели из КПРФ (отличные ребята, мы с ними сдружились), двое – от СР, паренёк из ЕдРа (за день он ни разу не высказал претензий комиссии, но и нам особо не мешал).<br/>  <br/> На стене – увеличенная форма протокола, необходимые графы – заполнены, на стенках висят листы со списком партий, но они как-то теряются среди расписаний лекций и иной печатной информации для студентов!  Отдельно, на огромном типографском листе – выдержка из Административного Кодекса с «карами» за нарушение избирательного законодательства.  А что, весьма кстати! <br/> Мы начинаем считать избирателей, распределяем между собой наблюдение за столами и урнами.  Понеслась!<br/>  <br/> Борьба за право видеосъёмки<br/> <br/> Представитель Новой Газеты  начинает видеосъёмку, это сразу же вызывает гнев комиссии.  Нам говорят, что «снимать нас нельзя», «снимать избирателей нельзя», «сейчас мы пожалуемся в ТИК» и вообще – Снимать – НЕЛЬЗЯ. Точка!  Я чётко и нудно цитирую законодательство, объясняя, что «снимать нам разрешает Закон об основных гарантиях избирательных прав, а ему (показывая на корреспондента) ещё и Закон о СМИ».  Поняв, что с нами так просто не справиться, вызывают подмогу – приезжают сама председатель ТИК\'а и её заместитель.  Разговор идёт уже на повышенных тонах, появляются новые аргументы – «снимать можно так, чтобы в кадр попало не больше четверти лица» (откуда им это приснилось?), «снимать можно только с определённого расстояния».  Сходимся на запрете снимать бюллетень, снимать избирателей, возражающих против съемки и снимать лица избирателей. А нам ничего этого и не нужно.<br/> Но – песец подкрался незаметно!  В порыве «праведного гнева» председатель решила перепроверить документы представителя СМИ и – о, ужас! – выяснила, что в его фамилии допущена ошибка в одной букве, и на этом основании объявила, что он его не имеет права присутствовать на участке.  Спору нет, косяк действительно был (серьёзность его весьма спорна при этом)... Дима не сдался, смотался в Новую Газету, получил исправленное редакционное задание и – с большим нежеланием – был допущен к присутствию на участке вновь!  Он – молодец, и его присутствие нам впоследствии сильно помогло.<br/> Мнение: запрет или ограничение видео- или фото-съёмки – первый признак готовящихся фальсификаций!</p>\n<p> Первая жалоба и «Смотрящий» из управы<br/> <br/> Нас начинают ограничивать в передвижении по участку, просят вставать подальше от урн и вообще «не мешать работе комиссии».  Мы стараемся не вступать в перепалки, считаем избирателей.  Появляется человек из Челябинска со временной регистрацией, хочет голосовать.  Я указываю комиссии, что в отсутствие его заявления, поданного за 3 дня до дня голосования, его нельзя включать в дополнительный список.  Председатель, тем не менее, намерена дать ему возможность голосовать на основании «решения комиссии».  Я позволяю себе усомниться в том, что было проведено именно голосование членов комиссии, но это решается быстро – никто из членов комиссии не пытается перечить председателю.  Человеку из Челябинска дают бюллетень.  Я в ответ пишу свою первую жалобу.  Наверное, это действительно был человек, который просто хотел проголосовать.  Но наша принципиальная позиция была – «Всё должно быть по Закону!» и пропустить данное нарушение без жалобы было невозможно – стратегически!<br/> Неожиданно появляется непонятный «человек в чёрном».  Он явно настроен на скандал, требует, чтобы мы перестали вести съёмку, представиться – отказывается.  Несколько раз громко сообщает всем присутствующим, что «идут честные выборы – так настойчиво, что это заставляет всех усомниться в его словах.<br/> Странно, но председателя комиссии его поведение совершенно не волнует.  Мы с ним обмениваемся рядом словесных уколов, он уже открыто обещает мне, что мои «минуты на этом участке сочтены», в какой-то момент переходит «на ты».  Это мне совершенно не нравится,я поворачиваюсь, чтобы отойти, и чувствую, что он хватает меня за шею.  Вывернувшись, я понимаю, что это был тот самый агрессор.  На мою удачу, полицейский был рядом, и он прекращает перепалку, которая едва не переросла в потасовку.  Даже после этого полицейский не собирается проверить у драчуна документы и вывести его с участка.  Сейчас я понимаю, что поддайся я на провокацию – комиссия только радостно потирала бы руки, когда меня выкинули бы с участка за драку. </p>\n<p>Впоследствии «маленького чёрного человека» мы неоднократно встречали в ТИК\'е, где он «любезно» развозил представителей участковых комиссий.  Нам сказали, что это «смотрящий» за выборами из управы...</p>\n<p>Голосование идёт своим чередом – мы следим за урнами, считаем получающих бюллетени, иногда выслушиваем про себя: «ходють тут всякие, работать мишають, нервирують...»<br/> Мнение: надо быть прежде всего психологически готовым к тому, что члены комиссии видят в наблюдателе врага, будут давить на него в течение всего дня.  Наилучшим способом борьбы является сплочённость наблюдателей и взаимная поддержка.<br/>  <br/> Отстранение члена комиссии («Жёлтая» карточка наблюдателю!).  </p>\n<p>Первая поездка в ТИК</p>\n<p>Поскольку я продолжаю свою тактику (нудно цитирую закон), комиссия решает, что они должны свою тактику сменить.  Мне предлагают сходить пообедать, намекают, что мои прогулки рядом с урнами заставляют уже их подозревать меня в планируемом вбросе и наконец делают «ход конём», объявив «А Вы у нас поедете на выездное голосование!».  На часах – 13:00, избиратель, как говорится, пошёл, и поскольку заявок всего 8, я понимаю, что на выезде мне «ловить» особо нечего.  Поэтому я вежливо отказываюсь.  Но у комиссии есть туз в рукаве: мне предъявляют «решение комиссии» о моём отстранении с формулировкой «за отказ работать на голосовании вне участка».  Заявляю им, что комиссия нарушает Закон, поскольку принимать участие в выездном голосовании – это моё право, а не обязанность.  Пишу заявление с требованием немедленно отменить решение, уезжаю в ТИК, чтобы обжаловать и там.  Пишу жалобу, которую принимают, решаю, что раз я уехал с рабочего участка – то можно съездить и на свой участок, отдать голос,  голосую и немедленно возвращаюсь на «место работы».<br/> Сейчас у меня есть почти полная уверенность, что именно в этот момент, пока я отсутствовал, произошёл вброс бюллетеней, о котором мы узнали при подсчёте голосов.  Наверное, зная, как развернутся события позднее, я бы постарался остаться на участке, но в этот момент мне казалось, что ТИК просто посмеётся над решением отстранивших меня «тётек» и я вернусь под фанфары. <br/> Как же глубоко я ошибался!<br/> Тем не менее, я вернулся на участок, где всё было достаточно спокойно и, если не считать того, что председательша перестала отвечать на наши даже самые безобидные вопросы (типа, «А где именно Вы планируете считать бюллетени?»), голосование проходило корректно.  За это время вернулись выездные урны и тут ничего неожиданного не было – за 2 выезда проголосовало 9 человек.<br/><br/> Начало подсчёта<br/> <br/> Благополучно «дожив» до закрытия участка (в 20:01 пришла семейная пара с ребёнком, но общим решением было дать им возможность проголосовать), комиссия закрыла участок.  Мне неоднократно напомнили, что «мы Вас – отстранили, а ТИК нам по Вашей жалобе ещё ничего не сказал», но позволили присутствовать при подсчете бюллетеней.<br/> Затем мы сверили свои результаты подсчета проголосовавших с результатами наблюдателей из КПРФ.  У нас получилось около 750 человек. (Всего в списках 1579 избирателей, бюллетеней в начале голосования было 1300 шт.)  Приступаем к подсчёту!</p>\n<p>Здесь нас ждало первое разочарование.  Неиспользованных бюллетеней оказалось 219 шт.  Быстро сложив в уме наши цифры выданных на участке (~750 шт.), использованные на выезде (10 шт.) и погашенные (219 шт.), мы получили цифру около 980 шт. и поняли, что мы пропустили вброс!  (Позднее выяснится, что всё же наши усилия даром не пропали – на участке недосчитались 95 бюллетеней, которые просто «испарились».  Видимо, они планировались также для вброса, но – не вышло, мы хоть немного, но помешали фальсификаторам!<br/> Вскрытие выездных урн никаких неожиданностей не принесло, но в этот момент я осознал, что мы пропустили этап работы с книгами.  Я немедленно указал на это комиссии и потребовал прекратить любую работу с бюллетенями до подсчёта данных по спискам избирателей!<br/>  <br/> Удаление (а теперь – Красная карточка!).  Вторая поездка в ТИК.<br/> Видимо, это требование стало той каплей, которая переполнила чашу терпения председателя, и она строгим, не терпящим возражений тоном указала полицейскому на меня и сказала: «А это вообще никто, выведите его с участка!».  Надо, надо было возмущаться, требовать письменного решения об удалении, вызова наряда полиции.  В общем, надо было скандалить!  Но у меня ещё оставалась надежда на то, что ТИК отменит явно противозаконное решение о моём отстранении и что я смогу вернуться и продолжить работу.  Поэтому я вышел, сопровождаемый полицейским, но запоминающегося скандала не устроил.<br/> Доехал до ТИК\'а, где уже чувствовалась нервозность, люди перебегали по коридорам, висели на телефонах, хлопали дверьми.  Собралось заседание для рассмотрения моей и других жалоб.  ТИК усиленно изображал объективное рассмотрение моей жалобы, мне дали возможность высказаться, однако председатель была явно настроена агрессивно (видимо, запомнив меня ещё с утра), передёргивала факты. В общем, у меня сложилось стойкое впечатление, что основным «заказчиком» всей той горы фальсификаций и нарушений является именно ТИК, которая безнаказанно пользуется тем самым административным ресурсом.  В общем, мне отказали большинством голосов, указав, что «действия комиссии признаны правомерными».<br/> Мнение: в настоящий момент я глубоко убеждён в том, что ТИК «штампует» любые решения УИК\'ов и что письменное обращение в ТИК может иметь своей целью лишь дополнительное фиксирование факта обжалования.<br/>  <br/> Ожидание<br/> Получив отказ в ТИК\'е, я понял, что участвовать в этот день в подсчёте голосов мне не судьба, но всё равно вернулся к участку около 23 часов и стал следить за разворачивающимися на нём событиями, благо, участок находился на первом этаже и через большие окна всё было прекрасно видно.  А там было на что посмотреть!  К этому времени подсчёт бюллетеней был закончен (позднее я узнал от коллег, что даже с пропущенным нами вбросом ПЖиВ набрала около 36%, что было явно меньше ожидаемого) и здесь председатель допустила стратегическую ошибку, внеся результаты подсчётов в увеличенную форму протокола (ребята всё засняли на видео-камеру).  Таким образом, результаты первичного подсчёта были зафиксированы!  Похоже, что это явно не устроило председателя и, побегав по участку в течение получаса, она отбыла в неизвестном направлении.  Да-да, не сказав никому ничего, даже не предупредив своих коллег по комиссии, наша председатель пропала.  Да так бесследно, что через 2 часа её отсутствия мы всерьёз подумывали о том, что пора звонить 112 и сообщать о пропаже человека.<br/> На участке к этому времени всё стало спокойно, наблюдатель из СР даже прикорнул на скамейке.  Соседний участок (2610) уже закончил подсчёт, раздал наблюдателям копии итоговых протоколов, и они разошлись.  А мы всё ждали...  Я – на улице, ребята – внутри.  На часах было 2:00 ночи...<br/> Мнение: необходимо настаивать на поэтапном выполнении всех предусмотренных законом процедур с оглашением и занесением в увеличенную форму протокола результатов каждого этапа.  Видео-съемка процесса – ОБЯЗАТЕЛЬНА!<br/>  <br/> Третья поездка в ТИК.<br/> Мне надоело гулять около участка, и я решил доехать до ТИК\'а, чтобы посмотреть что происходит там.  А там были пробки!  Да-да, в 3 утра машины приезжали, уезжали, зачастую не могли разъехаться на узком проезде к управе района Проспект Вернадского.  Приезжающие доставали пакеты с бюллетенями, перебрасывались короткими фразами, торопливо уходили в сторону здания, где заседал ТИК.  Чувствовалось, что работа кипела.<br/> Припарковавшись так, чтобы мне было видно всё происходящее, я начал наблюдать и через некоторое время стал ловить на себе заинтересованные взгляды участников процесса.  Так продолжалось около часа, и в этот момент позвонили ребята, запертые в избирательном участке, чтобы сообщить, что им наконец-то выдали копии протоколов.  А привёз их – тот самый «человек в чёрном», который так запомнился нам с утра.  В протоколах фальсификация «цвела пышным цветом».  Правда, похоже, комиссия нам попалась ленивая... Или – плохо считающая.  Поэтому, чтобы не усложнять себе жизнь, они лишь отняли по 20 голосов у четырёх основных оппозиционных партий (ПР и ПД трогать не стали, у них и так было по минимуму) и прибавили 4х20=80 ПЖиВ!  Итоговые результаты следующие:</p>\n<table>\n\n<tr>\n<td>\n<p>Партия</p>\n</td>\n<td>\n<p>После подсчёта бюллетеней</p>\n</td>\n<td>\n<p>В сфальсифицированном протоколе</p>\n</td>\n<td>\n<p>Если вычесть вброс...</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Справедливая Россия</p>\n</td>\n<td>\n<p>127</p>\n</td>\n<td>\n<p>13,33%</p>\n</td>\n<td>\n<p>107</p>\n</td>\n<td>\n<p>11,23%</p>\n</td>\n<td>\n<p>127</p>\n</td>\n<td>\n<p>17,45%</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>ЛДПР</p>\n</td>\n<td>\n<p>100</p>\n</td>\n<td>\n<p>10,49%</p>\n</td>\n<td>\n<p>80</p>\n</td>\n<td>\n<p>8,39%</p>\n</td>\n<td>\n<p>100</p>\n</td>\n<td>\n<p>13,74%</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Патриоты России</p>\n</td>\n<td>\n<p>12</p>\n</td>\n<td>\n<p>1,26%</p>\n</td>\n<td>\n<p>12</p>\n</td>\n<td>\n<p>1,26%</p>\n</td>\n<td>\n<p>12</p>\n</td>\n<td>\n<p>1,65%</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>КПРФ</p>\n</td>\n<td>\n<p>241</p>\n</td>\n<td>\n<p>25,29%</p>\n</td>\n<td>\n<p>221</p>\n</td>\n<td>\n<p>23,19%</p>\n</td>\n<td>\n<p>241</p>\n</td>\n<td>\n<p>33,10%</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Яблоко</p>\n</td>\n<td>\n<p>120</p>\n</td>\n<td>\n<p>12,59%</p>\n</td>\n<td>\n<p>100</p>\n</td>\n<td>\n<p>10,49%</p>\n</td>\n<td>\n<p>120</p>\n</td>\n<td>\n<p>16,48%</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>ПЖиВ</p>\n</td>\n<td>\n<p>346</p>\n</td>\n<td>\n<p>36,31%</p>\n</td>\n<td>\n<p>426</p>\n</td>\n<td>\n<p>44,70%</p>\n</td>\n<td>\n<p>~121</p>\n</td>\n<td>\n<p>16,62%</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Правое Дело</p>\n</td>\n<td>\n<p>7</p>\n</td>\n<td>\n<p>0,73%</p>\n</td>\n<td>\n<p>7</p>\n</td>\n<td>\n<p>0,73%</p>\n</td>\n<td>\n<p>7</p>\n</td>\n<td>\n<p>0,96%</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Итого:</p>\n</td>\n<td>\n<p>953</p>\n</td>\n<td>\n<p> </p>\n</td>\n<td>\n<p>953</p>\n</td>\n<td>\n<p> </p>\n</td>\n<td>\n<p>728</p>\n</td>\n<td>\n<p> </p>\n</td>\n</tr>\n\n</table>\n<p>Я немедленно поехал за ребятами, и мы вернулись в ТИК для написания жалоб. Здесь мы познакомились с членом ТИК\'а от КПРФ (нормальный мужик оказался, в курсе всего происходящего, ему даже разбили нос днём за съёмку «карусельщиков», но мне показалось, что он, поняв, что он в меньшинстве, пытается противодействовать по мелочам, не нарываясь на открытое противостояние с другими членами ТИК).  Мы описали все нарушения, подали жалобу в ТИК.  В коридоре своей очереди ожидали наблюдатели с другого участка, на котором удалили абсолютно всех наблюдателей и членов УИК с правом совещательного голоса.  Если до этого мы ещё питали иллюзии насчёт того, что «беспредел – это именно на нашем участке, хуже такого быть не может», то в этот момент мы окончательно поняли, что весь процесс выборов в Москве – это Циничная Система!<br/>  <br/> Краткие итоги и выводы</p>\n<p>·                     Мы боролись активно, но ошибкой было то, что акцент борьбы мы сделали в начале процесса голосования, гораздо важнее было сохранить потенциал к вечеру.</p>\n<p>·                     Мы пропустили бОльшую часть вброса, но смогли предотвратить его часть.</p>\n<p>·                     Важна взаимоподдержка при конфликтных ситуациях, не менее важно – распределить роли и постоянно их выполнять.  Лучше  об этом договориться заранее;</p>\n<p>·                     Необходимо готовить себя прежде всего психологически.  Да, знание законов – очень важно, но гораздо важнее Ваша уверенность, способность логично и кратко изложить своё требование, настойчиво требовать его выполнения;</p>\n<p>·                     Фальсификации – будут, это аксиома.  Надо держать эту мысль в голове постоянно.</p>\n<p>·                     Недостаточно исполнить свой гражданский долг, опустив бюллетень в ящик для голосования.  Гораздо важнее – отстоять свой голос!</p>\n<p>·                     Система может быть разрушена.  Или, по крайней мере, её работа нарушена в той мере, которая приблизит результаты выборов к реальным.</p>\n<p>·                     Не стоит впадать в уныние, если что-то не получается.  Отнестись к участию в выборах нужно как к очень полезному опыту – как в части знания российской государственной системы, так и как возможность повышения Вашей уверенности в себе.</p>\n<p>Конец и... до Марта!</p>\n<p>P.S.Я уверен, что я пойду наблюдателем на президентские выборы в марте 2012 г.  Более того – уже несколько людей из моих друзей и знакомых сказали, что также хотели бы участвовать в них в качестве наблюдателей.  Если не передумают к марту – отлично!  Но результат уже есть – я увидел? КАК всё происходит на самом деле (и это – удручает), но одновременно я увидел СКОЛЬКО есть людей, готовых абсолютно бескорыстно поддерживать демократию в нашей стране (а вот это, наоборот, – воодушевляет). <br/> Ребята, наблюдатели, члены УИК, корреспонденты, члены мобильных групп и просто сочувствовавшие нам избиратели  - Огромное Вам Спасибо за поддержку.  Ребята, которые работали со мной вместе от «Гражданина Наблюдателя», Дима Гринчин и Игорь Горбунов – вы просто молодцы! <br/> Я понял: если мы будем вместе – мы сможем дать своим согражданам возможность реализовать наше право на Честные Выборы!<br/> Присоединяйтесь к проекту Гражданин Наблюдатель –  WWW.NABLUDATEL.ORG.<br/>  <br/> <br/>  </p>\n<p> </p>','otchet-nablyudatelya-duma-uik-2608/'),(2627,'','','','',''),(2652,'','','','',''),(2662,'','','','','');
insert  into `report_412`(`uik`,`ocenka`,`author`,`shortDescr`,`fullReport`,`link`) values (2687,'нарушений не выявлено','','','<p> Для работы на выборах 04.12.2011 я посетил вводную встречу и лекцию, организованную движением \"Гражданин наблюдатель\" (ГН), освежил знание избирательных законов и при содействии активистов движения получил от партии Яблоко направление члена УИК с ПСГ на избирательный участок 2687. Ранее я уже 4 раза был наблюдателем (действовал в качестве наблюдателя и члена УИК с ПСГ на различных выборах в Москве и Московской области и участвовал в успешном судебном процессе против УИК). На вводной встрече ГН мы с коллегой (познакомились там же), попросили вместе направить нас на один из участков, где активисты ГН ожидают фальсификаций с наибольшей вероятностью. После обсуждения нас направили на участок 2687, который расположен в школе N 1000 района Солнцево. Нам сказали, что ранее на этом участке что-то около 80% голосов было отдано за ЕР. С другими участниками ГН, направленными на этот участок, мы сформировали группу наблюдения и разделили обязанности:</p>\n<p><strong>- Член УИК с ПСГ от Яблока</strong> - обращает внимание на нарушения, активно говорит о них с руководителями УИК, координирует действия наблюдателей, пишет жалобы и т.п. Занимает самую активную позицию как наиболее опытный наблюдатель и как член УИК с ПСГ, которого сложнее удалить (по закону вообще нельзя, но в практике тоже удаляют). <br/><strong>- Наблюдатель от Яблока</strong> - внимательно наблюдает и ведет эпизодическую видеозапись на вторую видеокамеру при необходимости; обращает внимание члена УИК с ПСГ на нарушения, предлагает ему действия; действует самостоятельно по обстановке, если члена УИК с ПСГ нет на месте (вышел, удалили, занят общением с руководством УИК и т.п.) или, если не согласен с его действиями (действует по согласованию с членом  УИК с ПСГ только в том случае, если полностью согласен с тем, что согласовано). <strong>- Представитель СМИ от \"Новой газеты\"</strong> - внимательно наблюдает, практически всегда молчит и не вмешивается ни в какие разговоры, если это не согласовано;несколько часов в начале, в конце дня и при необходимости ведет запись на видео (видеокамера позволяет вести запись около 8 часов непрерывно, не сменяя кассеты).<br/>- Вместе внимательно наблюдаем за ящиками для голосования - по очереди стоим около ящиков и ведем подсчет проголосовавших с помощью механического счетчика (одно нажатие увеличивает показания счетчика на 1). <br/>- Свободные от дежурства у ящиков сидят на стульях, выделенных для этого и наблюдают, при необходимости подходя к столам для голосования. - Если кому-то нужно выйти, то согласуем это. Одновременно выходит из помещения для голосования только один из нас.</p>\n<p><strong>3.12.2011</strong> около 14:00 я пришел на избирательный участок, устно представился (не стал сразу регистрировать направление - просто показал его и свой паспорт, не стал задавать значимых вопросов, узнавать кто из присутствующих в каком качестве действует и т.п.), осмотрелся и попробовал наладить отношения с комиссией. Говорили со мной доброжелательно, пока я не обратил внимание на тот факт, что с места, выделенного для наблюдателей, совершенно не видны ящики для голосования.  Сначала я очень мягко поговорил с ними об этом. Они сообщили, что так решила комиссия, что ничего уже изменить нельзя. Тогда я показал закон и попробовал мягко убедить, что нарушать закон нельзя, что надо как-то изменить расположение ящиков, кабин или места для наблюдателей. Тут они стали всячески показывать, что сильно заняты, взяли какие-то свои бумаги и стали их заполнять, заявили, что я им мешаю. Я сказал, что я направлен в качестве члена УИК с ПСГ и прошу их официально меня зарегистрировать. Они сообщили, что зарегистрируют меня завтра.<br/>Пришлось показывать закон и настаивать на немедленной регистрации. Руководитель куда-то стала звонить, потом снова мне отказала. Тогда я сказал, что мне придется немедленно составить жалобу, вручить им и отправиться прямо в суд с соответствующим заявлением. Тогда руководитель снова куда-то позвонила, рассказала все про жалобу и про суд. После этого меня все же зарегистрировали (внесли запись в соответствующий реестр). После этого я попросил их представиться, ознакомить меня с информацией о составе УИК и все записал. Затем я уже официально сообщил им, что сейчас намерен писать жалобу о нарушении. Они сказали, что ничего сделать не могут, я написал жалобу и они её зарегистрировали. После этого мне показалось, что присутствовавшие руководители УИК даже несколько успокоились, стали опять доброжелательными. Они сказали, что завтра до открытия участка рассмотрят мою жалобу.<br/>Потом я поговорил с ними на тему \"мне не нужны никакие жалобы, суды и т.п. проблемы; мне нужно 100% соблюдение законов; у меня уже есть успешный опыт суда против УИК и есть необходимая для суда юридическая подготовка; при этом я знаю, что на вас давят сверху, что вами \"руководят\"; очень советую использовать свершившийся факт моей настойчивости и поданное мое заявление как повод для того, чтобы отказать вашему руководству в возможности сделать что-то не совсем по закону, т.к. я любое малейшее нарушение буду обжаловать, буду обращаться в суд, а судебные скандалы уж точно никому не нужны, а ведь в суд вас точно по моему заявлению будут вызывать\". После моего доброжелательного монолога (уж старался как мог говорить максимально мягко) председатель УИК сказала мне: \"Мы понимаем. Спасибо, что предупредили.\" Мне показалось, что у присутствовавших руководителей УИК \"упала гора с плеч\". Мы довольно доброжелательно попрощались \"до завтра\". На другие вопросы я обращать их внимание не стал (смотреть списки избирателей, обсуждать материалы о партиях), чтобы свести их раздражение к минимуму. Им и так было над чем подумать.</p>\n<p><strong>4.12.2011</strong> мы прибыли на избирательный участок около 7:00, мои коллеги быстро зарегистрировались в УИК. Нашего представителя СМИ, т.к. он был с видеокамерой, зачем-то зарегистрировали у входа в здание полицейские, но мы не возражали (они просто переписали данные с удостоверения \"Новой газеты\"). В 7:10 зарегистрировали мое требование о копии протокола. В 7:35 зарегистрировали мою вторую жалобу (не было информации о кандидатах). Затем ещё до начала голосования провели заседание УИК и рассмотрели мои жалобы.</p>\n<p><strong>По жалобе от 3.12.2011</strong> у них уже было заготовлено решение, которое нас полностью устроило (передвинуть кабинки для голосования к стене, ящики для голосования сдвинуть, и со скамеек для наблюдателей ящики и вся территория УИК будут хорошо видны), при этом я предложил несколько иное решение, которое они не приняли, но это не имело практического значения. Кабинки и ящики передвинули. Фактически мои требования были полностью удовлетворены, а нарушение закона исправлено. Протокол мне выдали только в 9:20, в протоколе не было ни слова о том, как фактически было исправлено нарушение, но я не стал настаивать на исправлении протокола, т.к. не было практического смысла, а у нас была сделана полная видеозапись всего заседания УИК.</p>\n<p><strong>По жалобе от 4.12.2011</strong> председатель УИК сообщила, что материалы на стенде перед участком есть, просто они так там расположены, что их плохо видно (формально на стенде была стопка листов А4, распечатанных на принтере, прикрепленная булавкой, при этом прикреплена она была так, что для просмотра всей стопки с информацией о партиях, было нужно открепить другую булавку, крепившую другой материал!) В результате стопку перевесили, формальное требование закона вроде бы соблюдалось, но по сути это было издевательство - на участке и перед ним нигде (!) не было видно материалов о том, за кого можно на этих выборах проголосовать. Чтобы получить хоть какую-то информацию, избирателю нужно было подойти к стенду и листать пачку листов А4, которая за левый верхний угол была булавкой прикреплена к стенду, на котором было много и других материалов вроде правил пожарной безопасности. Я сообщил об этом на заседании УИК и члены УИК проголосовали за то, чтобы обратиться в ТИК за материалами о партиях. Примерно через час после принятия этого решения я сообщил о нем по телефону представителю Яблока в ТИКе (что нормальных материалов нет, что наша УИК должна обратиться в ТИК за материалами), но представитель Яблока сообщил мне, что есть официальное решение не печатать обычные наглядные материалы о партиях на этих выборах.</p>\n<p>Перед открытием избирательного участка нам открыли и предъявили ящики для голосования для осмотра. Мы этот процесс (как и все, что происходило на участке в первые и последние часы) записали на видео. После этого мы \"взяли ящики под постоянное наблюдение\" и с этого момента по очереди кто-то из нас стоял около ящиков, а другие обычно сидели на скамейке. Иногда было что-то нестандартное или подозрительное (иногда кого-то не было в списках; иногда нам казалось, что \"избиратель какой-то подозрительный\" и т.п.) и кто-то из нас подходил и рассматривал происходящее внимательно, просил что-то показать (например, прописку в паспорте). Мы слишком настойчиво не стояли \"над душой\" у членов комиссии, а они нам не отказывали, если мы просили что-то показать поближе (ворчали иногда, но позиция руководителей УИК весь день фактически была направлена на соблюдение закона и на нормальное сотрудничество с нами).</p>\n<p>Когда работа наладилась, я попросил внимательно осмотреть некоторые книги избирателей, но сделал это скорее для соблюдения формальностей, т.к. мы часто стояли близко при внесении записей и уже видели, что книги составлены аккуратно, прошнурованы, скреплены печатью и т.п. Не было никаких проблем с регистрацией заявок на голосование на дому и с организацией такого голосования. В список внесли не очень много желающих и мы решили не сопровождать группу, которая отправилась с переносными ящиками. Сопровождать выездное голосование отправился наблюдатель от КПРФ, который, как выяснилось, был хорошо знаком с руководителями УИК. С наблюдателем от КПРФ мы познакомились, обменялись телефонами, но было очевидно, что реального сотрудничества у нас не будет. Этот представитель пришел 3.12.2011, когда я вел споры с руководством УИК, и отказался поддержать мои требования - \"у меня нет опыта, как решит комиссия, так и должно быть\". Наблюдатель от ЕР формально иногда присутствовала, но вообще ничего не понимала в происходящем и просто \"отбывала номер\" (например, она поднимала руку при голосовании членов УИК, хотя не имела права голосовать; на это никто серьезного внимания не обратил, но было забавно - с таким же успехом \"наблюдать за голосованием\" мог и 5-и летний ребенок). Других наблюдателей (членов УИК с ПСГ или представителей СМИ) не было.</p>\n<p>До момента окончания голосования мы не увидели никаких особых причин для нашего беспокойства. Дважды на участок приходили \"понаблюдать\" какие-то подозрительные личности (мужчины лет около 50) и я сразу вел с ними вежливые, но жесткие беседы: \"Мы тут официальные зарегистрированные наблюдатели, а Вы кто? Представьтесь, пожалуйста. Сотрудник МЧС? Простите, постоянно на участке могут находиться только лица, указанные в законе, а вы можете посидеть рядом с участком - смотрите какие там удобные стулья. Что мы будем делать, если будет пожар? Вы можете быть в коридоре рядом, а мы пригласим вас как только пожар начнется. Будете здесь сидеть? Тогда мне придется жалобу писать, её будут официально рассматривать, вам это надо? А, Вы уже знаете о наших жалобах? Так их же полностью удовлетворили, Вы это тоже знаете?\" Оба раза после настойчивого, но корректного \"давления\" \"представители МЧС\" (удостоверения они не показывали) довольно быстро немного озлобленные уходили, хотя сначала всем своим поведением показывали, что они чуть ли не хозяева положения.</p>\n<p>В ходе голосования один из нас (представитель СМИ, который может наблюдать на любом участке) ходил на участок 2688 и выяснил, что там никаких наблюдателей нет вообще (сказали, что наблюдатель от КПРФ был, но заболел и ушел уже насовсем) и что работа комиссии организована \"странно\". Кроме этого, когда я ходил по школе (не без надобности), то со мной интересно разговорилась одна из учительниц.</p>\n<p>Мы заполняли разные \"анкетные\" данные (сколько избирателей проголосовало за каждый час, например), вели работу по перечню мероприятий наблюдения (хороший перечень подготовили активисты ГН), но главным для нас было общее внимательное наблюдение, чтобы не допустить вбросов или иных грубых нарушений. Всегда как минимум двое из нас были на участке и внимательно наблюдали, а один обычно стоял на расстоянии 1-2 метра от ящиков для голосования. Утром, вечером и в подозрительных случаях вели видеозапись (всего окого 8 часов записи есть, включая весь процесс подсчета голосов).</p>\n<p>После закрытия участка ящики вскрыли. Ящики выездного голосования вскрыли как положено, все данные по количеству бюллетеней в них сошлись. Пачек бюллетеней мы не обнаружили, хотя смотрели очень внимательно и вели подробную видеозапись. Комиссия не торопилась, вскрытие ящиков и перемещение бюллетеней из них на столы проводили аккуратно на наших глазах.</p>\n<p>Напряжение вернулось перед началом подсчета голосов. Как это обычно бывает, члены УИК захотели провести быструю параллельную сортировку бюллетеней и параллельный подсчет голосов. Мы к этому были готовы и мне пришлось активно цитировать закон с книжкой в руках, опять говорить про жалобы и т.п. Но сопротивление рядовых членов комиссии было преодолено и подсчет голосов в результате прошел полностью по закону. Было похоже, что стихийными инициаторами параллельного подсчета были рядовые члены УИК, которые ранее уже проводили такой подсчет параллельно, быстро подписывали что нужно и быстро отправлялиь домой. В этот раз им очень хотелось того же и они постарались этого добиться. И они бы добились этого, скорее всего, если бы не наша настойчивость при фактической молчаливой поддержке руководителей УИК, давно принявших решение не конфликтовать и делать все по закону, если наблюдатели будут наставивать.</p>\n<p>После того как члены комиссии провели подсчет по своим книгам, я быстро провел подсчет записей во всех книгах (сколько выдано бюллетеней). УИК мне не препятствовала, а даже помогала (перелистывали книги, когда я быстро суммировал данные на страницах и записывал их в свой черновик). Мои результаты сошлись с результатами УИК. Почти точно с результатом УИК сошлось и число проголосовавших, которое мы определяли с помощью механического счетчика.</p>\n<p>Когда стали известны результаты голосования, то мы поняли, что вбросов на нашем участке нет, что теперь надо обеспечить, чтобы полученные результаты попали в ГАС-выборы. После получения заверенных копий протокола один из нас (участников ГН) отправился домой, а мы с коллегой решили сопровождать доставку протокола в ТИК. Я заранее позвонил представителю Яблока в ТИКе, сообщил ему результаты голосования и согласовал, что перед выездом предупрежу его, чтобы он встречал нас у входа. Далее опять возникло напряжение. По неясным причинам руководители УИК задерживали отъезд в ТИК, хотя все для этого было готово. На мои вопросы председатель УИК отвечала что-то типа: \"Мы едем в ТИК не когда хотим, а когда нас зовут из ТИКа\". Тогда я снова позвонил представителю Яблока в ТИКе и сообщил о ситуации (пересказал и слова председателя). Он сказал, что попробует позвонить в наш УИК из ТИКа и посоветовал писать жалобу, если задержка будет продолжаться. После этого я сообщил председателю УИК о нашем законном требовании немедленно ехать в ТИК.</p>\n<p>Председатель попросила дать ей еще 10 минут и пообещала дольше не задерживать отъезд. Вскоре мы действительно выехали. Моего коллегу взяли с собой руководители УИКа в полицейскую \"Газель\", а я поехал за ними в своем автомобиле, чтобы при необходимости у нас была некоторая свобода действий. Перед входом в здание районной управы (ТИК в ней находился) нас уже ждал представитель Яблока, который провел нас всех в здание мимо полицейской охраны. Он пошел с руководителями нашего УИКа \"в очередь приемки протоколов\", а мы стали ждать результатов внутри здания, предупредив об этом и руководителей нашей УИК и представителя Яблока в ТИКе.</p>\n<p>Примерно через час представитель Яблока нам сообщил, что найдена ошибка, что будет составлен новый протокол, что для этого всех членов УИК вызывают в ТИК. Мы их дождались, присутствовали на новом заседании УИК, потом получили новый протокол и стали ждать ввода данных в ГАС-выборы. Об этом нам через некоторое время сообщил представитель Яблока в ТИКе и после этого мы отправились домой, т.к. по его информации после ввода данных в ГАС-выборы уже ничего менять не будут. <br/>Днем 5.12.2011 я обнаружил, что данные голосования на нашем участке 2687 корректно отображаются на сайте мосгоризбиркома. Окончательно выяснилось и то, что на участке 2688 были нарушения. После этого я принял решение написать жалобу в суд об отмене результатов голосования на участке 2688.</p>\n<p>О своем решении написать жалобу я сообщил активистам ГН и представителю Яблока в ТИКе, попросил у них помощи. Звонил я и непосредственно в Яблоко, общался там по телефону с юристом, которому потом направил письмо с материалами, но ответа от юриста Яблока не получил, хотя и звонил потом, оставлял для него сообщения через секретаря. Активист ГН (ответственный за ЗАО) обещал передать мой телефон тем, кто может помочь, но никаких звонков мне не поступило, а сам я дозвониться не смог (примерно в это время был митинг, наверное). Не получив никакой помощи, я решил писать заявление самостоятельно и прибыл с заявлением где-то в 21:30 в суд Солнцево. По закону в день, следующий за днем голосования, у меня должны были принять заявление немедленно, но в суде была только полицейская охрана. Моё заявление приняли только 6.12.2011, затем был официальный отказ в принятии заявления, частная жалоба с ходатайством. Подробности описаны в моих зявлениях в суд. Судебная тяжба  продолжается.</p>\n<p>После подачи заявления я об этом проинформировал активистов ГН (ответственного по ЗАО и в гуглгрупс) и представителя Яблока в ТИКе и попросил помощи в обсуждении дальнейших мероприятий и распространении листовок у школы N1000. В итоге прямого участия ГН (как организации) и Яблока (как участника выборов) мне добиться не удалось (все заняты, всем не до этого), но меня поддержали рядовые участники ГН, с которыми мы составили от имени \"Союза свободных граждан за суд присяжных, честные выборы и открытое общественное управление\", тиражировали и распространили листовки около школы N 1000 утром перед началом занятий и на территории участка 2688.</p>\n<p>За несколько дней до распространения листовок я поехал в школу 1000 и через дежурного охранника пригласил на встречу руководителей УИК 2687. Похоже, что они уже что-то знали о моем заявлении и пригласили на встречу представителя комиссии 2688 (похоже, это был председатель УИК 2688). Она на встрече молчала, но была очень расстроенная. Я сообщил о нарушениях в УИК 2688 и проинформировал о том, что будет суд и соответствующий скандал, которых можно избежать только, если руководство УИК 2688 само признает ошибку и попросит отменить результаты голосования на участке 2688, тогда заявление из суда будет отозвано, а вопрос исчерпан. Иначе же будет не только суд, но и распространение листовок в школе и на территории района. Они спросили что им конкретно надо сделать, и я посоветовал председателю УИК 2688 написать в ТИК официальное заявление об ошибках в подсчете с просьбой об отмене итогов голосования. В этом случае публичного скандала можно было бы избежать, а учителя - члены УИК 2688 могли бы спокойно смотреть в глаза своим ученикам. По сути они молча \"опусканием глаз\" подтвердили нарушения в УИК 2688. Разговор был коротким, я сказал, что никого не хочу ни в чем убеждать, что моя задача - просто проинформировать и по возможности избежать публичного скандала с участием учителей школы 1000, т.к. я уважаю учителей, которые были в комиссии 2687. Мне сказали: \"спасибо, что предупредили\", на том мы распрощались.</p>\n<p>Накануне распространения листовок я звонил представителю Яблока в ТИКе, который неофициально сообщил, что принято решение отказать в приеме моего заявления, т.к. я проживаю в другом районе. В разговоре он очень деликатно упоминал о проблемах, которые (у меня?) могут возникнуть, и о том, что, возможно, кто-то захочет со мной встретиться по этой теме для обсуждения чего-то. Мне показалось, что он сам опасается этого скандала, что он владеет внутренней \"кухонной\" информацией ТИКа и что через него кто-то хочет убедить меня в чем-то. Он делал это очень расплывчато и, похоже, сам не верил, что на что-то может повлиять. Например, он сначала уверенно рассказал, на каком основании решено отказать в принятии моей жалобы, и только когда я ему объяснил, почему это незаконно и что я точно будут обжаловать отказ и т.п., только тогда он мягко подтвердил, что и сам считает отказ незаконным. Также он подтвердил, что никакого заявления об отмене результатов УИК 2688 нет и не будет.</p>\n<p>Мы вручали листовки всем учителям, входящим в школу (почти все брали), родителям, проводившим детей, а также старшеклассникам. Говорили примерно так: \"В нашей школе прошло голосование на выборах в Госдуму. Есть чем гордиться, но были и нарушения. Пожалуйста, ознакомьтесь с результатами\". Обычно люди были доброжелательны.</p>\n<p>Недовольство проявила только директор школы, которая реагировала очень нервно (похоже, ей уже позвонили о нас до того, как она подъехала к школе) и почти кричала что-то вроде: \"вы не имеете права, я вызвала милицию\" и т.п. Милицию мы не дождались и пошли распространять листовки у домов участка 2688 (вручали малочисленным жителям и повесили на досках объявлений у подъездов). Учителя и ученики школы обычно брали наши листовки молча, а родители часто говорили что-то вроде: \"да интересно, посмотрим\" или \"да известно нам все, сплошные нарушения на выборах\". В школ резонанс был значительным.</p>\n<p>К отчету приложены файлы с изображениями документов (заявлений, жалоб, направления и т.п.)</p>','otchet-nablyudatelya-duma-uik-2687/'),(2689,'','','','',''),(2714,'некорректная работа УИК','Светлана Дурнова','предотвращенная попытка карусели','<p>Я была наблюдателем как корреспондент от \"Новой газеты\".</p>\n<p>Со мной были еще 2 участника проекта: Сергей - наблюдатель от Яблока и Михаил - член комиссии с правом совещательного голоса. На участке были также один наблюдатель от Справедливой России и один от Едра. Оба молодых человека отбывали номер за деньги - сидели в стороне и ничего не делали.<br/> <br/> В 7.30 мы были на участке. Урны мы проверили  (2 стационарные и 3 переносные), и их запечатали при нас. Урны были поставлены у стен так, что человек мог собой загородить их, и они с одной стороны находились практически вплотную к кабинкам, а с другой доступ был ограничен<br/> столом, за которым сидела секретарь. В общем, обзор был сильно ограничен.<br/> <br/> С 8.00 я занялась подсчетом избирателей, подходящих к урнам. Для того, чтобы видеть как опускают бюллетени, приходилось все время перемещаться в зоне урн. К 9 часам секретарю надоело, что я постоянно мотаюсь у нее под носом, и  она объявила, что я как представитель прессы не имею права находиться рядом с урнами. Я ей объяснила, что она не права и почему, но секретарь была настроена на скандал и, видимо, на мое удаление. Чтобы этого не произошло, я подозвала Сергея, и он как наблюдатель от партии занял место рядом с урнами, а я пошла к столам смотреть за выдачей бюллетеней, продолжая считать приходящих избирателей. Секретарь, правда, и здесь попыталась меня еще дальше отослать, но я, подловив председателя, которая была еще не в курсе конфликта, договорилась с ней о том, что я буду стоять напротив столов, где выдают бюллетени, о чем и сообщила секретарю, еще раз напомнив о законности моего пребывания на любом месте участка. Остальных наблюдателей секретарь тоже все время<br/> пыталась отогнать от урн.<br/> <br/> Весь день я практически глаз не сводила со столов, особенно пристально следя за столом, где получали бюллетени по открепительными и по заявлениям, и столом, где сидела представитель от Едра. На предложения пойти в буфет поесть-попить отказывалась, взяла все с собой. Но есть было некогда. Третий наш соратник Михаил ездил и проверял голосования на дому 3 раза.<br/> <br/> На участке пытались устроить карусель, но на третьем человеке мы это пресекли. К концу дня была еще одна попытка карусели, но ее тоже пресекли. Самое нервное началось после 20 часов. Члены комиссии пытались проводить параллельно работу с книгами и подсчет бюллетеней, но мы<br/> объяснили, что это не по закону. Секретарь опять начала нагнетать обстановку, но председатель прочитала положения закона (вообще ее незнание закона о выборах сыграло нам на руку, т.к. при конфликтах она вынуждена была  читать вслух закон) и всё стали делать по порядку. Та же секретарь на стол, где оформлялись книги со списками избирателей, положила на середину пачку чистых бюллетеней. Я от такой наглости чуть до потолка не подпрыгнула и заставила Михаила, как члена комиссии, убрать их со стола, посчитать и погасить. Потом мы с большим трудом совместными усилиями заставили писать членов УИК в книгах ручкой, а не карандашом. Все это время секретарь терлась около урн, но я зорко следила за ней. Наконец она, взбешенная, начала выводить меня из себя, говоря, что я дырку в них проглядела, нервирую их, что у них руки трясутся и кофточки дымятся, и что я вообще с таким взглядом и аурой как у меня в люди выходить нельзя. В общем, намекала, что я ведьма. Но я не реагировала и говорила, что работа у меня такая – смотреть и информировать. Немного отходила подальше, а потом обратно подходила ближе. Когда книги были посчитаны и убраны в сейф, секретарь сдулась, т.к. сфальсифицировать книги и сделать вбросы мы не дали. Больше она не конфликтовала и ушла в какой-то кабинет. После в нормальной обстановке посчитали бюллетени. Внесли в протокол цифры. Победила КПРФ 29%, потом Едро 20,4%, по 18% Спр. Рос и Яблоко, 10 ЛДПР, остальные около и менее 1%. Потом оформили нам копии протоколов, но их еще в течение 1,30 часа не отдавали, не было команды из ТИКа. Компьютер якобы завис. Но мы сказали, что будем ждать хоть до утра. Где-то к 1 ночи копии протоколов выдали. Данные нашего протокола соответствуют цифрам на официальном сайте мосизбиркома по участку 2714.<br/> <br/> И это победа! Спасибо проекту за предоставленную возможность узнать правду о выборах. Также огромное спасибо всем наблюдателям, которые сделали эту адскую работу и дали бой системе.</p>\n<p> </p>\n<p> </p>','otchet-nablyudatelya-duma-uik-2714/'),(2720,'','Эдуард Глезин','Вброс, предотвращенная карусель, препятствование фото-видеосъемке, отсутствие реестра на выездное голосование, беспрецедентное бегство комиссии с участка после окончания выборов, незанесение принятых жалоб в протокол и т.п.','<p><strong>Полный привет на участке №2720<br/></strong>Было подано 5 коллективных жалоб. Зафиксировано 26 нарушений избирательного законодательства. На московском избирательном участке №2720 по выборам в Госдуму 4 декабря 2011г. я, Эдуард Ефимович Глезин, был в статусе члена УИК с правом совещательного голоса от партии \"Яблоко\". <br/><br/>Странности в представлении председателя УИК Валентины Михайловны Ивуль о контроле за чистотой голосования стали очевидны за день до голосования. Когда я попросил ее больше приблизить места для наблюдателей с урнами для голосования, она заявила, что главный наблюдатель на участке и гарант их честности – это она сама. Поэтому именно она будет сидеть возле урн. <br/><br/>В итоге место для наблюдателей было отведено метрах в десяти от стационарных урн, так что все голосующие при волеизъявлении вставали к ним спиной. Таким образом для потенциальных вбросчиков бюллетеней были созданы максимально благоприятные условия – наблюдатели при всем желании не только не смогли бы поймать преступника за руку, но даже и заметить его манипуляции с бюллетенями. Вбрасывай сколько угодно!<br/>Но и этого ограничения председателю показалось мало, и она строжайше запретила наблюдателям заходить за линию, выложенную плиткой на полу, а чтобы никто не перешел границу, учредила пост для сотрудника полиции, который бдил в центе участка лицом к наблюдателям, спиной к урне. Таким образом, вместо того, чтобы обеспечить максимальный контроль над стационарными урнами, Валентина Михайловна контролировала наблюдателей. <br/><br/>Все мои апелляции к закону \"Об основных гарантиях избирательных прав и права на участие в референдуме граждан РФ\" разбились о железный аргумент В.М. Ивуль: \"Я не юрист и закон знать не обязана!\". <br/>Нарушения, выявленные наблюдателями на участке №2720:<br/>1) Незаполнение увеличенной копии протокола после открытия избирательного участка.<br/>2) Незаконные отметки в списках избирателей (мертвые души).<br/>Интересные отметки в списках избирателей о получении открепительных, БЕЗ ПОДПИСИ самих избирателей:<br/>3) Препятствование деятельности журналистов (от съемочной группы немецкого телеканала АRD требовали мифическое «разрешение на видеосъемку», без которого не давали работать)<br/>4) Запрещение на фото-видеосъемку для наблюдателей.<br/>5) Незаконное ограничение перемещения наблюдателей по избирательному участку.<br/>6) Отсутствие информационного плаката о политических партиях, принимающих участие в выборах.<br/>7) Списки избирателей (тетради) не были опечатаны и подписаны с обратной стороны после открытия избирательного участка и при начале голосования.<br/>8) Отсутствие реестра на голосование вне помещения.<br/>9) Неинформирование председателем УИК наблюдателей о данных по выездному голосованию до выезда мобильной группы.<br/>10) Отказ в немедленной регистрации копии заявления (жалобы) председателем УИК.11) Отказ в доступе к документам членам УИК с правом совещательного голоса.<br/>12) Постоянные угрозы в адрес наблюдателей со стороны председателя УИК. <br/>13) Нарушение процедуры окончания голосования и подведения итогов голосования (уход на час всех членов УИК «на ужин»).<br/>14) Изоляция от наблюдателей списков избирателей после закрытия участка для избирателей.15) Присутствие посторонних лиц при подведении итогов голосования и агрессивные действия в адрес наблюдателей с их стороны.<br/>16) Фальсификация данных в увеличенной копии протокола (помимо занесения подтасованных данных по голосованию за партии, в последней графе вместо пяти поданных и зарегистрированных жалоб не было отмечено ни одной)<br/>17) Незаполнение увеличенной копии протокола в установленное время.<br/>18) Заполнение увеличенной копии протокола по окончании голосования карандашом, а не маркером.<br/>19) Составление необоснованного решения УИК о незаконном удалении члена УИК с правом совещательного голоса.<br/>20) Изоляция от обзора наблюдателей переносных урн для голосования в первые часы голосования.<br/>21) Необоснованная четырехчасовая задержка выдачи копии протокола об итогах голосования.<br/>22) Неверное и неполное заполнение копии протокола об итогах голосования.<br/>23) Сортировка бюллетеней осуществлялась способом, который не позволял проконтролировать верность сортировки, а именно — вместо того, чтобы сортировать бюллетени по одному с оглашением отметок на них, члены комиссии все вместе одновременно набрасывались на кучу бюллетеней, вынутых из стационарных урн, и сортировали их по пачкам сразу в несколько пар рук, так что проверить правильность такой сортировки визуально было попросту невозможно.<br/>24) Подсчет голосов осуществлялся способом, который не позволял проконтролировать верность подсчета — вместо того, чтобы подсчитывать бюллетени по одному отдельно в каждой пачке с оглашением отметок на них, члены УИК одновременно считали бюллетени сразу во всех пачках. <br/>25) Не было проведено итоговое заседание УИК.<br/>26) Следствием перечисленных нарушений и подтасовок результатов голосования явился незаконный вброс бюллетеней (голосования за других лиц), в количестве 200 бюллетеней (что составляет примерно 20% от количества проголосовавших на данном избирательном участке).<br/><br/>Благодаря усилиям председателя УИК были созданы практически идеальные условия для вброса бюллетеней. И он таки произошел. Доказательством тому служат, по крайней мере, три факта.<br/>1) При осмотре книг избирателей чуть ли ни на каждой странице были обнаружены строки с заполненными на избирателей паспортными данными. Не хватало только подписей самого избирателя. При этом указывалось, что гражданин получил открепительное удостоверение. Хотя при его вручении избиратель обязан расписаться. (Сам брал открепительный – знаю).<br/>2) Наблюдатели вели свой подсчет количества проголосовавших. До вечера наши данные совпадали с показателями явки, которые с участка передавали в ТИК. Но около шести вечера две цифры резко разошлись. Мы насчитали примерно 750 проголосовавших, а по словам председателя УИК В.М. Ивуль бюллетени были выданы 1100 избирателям… К 750 можно было прибавить 43 проголосовавших на дому. Но все равно, разница в 300 (!) человек была слишком большой, чтобы ее можно было списать на статистическую погрешность или невнимательность счетовода, который не сходил со своего мета и практически не сводил глаз с урн для голосования. Тем более что до этого не было никаких существенных расхождений. С 6 вечера по данным Ивуль явка странным образом не менялась, тогда как по нашим подсчетам на момент закрытия участка проголосовавших было около 900 человек. Разница сократилась до 200 человек.<br/>3) При подсчете неиспользованных бюллетеней цифра несколько раз менялась. Но первая оказалась верной – 1048. Но тут Ивуль сверилась с какими-то своими подсчетами и заставила еще несколько раз пересчитать бюллетени, пока, наконец, не записали нужные цифры: 843. Разница составляла как раз 205 бюллетеня… Т.е. было вброшено около двухсот бюллетеней и они всплыли в виде «лишних» погашенных бюллетеней. Если бы был записан первоначальный показатель, то не сошлось бы главное контрольное соотношение, поэтому и не заполнялась сразу увеличенная копия протокола. Для этого и запирались от глаз наблюдателей списки избирателей, в которых было так много заполненных строк на «мертвых душ», оставалось только расписаться за них и можно сразу улучшить показатели партии власти.<br/><br/>Кроме прямых препятствий со стороны УИК для наблюдения за ходом голосования, были и косвенные. Тучная дама в красном буквально клеилась ко всем активным наблюдателям, отвлекая их пустопорожними разговорами, предлагала заменить счетчика голосующих, уговаривала то передохнуть в буфете, то выехать с мобильной группой для наблюдения за голосованием на дому. Из претензий к ходу голосования ее взволновало лишь два вопроса: имеют ли социологи право устраивать экзит-полы рядом с участком и не является ли незаконной агитацией название партий на бейджиках наблюдателей. Представившись сначала «независимым наблюдателем», а затем наблюдателем от «Правого дела», она впоследствии оказалась коллегой остальных членов УИК по заводу имени Хруничева.<br/><br/>Незаконные требования председатель УИК стала предъявлять сразу после открытия участка. Как только я попытался сфотографировать демонстрируемые наблюдателям пустые урны, она закричала, что фотографировать нельзя. Дружная отповедь наблюдателей вроде остудила ее пыл, но только на время. Позднее она потребовала от меня, под страхом удаления с избирательного участка, «специальное разрешение» на видеосъемку. К концу дня ее ненависть к моему фотоаппарату перешла все границы. Пришлось его выключить. Но и работающий диктофон вызвал у Ивуль не меньше эмоций. После того как она заметила его в моих руках, Валентина Михайловна приказала остановить подсчет бюллетеней, провела экстренное заседание УИК, на котором единогласно было принято незаконное решение о моём удалении с участка. Я напомнил ей, что в письменном решении должно быть сказано, чем именно я препятствовал работе комиссии и какой именно пункт закона был мной нарушен. Председатель удалилась в свою комнату. Примерно через полчаса, она торжественно вынесла и огласила постановление УИК. В нем говорилось, что «наблюдатель» Глезин «мешал» работе комиссии и потому подлежит немедленному удалению. Я возразил, что во-первых я член УИК с правом совещательного голоса; во-вторых в избирательном законодательстве нет такого определения: «мешал»; в-третьих в решении не указано, чем именно я препятствовал работе комиссии и какую статью закона нарушил; в четвертых, по закону члена УИК с правом совещательного голоса в принципе нельзя удалить с участка. «Так Вы хотите, чтобы я переписала решение комиссии?», – спросила Ивуль. «Да, конечно» – ответил я, и председатель снова заперлась в своем кабинете. Скорее всего после консультаций с начальством из ТИКа она поняла всю абсурдность своих претензий и незаконность столь желанного ей удаления меня с участка. Выйдя с натужной улыбкой из кабинета, она примиренческим тоном заявила: «Ну, если Вы будете себя хорошо вести, мы вас можем оставить». «Закон нарушать я не буду», – заверил я. <br/>Но самое интересное явление в день выборов для меня оказались карусельшики и связанная с их бурной деятельностью разница результатов голосования за Единую Россию на соседних участках в одной школе.. Один зал школы №1816 по улице Кастанаевской, дом 9 А был разделен на два участка, 2720 и 2721, с примерно равным количеством избирателей. Но так получилось, что наш участок с помощью проекта «Гражданин наблюдатель» был плотно прикрыт активными наблюдателями. А в соседнем участке общественные контролеры воспринимали происходящее вокруг как нечто потустороннее, которое никоим образом к ним не относится, а то и просто спали на месте. Председатели соседних комиссий, которые постоянно консультировались между собой, видимо договорились всех карусельщиков переправлять на спокойный участок. Только на моих глазах прошло пять таких организованных групп, с явным бригадиром во главе.<br/><br/>Репортаж с нашего участка германской телекомпании ARD \"Россия: Конец носителя надежды\". Текст <br/><br/></p>\n<p>Один из такой группы, шествуя мимо меня, сказал своему подельнику: «О, смотри как удобно: и двадцатый участок тут, давай и там проголосуем». Если такие голосующие бригады хотели проголосовать на нашем участке, то их аккуратно разворачивали к соседям. При этом все группы неизменно подходили к одному определенному столику. На мои съемки таких крайне подозрительно бригад очень нервно реагировал председатель соседней избирательной комиссии, говоря, что мое дело «наблюдать на своем участке». А все, что происходит на его участке – его внутреннее суверенное дело.<br/>После подведения итогов голосования стала видна разница между «карусельными» выборами и теми, где влияние административного ресурса ограничивается общественным контролем. На нашем участке за партию власти проголосовало (без учета) вброса 219 человек (17%), официально зафиксированный результат ЕдРа - 419 человек (37,6 %), а у соседей более чем с двукратным превышением – 882 голоса (52,9 %). Как говорится – почувствуйте разницу.<br/><br/>Как позднее выяснилось, такой поразительный отрыв ЕдРа на неконтролируемых соседних участках наблюдатели зафиксировали на слишком многих участках. (подробная статистика тут: http://nabludatel.org/ и в статьях Орешкина: \"С миру по нитке, \"Единой России 40%\", \"Называем реальные результаты выборов по Москве. И сравниваем их с \"нарисованными\" ) Слишком для того, чтобы считать это случайностью или простым совпадением. Это путинская закономерность. Создана отлаженная и тотальная система накручивания голосов для Партии жуликов и воров. Ей подчинены практически все избирательные комиссии. По сути это те же \"оборотни в погонах\". Вместо чистоты выборов они гарантируют их повсеместную фальсификацию. <br/>Не всегда, но все чаще и чаще махинаторов ловят за руку. С ростом доступа к интернету и развитием техники все больше очевидцев подтасовок на выборов имеют возможность распространить увиденное на все более широкую аудиторию. Время играет против кремлевских охранителей. Им всё труднее утаить шило в мешке.<br/>Смысл проекта «Гражданин наблюдатель», в котором я принимал участие, как раз и состоял в том, чтобы по специальной 5%-ой выборке сравнить реальные результаты выборов с желаемыми для власти. Таким образом, за счет активности наблюдателей у нашего народа появились реальные доказательства подтасовок на выборах и дополнительные сомнения в легитимности путинского режима…</p>\n<p> </p>\n<p> </p>','otchet-nablyudatelya-duma-uik-2720/'),(2744,'','','','',''),(2769,'','','','',''),(2778,'','','','',''),(2803,'нарушений не выявлено','','','<p>Аннотация: На участке была попытка запрета видеосъемки, но в целом голосование прошло по закону. Автор на основании своего опыта дал советы наблюдателям.</p>\n<p>Добрый день. Меня зовут Алымов Максим, был членом УИК с ПСГ от Яблока на участке 2803. Сразу хотелось бы поблагодарить ребят, с кем вместе работали в этот день: Смыслов Михаил (наблюдатель от СМИ), Цыганков Евгений (наблюдатель от СМИ) и Соболев Дмитрий (наблюдатель от Яблока).</p>\n<p><strong>Знакомство<br/></strong>Знакомиться пришел ещё в пятницу. Участок нашел без проблем, к комиссии проводили тоже без вопросов. Представился председателю (Феофанову Александру Васильевичу), тот спросил, как меня зовут, номер телефона, записал всё это. Далее уточнил, что у нас будут КОИБы и мы договорились, что я приеду к 7 утра, чтобы присутствовать при тестировании. Когда я уже уходил, он судорожно бросился к телефону и стал кому-то звонить, что навело меня на мысль, что без приключений не обойдется.</p>\n<p><strong>7:00-8:00<br/></strong>Будучи человеком сверхответственным, я приехал на участок аж в 6:45 и на участке (здание школы) были только охранники, но мне заботливо предложили посидеть на диванчике внизу. Ближе к 7 стали подтягиваться члены комиссии, и я переместился вместе с ними на второй этаж, где и был оборудован участок. Спросил, куда могу положить свою тяжелую сумку (вода, ноут, еда), мне указали на комнату. Всё было хорошо. Далее мне стал звонить Миша (наблюдатель от СМИ) и говорить, что его yе пропускают на участок. Председатель забегал туда-сюда, но минут через 5 его всё же пустили, как и остальных ребят. И очень вовремя, т.к. вскоре началось тестирование КОИБов. Опечатывание переносных ящиков произошло примерно в 7:45, мы не препятствовали, т.к. их нам предъявили пустыми. КОИБы после тестирования опустошили и тоже опечатали чуть раньше. Мы тоже не возражали, т.к. их несколько сложнее было опечатывать (требовалось вдевать какие-то пломбы, что требовало определенной ловкости рук). Нас внесли в списки присутствующих. Далее председатель огласил количество бюллетеней, полученных УИК, данные по открепительным и всё это занес в увеличенную форму протокола.</p>\n<p><strong>8:00-8:15<br/></strong>Первых избирателей охрана пустила немного раньше положенного (где-то в 7:58), поэтому они присутствовали при выдаче книг. Все книги были прошиты, но из-за суматохи до 8:00 книги посмотреть я не имел возможности. Чтобы не мешать работе комиссии, я подождал, когда проголосуют первые избиратели, и лишь затем подошел смотреть книги. Как только передо мной развернули книгу, со скоростью ястреба подлетел председатель и во всеуслышание заявил, что у меня первое предупреждение и что после второго он меня сразу удалит. Я попросил пояснить его позицию, он сказал, что я не имею права смотреть книги, т.к. в них находятся персональные данные. На что я достал распечатки выдержки статей и исчерпывающе зачитал ему статьи о правах члена УИК с ПСГ и о том, к каким документам у меня по закону есть доступ. Он попытался мне доказать, что это неправда, начал листать свой рабочий блокнот, но, разумеется, ничего там не обнаружил, стал звонить в ТИК. А меня тем временем принялась обрабатывать его зам – Комисарова Наталья Николаевна. После короткого разговора по телефону председатель подошел и согласился с моими законными требованиями – доступ к книгам предоставили. Чтобы не накалять обстановку, я выборочно проверил некоторые книги, из пометок там были только «на дому» (решил не указывать на это, т.к. голосование дважды – на дому и на участке было бы куда опаснее с точки зрения результатов) и стрелки «вниз»/«вверх» там, где ошиблись, выдавая открепительные (у меня был такой же случай – когда мне выдавали открепительный, председатель так волновался, что по ошибке записал мои данные в графу выше – на другого человека).</p>\n<p>Тем временем Мише запретили снимать с формулировкой «съемка запрещена». У него не было с собой распечаток закона, так что пришлось ему дать свои. После жаркой дискуссии с председателем и его замом, ему выдали разрешение на съемку, но с условием, чтобы он не снимал лица людей. Были также вялые попытки усадить наблюдателей в уголок, но тут мы все скопом стали апеллировать к закону, они не стали настаивать. Мы удобно расположились, распределив обязанности – один всегда находился коло урн, я наблюдал за столами комиссии с ещё одним человеком, и ещё один был в «свободном полете». После таких, прямо скажем, бурных 15 минут у меня немного пересохло в горле и я захотел взять в сумке воду. Потянулся к ручке двери комнаты, где была сумка, на что председатель и его зам снова взорвались, что мы вообще бог знает что себе позволяем, ходим где хотим, а теперь я и вовсе полез в комнату комиссии. Сказав, что у меня там сумка, я под личным надзором заместителя председателя её забрал и потом весь день держал её недалеко от себя.</p>\n<p><strong>8:15-10:30<br/></strong>Затем все немного улеглось, все успокоились, зам. председателя подошла к нам знакомиться, всё пыталась выяснить откуда нас таких четверо из ларца, но мы честно хлопая глазами говорили, что от СМИ и от партий. Про ГН решили не говорить. За полчаса до выездного голосования председатель об это объявил. Я подошел к секретарю (оказалась замечательная женщина. Пожалуй, единственная из всей комиссии, которая всегда была рада ответить на все вопросы) уточнить сколько людей. Тут и выяснилось, что у них на территории есть дом престарелых, там изъявили желание голосовать чуть ли не 70 человек и от них есть только заявления (реестр не составлялся). Это, разумеется, вызвало сильные подозрения, бросили жребий, ехать (точнее идти) выпало мне. И сразу же собиралась вторая группа для выездного голосования по домам.</p>\n<p><strong>Выездное голосование, 10:30-13:00<br/></strong>Прибыли в дом престарелых. Те, кто могли передвигаться, пришли в актовый зал. Там им в обмен на заявления и при предъявлении паспорта, выдавали бюллетень. Разумеется, 90% забыли очки и многие просили помочь. Заведующая домом один раз подсказала, за КОГО проголосовать, на что я сразу сказал, что это серьезное нарушение закона и дальше она подобного не повторяла. Т.к. люди пожилые, всё шло медленно, но честно. Далее прошли по квартирам лежачих. Пришлось заходить даже к бабушке, которая практикует уринотерапию. От зловония мы чуть не упали в обморок, особенно учитывая, что она потеряла паспорт и пришлось его искать, но работая за идею и не такое выдержишь. В 13:00 позвонил Миша и спросил, скоро ли мы возвращаемся, т.к. на участке просто аншлаг и требуется помощь.</p>\n<p><strong>13:00-17:00<br/></strong>Аншлаг продолжался, но шел на спад. Когда стало посвободнее, я подошел к председателю и спросил, когда будет составлен акт о выездном голосовании. Он сказал, что сейчас все заняты и «позже». Только к 17:00 они составили акт и занесли все данные по заявления в книги. Нарушение? – Да, но мы списали все данные по голосованию (кол-во выданных/использованных бюллетеней и т.д.) и поэтому особо не теребили их. Часам к 5 вечера ребята попросили председателя поместить переносные ящики на виду, на что поднялся невообразимый кипиш, он сказал, что мы его уже достали, мешаем работе комиссии и что он нас удалит всех сразу. Решили не обострять отношений – получить протокол было главным, иначе всё насмарку. Далее до закрытия всё проходило гладко. По возможности помогал людям: показывал, где находятся кабинки для голосования, а где урны.</p>\n<p><strong>20:00-окончание, итоги<br/></strong>Процедура пошла наперекосяк с самого начала. Вначале почему-то вскрыли переносные ящики, пересчитали число бюллетеней – всё сошлось. «Накормили» КОИБ этими бюллетенями. Параллельно другие члены УИК работали с книгами. При подсчете бюллетеней их унесли в другую комнату, но позже 939 штук нам дали пересчитать. Решили не доводить до кипения и поверили на слово. Далее ввели данные в КОИБ, контрольные соотношения сошлись, и стали печатать протокол. Периодически напоминали о необходимости внесения данных в увеличенную копию протокола. Нас спросили, устроят ли нас ксерокопии подписей и тут уже мы немного перепутав закон, сказали, что нет и нам нужны оригиналы – они скрипя зубами нам всё предоставили.</p>\n<p><strong>Данные по нашему участку №2803<br/></strong>1) Число избирателей, внесенных в список избирателей 2570<br/>2) Число избирательных бюллетеней, полученных УИК 2219<br/>3) Число избирательных бюллетеней, выданных избирателям, проголосовавшим досрочно 0<br/>4) Число избирательных бюллетеней, выданных избирателям в помещении для голосования 1164<br/>5) Число избирательных бюллетеней, выданных избирателям вне помещения для голосования 66<br/>6) Число погашенных избирательных бюллетеней 989<br/>7) Число избирательных бюллетеней в переносных ящиках для голосования 66<br/>8) Число избирательных бюллетеней в стационарных ящиках для голосования 1162<br/>9) Число недействительных избирательных бюллетеней 18<br/>10) Число действительных избирательных бюллетеней 1210<br/>11) Число открепительных удостоверений, полученных участковой избирательной комиссией 75<br/>12) Число открепительных удостоверений, выданных избирателям на избирательном участке 65<br/>13) Число избирателей, проголосовавших по открепительным удостоверениям на избирательном участке 44<br/>14) Число погашенных неиспользованных открепительных удостоверений 10<br/>15) Число открепительных удостоверений, выданных избирателям территориальной избирательной комиссией 3<br/>16) Число утраченных открепительных удостоверений 0<br/>17) Число утраченных избирательных бюллетеней 0<br/>18) Число избирательных бюллетеней, не учтенных при получении 0<br/>19) 1. Политическая партия СПРАВЕДЛИВАЯ РОССИЯ 198 (16.12%)<br/>20) 2. Политическая партия \"ЛДПР\" 194 (15.80%)<br/>21) 3. Политическая партия \"ПАТРИОТЫ РОССИИ\" 19 (1.55%) <br/>22) 4. Политическая партия \"КПРФ\" 333 (27.12%)<br/>23) 5. Политическая партия \"ЯБЛОКО\" 136 (11.07%)<br/>24) 6. Всероссийская политическая партия \"ЕДИНАЯ РОССИЯ\" 315 (25.65%)<br/>25) 7. Всероссийская политическая партия \"ПРАВОЕ ДЕЛО\" 15 (1.22%)</p>\n<p><strong>Выводы<br/></strong>1. Требуется с самого начала показать, что вы тут не на стульчике весь день пришли сидеть, а будете активно работать;<br/>2. Требуется отлично знать закон и свои права. Тем, кто будет наблюдателем на президентских выборах в чуть ли не приказном порядке собрать выдержки из законов, касающиеся вашего статуса на выборах (наблюдатель, СМИ или член УИК с ПСГ) – что вы вправе делать. Получится 3-4 листа А4, но это реально очень помогает; <br/>3. Члены УИК в основной своей массе – это простые люди. Подавляющее большинство из них не читало закон (ФЗГ), они выполняют распоряжения председателя, а председатель руководствуется своим рабочим блокнотом. Апеллирование к статьям закона производит на них фантастическое воздействие; <br/>4. Подавляющее число нарушений – это бытовые (человеческие) факторы. Например, они так привыкли, хотят домой и пр. Т.е. не от злого умысла (хотя бывает и он и нужно уметь различать). Поэтому «долбать» соблюдением процедуры целесообразно только тогда, когда есть серьезные основания подозревать комиссию в нечистоплотности;<br/>5. Аналогично с написанием жалоб. Можно исписать 3 ручки на жалобах и в конец испортить отношения, а можно по-человечески попытаться объяснить, что это неправильно, ВЕЖЛИВО указать на норму закона и предложить свою помощь в устранении;<br/>6. Наша цель – предотвратить серьезные нарушения (вброс, карусель, фальсификация итогов). Для этого во что бы то ни стало нужно оставаться на участке. Разругались из-за мелочи, вас удалили – всё, вы проиграли, выше задание провалено;<br/>7. Важно понять с самого начала: связаны ли ошибки комиссии с желанием фальсификации или это просто нервы и некоторая неопытность. Вопрос психологии, но без него можно переругаться со всеми членами комиссии, а должно быть сотрудничество. <br/><br/>Именно поэтому я не писал жалоб на действия комиссии. Во-первых, мы всё могли видеть сами, наш подсчет выданных бюллетеней в итоге не сильно отличался от показаний КОИБа. Во-вторых, на нашем участке ЕдРо проиграло и ребята видели (случайно), что некоторые члены УИК голосовали против ЕдРа. В-третьих, было важно получить копию протокола и сравнить с данными на сайте ЦИКа. По нашему УИК всё сошлось. <br/><br/>Простите, что много. Старался ничего не упустить.</p>\n<p>С уважением, <br/>Алымов Максим+++</p>\n<p> </p>','otchet-nablyudatelya-duma-uik-2803/'),(2826,'значительные нарушения','Крутенко Тамара','Вброс, удаление с участка','<p>Изначально предполагалось, что мы будем штурмовать УИК № 2826 полным составом нашей dreamteam (Любовь Крутенко – наблюдатель от «Яблока», Александр Кондрашёв - член УИК с ПСГ от «Яблока» и Тамара Крутенко - представитель СМИ). </p>\n<p>Однако 3-его декабря из-за неувязок с мандатами мы перестали быть яблочной компанией. Саша поехал на другой участок под флагом \"ХВАТИТ ЭТО ТЕРПЕТЬ!\", а я из наблюдателя превратилась в корреспондента \"Троицкого варианта\". Взамен Саши нам выдали другого наблюдателя. Сразу скажу, что он отсутствовал на участке почти весь день, так как там внезапно обнаружился другой наблюдатель от «Яблока». Этот другой наблюдатель всю дорогу сидел за столом, от которого урн не видно вообще. На попытки приобщить его к нормальной деятельности отвечал, что никакой активности проявлять не будет, потому что не хочет, чтобы его удалили. Вечером приехал наблюдатель от ГН, он присутствовал при подсчёте голосов и получил протокол.<br/> Приехав поутру на участок, мы с Тамарой услышали, что представителей СМИ \"по закону\" здесь вообще не должно быть, что на удостоверении печать не такая, что документы надо было принести вчера и т. д. Поупражнявшись в чтении закона вслух, Тамара отправилась гулять по участку, а я услышала такой разговор:<br/> -А вы в связи с этими...(широкий жест в сторону толпы наблюдателей).. эвакуацию объявлять не будете?<br/> -Нет, вроде не должны.<br/> После этого нас начали всячески зажимать: сказали, что снимать видео можно только из самого дальнего угла (из которого, естественно, урны видно только когда на участке нет ни души ), что стоять можно только в том же углу, отмахивались от вопросов про погашение открепительных, да и от всех остальных вопросов. Мы устроили свару из-за камеры, установив ее на сцене (т.е. на возвышении) прямо над урнами. По настоянию полицейского и председателя камеру убрали. <br/> Я уселась в двух шагах от урн с ручным счетчиком и принялась отслеживать каждый опущенный бюллетень. Тамара пошла задавать дерзкие вопросы.</p>\n<p>На соседнем участке (№2829, в том же актовом зале) прямо с утра произошел вброс, наблюдатель Вася поймал вбросившего, вызвали полицию. Кончилось тем, что человека, вбросившего бюллетень, отпустили, Васю удалили, урну не опечатали.</p>\n<p>Мы караулили урны, считали бюллетени, написали жалобу про запрет видеосъемки. Знакомиться со списками избирателей нам не дали, на вопросы не отвечали. Комиссия ругалась и делала предупреждения о том, что мы стоим слишком близко к урнам, фотографируем избирателей и комиссию, общаемся с наблюдателем Васей. <br/> <br/> В итоге мы подали жалобу. Комиссия демонстративно выгнала с участка всех избирателей и устроила заседание, чтобы нашу жалобу рассмотреть. Вести диктофонную запись на заседании нам не разрешили. Вначале мы ещё надеялись, что дело удастся разрулить полюбовно, поэтому, почитав вслух избранные места из ФЗ, мы диктофон выключили. Рассматривая жалобу, комиссия заявила, что видеосъемка запрещена законно, потому что \"мы не хотим, чтобы нас фотографировали\". Чтение вслух всех раздражало (даром что училки), тетки орали: \"Какой еще закон о СМИ, мы не хотим, понимаете, не хотим! И избиратели не хотят!\" Столпившиеся в ожидании открытия участка прямо за нашей спиной избиратели громко кричали: \"Мы хотим, хотим, пусть фотографируют!\". Начался жуткий бедлам, стали подползать полицейские. Секретарша заявила, что мы мешаем работе комиссии, потому что \"создаем нервозную обстановку\", и нас надо удалить. <br/> <br/> Потом они два часа писали акт об удалении, не хотели заверять копию жалобы, обвиняли нас во всех смертных грехах, говорили, что мы ещё \"не доросли\" и даже грозились написать ректору. Впрочем, в ответ на просьбу громко повторить в диктофон, кому написать, председатель начал упоминать какого-то Пушкина. Главный аргумент комиссии звучал так: \"Двадцать лет работаем, никогда такого не было, а тут!!\".<br/> <br/> Во время этого скандала пришла избирательница с соседнего участка (№2829) и сказала, что она только что обнаружила, что за неё и её маму уже проголосовали какие-то левые люди. Мы пошли поглядеть, что происходит. Оказалось, не происходит ничего, так как наблюдателя Васю к этому времени оттуда уже выгнали, тетка от ЕдРа делает вид, что всё нормально, а председатель и секретарь ушли пить чай. Мы записали избирательницы рассказ на диктофон. Чем кончилось дело, не ясно, так как на наш участок пришли тетки из ТИК, поддержали нашу комиссию, сказали, что такие \"провокации\" повсюду, везде, мол, скандалят и мешают работать. При этом требовали прекратить запись разговора, так как они «может, обсуждают тут свои домашние дела, а вам было бы приятно, если бы записывали?». В общем, под конец мы с ними конкретно поругались, сбежалась полиция и, не дав заверить копию жалобы, стала наступать на нас. Мы уехали в ТИК писать заявление.<br/> <br/> В ТИКе мы встретили наблюдателя Васю, писавшего жалобы про вброс бюллетеней и удаление его с участка. Он рассказал, что неподалеку на участке уже трижды вбрасывали. Несмотря на то, что этот участок не относился к выборке ГН, мы решили поехать туда снимать подсчет голосов и пытаться отследить сложенные пачки в урне.<br/> <br/> На этом участке (№ 2834)  был мир да покой. Председатель рассказала нам, что никакого вброса не была, была только попытка. На участке сидели двое наблюдателей от ЕдРа и одна девушка от КПРФ. Девушка видела все три вброса, но ей уже все \"объяснили\", и она сказала, что ничего не было. Вася уговорил ее написать заявление, а представитель от ЕдРа согласилась его подписать. Заявление отвезли в ТИК. Через некоторое время у ЕдРо-тети зазвонил телефон, и она начала в него оправдываться, говоря, что не подписать не могла и т.д.. Мы тем временем бродили и фотографировали, комиссия напрягалась все больше и больше. В 8 вечера они закрыли участок. Внезапно появились всё те же тетки из ТИК, увидели, что мы еще живы и действуем, и устроили скандал. Говорили, что мы должны будем стоять чуть ли не в трех метрах от стола, на котором считаются голоса.<br/> <br/> Мы тоже устроили маленький скандал. Тетки ушли побежденные, излучая сильную нелюбовь. Они присутствовали, когда удаляли с предыдущих участков нас и Васю, и явно злились, что мы никуда не делись, а появились на соседнем участке.<br/><br/>Из урн вывалили бюллетени. Сначала из первой, в которую трижды вбрасывали, потом поверх из второй. Я снимала, Тамара с Васей бегали вокруг стола и пытались заглянуть внутрь кучи в поисках сложенных пачек. Пока комиссия тупила и размышляла, с чего начать, они разглядели одну и заорали: \"Обращаем внимание комиссии - пачка! Вы обязаны ее отделить и опечатать!\" Председатель комиссии явно растерялась, пачку вытащила и отложила. Пока она откладывала, они нашли еще одну и закричали: \"Еще одна пачка!\" После этого мы бегали вокруг стола, фотографировали пачки и требовали их отложить. Первые три вытащили и признали недействительными, потом стали тупо утверждать, что пачки никакой не видно, потом перешли на личности, учитель информатики орал, что мы должны молчать, как рыбы, явный нашист спрашивал, сколько нам заплатили, тетки-училки ругались, обзывались и кричали, что мы чего только не придумаем. Пачки сознательно растаскивали и складывали в стопочку с бюллетенями за Едро. Мы носились вокруг стола и тоже орали на комиссию: «как не стыдно, что вы<br/>врете, пачка, пачка же, вы что, не видите?» </p>\n<p> </p>\n<p>  </p>\n<p>Комиссия вызвала полицию и попыталась с её помощью нас удалить. Мы потребовали заседания комиссии и составления решения об удалении. В итоге решение написали, но удалили только нас с Тамарой. Вася остался, заснял на видео, как комиссия нарушает порядок подсчета голосов, и получил копию итогового протокола, которой поделился с нами. </p>\n<p>Естественно, после подсчёта голосов оказалось, что цифры не сходятся, потому что они, конечно, в течении дня проставили фальшивые подписи в списках избирателей за те бюллетени, которые были вброшены. А мы часть этих бюллетеней изъяли.<br/> Все это очень противно и неприятно. Не говоря уж о том, что даже не покормили и музыки не было. Утешение одно. Как сказал Вася: \"Никогда еще не ощущал настолько четко, что все вокруг в дерьме, а я Д\"Артаньян\".<br/> <br/> P.S. Забавно было, что «силы добра» наша близнецовость очень радовала и умиляла, а «силы зла» сильно раздражала. Секретарь комиссии на нашем первом участке непрерывно путала нас и наши документы. :)</p>\n<p><br/> </p>','otchet-nablyudatelya-duma-uik-2826/'),(2841,'','','','',''),(2866,'','','','',''),(2880,'','','','',''),(2905,'нарушений не выявлено','Ирина Берлянд','Чисто','<p>Расскажу о работе на нашем участке (2905, Строгино). Я считаю, что нам с участком повезло. У нас была замечательная команда! Нас было четверо. Я была членом комиссии с псг от Яблока, Вадим Носов и Саша Фридер – корреспондентами, Дмитрий Самойлов – наблюдателем, тоже от Яблока. Мы с ними встречались в пятницу, познакомились, договорились о тактике.</p>\n<p>Повезло нам и с самим участком - помещение было небольшое и легко обозримое.</p>\n<p>Повезло и с комиссией - никаких злостных намеренных нарушений не было. Не злостные были, и я о них расскажу.</p>\n<p>Я пришла в комиссию накануне. Сказала, что участок вошел в выборку участков с усиленным контролем, что у нас будут очень опытные и внимательные наблюдатели, наизусть знающие все законы, будут представители СМИ, и мы постараемся не допустить ни одного нарушения на участке. Сказала, что нам это будет нетрудно, так как у нас КОИБ, который сам считает, а главное, как я вижу, добросовестные и честные члены комиссии. Члены комиссии смущенно закивали, двое сказали, что у них опыта нет. На это я сказала, что мы поможем! Председатель явно забеспокоилась, попыталась выяснить, какие еще участки из Строгино попали в эту выборку. Держалась очень любезно, позволила мне просмотреть все списки наблюдателей, сказала все нужные цифры. Я намеренно указала на пару незначительных и легко устранимых нарушений, например: слишком близко к столу председателя стоит ширмочка для заполнения бюллетеней, могут придраться к нарушению тайны голосования. Они немедленно подвинули. Дело выглядело так, что я им помогаю избежать назавтра возможных осложнений, они даже благодарили.</p>\n<p>В день голосования, однако, председатель уже держалась по отношению ко мне настороженно (видимо, после звонка в ТИК) и даже демонстрировала раздражение, когда я попыталась перелистать списки, сказала, что я имею право только «знакомиться», но не держать в руках документы. Я продекламировала ей наизусть статью закона и показала текст. Некоторое впечатление это произвело, но раздражение не исчезло (что можно объяснить еще тем, что у них была куча необходимых дел, а мы их отвлекали). В итоге все наблюдатели просмотрели списки и никакого криминала не нашли. Я в соответствии с избранной тактикой сказала: вот видите, тут прекрасная, честная комиссия, и я уверена, что у нас будет эталонный участок. Тетеньки заулыбались.</p>\n<p>Весь день голосования мы внимательно считали людей и сверяли со счетчиком КОИБа. Ребята даже пытались сначала считать отдельно по каждому столу, но это оказалось физически невозможно. Явка была реально большая.</p>\n<p>Стулья для наблюдателей (на которых, почти не вставая, кроме выездного голосования, просидели наблюдатели от КПРФ и ПЖИВ) стояли в углу, из которого в принципе все было видно. Но, разумеется, издали нельзя было рассмотреть, что пишут члены комиссии, предъявляются ли паспорта. Но! Никто нам не препятствовал, мы могли ходить, подходить к спискам, проверять записи, переспрашивать членов комиссии. Что наблюдатели и делали, достаточно регулярно, но не слишком часто, чтобы не казалось, что мы бессмысленно придираемся - только в подозрительных случаях, например, избиратель слишком долго сидит около столика, показывает что-то кроме паспорта и т.д. Особенно внимательно контролировали дополнительный список. Ничего подозрительного не было, никаких организованных групп, открепительные исправно отбирались. Необычно много было избирателей, имеющих прописку на нашем участке, но не включенных в основной список. У них проверялась прописка, и они заносились в доп. список под бдительным присмотром Саши.</p>\n<p>Атмосфера действительно была очень хорошая, к середине дня и председатель перестала на меня сердиться и даже в сомнительных случаях подходила ко мне советоваться. Я старалась представить дело так, что мы с ними делаем общее дело. В случае мелких нарушений говорила: да, это <strong>наша</strong> ошибка, давайте подумаем, что делать.</p>\n<p>Участок наш состоял из одного циклопически огромного дома, 26 подъездов. Все избиратели соседи, приходя, здоровались друг с другом, дети у них учатся в школе, где был участок, они бежали обниматься к своим любимым учительницам – членам комиссии. Атмосфера была абсолютно семейная. Какие-то большие группы карусельщиков были бы сразу заметны. Их не было!</p>\n<p>Серьезное нарушение было одно: ненадлежащим образом был составлен реестр для голосования вне помещения. Там было 52 человека, никаких фамилий людей, через кого были переданы заявления. Секретарь комиссии сказала, что этот список продиктовали из ТИКа. Подавать жалобу с требованием не проводить голосование по этому реестру мне показалось неконструктивным – ясно, что решение было бы не в нашу пользу: звучали голоса: «ну как же, надо дать старикам проголосовать, в доме много активных стариков». Решили пойти на компромисс. Я написала жалобу, в которой подробно разъяснила суть нарушения, и показала ее председателю, зампредседателя и секретарю, но официально подавать не стала. Мы выработали совместную тактику: 1. перед тем, как выходить для голосования, мы с секретарем <strong>вместе</strong> проверили по спискам, не проголосовали ли уже эти избиратели (стариков с утра приходило дикое количество), и вычеркнули нескольких человек; 2. с обеими выездными группами отправились наблюдатели от ГН и внимательнейшим образом следили за соблюдением процедуры; 3.<strong> </strong><strong>немедленно</strong> после возвращения секретарь у меня на глазах внесла проголосовавших в списки и мы убедились, что никто не проголосовал дважды. В итоге в одной группе с 25 фамилиями из реестра проголосовало 7, в другой тоже из 25 – 10: кто-то уже проголосовал, кто-то сказал, что придет сам с семьей, кто-то отказался, где-то не открыли дверь. Во второй половине дня отправилась третья группа, со списком, составленным правильно – из людей, которые сами звонили на участок или передавали просьбу через своих родственников, пришедших голосовать. С ними тоже отправился наш наблюдатель. Их было 11, и проголосовали все 11! Это было очень наглядно, я сказала секретарю: вот видите, когда реестр составляется правильно, по настоящим заявлениям людей, которые действительно хотят проголосовать, то и результат совсем другой! Секретарь сказала: да, я уж сама заметила: те за 3 часа 40 минут принесли всего 7 бюллетеней, а эти за 1 час 40 мин. – 11, надо учесть на будущее. У них работы много, не все даже успели пообедать, длительное отсутствие на участке 1-2 членов комиссии чувствительно, а главный результат - это явка, и КПД определяется по количеству бюллетеней на человеко-час. </p>\n<p>Жалобу я решила  не подавать, и считаю, что решила правильно. Возможно, проголосовали несколько человек, которые без этого списка не проголосовали бы. Но, во-первых, добиться отмены голосования мне  все равно почти наверняка не удалось бы; во-вторых, проголосовали реальные старики, сами, как хотели, с полным соблюдением процедуры; в-третьих, удалось сохранить и даже укрепить конструктивные отношения с комиссией.</p>\n<p>Второе нарушение я сама санкционировала, и считаю, что оно практически неизбежно, т.к. запрограммировано несоответствием закона и программы КОИБ. После голосования по закону положено сначала разобраться со списками избирателей, сделать соответствующие подсчеты, внести данные в увеличенную форму протокола и убрать списки, а потом уже приступать к работе с переносными ящиками. Однако оператор КОИБ сказал, что режим «Переносной» работает только до 21 часа, и если до этого времени мы не положим туда бюллетени из переносных ящиков, то придется все остальное делать вручную. Все пришли в ужас и закричали: давайте сейчас! (Было 20.40). Председатель комиссии сказала: если Ирина Ефимовна разрешает… Я разрешила, т.к. мы все наизусть знали, сколько в каком ящике должно быть бюллетеней. При этом все члены комиссии столпились вокруг КОИБа и работу со списками не вели. Уверена, что это никак не повлияло на итоги. </p>\n<p>Еще один напряженный момент был в самом конце, после распечатки протокола. Председатель позвонила в ТИК, продиктовала цифры и стала ждать санкции. Я напомнила, что закон требует начать итоговое заседание и приступить к оформлению протокола, а про санкцию ТИК ничего не сказано. Она сказала, что у нее есть начальство, которому она обязана подчиняться. Мы немного попрепирались, наблюдатели сфотографировали распечатанный протокол, сказали, что он сейчас же будет обнародован. Но тут пришла санкция из ТИК!</p>\n<p>Я уверена, что нарушений, которые могли бы повлиять на результаты, на нашем участке не было. Конечно, речь не может идти о честных выборах – административный ресурс, нерегистрация оппозиционных партий, неравные условия агитации и т.п. влияют на результаты. Но что касается собственно голосования и подсчета голосов, то тут у нас все было чисто, ручаюсь.</p>\n<p>Один член нашей команды, Вадим Носов, побывал еще на двух участках в этом же здании, вписался в список присутствующих по пресс-карте и получил их протоколы. В течение дня он также сообщал нам некоторые сведения с других участков, которые оказались полезными. Так, например, когда я говорила с председателем и секретарем о реестре для голосования на дому, одним из убедительных аргументов для них было то, что на других участках в реестре на начало дня соответственно 5 и 9 человек, а у них 52.</p>\n<p>Скан протокола прилагаю. ТИК наш протокол приняла. (Я, расставаясь с комиссией, попросила секретаря кинуть мне об этом смс, сказала: если не примут, вы по закону обязаны сообщить нам об этом и пригласить для составления повторного протокола, а если примут, по закону не обязаны, но я вас прошу. Она пообещала и сообщила!)</p>\n<p>Расстались мы с комиссией самым дружеским образом.</p>\n<p>Извините за моногобукв, но, может, кому на будущее пригодится. Я считаю, что выбранная нами тактика годится не для всех комиссий. Но для комиссий, члены которых не состоят в преступном сговоре с администрацией, а просто настроены слушаться начальство, не очень хорошо знают законы и не очень высоко их ставят, но изначально люди добросовестные, она, по-моему, хороша.</p>\n<p> </p>','otchet-nablyudatelya-duma-uik-2905/'),(2913,'','Виктор Цепаев','Вброс','<p> Прибыл на участок в 6:55. Стационарные и переносные ящики опечатали в присутствии членов комиссии до 8:00. При голосовании использовалась электронная обработка бюллетеней. Присутствовали два представителя от партии КПРФ и представитель от партии «Единая Россия»</p>\n<p>В процессе голосования со стороны председателя комиссии были неоднократные попытки удалить члена  избирательной комиссии от партии «Справедливая Россия» с правом совещательного голоса с территории избирательного участка. Делалось это под вполне благопристойными предлогами: пойти вместе покурить, выпить чаю с печеньем, сходить пообедать. Председатель комиссии Карпова всячески пыталась втереться в доверие к представителям от партий, демонстрировала, что она свой человек и готова помогать, при этом она довольно эмоционально говорила о том, что выборы будут честными, справедливыми и все будут довольны результатами. Пытаясь  наладить контакт, она заводила разговорв на бытовые темы: как дела, здоровье, работа, семья  и т.п.  Для представителей партий и наблюдателей было выделено специальное место (диван), где собственно представители и сидели. Председатель комиссии для подобных «бесед» расположилась как раз на этом диване, где сидели представители от партий.  (Я не знаю, является ли это нарушением или нет. Разрешается ли председателю комиссии сидеть в месте, предназначенном для наблюдателей?  Ведь впоследствии мне после выявления факта нарушения голосования неоднократно делалось замечания о том,  что я не могу даже подходить для консультаций к члену УИК с правом решающего голоса от партии «Справедливая Россия».) </p>\n<p>Во время проведения подобной «задушевной» беседы другой представитель комиссии – Обуховская Ирина Юрьевна (с её слов партия «Патриоты России») успела вбросить несколько  бюллетеней в урну для голосования.  На этом участке для голосования использовались КОИБы, оборудованы электронными сканерами, которые автоматически считают голоса избирателей; при обработке каждого бюллетеня звучит фраза «Здравствуйте, Ваш бюллетень обработан. Спасибо». В одной из урн такое «голосовое обращение» отсутствовало. В эту урну Ирина Юрьевна и вбрасывала бюллетени.  В определенный момент председатель комиссии привела какую-то девушку, представив её корреспондентом от газеты «Московские вести» и предложила сфотографироваться для газеты, я сделал вид, что согласился, и пошел в другой конец коридора. В этот момент начался сброс бюллетеней. Я резко бросился к урнам. Г-жа Обуховская бросила пачку бюллетеней на стул и села на них.  На мою просьбу объяснить, что это за документы и показать мне их, она ответила отказом.  Мне было сказано, что меня это не касается, что это обыкновенная бумага. Я вызвал полицейского. В присутствии полицейского и представителей партии КПРФ я сказал, что предполагаю, что на стуле, на котором сидит член комиссии, находятся документы, я подозреваю, что это заполненные бюллетени. Требую показать эти документы.  В этот момент вмешалась председатель комиссии и сказала, что я не могу приказывать(!?) члену комиссии показать мне то, на чем она сидит. Всё это сопровождалось раздраженным монологом о том, что я срываю голосование, срочно вызовите наряд полиции, нужно прекратить эту хулиганскую выходку. Фотографировать мне запретили. Председатель комиссии очень громко и резко говорила, это было больше похоже на крик: «Я запрещаю Вам фотографировать», закрывая своим телом и руками стул, на котором сидели Обуховская, а особенно то место, где как я предполагал, лежали заполненные бюллетени. На этих бумагах (они лежали тыльной стороной) отчетливо выделялись характерные квадраты для проставления значков за партию. Мне даже запретили близко подходить к урнам для голосования, председатель комиссии прикрывала урны своим телом и, отгоняя меня, размахивала руками.</p>\n<p>Приехал наряд полиции, во главе с с подполковником, после прибежали какие-то люди в форме охранников, они плотно окружили урну и меня и профессионально, абсолютно без рукоприкладства, своими торсами оттолкнули меня достаточно далеко от урны для голосования. Обращаю внимание, что в это время я стоял в 1,5-2 метрах от урны для голосования, руками ничего не трогал. В момент, когда всё было закрыто телами, пачка документов благополучно исчезла, на стуле ничего не было. Уже потом, спустя час или более, на стул положили какие-то мусорные бумажки. После чего подполковник, в чьем присутствии всё это происходило, спросил меня, видел ли я бюллетени. Я ответил, что я видел пачку документов, что предполагаю, что это были заполненные бюллетени и в присутствии сотрудника полиции требовал, чтобы мне показали эти документы. Документы мне не показали. На что подполковник полиции сделал вид, что забыл русский язык, и сказал мне, что он не понимает, о чём я говорю. Обращаю внимание, всё происходило в присутствии вызванного наряда полиции. После того как документы изчезли, все эти люди быстро удалились в неизвестном направлении.</p>\n<p>Председатель комиссии обвинила меня во лжи и клевете. Она бегала по избирательному участку, громко и эмоционально говорила, приставала к членам комиссии и представителям партий, утверждала, что произведена попытка срыва голосования. Минут через 30-40 Обухову демонстративно повели к доктору, её вели под руки несколько человек, потому что у неё якобы был нервный срыв, она плакала. Ей понадобились то ли таблетки, то ли уколы. Доктора не было, во всяком случае я доктора не видел. Вся эта клоунада продолжалась еще часа 2, после чего комиссия абсолютно спокойно продолжила работу, как будто ничего и не произошло. Прессинг прекратился, а с ним и страшилки о прокуратуре, моём хулиганском поведении, установленных скрытых видеокамерах и т.д. и т.п. сразу забылись.</p>\n<p>На избирательном участке несколько раз появлялось телевидение. При мне дважды председатель избирательной комиссии давала интервью для телевидения. Суть этих интервью была в том, что на участке была якобы проведена попытка сорвать выборы. В свою очередь один раз и я давал интервью для телевидения. Название канала я не запомнил (РЕН-ТВ «Доверие»?). Председатель  комиссии заставила дать интервью представителя от партии КПРФ для телевидения. В своём интервью он говорил, что на участке всё очень и очень хорошо и он очень счастлив, что так оно и есть.</p>\n<p>Никаких письменных жалоб при мне со стороны комиссии не было,  только слова. Я же подал 5 жалоб. Мои жалобы были приняты только после появления на участкае вышестоящих представителей партии «Справедливая Россия». Жалобы касались вброшенных бюллетеней, сканеров, бюллетеню с другого участка, агитации в пользу кандидатов от «Единой России»,того, что члены комиссии постоянно находятся у избирательных урн. В ответ на жалобу о том, что в месте голосования нахадятся агитационные материалы в пользу кандидатов от «Единой России», мне была предоставлена председателем комиссии какая-то бумажка,  и сказано, что это и есть тот самый документ, на основании которого фотографии президента и мэра не являются агитационными материалами. Эта бумажка подколота к жалобам.</p>\n<p>Во время произошедшего инцидента на участке находился представитель КПРФ Букаренко Владимир Яковлевич. Вместо того, чтобы подписать жалобу по факту выявленного, он нарушения принял сторону председателя комиссии. Мотивация была следующей: мои действия срывают проведение голосования, голосование на участке важнее, чем факт вброса бюллетеней, выборы бывают очень редко и люди должны проголосовать,. Я лично ему показал, что член избирательной комиссии сидит на пачке с документами, где с тыльной стороны были видны характерные для бюллетеней квадраты для отметки, и он сам всё это видел. Вместо того, чтобы прореагировать, он мне ответил, что он не видит никаких нарушений. Вот если бы я поймал за руку члена избирательной комиссии и бюллетени бы изъяли, потом бы эти бюллетени пересчитали, убедились бы, что это действительно бюллетени, специально предназначенные для фальсификации, собрали бы комиссию, где несколько человек подтвердили бы этот факт, вот тогда бы он подписал бы жалобу. Кто бы стал этим заниматься без нашей жалобы, он не рассказал. Мои объяснения, что полиция и члены избирательной комиссии находятся в сговоре, чтобы сфальсифицировать результаты выборов, а данное нарушение есть один из способов фальсификаций выборов, и что одна из наших задач обеспечить честность выборов, на представителя КПРФ не подействовали. Второй представитель от КПРФ какого-либо реального участия в наблюдениях не принимала, где-то ходила, а в другое время спала. Член комиссии от партии «Справедливая Россия» с правом решающего голоса, когда я обратился к ней, сказала, что факт нарушения я должен зафиксировать с членами избирательной комиссии с правом совещательного голоса, а она как член комиссии с правом решающего голоса не должна вмешиваться. Таким образом, в жалобах только моя подпись.</p>\n<p>Незадолго до времени сброса бюллетеней на избирательном участке был какой-то человек. Он рассказывал о том, что по участкам ходят представители движения «Наши» и голосуют по открепительным удостоверениям, выданным в других областях РФ, не в Москве и московской области. С какой целью наблюдателям была «слита» эта информация, я не знаю. Я обратился к председателю комиссии с предложением информировать представителей партий в случае такого «голосования», чтобы можно было проследить, а не приехали ли такие «голосовавшие» бригадой на автобусе с соседнего участка. Моё предложение было принято и доведено до остальных членов комиссии. В течение оставшегося времени ни представителей от КПРФ, ни меня не информировали о такого рода «голосованиях».</p>\n<p><strong>Замечания по сканерам<br/></strong><br/>На месте голосования было установлено 2 урны для голосования, снабженные специальными электронными сканерами для обработки бюллетеней. Одна из урн находилась дальше от наблюдателей, чем другая, и была закрыта от них первой урной. Электронные сканеры при обработке каждого бюллетеня произносят фразу: «Здравствуйте, Ваш бюллетень обработан». На обработку уходит некоторое время. Количество обработанных бюллетеней после этого увеличивается на единицу. Обращаю внимание, что одна из урн была оборудована работоспособным сканером, но сканер при обработке бюллетеней никаких голосовых сообщений не выдавал. Таким образом, была, по всей видимости, сознательно облегчена возможность манипуляции с бюллетенями. Члены комиссии на протяжении всего времени голосования в количестве от 1 до 3-х человек находились рядом с урнами, причем не просто находились, а прислонялись к ними, «помогали» голосовать. Это отражено в жалобе. Это зафиксировали на видео представители партии «Справедливая Россия» во время инспекции участка.  Во время голосования приезжал какой-то молодой человек, общался с членами комиссии. По всей видимости, это был инженер, потому что он спрашивал о том, нормально ли работают сканеры. Ему ответили, что всё в порядке. Представителям партий этого человека не представляли. Сканеры автоматически считают количество бюллетеней и количество проголосовавших за каждую партию. По состоянию на 20.00 в урне, оборудованной «голосовым сообщением» было 412 бюллетеней по счетчику, а в урне, не оборудованной «голосовым сообщением» 676 бюллетеней, т.е на 50% больше. Вероятно, не случайно!</p>\n<p><strong>Замечания по бюллетеням</strong></p>\n<p>В процессе голосования я обратил внимание, что бюллетени разносятся сотнями. Наверное, это правильно. Один раз мне сообщили, что был испорчен бюллетень и взамен него был выдан новый. В моем присутствии испорченный бюллетень был погашен (отрезали угол). После окончания голосования была предъявлена стопка погашенных бюллетеней, на которых было написано «погашено», по крайней мере, на тех что удалось прочитать. В стопке все бюллетени были исчирканы. Было сказано, что эти бюллетени использовались для тестирования электронных сканеров за день до голосования. Их потом прибавили к общему числу погашенных бюллетеней. Также в процессе голосования был выдан бюллетень для другого участка (на территории школы 2 участка). Нарушение зафиксировано в жалобе.</p>\n<p><strong>Замечания по работе штаба</strong></p>\n<p>Вынужден отметить, что работа штаба была не оперативной  как в дни до голосования, так и в день голосования. По сданному мною заявлению и копии паспорта в назначенный день и час я в течение 1,5 часов не мог получить направление на избирательный участок. Копию паспорта пришлось заново искать. В день голосования и именно в тот момент, когда был зафиксирован факт нарушения, трудно было связаться со штабом для корректировки своих действий, обращения принимал секретарь. Вечером невозможно было сдать протоколы. Прождали 2 часа у метро «Строгино», чтобы забрали протоколы и поехать домой. Курьер всё это время с его слов находился где-то рядом. Время было в районе за 23 часа. Пришлось ехать домой, не сдав протоколы, а дорога составляет в районе 1,5 часов. За это время протоколы можно было бы самостоятельно довезти до штаба. По телефону с курьером общалась другой член избирательной комиссии. В районе 23 часов я сам звонил курьеру. Трубку не брали. Дозвониться удалось в районе 0:30, когда я вышел из метро в районе своего проживания (м. «Кожуховская»). Мне было сказано, что я сам во всём виноват, так как все остальные курьера дождались.</p>\n<p><strong>Замечание по протоколу</strong></p>\n<p>Мне был выдан бланк за подписью заместителя председателя избирательной комиссии без подписей других членов комиссии и было сказано, что «сойдет и так». В тоже время представителю от КПРФ был выдан полноценный бланк протокола со всеми подписями. Мне такой не выдали, поэтому представитель КПРФ такой бланк «по дружбе» с подписями председателя комиссии и подписями остальных членов комиссии сделал и для меня. Оба бланка подколоты.</p>\n<p><strong>Приложения:</strong></p>\n<p>1.      Копия протокола участковой избирательной комиссии об итогах голосования 4 декабря 2011 года. УИК 2913. Присутствуют все подписи</p>\n<p>2.      Копия протокола участковой избирательной комиссии об итогах голосования 4 декабря 2011 года. УИК 2913. Есть только подпись заместителя председателя избирательной комиссии.</p>\n<p>3.      Результаты голосования. УИК 2913</p>\n<p>4.      Жалобы о замеченных нарушениях. 5 бланков</p>\n<p>5.      Листок, на основании которого председатель избирательной комиссии говорила, что изображения мэра и президента не являются агитационными материалами.</p>\n<p>6.      Диск DVD с материалами с участка голосования</p>\n<p> </p>\n<p> </p>\n<p><br/></p>','otchet-nablyudatelya-duma-uik-2913/'),(2925,'','','','',''),(2950,'','','','',''),(2971,'','','','',''),(2996,'','','','',''),(3000,'','','','',''),(3025,'нарушений не выявлено','','','',''),(3028,'некорректная работа УИК','','','',''),(3043,'','','','',''),(3068,'','','','',''),(3080,'нарушений не выявлено','','','',''),(3104,'','','','',''),(3124,'нарушений не выявлено','','','',''),(3149,'нарушений не выявлено','','','','');

